INSERT INTO `ad_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `additional_description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 1, 1, 'Baza', '', '', 'baza', '', '', ''),
(2, 1, 1, 'Strona główna', '', '', 'strona-glowna', '', '', ''),
(3, 1, 1, 'Buty', '<p>Bez butów ani rusz. Czy na co dzień, czy w sporcie trudno się bez nich obejść – podpierają stopę, chronią ją i amortyzują uderzenia o podłoże. W adidas wiemy o tym doskonale, dlatego nasze modele tworzymy z najbardziej zaawansowanych materiałów i z wykorzystaniem specjalnych technologii, które wspierają ruch.</p>', '', 'buty', '', '', ''),
(4, 1, 1, 'Sneakersy', '<p>Adidasy męskie to jeden z najbardziej rozpoznawalnych elementów całej naszej marki. Tworzymy buty sportowe od dziesięcioleci i wiemy o tym procesie wszystko. Nasze sneakersy męskie to oczywiście nie tylko element wyposażenia mężczyzn, którzy uprawiają sport na poziomie profesjonalnym, ale to także bardzo charakterystyczny i ceniony element miejskiego stylu.</p>', '', 'sneakersy', '', '', ''),
(5, 1, 1, 'Bieganie', '<p>Wygodne, otulające stopę cholewki i sprężyste podeszwy, zapewniające amortyzację. To tylko kilka cech dobrych butów biegowych. Jeśli szukasz pary, która wspomoże cię w porannym treningu, poznaj kolekcję butów do biegania dla mężczyzn.</p>', '', 'bieganie', '', '', ''),
(6, 1, 1, 'Odzież', '<p>Odzież męska adidas to kolekcja produktów przeznaczona zarówno dla sportowców – aktywnych fizycznie amatorów i profesjonalistów – jak i dla koneserów mody ulicznej. Znajdziesz tu odzież wierzchnią, taką jak kurtki zimowe, bluzy, spodenki czy wiatrówki oraz ubranie służące jako dolne warstwy, takie jak koszulki czy legginsy. Sportowa stylistyka adidas daje ci wysokiej jakości, dopracowany design połączony z wygodą noszenia poprzez wykorzystanie nowoczesnych technologii i różnych materiałów.</p>', '', 'odziez', '', '', ''),
(7, 1, 1, 'Koszulki i topy sportowe', '<p>Koszulki męskie z naszym charakterystycznym logo to kwintesencja wygody z technologicznym wsparciem. Fasony uszyte są z miękkich materiałów, aby przyjemnie otulić twoje ciało. Nieważne, czy intensywnie ćwiczysz z hantlami, biegasz na bieżni, czy spacerujesz po mieście, T-shirty męskie adidas będą zawsze blisko ciebie.</p>', '', 'koszulki-i-topy', '', '', ''),
(8, 1, 1, 'Bluzy', '<p>Męskie bluzy i swetry adidas zapewnią ci przede wszystkim swobodę. Jeśli chcesz zadbać o swój look, ochronić się przed chłodem oraz czuć się wygodnie podczas zimniejszego dnia – postaw na ciepłą i komfortową bluzę lub sweter. Wybierz jeden z ciekawych designów i grafik, i dopasuj je do swojej osobowości, prezentując ją od pierwszego wejrzenia.</p>', '', 'bluzy', '', '', ''),
(9, 1, 1, 'Akcesoria', '<p>Akcesoria to bardzo szeroka kategoria produktów naszej marki, które łączy jedno – są znakomitej jakości i bardzo modne. Dzięki temu będą świetnym dopełnieniem każdego outfitu i posłużą przez wiele sezonów. Akcesoria męskie to między innymi czapki zimowe, czapeczki z daszkiem czy skarpety. Są to zatem elementy codziennego ubioru. Zależało nam, aby wyróżniały się swoim designem, dlatego dajemy ci do wyboru bardzo ciekawe modele w wielu wersjach kolorystycznych.</p>', '', 'akcesoria', '', '', ''),
(11, 1, 1, 'Piłka nożna', '<p>Korki męskie to podstawowe akcesorium miłośnika futbolu. Jeżeli po godzinach grasz mecze z przyjaciółmi albo trenujesz piłkę dla własnej przyjemności, takich butów z korkami nie może zabraknąć w twojej szafie. Nasi projektanci przygotowali mnóstwo różnych modeli, które łączy przede wszystkim lekkość i podeszwa z korkami. Korki męskie w trakcie biegu za piłką wbijają się w naturalną nawierzchnię, wpływając na precyzję ruchów.</p>', '', 'pilka-nozna', '', '', ''),
(12, 1, 1, 'Spodnie', '<p>W naszych modelach spodni męskich nadasz swojemu wizerunkowi charakterystyczny sportowy rys. Wybierz takie dresy, które są dla ciebie najbardziej odpowiednie. Te zapewniające cyrkulację powietrza przydadzą się podczas intensywnych treningów. Dodatkowo te spodnie męskie z logo adidas są wykonane z szybkoschnącego materiału.</p>', '', 'spodnie', '', '', ''),
(13, 1, 1, 'Skarpetki', '<p>Biegasz? Grasz w golfa? Grywasz z kumplami w piłkę w weekendy? A może nie wyobrażasz sobie weekendu bez wypadu w góry? Do wszystkich z tych, jak również wielu innych aktywności przydadzą ci się skarpetki. Wygodne, zapewniające komfort i idealnie dopasowane do czynności, którą wykonujesz. W adidas doskonale wiemy, że czasem mała rzecz może zepsuć wielkie sportowe plany, ale i odwrotnie – mała zmiana może przyczynić się do sukcesu.</p>', '', 'skarpetki', '', '', ''),
(14, 1, 1, 'Nakrycia głowy', '<p>Klasyczna czapka z daszkiem, kapelusz sportowy czy wełniane nakrycia głowy? Wybierz to, co najlepiej podkreśli twój styl i uchroni cię przed zimnem lub promieniami słonecznymi. Wyjątkowe nakrycia głowy adidas chronią przed potem i odprowadzają wilgoć z powierzchni skóry, a charakterystyczne detale, takie jak wszyte 3-Stripes lub logo Trefoil sprawiają, że czapki wyróżniają się z tłumu i doskonale pasują do twojej garderoby.</p>', '', 'nakrycia-glowy', '', '', ''),
(15, 1, 1, 'Torby i plecaki', '<p>Torba dla mężczyzny musi być pakowna i poręczna, tak żebyś bez trudu zmieścił wszystkie potrzebne rzeczy i łatwo znalazł to, czego akurat szukasz. Torby męskie adidas to m.in. torby sportowe, plecaki czy raportówki na ramię o różnej pojemności, konstrukcji oraz liczbie kieszeni.</p>', '', 'torby-i-plecaki', '', '', '');
