INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, 'Które buty dziś założyć? Zwykle to trudna decyzja. Chyba, że masz buty adidas OZWEEGO. Podrasuj swój look i ciesz się autentycznym stylem dzięki śmiałym liniom, które nawiązują do klimatu z przełomu XX i XXI wieku.  Trzeba to powiedzieć jasno: gdyby to były zawody w kategorii styl, masz bezapelacyjnie złoty medal. A czy wspominaliśmy już o potrójnej amortyzacji, która gwarantuje niezrównany komfort? Podeszwa środkowa z pianki EVA z amortyzacją Adiprene i Adiprene+ zapewnia wygodę na każdym kroku.', 'Inspirowane archiwalnymi modelami buty OZWEEGO, które zapewniają wyjątkowy komfort.', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(2, 1, 1, 'Jeżeli musisz zdecydować się na styl lub innowacyjność, co wybierzesz? Głupie pytanie. Nie powinno się być zmuszonym do takiego wyboru. Po prostu załóż buty adidas ZX 5K Boost. Model wzorowany na innowacyjnym duchu designu ZX ma podeszwę środkową Boost na całej długości, otoczoną półprzezroczystym wykończeniem. Zamszowe nakładki i odblaskowe detale wyróżniają się na siateczkowej cholewce, nadając całości błyszczący styl.', 'Progresywne buty w nowoczesnym stylu.', 'zx-5k-boost-shoes', '', '', '', 'ZX 5K Boost Shoes', '', '', '', ''),
(3, 1, 1, 'Stworzone pierwotnie w latach 70. na koszykarskie parkiety. Królujące wśród hiphopowców w latach 80. Buty adidas Superstar obecnie stanowią znak rozpoznawczy entuzjastów miejskiego stylu. Znana na całym świecie osłona palców w kształcie muszli spełnia swoją funkcję, zapewniając styl i ochronę. Zupełnie tak samo, jak na koszykarskich parkietach lata temu.  Teraz, niezależnie od tego, czy jesteś na festiwalu, czy chodzisz po ulicy, możesz się dobrze bawić bez obawy o nadepnięcie.  Detal w postaci ząbkowanych 3 pasków i okienko z logo adidas Superstar nadają Ci autentyczny styl OG.', 'Autentyczne niskie buty z osłoną palców w kształcie muszli.', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(4, 1, 1, 'Od ponad 50 lat buty adidas Stan Smith umacniają swoją pozycję ikony stylu. Teraz klasyczna sylwetka zyskuje magiczną odsłonę w postaci butów inspirowanych postacią kapitana Haka z disnejowskiego filmu „Piotruś Pan”. Zrób wrażenie dzięki cholewce z syntetycznego zamszu w kolorze głębokiej czerwieni, która nada barwny akcent każdej stylizacji. Naszywki na pięcie przypominają, że „it’s not easy being green”, dlatego ważne jest, aby robić wszystko, co w naszej mocy dla dobra planety.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty adidas x Disney wykonane częściowo z materiałów pochodzących z recyklingu.', 'stan-smith-shoes', '', '', '', 'Stan Smith Shoes', '', '', '', ''),
(5, 1, 1, 'Ku uciesze kibiców i fanów ulicznej mody ten piłkarski model z lat 60. ma jeszcze co nieco do powiedzenia. To wierna reedycja ulepszonych butów Gazelle z 1991 roku z wykorzystaniem autentycznych materiałów, faktur i proporcji. Cholewkę wykonano ze świńskiego nubuku ze stonowanym kolorystycznie wykończeniem i srebrzystym napisem.', 'Nowoczesna wersja oryginalnych butów piłkarskich.', 'buty-gazelle', '', '', '', 'Buty Gazelle', '', '', '', ''),
(6, 1, 1, 'Ciesz się komfortem adidas Ultraboost w każdej chwili wypełnionego aktywnościami dnia. Te buty do biegania mają setki kapsułek BOOST, które łączą się, zapewniając niewiarygodny zwrot energii i niezawodną amortyzację. Buty w trailowym stylu mają przypominające skórę nakładki, które wspierają stopę i maksymalizują trwałość. Gumowa podeszwa zewnętrzna z ząbkowanymi elementami gwarantuje przyczepność na nierównych ścieżkach i śliskich nawierzchniach. Wybierz buty, które dodadzą Ci pewności siebie.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-dna-xxii-lifestyle-running-sportswear-capsule-collection-shoes', '', '', '', 'Ultraboost DNA XXII Lifestyle Running Sportswear Capsule Collection Shoes', '', '', '', ''),
(7, 1, 1, 'Wyjście na dwór przynosi korzyści o wszystkich porach roku. Ocieplane i odporne na pogodę buty hikingowe adidas Terrex pomogą Ci pokonywać jeszcze dłuższe trasy w chłodne dni. Eksplorowanie oblodzonych szlaków i zaśnieżonych ulic to pestka, gdy zadbasz o ciepły, suchy komfort stóp. Miejski styl nadaje butom nowoczesny, codzienny charakter.', 'Ocieplane buty hikingowe do noszenia w chłodne dni.', 'terrex-snowpitch-coldrdy-hiking-shoes', '', '', '', 'Terrex Snowpitch COLD.RDY Hiking Shoes', '', '', '', ''),
(8, 1, 1, 'Dzięki butom do wycieczek pieszych adidas możesz pominąć okres odpoczynku i przejść od razu do dobrych rzeczy: weekendowych wędrówek i przygód z przyjaciółmi. Od razu po wyjęciu z pudełka otulają Twoją stopę wspierającym krojem i amortyzowanym komfortem. RAIN.RDY nie przepuszcza wilgoci, więc możesz biegać po kałużach, nie ryzykując przemoknięcia stóp. Podeszwa zewnętrzna Traxion zapewnia przyczepność we wszystkich kierunkach.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie i wytrzymałe buty na wędrówki wykonane częściowo z materiałów pochodzących z recyklingu.', 'eastrail-20-mid-rainrdy-hiking-shoes', '', '', '', 'Eastrail 2.0 Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(9, 1, 1, 'Model Samba, który narodził się na boisku, stał się ponadczasową ikoną stylu miejskiego. Te buty pozostają wierne swojej historii za sprawą cholewki z miękkiej skóry z zamszowymi nakładkami.', 'Klasyczny look i komfort autentycznego modelu Samba.', 'samba-og-shoes', '', '', '', 'Samba OG Shoes', '', '', '', ''),
(10, 1, 1, 'Mroźne i zimowe warunki to nie problem, gdy nosisz buty adidas Terrex Trailmaker Mid Hiking, zaprojektowane jako wyjątkowo uniwersalny model. Ich lekki, elastyczny materiał i wodoodporna membrana z zimową wyściółką są doskonale dopasowane do stóp. Dzięki wodoodpornej izolacji PrimaLoft® i COLD.RDY zachowasz ciepły i suchy komfort nawet podczas wędrówek w zimne, deszczowe dni.', 'Lekkie, ciepłe buty hikingowe.', 'terrex-trailmaker-mid-coldrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid COLD.RDY Hiking Shoes', '', '', '', ''),
(11, 1, 1, 'Model Samba, który narodził się na boisku, stał się ponadczasową ikoną stylu miejskiego. Te buty pozostają wierne swojej historii za sprawą cholewki z miękkiej skóry z zamszowymi nakładkami.', 'Klasyczny look i komfort autentycznego modelu Samba.', 'samba-og-shoes', '', '', '', 'Samba OG Shoes', '', '', '', ''),
(12, 1, 1, 'Wybierz buty, które robią wrażenie. Model adidas Forum zadebiutował w 1984 roku i zyskał ogromną popularność zarówno na koszykarskim parkiecie, jak i muzycznej scenie. Ta wersja miejskich, niskich butów nawiązuje do pełnego energii stylu koszykarskiego z lat 80. za sprawą kultowego designu z krzyżującymi się paskami w kostkach.', 'Niskie buty w koszykarskim stylu.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(13, 1, 1, 'Wybierz buty, które robią wrażenie. Model adidas Forum zadebiutował w 1984 roku i zyskał ogromną popularność zarówno na koszykarskim parkiecie, jak i muzycznej scenie. Ta wersja miejskich, niskich butów nawiązuje do pełnego energii stylu koszykarskiego z lat 80. za sprawą kultowego designu z krzyżującymi się paskami w kostkach.', 'Niskie buty w koszykarskim stylu.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(14, 1, 1, 'Chcesz zobaczyć, na co Cię stać? Załóż buty adidas Forum i przekonaj się! Inspirowane koszykówką buty, które od 1984 roku są symbolem autoekspresji, są stworzone do przekraczania granic i dostrzegania tego, co możesz osiągnąć dzięki ciężkiej pracy. Podkreślają również fakt, że bez innych nie dotarlibyśmy tak daleko — za sprawą klasycznych barw drużyny i akcentu w postaci stylizowanej opaski na głowę. Cholewka z białej skóry i akcenty kolorystyczne oddają hołd tradycji modelu Forum przy każdym kroku.', 'Niskie buty Forum wykonane częściowo z materiałów pochodzących z recyklingu.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(15, 1, 1, 'Poczuj płynność biegu w butach do biegania Ultra 4DFWD. Łączą cholewkę naszych kultowych butów Ultraboost z podeszwą środkową adidas 4DFWD z nadrukiem 3D, która została udoskonalona tak, aby kompresja do przodu zmniejszała siłę hamowania i przekształcała energię uderzenia w ruch naprzód. Gwarantuje to płynne przetoczenie stopy i wyjątkowe wrażenia niczym podczas szybowania. Cholewka adidas PRIMEKNIT otula stopę, zapewniając jej dynamiczne wsparcie w strategicznych obszarach, a podeszwa zewnętrzna z gumy Continental™ zwiększa przyczepność w każdych warunkach pogodowych.', 'Buty do biegania zaprojektowane z myślą o ruchu i wykonane częściowo z Parley Ocean Plastic.', 'ultra-4dfwd-shoes', '', '', '', 'Ultra 4DFWD Shoes', '', '', '', ''),
(16, 1, 1, 'adidas ADIZERO SL to szybkie buty treningowe na co dzień, wyposażone w kluczowe elementy i wyróżniki designu z naszej bijącej rekordy popularności na całym świecie linii Adizero. Podeszwa środkowa ma lekką ramę Lightstrike z pianki EVA na całej długości, która zapewnia równowagę między stabilnością, wytrzymałością i amortyzacją. Została ona połączona z naszej światowej sławy pianką Lightstrike Pro i szybką, treningową cholewką z wyjątkowo miękkiej siateczki o specjalnej konstrukcji rozmieszczonej w kluczowych obszarach. Solidnie wyściełana konstrukcja pięty i języka zapewnia wygodę podczas zakładania i biegu, a design cholewki uzupełnia migający znak ADIZERO na pięcie. Całkowicie gumowa podeszwa zewnętrzna zapewnia przyczepność na każdej nawierzchni i w każdych warunkach. Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Zaprojektowane, by pomóc biegaczom osiągać coraz lepsze wyniki podczas krótkich i długich treningów biegowych.', 'adidas-adizero-sl-running-shoes', '', '', '', 'ADIDAS ADIZERO SL RUNNING SHOES', '', '', '', ''),
(17, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(18, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów.   Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Sportowe, wygodne buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(19, 1, 1, 'Buty w biegowym stylu zainspirowane tradycją adidas. Łącząc to, co najlepsze z klasycznych modeli z bieżni z prostymi liniami nowoczesnego stylu miejskiego, ten model prezentuje ponadczasowy design, który sprawdzi się na co dzień. Podeszwa środkowa Cloudfoam zapewnia wyjątkową miękkość na każdym kroku.', 'Stylowe buty na aktywne dni.', 'run-60s-20-shoes', '', '', '', 'Run 60s 2.0 Shoes', '', '', '', ''),
(20, 1, 1, 'Wybierz buty, które prezentują masywny design sprzed lat i zapewniają Ci całodzienny komfort. Gładka skórzana cholewka została wykończona wycinanymi detalami, nakładkami i charakterystycznymi 3 paskami. Osadzona jest na wysokiej, profilowanej podeszwie środkowej i przyczepnej podeszwie zewnętrznej.', 'Solidne buty w sportowym stylu stworzone z myślą o wygodzie w aktywne dni.', 'strutter-shoes', '', '', '', 'Strutter Shoes', '', '', '', ''),
(21, 1, 1, 'Dobrze mieć ciepłe i suche stopy mimo chłodu i deszczu. Stworzone z myślą o zimowych wędrówkach, przygodach na śniegu i długich, chłodnych dniach spędzanych na dworze buty zimowe adidas Terrex są wodoodporne i w pełni ocieplane. COLD.RDY z PrimaLoft® otula Twoją stopę, zatrzymując ciepło, a RAIN.RDY chroni przed zamoczeniem, śniegiem i deszczem, zapewniając suchy komfort stopom przez cały dzień. BOA® Fit System pozwala Ci na szybkie zasznurowanie i gwarantuje pewność. Podeszwa środkowa BOOST amortyzuje i dodaje energii na każdym kroku, na śniegu i poza nim, niezależnie od temperatury. Przyczepna guma Stealth przystosowana do zimy oznacza doskonałą przyczepność i pewność na śliskich, oblodzonych nawierzchniach.', 'Wodoodporne buty z izolacją, wykonane częściowo z Parley Ocean Plastic.', 'terrex-conrax-boa-rainrdy-hiking-shoes', '', '', '', 'Terrex Conrax BOA RAIN.RDY Hiking Shoes', '', '', '', ''),
(22, 1, 1, 'Przejmij kontrolę, wychodząc na parkiet w tych butach koszykarskich adidas. Siateczkowa cholewka zapewnia stopom świeżość, gdy biegasz po całym boisku. Lekka amortyzacja pochłania siłę uderzenia z każdym krokiem.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', 'Szorty koszykarskie gwarantujące komfort przez cały mecz.', 'ownthegame-shoes', '', '', '', 'Ownthegame Shoes', '', '', '', ''),
(23, 1, 1, 'Przygody w outdoorze już na Ciebie czekają, a wodoodporne buty hikingowe adidas Terrex pomogą Ci odkrywać świat: ten bliski i ten daleki. Ich uniwersalny, sportowy design jest wystarczająco lekki, aby sprostać codziennym wędrówkom, i wystarczająco techniczny, aby wytrzymać trudy górskiej wspinaczki czy przejścia via ferrata. Ten model wspiera Twoje stopy lekkim, a jednocześnie mocnym i stabilnym designem, który ułatwia koncentrację na szlaku. Wodoodporny, oddychający GORE-TEX nie przepuszcza wody i błota, pozwalając jednocześnie stopom oddychać. Język z klinem i wyściełanym mankiet do kostki otulają stopę i nie przepuszczają kurzu ani brudu, gwarantując komfort inspirowany butami do biegania. Przyczepność gumy Continental™ w każdych warunkach oznacza, że możesz pewnie poruszać się po kamienistych zboczach, mokrych korzeniach i piaszczystych trasach. A więc załóż te buty i ruszaj w drogę.', 'Uniwersalne, wodoodporne buty hikingowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-ax4-mid-gore-tex-hiking-shoes', '', '', '', 'Terrex AX4 Mid GORE-TEX Hiking Shoes', '', '', '', ''),
(24, 1, 1, 'Sprawdzone w bojach. Klasyczne buty koszykarskie z lat 80. nadal spełniają najwyższe standardy wydajności. Wysokiej jakości detale, takie jak cholewka z zamszu i skóry, nadają im nowoczesny charakter, a nakładka X i gumowa podeszwa nawiązują do autentycznego stylu adidas.', 'Buty do kostki z lat 80. z luksusowym wykończeniem.', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(25, 1, 1, 'Zaufaj nam, te buty hikingowe adidas poradzą sobie w każdym terenie. Musisz tylko przyspieszyć. Buty hikingowe z GORE-TEX stworzone z myślą o szybkich ruchach w górach są wodoodporne i przewiewne, dzięki czemu sprawdzą się podczas całodziennych przygód. Lekki model z amortyzowaną podeszwą środkową i wstawką na języku zapewnia Ci ochronę i komfort, gdy wspinasz się po stromych zboczach. Przyczepna podeszwa zewnętrzna z gumy Continental™ zapewnia przyczepność w każdych warunkach pogodowych.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', 'Lekkie buty na wędrówki wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-swift-r3-mid-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R3 Mid GORE-TEX Hiking Shoes', '', '', '', ''),
(26, 1, 1, 'Buty hikingowe adidas RAIN.RDY stworzone z myślą o dniach spędzanych na świeżym powietrzu to Twój ulubiony, lekki model na całodzienne przygody. Wygodne, wodoodporne buty hikingowe, które sprawdzą się od pierwszego założenia, zmienią sposób, w jaki odkrywasz ulubione szlaki.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Te wodoodporne buty na wędrówki zostały częściowo wykonane z materiałów pochodzących z recyklingu.', 'eastrail-20-mid-rainrdy-hiking-shoes', '', '', '', 'Eastrail 2.0 Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(27, 1, 1, 'Poświęćmy chwilę na uhonorowanie ikony. Czy to legenda koszykówki z lat 80., która przeczy prawom grawitacji? A może kultowe buty, które ozdabiały stopy raperów? I jedno, i drugie. Buty adidas Forum zdominowały parkiet koszykarski i ulice, a teraz powracają w wersji do kostki, aby pomóc Ci wspiąć się na wyższy poziom stylu. Wybierz rozpoznawalny look ― dostępny w wersji z luksusowej, powlekanej skóry ― i zaprezentuj się w klasycznym stylu.', 'Luksusowe buty do kostki o koszykarskim rodowodzie.', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(28, 1, 1, 'Wybierz buty trekkingowe dla mężczyzn, które pozwolą Ci szybko poruszać się w górach. Lekka, oddychająca konstrukcja wyposażona jest w GORE-TEX, który zapewni suchy komfort stopom. Buty mają podeszwę zewnętrzną Traxion z gumą Continental™, dającą wsparcie na suchej i mokrej nawierzchni.', 'Lekkie buty trekkingowe zapewniające przyczepność w każdych warunkach.', 'terrex-swift-r2-mid-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R2 Mid GORE-TEX Hiking Shoes', '', '', '', ''),
(29, 1, 1, 'Męskie buty trekkingowe Terrex Free Hiker COLD.RDY dbają o to, aby Twoje stopy nie przegrzały się ani nie przemokły. Częściowo lekkie, a częściowo zimowe buty trekkingowe o trwałym, mocnym, a jednocześnie lekkim designie łączą otulającą stopę, wygodną cholewkę adidas Primeknit ze sprężystością BOOST. GORE-TEX Duratherm chroni stopy przed śniegiem, błotem i wodą, zapewniając Ci suchy komfort, gdy pokonujesz zaśnieżone szlaki lub błotnisty teren. COLD.RDY to niskoprofilowa izolacja, która zatrzymuje ciepło i zapewnia stopom wygodę. Wewnętrzna rama daje Ci wsparcie, którego potrzebujesz, aby pewnie poruszać się po wymagającym terenie, a podeszwa zewnętrzna z gumy Continental™ zapewnia przyczepność na mokrych i oblodzonych nawierzchniach.', 'Wodoodporne ocieplane buty trekkingowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-free-hiker-coldrdy-hiking-boots', '', '', '', 'Terrex Free Hiker COLD.RDY Hiking Boots', '', '', '', ''),
(30, 1, 1, 'Poruszaj się szybko w górach w tych butach trailowych. Niskoprofilowa, mocna cholewka z membraną GORE-TEX nie przepuszcza wody, zapewniając suchy komfort stopom. System szybkiego sznurowania gwarantuje wsparcie na nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ dba o przyczepność na mokrych i suchych nawierzchniach, dając pewność na śliskich korzeniach i skałach.', 'Lekkie buty na wędrówki w każdych warunkach.', 'terrex-swift-r2-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R2 GORE-TEX Hiking Shoes', '', '', '', ''),
(31, 1, 1, 'Sylwetka butów adidas Forum jest łatwa do rozpoznania. Detal w kształcie litery X sprawia, że od razu rzucają się w oczy. Więc jak wyglądałyby buty Forum, gdybyśmy tym razem zaczęli tworzyć je od zewnątrz? Znamy już odpowiedź na to pytanie – zachowują charakter oryginalnego modelu Forum, a zamienione materiały nadają im ciekawą nową teksturę i energię.', 'Buty Forum Low w łagodnym stylu wykonane częściowo z materiałów pochodzących z recyklingu.', 'forum-exhibit-low-shoes', '', '', '', 'Forum Exhibit Low Shoes', '', '', '', ''),
(32, 1, 1, 'Sneakery adidas czerpią inspirację z kortu centralnego, ale wzbudzają nie mniejszy podziw podczas spacerów po ulicach miasta. Proste, gładkie linie i subtelne akcenty kolorystyczne sprawiają, że pasują do wszystkiego: od szortów treningowych po chinosy, od spodni dresowych po dżinsy.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', 'Stonowane sneakery wykonane częściowo z materiałów pochodzących z recyklingu.', 'breaknet-20-shoes', '', '', '', 'Breaknet 2.0 Shoes', '', '', '', ''),
(33, 1, 1, 'Poświęćmy chwilę na uhonorowanie ikony. Czy to legenda koszykówki z lat 80., która przeczy prawom grawitacji? A może kultowe buty, które ozdabiały stopy raperów? I jedno, i drugie. Buty adidas Forum zdominowały parkiet koszykarski i ulice, a teraz powracają w wersji do kostki, aby pomóc Ci wspiąć się na wyższy poziom stylu. Wybierz rozpoznawalny look ― dostępny w wersji z luksusowej, powlekanej skóry ― i zaprezentuj się w klasycznym stylu.', 'Luksusowe buty do kostki o koszykarskim rodowodzie.', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(34, 1, 1, 'Czerpiąc inspirację z archiwów adidas Koszykówka, te buty łączą sport i styl. Kultowe nakładki nadają oldschoolowy look odświeżonemu designowi. Wstawka Cloudfoam zapewnia długotrwały komfort, a kołnierz Geofit idealnie przylega do kostek.', 'Inspirowane koszykówką buty zapewniające komfort i stylowy look przez cały dzień.', 'postmove-mid-shoes', '', '', '', 'Postmove Mid Shoes', '', '', '', ''),
(35, 1, 1, 'Wybierz buty adidas, które łączą stabilne dopasowanie i przewiewność i zyskaj wygodę podczas codziennego treningu. Elastyczna cholewka zawiera odpowiednią ilość streczu. Lekka amortyzacja Bounce pod stopą oznacza komfort od pierwszego do ostatniego kroku.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty treningowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'trainer-v-shoes', '', '', '', 'Trainer V Shoes', '', '', '', ''),
(36, 1, 1, 'Kiedy masz dobre wyposażenie, możesz iść wszędzie. Męskie buty trekkingowe adidas staną się Twoim ulubionym obuwiem na wyprawy w chłodne dni. Od pieszych wędrówek przez wspinaczkę po paralotniarstwo – ten model łączy lekkość butów do biegania z trwałą i wspierającą konstrukcją butów trekkingowych, która sprawdzi się w górach. COLD.RDY z izolacją PrimaLoft® otula Twoją stopę, dbając o ciepło w chłodne dni, a podeszwa zewnętrzna z gumy Continental™ gwarantuje przyczepność, której potrzebujesz, aby poruszać się po wyboistym, mokrym lub suchym terenie.', 'Ocieplane buty trekkingowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-ax4-beta-coldrdy-hiking-shoes', '', '', '', 'Terrex AX4 Beta COLD.RDY Hiking Shoes', '', '', '', ''),
(37, 1, 1, 'Wybierz buty łączące elementy retro z futurystycznymi liniami designu, aby wprowadzić styl z przełomu XX i XXI wieku na nowe terytoria. Wykonane są z siateczki, zamszu i gładkiego TPU. Strategicznie rozmieszczone wsparcie w przedniej części stopy i w pięcie sprawia, że bieg staje się niezwykle komfortowy.', 'Buty sportowe w futurystycznym stylu.', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(38, 1, 1, 'Szybkość na każdej wędrówce. Buty Terrex Swift R3 GORE-TEX to połączenie lekkiego designu i amortyzacji typowych dla butów do biegania przełajowego z wszechstronnością i stabilnością obuwia trekkingowego.', 'Uniwersalne buty trekkingowe stworzone z myślą o prędkości w górach.', 'terrex-swift-r3-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R3 GORE-TEX Hiking Shoes', '', '', '', ''),
(39, 1, 1, 'Trae Young, jak nikt inny, wyznaczył najwyższe standardy dla współczesnych rozgrywających. Sygnowane przez niego buty do koszykówki pomogły mu podążać tym szlakiem. Design bez sznurowadeł wygodnie otula Twoje stopy, dając poczucie bezpiecznego dopasowania. BOOST w pięcie połączony z podeszwą środkową Lightstrike amortyzuje dynamiczne kroki bez spowalniania. Teraz możesz dominować na parkiecie i atakować kosz raz po raz.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Sprężyste buty koszykarskie z logo Trae Younga wykonane częściowo z materiałów pochodzących z recyklingu.', 'trae-young-20-shoes', '', '', '', 'Trae Young 2.0 Shoes', '', '', '', ''),
(40, 1, 1, 'Już jest część druga! Buty adidas Forum wzorowane na kultowym filmie „Kevin sam w Nowym Jorku” („Home Alone 2”) z lat 90. powstały na cześć wątpliwych przygód Kevina. Od odcieni szarej skóry przypominającej gołębie po ozdoby na sznurowadłach cytujące samą gołębiarkę, kolory i detale ożywiają wzruszającą scenę, w której Kevin zaprzyjaźnia się z gołębiarką w parku. Całość wykończono małymi detalami, od metki na języku po wkładki z grafiką.', 'Kultowe buty adidas Forum oddają hołd klasycznemu filmowi z lat 90.', 'forum-84-home-alone-2', '', '', '', 'Forum 84 Home Alone 2', '', '', '', ''),
(41, 1, 1, 'Poświęćmy chwilę na uhonorowanie ikony. Czy to legenda koszykówki z lat 80., która przeczy prawom grawitacji? A może kultowe buty, które ozdabiały stopy raperów? I jedno, i drugie. Buty adidas Forum zdominowały parkiet koszykarski i ulice, a teraz powracają w wersji do kostki, aby pomóc Ci wspiąć się na wyższy poziom stylu. Wybierz rozpoznawalny look ― dostępny w wersji z luksusowej, powlekanej skóry ― i zaprezentuj się w klasycznym stylu.', 'Luksusowe buty do kostki o koszykarskim rodowodzie.', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(42, 1, 1, 'Buty adidas NMD S1 kontynuują tradycję serii NMD. Dopasowana niczym skarpetka, pleciona cholewka pozostaje niezmienna, ale podeszwa zewnętrzna stanowi świeży, przyciągający uwagę element uzupełniony charakterystycznymi wstawkami NMD. Dodaj do tego wygodę, którą zapewnia miękka amortyzacja BOOST zwracająca energię na każdym kroku.', 'Wyjątkowo wygodne buty, wpisane w klasyczną linię modeli NMD.', 'nmd-s1-shoes', '', '', '', 'NMD S1 Shoes', '', '', '', ''),
(43, 1, 1, 'Przy każdej pogodzie. Na każdej nawierzchni. Buty do kolarstwa górskiego adidas Five Ten stworzone z myślą o wyprawach przełajowych i nieuczęszczanych drogach mają lekką, amortyzowaną konstrukcję typową dla butów do biegów przełajowych. Wodoodporna, oddychająca membrana GORE-TEX zapewnia stopom suchy komfort na mokrych nawierzchniach. Guma Stealth® Phantom zapewnia przyczepność do pedałów na każdym szlaku. Neoprenowe osłony nie przepuszczają brudu i żwiru. Wybieraj mało uczęszczane trasy.', 'Wodoszczelne buty do kolarstwa górskiego stworzone z myślą o przygodach na rowerze i poza nim.', 'five-ten-trailcross-gore-tex-mountain-bike-shoes', '', '', '', 'Five Ten Trailcross GORE-TEX Mountain Bike Shoes', '', '', '', ''),
(44, 1, 1, 'W 1979 roku adidas stworzył buty Handball Spezial z myślą o jednym celu —  grze. Teraz nadszedł czas, aby podbiły ulice. Model zachowuje klasyczne kolory Spezial i amortyzację, która odmienia przebieg gry. Zwiększyliśmy trwałość tych butów za sprawą cholewki z tkaniny CORDURA®, która jest odporna na zużycie.', 'Buty z lat 70. dostosowane do dzisiejszych trendów.', 'handball-spezial-shoes', '', '', '', 'Handball Spezial Shoes', '', '', '', ''),
(45, 1, 1, 'Niezależnie od tego, co dźwigasz, te buty adidas do podnoszenia ciężarów zapewniają Ci komfort. Lekka, lecz mocna płócienna cholewka ma wstawki z siateczki o dużych oczkach, które zwiększają przewiewność. Połączenie paska i sznurowadeł zabezpiecza śródstopie, a podwyższona podeszwa środkowa gwarantuje solidną stabilizację przy dużym obciążeniu. Od spodu gumowa podeszwa zewnętrzna trzyma się maty, dając Ci dobry punkt zaczepienia.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Uniwersalne buty treningowe do podnoszenia ciężarów wykonane częściowo z materiałów pochodzących z recyklingu.', 'powerlift-5-weightlifting-shoes', '', '', '', 'Powerlift 5 Weightlifting Shoes', '', '', '', ''),
(46, 1, 1, 'Wybierz buty trekkingowe dla mężczyzn, które pozwolą Ci szybko poruszać się w górach. Lekka, oddychająca konstrukcja jest wyposażona w system szybkiego sznurowania. Zewnętrzna podeszwa Traxion z gumą Continental™ zapewni wsparcie na suchej i mokrej nawierzchni.', 'Lekkie buty trekkingowe zapewniające przyczepność w każdych warunkach.', 'terrex-swift-r2-hiking-shoes', '', '', '', 'Terrex Swift R2 Hiking Shoes', '', '', '', ''),
(47, 1, 1, 'Wędruj. Wspinaj się. Odkrywaj. Podobnie jak uniwersalne buty trailowe te buty hikingowe adidas Terrex gwarantują uniwersalność niezbędną podczas przygód w terenie. Membrana GORE-TEX nie przepuszcza wilgoci, pozwalając jednocześnie stopom oddychać i dbając o ich długotrwały komfort na mokrych i suchych nawierzchniach. Ich lekka, a jednocześnie mocna konstrukcja wspiera Twoje stopy, gwarantując im komfortową stabilizację, dzięki której możesz pewnie poruszać się w trudnym, nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ oznacza doskonałą przyczepność zarówno na suchych, jak i na mokrych nawierzchniach.', 'Uniwersalne buty  hikingowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-swift-r3-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R3 GORE-TEX Hiking Shoes', '', '', '', ''),
(48, 1, 1, 'Inspirowane bieganiem buty, które nadają się na wszystkie codzienne przygody. Wybierz te wyjątkowo wygodne buty adidas, gdy musisz być na nogach. Przez jakiś czas. Podeszwa środkowa z pianki EVA dodaje Ci energii, a Torsion Bar w podeszwie zewnętrznej zapewnia wsparcie. Dodaj do tego mocną cholewkę z siateczki i zamszu, a uwierzysz, że marzenia się spełniają.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Te buty w stylu retro zostały częściowo wykonane z materiałów pochodzących z recyklingu.', 'retropy-f90-shoes', '', '', '', 'Retropy F90 Shoes', '', '', '', ''),
(49, 1, 1, 'Rozpal swoją buntowniczą naturę w butach adi2000 inspirowanych śmiałym stylem z początku XXI wieku. Sneakery adidas, które łączą styl skejtowy z tamtych czasów z białym tłem, są jakby stworzone dla Ciebie. 3 paski zostały odwrócone w zabawnym stylu, a skórzana cholewka i gumowa podeszwa zewnętrzna zapewniają Ci komfort.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Inspirowane skateboardingiem buty w monochromatycznym stylu wykonane częściowo z materiałów pochodzących z recyklingu.', 'adi2000-shoes', '', '', '', 'adi2000 Shoes', '', '', '', ''),
(50, 1, 1, 'Mokre, błotniste szlaki są częścią przygody w outdoorze, ale mokre stopy nie muszą nią być. Ciesz się suchymi stopami i poczuciem wyjątkowej lekkości, gdy przemieszczasz się z drogi na szlak i z powrotem w butach adidas do biegów przełajowych. Oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a ultralekka amortyzacja Lightstrike wspiera szybkość i zwinność na nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ ma wypustki i zapewnia pewną trakcję na mokrych i suchych nawierzchniach.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-agravic-flow-20-gore-tex-trail-running-shoes', '', '', '', 'Terrex Agravic Flow 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(51, 1, 1, 'Stworzone pierwotnie w latach 70. na koszykarskie parkiety. Królujące wśród hiphopowców w latach 80. Buty adidas Superstar obecnie stanowią znak rozpoznawczy entuzjastów miejskiego stylu. Znana na całym świecie osłona palców w kształcie muszli spełnia swoją funkcję, zapewniając styl i ochronę. Zupełnie tak samo, jak na koszykarskich parkietach lata temu.  Teraz, niezależnie od tego, czy jesteś na festiwalu, czy chodzisz po ulicy, możesz się dobrze bawić bez obawy o nadepnięcie.  Detal w postaci ząbkowanych 3 pasków i okienko z logo adidas Superstar nadają Ci autentyczny styl OG.', 'Autentyczne niskie buty z osłoną palców w kształcie muszli.', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(52, 1, 1, 'Wybierz buty adidas, które łączą stabilne dopasowanie i przewiewność i zyskaj wygodę podczas codziennego treningu. Elastyczna cholewka zawiera odpowiednią ilość streczu. Lekka amortyzacja Bounce pod stopą oznacza komfort od pierwszego do ostatniego kroku.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty treningowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'trainer-v-shoes', '', '', '', 'Trainer V Shoes', '', '', '', ''),
(53, 1, 1, 'Nie trać nic na szybkości i wybij przeciwnika z rytmu w tych butach bokserskich. Model opracowany zgodnie z podstawowymi wymaganiami butów do boksu ma elastyczną przednią część stopy połączoną z gwarantującym stabilizację śródstopiem. Design utrzymuje się na miejscu dzięki piance i paskom w pięcie, które umożliwiają Ci szybkie ruchy, nie ograniczając stabilizacji.', 'Lekkie buty do boksu stworzone z myślą o prędkości w ringu.', 'speedex-18-boxing-shoes', '', '', '', 'Speedex 18 Boxing Shoes', '', '', '', ''),
(54, 1, 1, 'Wędruj dalej. Odkrywaj jeszcze więcej. Podziwiaj świat. Lekkie buty hikingowe gwarantują komfort nowej generacji i wsparcie na szlaku, zarówno podczas wędrówek, jak i weekendowych wypraw. Podeszwa środkowa BOOST dodaje energii każdemu krokowi, ułatwiając Ci długie i krótkie wyprawy. Membrana GORE-TEX nie przepuszcza wilgoci, pozwalając jednocześnie stopom oddychać podczas rozgrzewki. Miękka, wspierająca cholewka i klinowa konstrukcja języka otulają stopę, zapewniając komfort i dopasowanie, dzięki czemu możesz dłużej wędrować. Wewnętrzna rama i wsparcie pięty gwarantują stabilizację, która doda Ci pewności na skalistym terenie i nierównym terenie, a podeszwa zewnętrzna z gumy Continental™ dba o pewną trakcję na mokrych i suchych nawierzchniach.', 'Buty trekkingowe kolejnej generacji wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-free-hiker-gore-tex-hiking-shoes-20', '', '', '', 'Terrex Free Hiker GORE-TEX Hiking Shoes 2.0', '', '', '', ''),
(55, 1, 1, 'Styl lat 90. był śmiały i przełomowy. Nie powinno więc dziwić, że buty adidas OZWEEGO też takie są. Nawiązują do tamtych bezkompromisowych czasów, czerpiąc inspirację z ówczesnych butów do biegania. Ich dzisiejszy formowany kształt możesz zestawić ze wszystkim, co masz w swojej szafie. Metaliczne i odblaskowe detale nadają całości luksusowy charakter.', 'Śmiałe, amortyzowane buty do noszenia na co dzień.', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(56, 1, 1, 'Poruszaj się szybko po szlaku. Te lekkie buty powstały, aby zapewniać szybkość na nierównym terenie. Mocna, gumowa podeszwa zewnętrzna daje Ci pewną przyczepność na mokrym i suchym podłożu, gdy biegasz lub wędrujesz po szlaku.', 'Lekkie, oddychające buty trekkingowe stworzone z myślą o szybkości.', 'terrex-ax3-hiking-shoes', '', '', '', 'Terrex AX3 Hiking Shoes', '', '', '', ''),
(57, 1, 1, 'Nie da się uderzyć tego, czego nie widać. Dzięki butom bokserskim adidas Box Hog będziesz tańczyć na ringu za sprawą lekkiej cholewki z siateczki, supercienkiej podeszwy środkowej z pianki EVA i przyczepnej gumowej podeszwy zewnętrznej. Średniowysoki profil i wewnętrzne wzmocnienia zapewniają stabilizację, gdy osiągasz najwyższy poziom pracy nóg.', 'Wzmocnione buty bokserskie, które zapewnią Ci przyczepność.', 'box-hog-20-boots', '', '', '', 'Box Hog 2.0 Boots', '', '', '', ''),
(58, 1, 1, 'Być może lata 90. to dla Ciebie odległa historia, ale buty Ozelia są zakorzenione w tej bezkompromisowej, eksperymentalnej erze. Śmiały model inspirowany archiwalnymi butami adidas ma solidną konstrukcję, która sprawia, że nie sposób go nie zauważyć. Gładkie buty mają biegowy charakter, a kiedy Twoje dni nabierają tempa, amortyzacja Adiprene zapewnia stopom wygodę.  Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', 'Futurystyczne buty, które przenoszą komfort na nowy poziom.', 'ozelia-shoes', '', '', '', 'Ozelia Shoes', '', '', '', ''),
(59, 1, 1, 'Zaprezentuj światu swój nowy trick na desce lub po prostu relaksuj się w swobodnym stylu w tych butach adidas. Model pozostaje wierny swoim sjektowym korzeniom za sprawą nubukowej cholewki i wulkanizowanej podeszwy środkowej. Załóż je, aby sprawdzić swoje umiejętności na rampie, płaskim drążku lub gdy po prostu chcesz się zrelaksować z przyjaciółmi.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Minimalistyczne, inspirowane skateboardingiem buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'vs-pace-20-lifestyle-skateboarding-3-stripes-branding-synthetic-nubuck-shoes', '', '', '', 'VS Pace 2.0 Lifestyle Skateboarding 3-Stripes Branding Synthetic Nubuck Shoes', '', '', '', ''),
(60, 1, 1, 'Buty adidas Forum po raz pierwszy pojawiły się na parkiecie w 1984 roku, wywołując spore poruszenie. Chociaż nie służą już do gry w koszykówkę, nadal robią wrażenie. Ten model nie jest wyjątkiem, a do tego ma ten sam detal w kształcie litery X i pasek w kostce, które uczyniły z oryginału ikonę. Model, który składa hołd latom 70. i 80., prezentuje zanikający wzór w delikatnych i łagodnych kolorach.', 'Buty Forum inspirowane modelami vintage i wykonane częściowo z materiałów pochodzących z recyklingu.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(61, 1, 1, 'Podkręć swój weekendowy bieg w butach adidas Alphaboost. Zasznuruj je i ruszaj na bieżnię, do pobliskiego parku lub na siłownię. Podeszwa środkowa Bounce sprawia, że bieg jest miękki i sprężysty. BOOST w pięcie zwraca energię, gdy biegasz, więc nie zabraknie Ci paliwa aż do końca biegu.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Wygodne buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'alphaboost-v1-sustainable-boost-lifestyle-running-shoes', '', '', '', 'Alphaboost V1 Sustainable BOOST Lifestyle Running Shoes', '', '', '', ''),
(62, 1, 1, 'Pewnym krokiem wkraczaj w przyszłość. Nie zapominając o dobrym stylu. Inspirowane modelami biegowymi z lat 80. buty NMD powstały w 2015 roku, aby połączyć elegancki styl z nowoczesnymi technologiami i komfortem. Młodzieżowe buty adidas NMD_R1 V2 zapewniają Twoim stopom amortyzację dzięki sprężystej podeszwie środkowej BOOST. Szykowne, przezroczyste nakładki nadają im cyberpunkowy charakter. Przyszłość należy do Ciebie. Pewnie staw jej czoła.  Cholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', 'Progresywne buty inspirowane bieganiem, stworzone częściowo z Parley Ocean Plastic.', 'nmdr1-v2-shoes', '', '', '', 'NMD_R1 V2 Shoes', '', '', '', ''),
(63, 1, 1, 'Rozpal swoją buntowniczą naturę w butach adi2000 inspirowanych śmiałym stylem z początku XXI wieku. Sneakery adidas, które łączą styl skejtowy z tamtych czasów z uniwersalną paletą kolorów, są jakby stworzone dla Ciebie. 3 paski zostały odwrócone w zabawnym stylu, a skórzana cholewka i gumowa podeszwa zewnętrzna zapewniają Ci komfort.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Inspirowane skateboardingiem buty z gładkimi detalami wykonane częściowo z materiałów pochodzących z recyklingu.', 'adi2000-shoes', '', '', '', 'adi2000 Shoes', '', '', '', ''),
(64, 1, 1, 'Leśne szlaki. Wędrówki po górach. Przygody poza szlakiem. Wybierz buty hikingowe adidas, które dają Ci wiele możliwości. Guma Continental™ gwarantująca w każdych warunkach wspólnie z wodoodpornym, oddychającym materiałem GORE-TEX pomogą Ci wędrować, wspinać się i odkrywać świat ten bliski i ten daleki. Język z klinem nie przepuszcza brudu, a płytka chroniąca przed kamieniami i dodatkowe wsparcie pięty ułatwiają pewną wspinaczkę po kamienistych nawierzchniach.', 'Wodoodporne buty hikingowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-swift-r3-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R3 GORE-TEX Hiking Shoes', '', '', '', ''),
(65, 1, 1, 'Niezależnie od tego, co dźwigasz, te buty adidas do podnoszenia ciężarów zapewniają Ci komfort. Lekka, lecz mocna płócienna cholewka ma wstawki z siateczki o dużych oczkach, które zwiększają przewiewność. Połączenie paska i sznurowadeł zabezpiecza śródstopie, a podwyższona podeszwa środkowa gwarantuje solidną stabilizację przy dużym obciążeniu. Od spodu gumowa podeszwa zewnętrzna trzyma się maty, dając Ci dobry punkt zaczepienia.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Uniwersalne buty treningowe do podnoszenia ciężarów wykonane częściowo z materiałów pochodzących z recyklingu.', 'powerlift-5-weightlifting-shoes', '', '', '', 'Powerlift 5 Weightlifting Shoes', '', '', '', ''),
(66, 1, 1, 'Kader Sylla, zawodnik teamu adidas Skateboarding, na nowo definiuje styl. Rezulatatem jego najnowszej współpracy z adidas Skateboarding jest monochromatyczna, fioletowa wersja klasycznych butów adidas Superstar ADV, będąca ukłonem w stronę lat 90. Buty Superstar ADV X Kader mają cholewkę z wysokiej jakości mechatego zamszu, logo Kader ze złotej folii oraz charakterystyczną wkładkę, giętką, gumową podeszwę zewnętrzną, grube sznurowadła i ozdobę na sznurowadłach inspirowaną mistrzostwami.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Kader ― nie do zatrzymania.', 'superstar-adv-x-kader-shoes', '', '', '', 'Superstar ADV x Kader Shoes', '', '', '', ''),
(67, 1, 1, 'Wybierz buty, które robią wrażenie. Model adidas Forum zadebiutował w 1984 roku i zyskał ogromną popularność zarówno na koszykarskim parkiecie, jak i muzycznej scenie. Ta wersja miejskich, niskich butów nawiązuje do pełnego energii stylu koszykarskiego z lat 80. za sprawą kultowego designu z krzyżującymi się paskami w kostkach.', 'Niskie buty w koszykarskim stylu.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(68, 1, 1, 'Leśne szlaki. Wędrówki po górach. Przygody poza szlakiem. Wybierz buty hikingowe adidas, które dają Ci wiele możliwości. Guma Continental™ gwarantująca w każdych warunkach wspólnie z wodoodpornym, oddychającym materiałem GORE-TEX pomogą Ci wędrować, wspinać się i odkrywać świat ten bliski i ten daleki. Język z klinem nie przepuszcza brudu, a płytka chroniąca przed kamieniami i dodatkowe wsparcie pięty ułatwiają pewną wspinaczkę po kamienistych nawierzchniach.', 'Wodoodporne buty hikingowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-swift-r3-gore-tex-hiking-shoes', '', '', '', 'Terrex Swift R3 GORE-TEX Hiking Shoes', '', '', '', ''),
(69, 1, 1, 'Buty adidas OZWEEGO powstały, aby robić wrażenie. Nie tylko w kwestii komfortu, o którego nowy wymiar dba niezastąpiona, zjednoczona moc amortyzacji EVA, Adiprene i Adiprene+. Mają również pozwolić Tobie robić wrażenie. Odważna sylwetka i płynne linie przyciągają spojrzenia. Właśnie o to chodzi.', 'Wyróżniające się buty z wyjątkową amortyzacją i śmiałą mieszanką materiałów.', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(70, 1, 1, 'Gdy dni stają się krótsze, a temperatura spada, zamień klapki na buty adidas, które sprawdzą się w chłodne dni. Na przykład na te buty adidas Superstar. To doskonałe uzupełnienie ciepłych bluz z kapturem i gorących napojów ma odporną na przetarcia cholewkę CORDURA®. Te buty nie tylko sprawdzą się w czasie codziennych aktywności, ale również nadadzą Ci kultowy styl dzięki gumowej osłonie palców w kształcie muszli i 3 paskom.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Buty w stylu retro odświeżone przy pomocy materiału CORDURA® i wykonane częściowo z materiałów pochodzących z recyklingu.', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(71, 1, 1, 'Prosty, świeży i wyrazisty styl, który po prostu zapiera dech. Tak się poczujesz, gdy wyjmiesz te buty adidas z pudełka. Subtelne 3 paski na stonowanej cholewce z syntetycznej skóry nawiązują do tradycyjnego klimatu. Amortyzowana podeszwa środkowa zapewnia miękkie wsparcie nad gumową podeszwą zewnętrzną w stylu retro.', 'Buty przed kostkę zainspirowane koszykówką, które sprawdzą się podczas codziennych zajęć.', 'hoops-30-low-classic-vintage-shoes', '', '', '', 'Hoops 3.0 Low Classic Vintage Shoes', '', '', '', ''),
(72, 1, 1, 'Przeżyj na nowo lata 80., gdy styl sportowy przeniósł się z parkietów koszykarskich na ulice miast. Te kultowe buty adidas Forum Low zyskały nowoczesną odsłonę w postaci nowych zestawień kolorystycznych. Skórzana cholewka i gumowa podeszwa zewnętrzna zapewniają dodatkowy komfort, na który zasługujesz.', 'Buty adidas Forum Low w stylu koszykarskim sprzed lat.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(73, 1, 1, 'Zapewnij swoim stopom komfort i styl dzięki butom adidas ― od porannej sesji na siłowni poprzez załatwianie codziennych spraw, aż po wieczór z przyjaciółmi. Zestaw je ze swoimi ulubionymi szortami do biegania, aby zyskać swobodny, sportowy charakter. Cholewka z siateczki dba o Twój przewiewny komfort, a superlekka amortyzacja towarzyszy Ci na każdym kroku.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty do biegania na co dzień wykonane częściowo z materiałów pochodzących z recyklingu.', 'duramo-sl-20-shoes', '', '', '', 'Duramo SL 2.0 Shoes', '', '', '', ''),
(74, 1, 1, 'Południowy Londyn nie byłby taki sam bez Trap Kitchen. Właśnie dlatego w ramach naszej kolekcji Adilicious City Series połączyliśmy siły z popularną miejscówką kulinarną, aby stworzyć buty adidas Forum. Znana ze swoich kultowych i dekadenckich potraw Trap Kitchen powstała, gdy Prince Cofi Owusu zaczął serwować jedzenie na wynos z mieszkania swojej mamy. Wyszywane logo z telefonem, wkładka z nadrukiem i brelok na klucze upamiętniają naszą współpracę.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Wykonane częściowo z materiałów pochodzących z recyklingu buty Forum stworzone na cześć londyńskiej restauracji Trap Kitchen.', 'forum-low-trap-kitchen-shoes', '', '', '', 'Forum Low Trap Kitchen Shoes', '', '', '', ''),
(75, 1, 1, 'SS80S NBHD', 'SS80S NBHD', 'ss80s-nbhd', '', '', '', 'SS80S NBHD', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(76, 1, 1, 'Pogoda wpływa jedynie na zmianę Twojego stroju — nie Twoich planów. W takich przypadkach przydadzą Ci się buty adidas Superstar. Gotowa na nieprzewidywalność, wodoodporna cholewka z nubuku zapewnia stopom suchy komfort, gdy zmienia się pogoda, a gumowa podeszwa zewnętrzna gwarantuje stabilność na śliskich ulicach. Więc nie musisz się wahać, czy wyjść, nawet gdy deszcz pada.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Wodoodporne buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(77, 1, 1, 'Uzupełnij swój codzienny look o wygodę i sportowy styl obuwia do biegania dzięki butom adidas. Czuj się pewnie przez cały dzień za sprawą idealnego dopasowania i lekkiej podeszwy środkowej, która amortyzuje każdy krok.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka wykonana w 50% z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', 'Inspirowane bieganiem buty do noszenia na co dzień.', 'racer-tr21-shoes', '', '', '', 'Racer TR21 Shoes', '', '', '', ''),
(78, 1, 1, 'Buty adidas Forum, które zadebiutowały na parkiecie koszykarskim, a następnie zdominowały betonowe boiska, zyskały popularność na całym świecie. Teraz te nowoczesne buty są częścią naszych wysiłków, aby go chronić. Średniowysoki model stworzony we współpracy z Parley for the Oceans został wykonany z materiałów pochodzących z recyklingu. O ile pasek w kształcie litery X w kostce nawiązuje do koszykarskiego dziedzictwa, to ich monochromatyczny look jest ukłonem w stronę oceanów, a stonowane kolorystycznie odcienie czerpią inspirację z japońskiej odzieży roboczej.', 'Buty adidas x Parley Forum wykonane częściowo z materiałów pochodzących z recyklingu.', 'forum-mid-parley-shoes', '', '', '', 'Forum Mid Parley Shoes', '', '', '', ''),
(79, 1, 1, 'Przoduj we wszystkim podczas gry na hali. Superstylowe buty adidas Adizero Fastcourt osadzone są na platformie z lekkiej podeszwy środkowej Lightstrike i podeszwy zewnętrznej z gumy, która zapewnia przyczepność we wszystkich kierunkach, oraz mają zaokrąglone krawędzie, gwarantujące naturalną swobodę ruchu. To połączenie zostało stworzone z myślą o szybkich reakcjach i komforcie przy każdym przyspieszeniu. Wyściełana miękkim materiałem cholewka z siateczki owija się wokół stopy, wspierając każdy krok.', 'Niskie, lekkie buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-fastcourt-shoes', '', '', '', 'Adizero Fastcourt Shoes', '', '', '', ''),
(80, 1, 1, 'Biegaj poza utartym szlakiem. Te buty adidas do biegów przełajowych zapewnią Ci suchy komfort i pewną trakcję na luźnych, pokrytych kamieniami i mokrych szlakach. Oddychająca membrana GORE-TEX nie przepuszcza wody, zapewniając długotrwały komfort w mokrych warunkach. Mocne nakładki w strefach narażonych na zniszczenie sprawdzą się w każdym terenie, a lekka amortyzacja wspiera stopy. Głęboko żłobiona podeszwa zewnętrzna TRAXION maksymalizuje przyczepność we wszystkich kierunkach, dając Ci pewność na każdym kroku poza szlakiem.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'tracerocker-20-gore-tex-trail-running-shoes', '', '', '', 'Tracerocker 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(81, 1, 1, 'Stworzone pierwotnie w latach 70. na koszykarskie parkiety. Królujące wśród hiphopowców w latach 80. Buty adidas Superstar obecnie stanowią znak rozpoznawczy entuzjastów miejskiego stylu. Znana na całym świecie osłona palców w kształcie muszli spełnia swoją funkcję, zapewniając styl i ochronę. Zupełnie tak samo, jak na koszykarskich parkietach lata temu.  Teraz, niezależnie od tego, czy jesteś na festiwalu, czy chodzisz po ulicy, możesz się dobrze bawić bez obawy o nadepnięcie.  Detal w postaci ząbkowanych 3 pasków i okienko z logo adidas Superstar nadają Ci autentyczny styl OG.', 'Autentyczne niskie buty z osłoną palców w kształcie muszli.', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(82, 1, 1, 'Być może lata 90. to dla Ciebie odległa historia, ale buty Ozelia są zakorzenione w tej bezkompromisowej, eksperymentalnej erze. Śmiały model inspirowany archiwalnymi butami adidas ma solidną konstrukcję, która sprawia, że nie sposób go nie zauważyć. Gładkie buty mają biegowy charakter, a kiedy Twoje dni nabierają tempa, amortyzacja Adiprene zapewnia stopom wygodę.  Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', 'Futurystyczne buty, które przenoszą komfort na nowy poziom.', 'ozelia-shoes', '', '', '', 'Ozelia Shoes', '', '', '', ''),
(83, 1, 1, 'Rok 1984 stanowił ważną datę w historii koszykówki. Epickie mecze. Odważni zawodnicy. Debiut butów adidas Forum. Te nowoczesne buty koszykarskie w stylu retro mają wszystkie charakterystyczne detale oryginalnego modelu: pasek w kostce, perforowane palce i grubą, gumową podeszwę. Dodaliśmy nowe akcenty kolorystyczne, aby je troszkę odświeżyć.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Klasyczne buty Forum wykonane częściowo z materiałów pochodzących z recyklingu.', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(84, 1, 1, 'Styl biegowy stworzony z myślą o codziennych przygodach. Buty adidas NMD_R1 odświeżają oryginalny model inspirowany latami 80. przy pomocy odblaskowej klatki z RPU. Elastyczna, pleciona cholewka otula stopę, zapewniając komfort w ruchu. Długie dojazdy i śliskie chodniki to żaden problem, gdy masz pod stopami zwracającą energię amortyzację BOOST i przyczepną gumową podeszwę zewnętrzną.  Cholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', 'Inspirowane latami 80. buty wykonane częściowo z Parley Ocean Plastic.', 'nmdr1-shoes', '', '', '', 'NMD_R1 Shoes', '', '', '', ''),
(85, 1, 1, 'Dbaj o środowisko i pozwól się porwać przygodzie. Te buty hikingowe adidas mają zwracającą energię piankę BOOST i wspierającą, płócienną cholewkę z użyciem materiałów pochodzących z recyklingu, która zapewnia długotrwały komfort i trwałość. Otulający stopę komfort będzie towarzyszyć Ci zarówno na weekendowych wycieczkach, jak i podczas całonocnych przygód. GORE-TEX nie przepuszcza wody, zapewniając suchy komfort Twoim stopom, a guma Continental™ dba o nadzwyczajną przyczepność na mokrych i suchych szlakach.', 'Wodoodporne buty hikingowe z izolacją wykonane częściowo z Parley Ocean Plastic.', 'terrex-free-hiker-xpl-gtx-boots', '', '', '', 'Terrex Free Hiker XPL GTX Boots', '', '', '', ''),
(86, 1, 1, 'Ciesz się komfortem na łonie natury. Buty adidas TERREX Free Hiker 2 to gwarancja wygody i niezawodności podczas codziennych przygód, dzięki którym docenisz czas spędzany na świeżym powietrzu.   Poczuj ducha outdooru w nowych butach adidas TERREX Free Hiker 2 z gumą Continental™, która gwarantuje niezawodną przyczepność podczas wędrówek. BOOST zapewnia niesamowity zwrot energii i wyjątkowy komfort na każdym kroku. Cholewka tych butów wykonana jest z wysokiej jakości przędzy zawierającej co najmniej 50% Parley Ocean Plastic i 50% poliestru pochodzącego z recyklingu.', 'Buty hikingowe nowej generacji wykonane częściowo z Parley Ocean Plastic.', 'terrex-free-hiker-2-hiking-shoe', '', '', '', 'TERREX Free Hiker 2 Hiking Shoe', '', '', '', ''),
(87, 1, 1, 'Szybkość to podstawa, jeśli chcesz pobić każdego przeciwnika na parkiecie. Te buty koszykarskie adidas mają cholewkę z siateczki osadzoną na ultralekkiej podeszwie środkowej Lightstrike, która pomoże Ci unosić się nad parkietem. Gumowa podeszwa zewnętrzna i zwiększona blokada stopy zabezpieczają nogi podczas gwałtownych zwrotów i dynamicznych ruchów do kosza.', 'Lekkie buty koszykarskie stworzone z myślą o dominacji na parkiecie.', 'adizero-select-shoes', '', '', '', 'Adizero Select Shoes', '', '', '', ''),
(88, 1, 1, 'Nie pozwól, by deszczowa pogoda stanęła Ci na drodze w czasie biegu. Te buty do biegania adidas mają konstrukcję z oddychającą membraną GORE-TEX, która zapewnia stopom suchy komfort w deszczowe dni. Podeszwa środkowa zawiera setki połączonych ze sobą kapsułek BOOST, które gwarantują niewiarygodny zwrot energii i dodają Ci mocy od startu do mety bez względu na dystans lub warunki.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-gore-tex-shoes', '', '', '', 'Ultraboost 22 GORE-TEX Shoes', '', '', '', ''),
(89, 1, 1, 'Wybierz oldschoolowy look i ciesz się nowoczesnym komfortem. Te inspirowane bieganiem buty mają pluszowo miękką amortyzację Cloudfoam w podeszwie środkowej, dzięki czemu unikniesz zmęczenia w długie, wypełnione aktywnością dni. Zamszowe nakładki i łatwo rozpoznawalne 3 paski stanowią stylowy akcent.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', 'Buty adidas w stylu retro z przyczepną, gumową podeszwą zewnętrzną.', 'run-80s-shoes', '', '', '', 'Run 80s Shoes', '', '', '', ''),
(90, 1, 1, 'Niskoprofilowy klasyk. Gazelle zadebiutowały jako buty piłkarskie, aby następnie stać się ikoną stylu miejskiego. Ten model o nieco poszerzonych proporcjach oddaje hołd ulubionej wersji z 1991 roku za sprawą konstrukcji z tych samych materiałów i takiej samej kolorystyki. Cholewka z nubuku dodaje konstrukcji miękkości i gładkości w dotyku.', 'Model Gazelle z 1991 roku powraca w wiernej reedycji.', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(91, 1, 1, 'Spakuj torbę, zawiąż buty i ruszaj w drogę. Przygody w mieście wymagają modelu NMD_R1. Nowoczesne buty będące nową odsłoną popularnego modelu biegowego z lat 80. z archiwów adidas mają miękką, elastyczną cholewkę o plecionym designie i zwracającą energię amortyzację Boost, która gwarantuje komfort przez cały dzień. Śmiałe kolory i charakterystyczne wstawki w podeszwie środkowej przyciągają wzrok, więc gdziekolwiek zmierzasz, z pewnością pokażesz się w dobrym stylu.  Ten produkt został wykonany z Primeblue – wysokiej jakości materiału pochodzącego z recyklingu, powstałego częściowo z Parley Ocean Plastic. Cholewka składa się w 50% z materiału tekstylnego, a 75% tego materiału stanowi przędza Primeblue. Model nie zawiera nowo wyprodukowanego poliestru.', 'Progresywne buty sportowe zakorzenione w stylu biegowym.', 'nmdr1-primeblue-shoes', '', '', '', 'NMD_R1 Primeblue Shoes', '', '', '', ''),
(92, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(93, 1, 1, 'Być może lata 90. to dla Ciebie odległa historia, ale buty Ozelia są zakorzenione w tej bezkompromisowej, eksperymentalnej erze. Śmiały model inspirowany archiwalnymi butami adidas ma solidną konstrukcję, która sprawia, że nie sposób go nie zauważyć. Gładkie buty mają biegowy charakter, a kiedy Twoje dni nabierają tempa, amortyzacja Adiprene zapewnia stopom wygodę.  Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', 'Futurystyczne buty, które przenoszą komfort na nowy poziom.', 'ozelia-shoes', '', '', '', 'Ozelia Shoes', '', '', '', ''),
(94, 1, 1, 'Kiedy zakładasz buty adidas Forum, zyskujesz nie tylko styl. Stworzone w 1984 roku, aby dominować na parkiecie, są teraz przeznaczone na wielkie wejścia. Regulowany pasek w kostce i design X zachowały swój kultowy charakter. Ich kolorystyka została zainspirowana jedną z najlepszych drużyn ligi.', 'Sneakery przed kostkę inspirowane koszykarskim dziedzictwem.', 'forum-84-low-shoes', '', '', '', 'Forum 84 Low Shoes', '', '', '', ''),
(95, 1, 1, 'W 1984 roku buty adidas Forum zawojowały parkiety koszykarskie swoją energią i dynamiką. Teraz koszykarski styl powraca do Twojej szafy. Te buty mają ten sam design z krzyżującymi się w kostce paskami i luksusową cholewkę, która sprawiła, że stały się legendą. Dodaliśmy do nich jeszcze wyeksponowany kołnierz z pianki i język. Ciesz się nostalgią za latami 80. na każdym kroku.', 'Buty adidas zakorzenione w koszykarskim stylu lat 80.', 'forum-84-hi-shoes', '', '', '', 'Forum 84 Hi Shoes', '', '', '', ''),
(96, 1, 1, 'ULTRA4D FWD', 'ULTRA4D FWD', 'ultra4d-fwd', '', '', '', 'ULTRA4D FWD', '', '', '', ''),
(97, 1, 1, 'adidas ADIZERO SL to szybkie buty treningowe na co dzień, wyposażone w kluczowe elementy i wyróżniki designu z naszej bijącej rekordy popularności na całym świecie linii Adizero. Podeszwa środkowa ma lekką ramę Lightstrike z pianki EVA na całej długości, która zapewnia równowagę między stabilnością, wytrzymałością i amortyzacją. Została ona połączona z naszej światowej sławy pianką Lightstrike Pro i szybką, treningową cholewką z wyjątkowo miękkiej siateczki o specjalnej konstrukcji rozmieszczonej w kluczowych obszarach. Solidnie wyściełana konstrukcja pięty i języka zapewnia wygodę podczas zakładania i biegu, a design cholewki uzupełnia migający znak ADIZERO na pięcie. Całkowicie gumowa podeszwa zewnętrzna zapewnia przyczepność na każdej nawierzchni i w każdych warunkach. Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Zaprojektowane, by pomóc biegaczom osiągać coraz lepsze wyniki podczas krótkich i długich treningów biegowych.', 'adidas-adizero-sl-running-shoes', '', '', '', 'ADIDAS ADIZERO SL RUNNING SHOES', '', '', '', ''),
(98, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(99, 1, 1, 'Są buty, w których możesz biegać. I są też buty do biegania, w których chcesz biegać. SOLARGLIDE 6 to buty, które zakładasz codziennie, pamiętając o swoich celach, takich jak pokonywanie kolejnych kilometrów lub bicie życiowych rekordów. Wyposażono je w technologie, których potrzebujesz, aby móc biegać dalej i szybciej, w tym sprężystą amortyzację BOOST. adidas LEP 2.0 prowadzi każdy krok, dodając Ci przyspieszenia, a podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych i suchych nawierzchniach.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', 'Buty do biegania na co dzień wykonane częściowo z materiałów pochodzących z recyklingu.', 'solarglide-6-shoes', '', '', '', 'SOLARGLIDE 6 Shoes', '', '', '', ''),
(100, 1, 1, 'Nie pozwól, aby deszczowa pogoda pokrzyżowała Twoje plany treningowe. Te buty do biegania adidas zapewniają wygodę i pewność siebie podczas biegu w deszczowe dni. Cholewka GORE-TEX dba o suchy komfort stóp, a przyczepna, gumowa podeszwa zewnętrzna gwarantuje trakcję na śliskich nawierzchniach. Sprężysta amortyzacja BOOST zapewnia płynny bieg w każdych warunkach.', 'Wodoodporne buty do biegania na trening w deszczowe dni.', 'supernova-gore-tex-shoes', '', '', '', 'Supernova GORE-TEX Shoes', '', '', '', ''),
(101, 1, 1, 'Nie robisz sobie przerwy od biegania, gdy nadejdzie deszcz i chłód. Przygotuj się na zimę w tych butach adidas. Cholewka GORE-TEX i wewnętrzna skarpetka nie przepuszczają wody, dbając, aby Twoje stopy pozostały suche, a ochronna osłona nad sznurowadłami zapewnia dodatkowe okrycie. Setki kapsułek BOOST pod stopą gwarantują niewiarygodny zwrot energii, dzięki czemu będziesz czuć się świeżo niezależnie od długości trasy. Gumowa podeszwa zewnętrzna Continental™ z wypustkami zapewnia przyczepność na śliskich nawierzchniach i gwarantuje pewny krok niezależnie od warunków.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'solar-glide-5-gore-tex-shoes', '', '', '', 'Solar Glide 5 GORE-TEX Shoes', '', '', '', ''),
(102, 1, 1, 'Niezależnie od tego, czy dopiero zaczynasz uprawiać sport, czy trenujesz już na dystansie 10 km, te buty do biegania adidas pomogą Ci dotrzeć do celu. Zwracająca energię pianka BOOST w podeszwie środkowej wspiera lądowanie i dodaje energii każdemu krokowi, a sprężysta amortyzacja w przedniej części stopy dodaje Ci przyspieszenia. Strategicznie rozmieszczone strefy elastyczności i wentylacja na cholewce z siateczki zapewniają stopom komfort, dzięki czemu możesz osiągnąć swoje cele.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Wygodne buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'supernova-20-shoes', '', '', '', 'Supernova 2.0 Shoes', '', '', '', ''),
(103, 1, 1, 'Poczuj płynność biegu w butach do biegania Ultra 4DFWD. Łączą cholewkę naszych kultowych butów Ultraboost z podeszwą środkową adidas 4DFWD z nadrukiem 3D, która została udoskonalona tak, aby kompresja do przodu zmniejszała siłę hamowania i przekształcała energię uderzenia w ruch naprzód. Gwarantuje to płynne przetoczenie stopy i wyjątkowe wrażenia niczym podczas szybowania. Cholewka adidas PRIMEKNIT otula stopę, zapewniając jej dynamiczne wsparcie w strategicznych obszarach, a podeszwa zewnętrzna z gumy Continental™ zwiększa przyczepność w każdych warunkach pogodowych.', 'Buty do biegania zaprojektowane z myślą o ruchu i wykonane częściowo z Parley Ocean Plastic.', 'ultra-4dfwd-shoes', '', '', '', 'Ultra 4DFWD Shoes', '', '', '', ''),
(104, 1, 1, 'Mokre, błotniste szlaki są częścią przygody w outdoorze, ale mokre stopy nie muszą nią być. Ciesz się suchymi stopami i poczuciem wyjątkowej lekkości, gdy przemieszczasz się z drogi na szlak i z powrotem w butach adidas do biegów przełajowych. Oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a ultralekka amortyzacja Lightstrike wspiera szybkość i zwinność na nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ ma wypustki i zapewnia pewną trakcję na mokrych i suchych nawierzchniach.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-agravic-flow-20-gore-tex-trail-running-shoes', '', '', '', 'Terrex Agravic Flow 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(105, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(106, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów.   Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Sportowe, wygodne buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(107, 1, 1, 'Biegaj poza utartym szlakiem. Te buty adidas do biegów przełajowych zapewnią Ci suchy komfort i pewną trakcję na luźnych, pokrytych kamieniami i mokrych szlakach. Oddychająca membrana GORE-TEX nie przepuszcza wody, zapewniając długotrwały komfort w mokrych warunkach. Mocne nakładki w strefach narażonych na zniszczenie sprawdzą się w każdym terenie, a lekka amortyzacja wspiera stopy. Głęboko żłobiona podeszwa zewnętrzna TRAXION maksymalizuje przyczepność we wszystkich kierunkach, dając Ci pewność na każdym kroku poza szlakiem.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'tracerocker-20-gore-tex-trail-running-shoes', '', '', '', 'Tracerocker 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(108, 1, 1, 'Nie pozwól, by deszczowa pogoda stanęła Ci na drodze w czasie biegu. Te buty do biegania adidas mają konstrukcję z oddychającą membraną GORE-TEX, która zapewnia stopom suchy komfort w deszczowe dni. Podeszwa środkowa zawiera setki połączonych ze sobą kapsułek BOOST, które gwarantują niewiarygodny zwrot energii i dodają Ci mocy od startu do mety bez względu na dystans lub warunki.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-gore-tex-shoes', '', '', '', 'Ultraboost 22 GORE-TEX Shoes', '', '', '', ''),
(109, 1, 1, 'ULTRA4D FWD', 'ULTRA4D FWD', 'ultra4d-fwd', '', '', '', 'ULTRA4D FWD', '', '', '', ''),
(110, 1, 1, 'Ucieknij z ulic miast w tych butach adidas do biegów przełajowych. Siateczkowa cholewka zapewnia stopom świeżość, a mocne nakładki sprawdzą się w trudnym terenie. Pokonuj długie dystanse, ciesząc się długotrwałym komfortem i lekką amortyzacją oraz dynamicznym wybiciem za sprawą profilowanej konstrukcji pod palcami. Gdziekolwiek się udasz, głęboko żłobiona podeszwa zewnętrzna Traxion zapewnia przyczepność we wszystkich kierunkach.', 'Buty do biegów przełajowych w każdym terenie wykonane częściowo z materiałów pochodzących z recyklingu.', 'tracerocker-20-trail-running-shoes', '', '', '', 'Tracerocker 2.0 Trail Running Shoes', '', '', '', ''),
(111, 1, 1, 'Jeśli lubisz biegać w terenie, buty Terrex Two Ultra Trail są właśnie dla Ciebie. BOOST dodaje energii każdemu krokowi i dostosowuje się do kamienistych nierówności podłoża, amortyzując krok na długich dystansach. Dopasowana niczym skarpetka cholewka adidas PRIMEKNIT zapewnia otulające stopę wsparcie, oddychalność i elastyczność, które zwiększają Twój zakres komfortu na szlaku. Dodaj do tego gumę Continental™, a zyskasz przyczepność w każdych warunkach dzięki butom trailowym, które sprawdzą się niezależnie do rodzaju terenu.', 'Wyjątkowo wygodne buty do biegów przełajowych stworzone częściowo z Parley Ocean Plastic.', 'terrex-two-ultra-trail-running-shoes', '', '', '', 'Terrex Two Ultra Trail Running Shoes', '', '', '', ''),
(112, 1, 1, 'Niezależnie od tego, czy jest to liściasta okolica, szlak nad potokiem, czy leśny szlak na obrzeżach miasta, natura zapewnia piękno i pociechę podczas najlepszych biegów. Zrób krok w kierunku zachowania tych darów w butach do biegania, które są wykonane z naturalnych i odnawialnych zasobów. Oferują wszystkie najlepsze cechy kultowych Ultraboost, w tym sprężystą amortyzację BOOST i otulający stopę adidas PRIMEKNIT. Gwarantują dobre samopoczucie, czyniąc dobro.', 'Wygodne, sprężyste buty do biegania stworzone z myślą o naturze.', 'ultraboost-22-made-with-nature-shoes', '', '', '', 'Ultraboost 22 Made with Nature Shoes', '', '', '', ''),
(113, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(114, 1, 1, 'Zapewnij swoim stopom komfort i styl dzięki butom adidas ― od porannej sesji na siłowni poprzez załatwianie codziennych spraw, aż po wieczór z przyjaciółmi. Zestaw je ze swoimi ulubionymi szortami do biegania, aby zyskać swobodny, sportowy charakter. Cholewka z siateczki dba o Twój przewiewny komfort, a superlekka amortyzacja towarzyszy Ci na każdym kroku.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty do biegania na co dzień wykonane częściowo z materiałów pochodzących z recyklingu.', 'duramo-sl-20-shoes', '', '', '', 'Duramo SL 2.0 Shoes', '', '', '', ''),
(115, 1, 1, 'Ścigaj się z czasem w butach do biegania adidas. Mają oddychającą cholewkę z siateczki i wyściełany kołnierz Geofit, który wspiera kostki. Bounce w pięcie i Bounce+ pod stopą zwiększają amortyzację, zapewniając szybkość i sprężystość. Gumowa podeszwa zewnętrzna oznacza doskonałą przyczepność, więc możesz śmiało ruszać w teren.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Sprężyste buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'response-super-30-shoes', '', '', '', 'Response Super 3.0 Shoes', '', '', '', ''),
(116, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(117, 1, 1, 'adidas 4DFWD 2 na nowo definiuje ruch do przodu, łącząc unikalną, przełomową innowację w postaci drukowanej w 3D podeszwy środkowej z nową konstrukcją cholewki i podeszwą zewnętrzną Continental dla dodatkowej przyczepności. Na każdym kroku podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Dzięki temu bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe. Przyczepna podeszwa zewnętrzna z gumy Continental™ gwarantuje trakcję na mokrych i suchych nawierzchniach, dzięki czemu możesz biegać w każdych warunkach, a cholewka adidas PRIMEKNIT+ otula stopę nowym krojem, który zwiększa swobodę ruchu.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Innowacja, która pozwala Ci iść naprzód.', 'adidas-4dfwd-2-running-shoes', '', '', '', 'adidas 4DFWD 2 running shoes', '', '', '', ''),
(118, 1, 1, 'Ruszaj na podbój miejskich lub górskich szlaków. Buty do biegania przełajowego adidas Terrex Two Flow otulają stopę przy pomocy lekkiej, oddychającej cholewki z siateczki, gwarantującej dynamiczne wsparcie w zróżnicowanym terenie. Podeszwa środkowa Lightstrike zmniejsza wagę buta bez szkody dla amortyzacji. Niewielkie wypustki ułatwiają przechodzenie między nawierzchnią utwardzoną, żwirową i szlakiem. Przyczepność w każdych warunkach dzięki gumie Continental™ pozwala pewnie stąpać po ziemi.', 'Buty do biegów przełajowych zapewniające płynne przejście między trasami szosowymi i terenowymi.', 'terrex-two-flow-trail-running-shoes', '', '', '', 'Terrex Two Flow Trail Running Shoes', '', '', '', ''),
(119, 1, 1, 'Zwiększaj dystans dzięki butom do biegów przełajowych adidas Terrex. Amortyzowana podeszwa środkowa i miękka amortyzacja pięty dbają o całodzienny komfort. Hybrydowa podeszwa z wypustkami ułatwia przejście z drogi na szlak. Podwyższone boki dopełniają cholewkę z siateczki o specjalnej konstrukcji, gwarantując stabilizację i pewność kroku na każdym szlaku.', 'Buty do biegów przełajowych stworzone, aby zapewniać długotrwały komfort od chodnika po szlak.', 'terrex-soulstride-trail-running-shoes', '', '', '', 'Terrex Soulstride Trail Running Shoes', '', '', '', ''),
(120, 1, 1, 'Maraton Bostoński to wyścig. Ale jest to również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 11 powstały z myślą o biegach na średnich i długich dystansach. Dynamiczna technologia ENERGYRODS, która ogranicza utratę energii pod stopą, sprawia, że podczas każdego treningu czujesz się jak w dzień wyścigu. Są szybkie, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', 'Buty do biegów na średnich i długich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-boston-11-shoes', '', '', '', 'Adizero Boston 11 Shoes', '', '', '', ''),
(121, 1, 1, 'Maraton Bostoński to wyścig. Ale jest to również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 11 powstały z myślą o biegach na średnich i długich dystansach. Dynamiczna technologia ENERGYRODS, która ogranicza utratę energii pod stopą, sprawia, że podczas każdego treningu czujesz się jak w dzień wyścigu. Są szybkie, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', 'Buty do biegów na średnich i długich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-boston-11-shoes', '', '', '', 'Adizero Boston 11 Shoes', '', '', '', ''),
(122, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów.   Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Sportowe, wygodne buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(123, 1, 1, 'Buty do biegów przełajowych, których zaawansowana technologia pomoże Ci wejść na jeszcze wyższy poziom za sprawą solidnej ochrony i lekkiej amortyzacji.  Te wypróbowane przez sportowców buty do biegów przełajowych zapewniają komfort na każdym kroku w górach dzięki wyjątkowo wygodnej i przewiewnej cholewce z siateczki o nowej konstrukcji. Doskonałą ochronę i stabilizację gwarantuje folia powierzchniowej na całej długości. Dodatkowo podeszwa zewnętrzna Continental™ zapewnia właściwą przyczepność w każdym terenie. Ponadto buty dają lekką amortyzację dzięki nowej piance Lightstrike EVA. To model stworzony do osiągania nowych szczytów!', 'STWORZONE Z MYŚLĄ O GÓRSKICH SZLAKACH.', 'terrex-agravic-flow-2-trail-running-shoes', '', '', '', 'TERREX AGRAVIC FLOW 2 TRAIL RUNNING SHOES', '', '', '', ''),
(124, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów.   Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Sportowe, wygodne buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(125, 1, 1, 'Nie pozwól, by deszczowa pogoda stanęła Ci na drodze w czasie biegu. Te buty do biegania adidas mają konstrukcję z oddychającą membraną GORE-TEX, która zapewnia stopom suchy komfort w deszczowe dni. Podeszwa środkowa zawiera setki połączonych ze sobą kapsułek BOOST, które gwarantują niewiarygodny zwrot energii i dodają Ci mocy od startu do mety bez względu na dystans lub warunki.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-gore-tex-shoes', '', '', '', 'Ultraboost 22 GORE-TEX Shoes', '', '', '', ''),
(126, 1, 1, 'ADIZERO PRIME X STRUNG to nasze pierwsze buty biegowe adizero z cholewką STRUNG. STRUNG to tekstylna innowacja, która przetwarza dane uzyskane od sportowców w dynamiczny materiał dostosowany do ich potrzeb. Umożliwia to odwzorowanie i zaprogramowanie różnych właściwości włókna, nić po nici.   Dzięki elastycznemu i lekkiemu, bezszwowemu designowi owiniętemu wokół stopy, STRUNG optymalizuje komfort i wspiera Cię w biciu rekordów życiowych na długich dystansach. Cholewka STRUNG jest osadzona na podeszwie zewnętrznej Prime X, zawierającej włókna węglowe ENERGYRODS i trzy warstwy LIGHTSTRIKE PRO, co gwarantuje sprężysty bieg.', 'Lekkie buty do biegów długodystansowych, częściowo wykonane z materiałów pochodzących z recyklingu.', 'adizero-prime-x-strung', '', '', '', 'ADIZERO PRIME X STRUNG', '', '', '', ''),
(127, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów.   Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Sportowe, wygodne buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(128, 1, 1, 'Mokre, błotniste szlaki są częścią przygody w outdoorze, ale mokre stopy nie muszą nią być. Ciesz się suchymi stopami i poczuciem wyjątkowej lekkości, gdy przemieszczasz się z drogi na szlak i z powrotem w butach adidas do biegów przełajowych. Oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a ultralekka amortyzacja Lightstrike wspiera szybkość i zwinność na nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ ma wypustki i zapewnia pewną trakcję na mokrych i suchych nawierzchniach.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-agravic-flow-20-gore-tex-trail-running-shoes', '', '', '', 'Terrex Agravic Flow 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(129, 1, 1, 'adidas 4DFWD 2 na nowo definiuje ruch do przodu, łącząc unikalną, przełomową innowację w postaci drukowanej w 3D podeszwy środkowej z nową konstrukcją cholewki i podeszwą zewnętrzną Continental dla dodatkowej przyczepności. Na każdym kroku podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Dzięki temu bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe. Przyczepna podeszwa zewnętrzna z gumy Continental™ gwarantuje trakcję na mokrych i suchych nawierzchniach, dzięki czemu możesz biegać w każdych warunkach, a cholewka adidas PRIMEKNIT+ otula stopę nowym krojem, który zwiększa swobodę ruchu.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Innowacja, która pozwala Ci iść naprzód.', 'adidas-4dfwd-2-running-shoes', '', '', '', 'adidas 4DFWD 2 running shoes', '', '', '', ''),
(130, 1, 1, 'Buty biegowe Ultraboost zapewniają wygodę i sprężystość. Mają podeszwę środkową BOOST, która zapewnia niekończącą się energię, system Linear Energy Push oraz podeszwę zewnętrzną z gumy Continental™.', 'POWITAJ NIESAMOWITY ZWROT ENERGII WŁOŻONEJ W KAŻDY KROK.', 'ultraboost-22-shoes', '', '', '', 'Ultraboost 22 Shoes', '', '', '', ''),
(131, 1, 1, 'Pobij swój kolejny rekord życiowy w butach do biegania adidas Adizero. Przewiewna cholewka z siateczki łączy superlekką amortyzację Lightstrike z wytrzymałą Lightstrike Pro. To połączenie sprawia, że są wystarczająco szybkie, aby sprostać wyzwaniom codziennego treningu. Technologia TORSIONRODS nadaje modelowi subtelną sztywność, która zwiększa przeniesienie siły na każdym kroku. Efekt? Buty do biegania, które pomogą Ci biegać szybciej (i dłużej) niż kiedykolwiek wcześniej, a jednocześnie zapewnią świeży komfort Twoim stopom.', 'Szybkie buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-adios-7-shoes', '', '', '', 'Adizero Adios 7 Shoes', '', '', '', ''),
(132, 1, 1, 'Buty biegowe Ultraboost zapewniają wygodę i sprężystość. Mają podeszwę środkową BOOST, która zapewnia niekończącą się energię, system Linear Energy Push oraz podeszwę zewnętrzną z gumy Continental™. Cholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów.', 'POWITAJ NIESAMOWITY ZWROT ENERGII WŁOŻONEJ W KAŻDY KROK', 'ultraboost-22-shoes', '', '', '', 'Ultraboost 22 Shoes', '', '', '', ''),
(133, 1, 1, 'adidas ADIZERO SL to szybkie buty treningowe na co dzień, wyposażone w kluczowe elementy i wyróżniki designu z naszej bijącej rekordy popularności na całym świecie linii Adizero. Podeszwa środkowa ma lekką ramę Lightstrike z pianki EVA na całej długości, która zapewnia równowagę między stabilnością, wytrzymałością i amortyzacją. Została ona połączona z naszej światowej sławy pianką Lightstrike Pro i szybką, treningową cholewką z wyjątkowo miękkiej siateczki o specjalnej konstrukcji rozmieszczonej w kluczowych obszarach. Solidnie wyściełana konstrukcja pięty i języka zapewnia wygodę podczas zakładania i biegu, a design cholewki uzupełnia migający znak ADIZERO na pięcie. Całkowicie gumowa podeszwa zewnętrzna zapewnia przyczepność na każdej nawierzchni i w każdych warunkach. Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Zaprojektowane, by pomóc biegaczom osiągać coraz lepsze wyniki podczas krótkich i długich treningów biegowych.', 'adidas-adizero-sl-running-shoes', '', '', '', 'ADIDAS ADIZERO SL RUNNING SHOES', '', '', '', ''),
(134, 1, 1, 'adidas 4DFWD 2 na nowo definiuje ruch do przodu, łącząc unikalną, przełomową innowację w postaci drukowanej w 3D podeszwy środkowej z nową konstrukcją cholewki i podeszwą zewnętrzną Continental dla dodatkowej przyczepności. Na każdym kroku podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Dzięki temu bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe. Przyczepna podeszwa zewnętrzna z gumy Continental™ gwarantuje trakcję na mokrych i suchych nawierzchniach, dzięki czemu możesz biegać w każdych warunkach, a cholewka adidas PRIMEKNIT+ otula stopę nowym krojem, który zwiększa swobodę ruchu.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Innowacja, która pozwala Ci iść naprzód.', 'adidas-4dfwd-2-running-shoes', '', '', '', 'adidas 4DFWD 2 running shoes', '', '', '', ''),
(135, 1, 1, 'Maraton Bostoński to wyścig. Ale jest to również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 11 powstały z myślą o biegach na średnich i długich dystansach. Dynamiczna technologia ENERGYRODS, która ogranicza utratę energii pod stopą, sprawia, że podczas każdego treningu czujesz się jak w dzień wyścigu. Są szybkie, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', 'Buty do biegów na średnich i długich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-boston-11-shoes', '', '', '', 'Adizero Boston 11 Shoes', '', '', '', ''),
(136, 1, 1, 'Mokre, błotniste szlaki są częścią przygody w outdoorze, ale mokre stopy nie muszą nią być. Ciesz się suchymi stopami i poczuciem wyjątkowej lekkości, gdy przemieszczasz się z drogi na szlak i z powrotem w butach adidas do biegów przełajowych. Oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a ultralekka amortyzacja Lightstrike wspiera szybkość i zwinność na nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ ma wypustki i zapewnia pewną trakcję na mokrych i suchych nawierzchniach.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-agravic-flow-20-gore-tex-trail-running-shoes', '', '', '', 'Terrex Agravic Flow 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(137, 1, 1, 'Nie pozwól, by deszczowa pogoda stanęła Ci na drodze w czasie biegu. Te buty do biegania adidas mają konstrukcję z oddychającą membraną GORE-TEX, która zapewnia stopom suchy komfort w deszczowe dni. Podeszwa środkowa zawiera setki połączonych ze sobą kapsułek BOOST, które gwarantują niewiarygodny zwrot energii i dodają Ci mocy od startu do mety bez względu na dystans lub warunki.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-gore-tex-shoes', '', '', '', 'Ultraboost 22 GORE-TEX Shoes', '', '', '', ''),
(138, 1, 1, 'Niezależnie od tego, czy jest to liściasta okolica, szlak nad potokiem, czy leśny szlak na obrzeżach miasta, natura zapewnia piękno i pociechę podczas najlepszych biegów. Zrób krok w kierunku zachowania tych darów w butach do biegania, które są wykonane z naturalnych i odnawialnych zasobów. Oferują wszystkie najlepsze cechy kultowych Ultraboost, w tym sprężystą amortyzację BOOST i otulający stopę adidas PRIMEKNIT. Gwarantują dobre samopoczucie, czyniąc dobro.', 'Wygodne, sprężyste buty do biegania stworzone z myślą o naturze.', 'ultraboost-22-made-with-nature-shoes', '', '', '', 'Ultraboost 22 Made with Nature Shoes', '', '', '', ''),
(139, 1, 1, 'Nie pozwól, by deszczowa pogoda stanęła Ci na drodze w czasie biegu. Te buty do biegania adidas mają konstrukcję z oddychającą membraną GORE-TEX, która zapewnia stopom suchy komfort w deszczowe dni. Podeszwa środkowa zawiera setki połączonych ze sobą kapsułek BOOST, które gwarantują niewiarygodny zwrot energii i dodają Ci mocy od startu do mety bez względu na dystans lub warunki.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-gore-tex-shoes', '', '', '', 'Ultraboost 22 GORE-TEX Shoes', '', '', '', ''),
(140, 1, 1, 'Biegaj poza utartym szlakiem. Te buty adidas do biegów przełajowych zapewnią Ci suchy komfort i pewną trakcję na luźnych, pokrytych kamieniami i mokrych szlakach. Oddychająca membrana GORE-TEX nie przepuszcza wody, zapewniając długotrwały komfort w mokrych warunkach. Mocne nakładki w strefach narażonych na zniszczenie sprawdzą się w każdym terenie, a lekka amortyzacja wspiera stopy. Głęboko żłobiona podeszwa zewnętrzna TRAXION maksymalizuje przyczepność we wszystkich kierunkach, dając Ci pewność na każdym kroku poza szlakiem.', 'Wodoodporne buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'tracerocker-20-gore-tex-trail-running-shoes', '', '', '', 'Tracerocker 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(141, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(142, 1, 1, 'Zasznuruj je i ruszaj poza utarty szlak. Buty trailowe adidas Terrex powstały z myślą o wygodzie i trwałości w wymagającym terenie. Amortyzacja Lightstrike i płytka chroniąca przed kamieniami pomogą Ci pewnie poruszać się po nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ zapewnia wyjątkową przyczepność na korzeniach, kamieniach i ziemi oraz na mokrych i suchych nawierzchniach. Syntetyczne nakładki zwiększają trwałość, a klinowa konstrukcja języka zapobiega wpadaniu drobnych kamyków do buta, dzięki czemu możesz sprawnie przemierzać każdy teren.', 'Lekkie buty trailowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-trailrider-trail-running-shoes', '', '', '', 'Terrex Trailrider Trail Running Shoes', '', '', '', ''),
(143, 1, 1, 'Od drzwi na szlak i z powrotem, buty do biegów przełajowych adidas Terrex pozwolą Ci zdobywać nowe terytoria. Cholewka z siateczki przylega do stopy, zapewniając jej miękkie, elastyczne dopasowanie, które wspiera i oddycha tam, gdzie jest to najbardziej potrzebne. Miękka niczym poduszka amortyzacja z lekkiej pianki EVA oznacza wygodę w ruchu przez cały dzień. Przyczepna we wszystkich kierunkach podeszwa zewnętrzna Traxion pozwala Ci pewnie poruszać się po mieście, na szlaku i wszędzie tam, gdzie chcesz.', 'Wygodne buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-soulstride-trail-running-shoes', '', '', '', 'Terrex Soulstride Trail Running Shoes', '', '', '', ''),
(144, 1, 1, 'Poczuj płynność biegu w butach do biegania Ultra 4DFWD. Łączą cholewkę naszych kultowych butów Ultraboost z podeszwą środkową adidas 4DFWD z nadrukiem 3D, która została udoskonalona tak, aby kompresja do przodu zmniejszała siłę hamowania i przekształcała energię uderzenia w ruch naprzód. Gwarantuje to płynne przetoczenie stopy i wyjątkowe wrażenia niczym podczas szybowania. Cholewka adidas PRIMEKNIT otula stopę, zapewniając jej dynamiczne wsparcie w strategicznych obszarach, a podeszwa zewnętrzna z gumy Continental™ zwiększa przyczepność w każdych warunkach pogodowych.  Cholewka tych butów została wykonana z wysokiej jakości przędzy, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', 'Wspierające, progresywne buty do biegania wykonane częściowo z Parley Ocean Plastic.', 'ultra-4dfwd-shoes', '', '', '', 'Ultra 4DFWD Shoes', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(145, 1, 1, 'Chcesz podkręcić swój trening? Te buty adidas pomogą Ci zrobić kolejny krok w biegowej podróży. Lekka amortyzacja Bounce zapewnia komfort i elastyczność, dodając Ci energii, gdy pokonujesz kolejne kilometry w codziennym biegu. Trwała, gumowa podeszwa zewnętrzna dba o przyczepność na różnych nawierzchniach, która przekłada się na pewny bieg.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultrabounce-shoes', '', '', '', 'Ultrabounce Shoes', '', '', '', ''),
(146, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(147, 1, 1, 'adidas 4DFWD 2 na nowo definiuje ruch do przodu, łącząc unikalną, przełomową innowację w postaci drukowanej w 3D podeszwy środkowej z nową konstrukcją cholewki i podeszwą zewnętrzną Continental dla dodatkowej przyczepności. Na każdym kroku podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Dzięki temu bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe. Przyczepna podeszwa zewnętrzna z gumy Continental™ gwarantuje trakcję na mokrych i suchych nawierzchniach, dzięki czemu możesz biegać w każdych warunkach, a cholewka adidas PRIMEKNIT+ otula stopę nowym krojem, który zwiększa swobodę ruchu.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Innowacja, która pozwala Ci iść naprzód.', 'adidas-4dfwd-2-running-shoes', '', '', '', 'adidas 4DFWD 2 running shoes', '', '', '', ''),
(148, 1, 1, 'Nie potrzebujesz zbyt wiele, aby biegać. Przekąska, playlista i buty do biegania adidas pozwolą Ci pokonać kolejne kilometry. Amortyzowane i sprężyste buty Pureboost to wyjątkowo wygodny model treningowy do krótkich, codziennych treningów biegowych. adidas BOOST zapewnia niewiarygodny zwrot energii na każdym kroku, a gumowa podeszwa zewnętrzna Stretchweb wygina się pod stopą, dodając energii Twoim krokom.', 'Buty do biegania na krótkich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'pureboost-22-shoes', '', '', '', 'Pureboost 22 Shoes', '', '', '', ''),
(149, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', 'Buty do biegów długodystansowych wykonane częściowo z Parley Ocean Plastic.', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(150, 1, 1, 'Zasznuruj je i ruszaj poza utarty szlak. Buty trailowe adidas Terrex powstały z myślą o wygodzie i trwałości w wymagającym terenie. Amortyzacja Lightstrike i płytka chroniąca przed kamieniami pomogą Ci pewnie poruszać się po nierównym terenie. Podeszwa zewnętrzna z gumy Continental™ zapewnia wyjątkową przyczepność na korzeniach, kamieniach i ziemi oraz na mokrych i suchych nawierzchniach. Syntetyczne nakładki zwiększają trwałość, a klinowa konstrukcja języka zapobiega wpadaniu drobnych kamyków do buta, dzięki czemu możesz sprawnie przemierzać każdy teren.', 'Lekkie buty trailowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-trailrider-trail-running-shoes', '', '', '', 'Terrex Trailrider Trail Running Shoes', '', '', '', ''),
(151, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(152, 1, 1, 'Nie potrzebujesz zbyt wiele, aby biegać. Przekąska, playlista i buty do biegania adidas pozwolą Ci pokonać kolejne kilometry. Amortyzowane i sprężyste buty Pureboost to wyjątkowo wygodny model treningowy do krótkich, codziennych treningów biegowych. adidas BOOST zapewnia niewiarygodny zwrot energii na każdym kroku, a gumowa podeszwa zewnętrzna Stretchweb wygina się pod stopą, dodając energii Twoim krokom.', 'Buty do biegania na krótkich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'pureboost-22-shoes', '', '', '', 'Pureboost 22 Shoes', '', '', '', ''),
(153, 1, 1, 'adidas 4DFWD 2 na nowo definiuje ruch do przodu, łącząc unikalną, przełomową innowację w postaci drukowanej w 3D podeszwy środkowej z nową konstrukcją cholewki i podeszwą zewnętrzną Continental dla dodatkowej przyczepności. Na każdym kroku podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Dzięki temu bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe. Przyczepna podeszwa zewnętrzna z gumy Continental™ gwarantuje trakcję na mokrych i suchych nawierzchniach, dzięki czemu możesz biegać w każdych warunkach, a cholewka adidas PRIMEKNIT+ otula stopę nowym krojem, który zwiększa swobodę ruchu.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Innowacja, która pozwala Ci iść naprzód.', 'adidas-4dfwd-2-running-shoes', '', '', '', 'adidas 4DFWD 2 running shoes', '', '', '', ''),
(154, 1, 1, 'Są buty, w których możesz biegać. I są też buty do biegania, w których chcesz biegać. SOLARGLIDE 6 to buty, które zakładasz codziennie, pamiętając o swoich celach, takich jak pokonywanie kolejnych kilometrów lub bicie życiowych rekordów. Wyposażono je w technologie, których potrzebujesz, aby móc biegać dalej i szybciej, w tym sprężystą amortyzację BOOST. adidas LEP 2.0 prowadzi każdy krok, dodając Ci przyspieszenia, a podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych i suchych nawierzchniach.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', 'Buty do biegania na co dzień wykonane częściowo z materiałów pochodzących z recyklingu.', 'solarglide-6-shoes', '', '', '', 'SOLARGLIDE 6 Shoes', '', '', '', ''),
(155, 1, 1, 'Chcesz podkręcić swój trening? Te buty adidas pomogą Ci zrobić kolejny krok w biegowej podróży. Lekka amortyzacja Bounce zapewnia komfort i elastyczność, dodając Ci energii, gdy pokonujesz kolejne kilometry w codziennym biegu. Trwała, gumowa podeszwa zewnętrzna dba o przyczepność na różnych nawierzchniach, która przekłada się na pewny bieg.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultrabounce-shoes', '', '', '', 'Ultrabounce Shoes', '', '', '', ''),
(156, 1, 1, 'Podejmij wyzwanie i opuść utarte ścieżki. Buty do biegania przełajowego adidas Terrex Speed Pro zapewniają poczucie lekkości i zwinności niezbędne w wymagającym terenie. Amortyzowana podeszwa środkowa Lightstrike na całej długości chroni stopy przed wstrząsami, nie ograniczając przy tym swobody ruchu. Guma Continental™ zapewnia przyczepność na mokrych i suchych nawierzchniach.', 'Buty do biegów przełajowych stworzone z myślą o zwinności i prędkości w wymagającym terenie.', 'terrex-speed-pro-trail-running-shoes', '', '', '', 'Terrex Speed Pro Trail Running Shoes', '', '', '', ''),
(157, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.  Cholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(158, 1, 1, 'Maraton Bostoński to wyścig. Ale jest to również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 11 powstały z myślą o biegach na średnich i długich dystansach. Dynamiczna technologia ENERGYRODS, która ogranicza utratę energii pod stopą, sprawia, że podczas każdego treningu czujesz się jak w dzień wyścigu. Są szybkie, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', 'Buty do biegów na średnich i długich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-boston-11-shoes', '', '', '', 'Adizero Boston 11 Shoes', '', '', '', ''),
(159, 1, 1, 'adidas 4DFWD 2 na nowo definiuje ruch do przodu, łącząc unikalną, przełomową innowację w postaci drukowanej w 3D podeszwy środkowej z nową konstrukcją cholewki i podeszwą zewnętrzną Continental dla dodatkowej przyczepności. Na każdym kroku podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Dzięki temu bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe. Przyczepna podeszwa zewnętrzna z gumy Continental™ gwarantuje trakcję na mokrych i suchych nawierzchniach, dzięki czemu możesz biegać w każdych warunkach, a cholewka adidas PRIMEKNIT+ otula stopę nowym krojem, który zwiększa swobodę ruchu.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Innowacja, która pozwala Ci iść naprzód.', 'adidas-4dfwd-2-running-shoes', '', '', '', 'adidas 4DFWD 2 running shoes', '', '', '', ''),
(160, 1, 1, 'Buty TERREX AGRAVIC ULTRA powstały w ścisłej współpracy z jedną z najszybszych zawodniczek biegów przełajowych – EKATERINĄ MITYAEVĄ. To jeden z pierwszych modeli butów do biegów przełajowych od adidas z płytką z termoplastycznego elastomeru (TPE) wykonaną w 90% z odnawialnego włókna węglowego.​  ​Płytka z bio-tworzywa TPE przebiega całą długość buta, łącząc się z podeszwą środkową oraz zewnętrzną i zapewniając lekką, trwałą ochronę przed kamieniami na długich, górskich szlakach.​ Model został stworzony z wykorzystaniem odnawialnych źródeł węgla i przy użyciu bioskładników.​  Połączenie sprężystej pianki Boost i ultralekkiej technologii Lightstrike z płytką z TPE gwarantuje wysoki zwrot energii w górskim terenie oraz doskonałą amortyzację, co pomaga utrzymać tempo na technicznych szlakach.', 'STWORZONE Z MYŚLĄ O GÓRACH', 'terrex-agravic-ultra-trail-running-shoes', '', '', '', 'Terrex Agravic Ultra Trail Running Shoes', '', '', '', ''),
(161, 1, 1, 'adidas Ultraboost zadebiutowały w 2015 roku, wyznaczając standardy wygody i wydajności butów do biegania. Każda nowa wersja podnosi poprzeczkę, a obecna nie jest wyjątkiem. Te buty biegowe powstały z myślą o bieganiu w chłodne dni i mają technologię COLD.RDY, która ogrzewa stopy. Odblaskowa, zwracająca energię podeszwa środkowa BOOST pozwoli Ci biegać od zmierzchu po świt. Podeszwa zewnętrzna z gumy Continental™ Wintergrip™ oznacza bezpieczną przyczepność na śliskich ulicach.', 'Buty do biegania w chłodne dni wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultraboost-22-coldrdy-20-shoes', '', '', '', 'Ultraboost 22 COLD.RDY 2.0 Shoes', '', '', '', ''),
(162, 1, 1, 'Od Twojego pierwszego biegu po linię mety na dystansie 10 km buty Solarboost 4 zapewniają sprężystość kilometr po kilometrze i dzień po dniu. Te buty do biegania adidas mają piankę BOOST na całej długości i specjalny panel, który wspiera stopę na każdym kroku. System Linear Energy Push zapewni Ci płynny, szybki bieg od rozpoczęcia treningu po dzień wyścigu.', 'Wytrzymałe buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'solarboost-4-shoes', '', '', '', 'Solarboost 4 Shoes', '', '', '', ''),
(163, 1, 1, 'Buty do biegów przełajowych, których zaawansowana technologia pomoże Ci wejść na jeszcze wyższy poziom za sprawą solidnej ochrony i lekkiej amortyzacji.  Te wypróbowane przez sportowców buty do biegów przełajowych zapewniają komfort na każdym kroku w górach dzięki wyjątkowo wygodnej i przewiewnej cholewce z siateczki o nowej konstrukcji. Doskonałą ochronę i stabilizację gwarantuje folia powierzchniowej na całej długości. Dodatkowo podeszwa zewnętrzna Continental™ zapewnia właściwą przyczepność w każdym terenie. Ponadto buty dają lekką amortyzację dzięki nowej piance Lightstrike EVA. To model stworzony do osiągania nowych szczytów!', 'STWORZONE Z MYŚLĄ O GÓRSKICH SZLAKACH.', 'terrex-agravic-flow-2-trail-running-shoes', '', '', '', 'TERREX AGRAVIC FLOW 2 TRAIL RUNNING SHOES', '', '', '', ''),
