(168, 1, 1, 'Znajdź swój rytm na miejskich chodnikach lub szlakach.  Buty adidas Terrex do biegów przełajowych mają prostą, głęboko żłobioną podeszwę zewnętrzną, która ułatwia płynne przechodzenie między utwardzonymi, żwirowymi i gruntowymi nawierzchniami. Cholewka wykonana z lekkiej, oddychającej siateczki zapewnia dynamiczne wsparcie, pozwalając stopie na swobodę ruchów i elastyczność w zróżnicowanym terenie. Podeszwa środkowa adidas Lightstrike zmniejsza wagę buta, jednocześnie zwiększając komfort. Guma Continental™ zapewnia przyczepność w każdych warunkach, więc możesz pewnie poruszać się po każdej nawierzchni, mokrej czy suchej.', 'Lekkie buty do biegów przełajowych wykonane częściowo z materiałów pochodzących z recyklingu.', 'terrex-two-flow-trail-running-shoes', '', '', '', 'Terrex Two Flow Trail Running Shoes', '', '', '', ''),
(169, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', 'Buty do biegów długodystansowych wykonane częściowo z Parley Ocean Plastic.', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(170, 1, 1, 'Załóż te buty do biegania adidas i spraw, aby droga do pierwszego wyścigu była nieco płynniejsza. Zostały stworzone z myślą o komforcie podczas treningu i mają w podeszwie środkowej sprężystą piankę BOOST, która dodaje energii każdemu krokowi. Sprężysta amortyzacja Bounce w przedniej części stopy ułatwia ruch do przodu, gdy dążysz do osiągnięcia swoich celów.', 'Wygodne buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'supernova-20-shoes', '', '', '', 'Supernova 2.0 Shoes', '', '', '', ''),
(171, 1, 1, 'Załóż te buty do biegania adidas i spraw, aby droga do pierwszego wyścigu była nieco płynniejsza. Zostały stworzone z myślą o komforcie podczas treningu i mają w podeszwie środkowej sprężystą piankę BOOST, która dodaje energii każdemu krokowi. Sprężysta amortyzacja Bounce w przedniej części stopy ułatwia ruch do przodu, gdy dążysz do osiągnięcia swoich celów.', 'Wygodne buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'supernova-20-shoes', '', '', '', 'Supernova 2.0 Shoes', '', '', '', ''),
(172, 1, 1, 'Buty biegowe Ultraboost zapewniają wygodę i sprężystość. Mają podeszwę środkową BOOST, która zapewnia niekończącą się energię, system Linear Energy Push oraz podeszwę zewnętrzną z gumy Continental™. Cholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów.', 'POWITAJ NIESAMOWITY ZWROT ENERGII WŁOŻONEJ W KAŻDY KROK', 'ultraboost-22-shoes', '', '', '', 'Ultraboost 22 Shoes', '', '', '', ''),
(173, 1, 1, 'Buty biegowe Ultraboost zapewniają wygodę i sprężystość. Mają podeszwę środkową BOOST, która zapewnia niekończącą się energię, system Linear Energy Push oraz podeszwę zewnętrzną z gumy Continental™. Cholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów.', 'POWITAJ NIESAMOWITY ZWROT ENERGII WŁOŻONEJ W KAŻDY KROK', 'ultraboost-22-shoes', '', '', '', 'Ultraboost 22 Shoes', '', '', '', ''),
(174, 1, 1, 'Buty do biegów przełajowych, których zaawansowana technologia pomoże Ci wejść na jeszcze wyższy poziom za sprawą solidnej ochrony i lekkiej amortyzacji.  Te wypróbowane przez sportowców buty do biegów przełajowych zapewniają komfort na każdym kroku w górach dzięki wyjątkowo wygodnej i przewiewnej cholewce z siateczki o nowej konstrukcji. Doskonałą ochronę i stabilizację gwarantuje folia powierzchniowej na całej długości. Dodatkowo podeszwa zewnętrzna Continental™ zapewnia właściwą przyczepność w każdym terenie. Ponadto buty dają lekką amortyzację dzięki nowej piance Lightstrike EVA. To model stworzony do osiągania nowych szczytów!', 'STWORZONE Z MYŚLĄ O GÓRSKICH SZLAKACH.', 'terrex-agravic-flow-2-trail-running-shoes', '', '', '', 'TERREX AGRAVIC FLOW 2 TRAIL RUNNING SHOES', '', '', '', ''),
(175, 1, 1, 'Pobij swój kolejny rekord życiowy w butach do biegania adidas Adizero. Przewiewna cholewka z siateczki łączy superlekką amortyzację Lightstrike z wytrzymałą Lightstrike Pro. To połączenie sprawia, że są wystarczająco szybkie, aby sprostać wyzwaniom codziennego treningu. Technologia TORSIONRODS nadaje modelowi subtelną sztywność, która zwiększa przeniesienie siły na każdym kroku. Efekt? Buty do biegania, które pomogą Ci biegać szybciej (i dłużej) niż kiedykolwiek wcześniej, a jednocześnie zapewnią świeży komfort Twoim stopom.', 'Szybkie buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-adios-7-shoes', '', '', '', 'Adizero Adios 7 Shoes', '', '', '', ''),
(176, 1, 1, 'Wybierz buty stworzone, aby zapewnić Ci komfort, gdy poruszasz się szybko po długich szlakach. Siateczkowa cholewka z przędzą wykonaną z plastiku pochodzącego z recyklingu otula Twoją stopę przy pomocy lekkiej, wspierającej konstrukcji. Podeszwa zewnętrzna z wypustkami zapewnia bezpieczną trakcję, a wzmocniona podeszwa środkowa amortyzuje każdy krok, pomagając Ci biec jeszcze dłużej.', 'Buty do biegów przełajowych z dopasowaną niczym skarpetka cholewką.', 'terrex-two-ultra-primeblue-trail-running-shoes', '', '', '', 'Terrex Two Ultra Primeblue Trail Running Shoes', '', '', '', ''),
(177, 1, 1, 'adidas 4DFWD to buty do biegania, które poniosą Cię naprzód. Z każdym krokiem drukowana w 3D podeszwa środkowa 4D kieruje energię uderzenia do przodu. Efekt? Bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe.  Ucz i działaj. Odwiedź stronę Parley for the Oceans, aby dowiedzieć się więcej. Zarejestruj się na adidas.com/parley i zacznij działać.', 'Buty do biegania wykonane częściowo z Parley Ocean Plastic.', 'adidas-4dfwd-x-parley-shoes', '', '', '', 'adidas 4DFWD x Parley Shoes', '', '', '', ''),
(178, 1, 1, 'Wybierz buty do biegania stworzone, aby pomóc Ci iść naprzód, niezależnie od tego, czy dopiero zaczynasz biegać, czy masz już za sobą tyle wyścigów, że już ich nawet nie liczysz. The lattice design of the 3D-printed 4D midsole compresses with each step, reducing braking forces and transforming the impact energy into forward motion. Efekt? Smooth transitions and a unique gliding experience. Cholewka adidas PRIMEKNIT otula stopę elastycznym krojem, który zwiększa swobodę ruchu.', 'Starannie przemyślane buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'adidas-4d-fwd-shoes', '', '', '', 'adidas 4D FWD Shoes', '', '', '', ''),
(179, 1, 1, 'Chcesz podkręcić swój trening? Te buty adidas pomogą Ci zrobić kolejny krok w biegowej podróży. Lekka amortyzacja Bounce zapewnia komfort i elastyczność, dodając Ci energii, gdy pokonujesz kolejne kilometry w codziennym biegu. Trwała, gumowa podeszwa zewnętrzna dba o przyczepność na różnych nawierzchniach, która przekłada się na pewny bieg.', 'Buty do biegania z amortyzacją wykonane częściowo z materiałów pochodzących z recyklingu.', 'ultrabounce-shoes', '', '', '', 'Ultrabounce Shoes', '', '', '', ''),
(180, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', 'Buty do biegów długodystansowych wykonane częściowo z Parley Ocean Plastic.', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(181, 1, 1, 'Buty do biegów przełajowych, których zaawansowana technologia pomoże Ci wejść na jeszcze wyższy poziom za sprawą solidnej ochrony i lekkiej amortyzacji.  Te wypróbowane przez sportowców buty do biegów przełajowych zapewniają komfort na każdym kroku w górach dzięki wyjątkowo wygodnej i przewiewnej cholewce z siateczki o nowej konstrukcji. Doskonałą ochronę i stabilizację gwarantuje folia powierzchniowej na całej długości. Dodatkowo podeszwa zewnętrzna Continental™ zapewnia właściwą przyczepność w każdym terenie. Ponadto buty dają lekką amortyzację dzięki nowej piance Lightstrike EVA. To model stworzony do osiągania nowych szczytów!', 'STWORZONE Z MYŚLĄ O GÓRSKICH SZLAKACH.', 'terrex-agravic-flow-2-trail-running-shoes', '', '', '', 'TERREX AGRAVIC FLOW 2 TRAIL RUNNING SHOES', '', '', '', ''),
(182, 1, 1, 'Nie potrzebujesz zbyt wiele, aby biegać. Przekąska, playlista i buty do biegania adidas pozwolą Ci pokonać kolejne kilometry. Amortyzowane i sprężyste buty Pureboost to wyjątkowo wygodny model treningowy do krótkich, codziennych treningów biegowych. adidas BOOST zapewnia niewiarygodny zwrot energii na każdym kroku, a gumowa podeszwa zewnętrzna Stretchweb wygina się pod stopą, dodając energii Twoim krokom.', 'Buty do biegania na krótkich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'pureboost-22-shoes', '', '', '', 'Pureboost 22 Shoes', '', '', '', ''),
(183, 1, 1, 'Dzień wyścigu to odpowiednia pora, aby pokazać, co oznacza szybkość. Podkręć tempo w tych butach do biegania adidas stworzonych z myślą o biegach ulicznych na dystansie 5 kilometrów i półmaratonach. Amortyzacja Lightstrike Pro dodaje energii Twoim krokom, a ENERGYRODS zapewniają sztywność przy dynamicznych wybiciach z palców. Cholewka jest niemal jak druga skóra ― dzięki czemu nic Cię nie zatrzyma.   Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pełne energii buty do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-takumi-sen-8-shoes', '', '', '', 'Adizero Takumi Sen 8 Shoes', '', '', '', ''),
(184, 1, 1, 'Maraton Bostoński to wyścig. Ale jest to również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 11 powstały z myślą o biegach na średnich i długich dystansach. Dynamiczna technologia ENERGYRODS, która ogranicza utratę energii pod stopą, sprawia, że podczas każdego treningu czujesz się jak w dzień wyścigu. Są szybkie, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', 'Buty do biegów na średnich i długich dystansach wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-boston-11-shoes', '', '', '', 'Adizero Boston 11 Shoes', '', '', '', ''),
(185, 1, 1, 'Nie robisz sobie przerwy od biegania, gdy nadejdzie deszcz i chłód. Przygotuj się na zimę w tych butach adidas. Cholewka GORE-TEX i wewnętrzna skarpetka nie przepuszczają wody, dbając, aby Twoje stopy pozostały suche, a ochronna osłona nad sznurowadłami zapewnia dodatkowe okrycie. Setki kapsułek BOOST pod stopą gwarantują niewiarygodny zwrot energii, dzięki czemu będziesz czuć się świeżo niezależnie od długości trasy. Gumowa podeszwa zewnętrzna Continental™ z wypustkami zapewnia przyczepność na śliskich nawierzchniach i gwarantuje pewny krok niezależnie od warunków.', 'Buty do biegania w deszczu wykonane częściowo z materiałów pochodzących z recyklingu.', 'solar-glide-5-gore-tex-shoes', '', '', '', 'Solar Glide 5 GORE-TEX Shoes', '', '', '', ''),
(186, 1, 1, 'adidas i Allbirds łączą siły, aby pokazać mocne strony obu marek. Ciesz się wydajnością butów do biegania adidas i doświadczeniem Allbirds w dziedzinie materiałów naturalnych. Celem wszystkich procesów projektowania i produkcji było ograniczenie do minimum emisji CO2. Podeszwa środkowa na bazie materiałów biologicznych i tekstylna cholewka wspólnie tworzą lekką konstrukcję gwarantującą swobodny krok.   W ramach naszego dążenia do ograniczenia wykorzystania surowców ten produkt został w co najmniej 25% wykonany z materiałów pochodzących z recyklingu i poddany barwieniu w sposób jak najmniej szkodliwy dla środowiska.', 'Buty do biegania Allbirds x adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'adizero-x-allbirds-294-kg-co2e', '', '', '', 'ADIZERO X ALLBIRDS 2.94 KG CO2E', '', '', '', ''),
(187, 1, 1, 'adidas 4DFWD to buty do biegania, które poniosą Cię naprzód. Z każdym krokiem drukowana w 3D podeszwa środkowa 4D kieruje energię uderzenia do przodu. Efekt? Bieg zyskuje na płynności, a zetknięcie stopy z nawierzchnią staje się bardziej komfortowe.  Ucz i działaj. Odwiedź stronę Parley for the Oceans, aby dowiedzieć się więcej. Zarejestruj się na adidas.com/parley i zacznij działać.', 'Buty do biegania wykonane częściowo z Parley Ocean Plastic.', 'adidas-4dfwd-x-parley-shoes', '', '', '', 'adidas 4DFWD x Parley Shoes', '', '', '', ''),
(188, 1, 1, 'Półtorakilometrowa przebieżka lub dwugodzinny bieg. Bez względu na to, jak długi dystans pokonujesz lub jak intensywny jest Twój trening, buty Supernova+ pomogą Ci osiągnąć wyznaczone cele. Podobnie jak modele Supernova, te buty adidas są osadzone na podeszwie, łączącej amortyzacje BOOST i Bounce. Ale znak plus w nazwie wskazuje, że jest kilka ulepszeń; dodatkowa amortyzacja BOOST w przedniej części buta, odblaskowe wykończenie 3 pasków i pięty.', 'Buty do codziennego treningu wykonane częściowo z Parley Ocean Plastic.', 'supernova-shoes', '', '', '', 'Supernova+ Shoes', '', '', '', ''),
(189, 1, 1, 'Jeśli uwielbiasz bieganie, nie możesz się doczekać na codzienny trening. Pokonuj kolejne kilometry, ciesząc się wyjątkowym komfortem dzięki tym butom adidas. Oddychająca cholewka zapewnia stopom poczucie chłodu i świeżości w ciepłe dni. Lekka amortyzacja sprawia, że każdy krok jest bardziej przyjemny.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', 'Buty do codziennego biegania.', 'eq21-run-shoes', '', '', '', 'EQ21 Run Shoes', '', '', '', ''),
(190, 1, 1, 'Wybierz buty stworzone, aby zapewnić Ci komfort, gdy poruszasz się szybko po długich szlakach. Siateczkowa cholewka z przędzą wykonaną z plastiku pochodzącego z recyklingu otula Twoją stopę przy pomocy lekkiej, wspierającej konstrukcji. Podeszwa zewnętrzna z wypustkami zapewnia bezpieczną trakcję, a wzmocniona podeszwa środkowa amortyzuje każdy krok, pomagając Ci biec jeszcze dłużej.', 'Buty do biegów przełajowych z dopasowaną niczym skarpetka cholewką.', 'terrex-two-ultra-primeblue-trail-running-shoes', '', '', '', 'Terrex Two Ultra Primeblue Trail Running Shoes', '', '', '', ''),
(191, 1, 1, 'Lekkie i wygodne buty Terrex Speed Ultra zostały wyposażone w innowacyjne technologie, które zapewniają sportowcom przewagę. Tom Evans przez dwa lata testował różne wersje butów i pomógł nam zaprojektować ten model. Potem wypróbował je w boju i wygrał w nich bieg Tarawera. Myśli, że to magia, ale to tylko umiejętności w połączeniu z nauką.   Te buty łączą wiele innowacji, które wspierają Cię w drodze do celu. Wzór podeszwy zewnętrznej inspirowany kolarstwem przełajowym gwarantuje doskonałą przyczepność. Podeszwa środkowa wykonana z dwóch rodzajów lekkich materiałów amortyzuje i oddaje energię, nie ograniczając stabilności. Wyściełany język i wstawki przy pięcie dbają o wygodę, a cholewka jest lekka, przewiewna i gotowa, aby odprowadzać wodę.', 'Design stworzony wspólnie ze sportowcem. Zwycięzca na szlaku.', 'terrex-speed-ultra-trail-running-shoes', '', '', '', 'Terrex Speed Ultra Trail Running Shoes', '', '', '', ''),
(192, 1, 1, 'Buty TERREX AGRAVIC ULTRA powstały w ścisłej współpracy z jedną z najszybszych zawodniczek biegów przełajowych – EKATERINĄ MITYAEVĄ. To jeden z pierwszych modeli butów do biegów przełajowych od adidas z płytką z termoplastycznego elastomeru (TPE) wykonaną w 90% z odnawialnego włókna węglowego.​  ​Płytka z bio-tworzywa TPE przebiega całą długość buta, łącząc się z podeszwą środkową oraz zewnętrzną i zapewniając lekką, trwałą ochronę przed kamieniami na długich, górskich szlakach.​ Model został stworzony z wykorzystaniem odnawialnych źródeł węgla i przy użyciu bioskładników.​  Połączenie sprężystej pianki Boost i ultralekkiej technologii Lightstrike z płytką z TPE gwarantuje wysoki zwrot energii w górskim terenie oraz doskonałą amortyzację, co pomaga utrzymać tempo na technicznych szlakach.', 'STWORZONE Z MYŚLĄ O GÓRACH', 'terrex-agravic-ultra-trail-running-shoes', '', '', '', 'Terrex Agravic Ultra Trail Running Shoes', '', '', '', ''),
(193, 1, 1, 'SAMBA CLASSIC', 'SAMBA CLASSIC', 'samba-classic', '', '', '', 'SAMBA CLASSIC', '', '', '', ''),
(194, 1, 1, 'Postaw na legendę pięknej gry. Przednia część butów adidas inspirowanych kultowym modelem została uszyta z miękkiej, dopasowującej się do stopy skóry krowiej i ma klasyczne przeszycia Copa Mundial, które pomogą Ci utrzymać piłkę przy nodze w stylu dobrze znanym z przeszłości. Wygodna wyściółka i język z syntetycznego zamszu gwarantują komfort od palców aż po krawędź kołnierza. Lekka podeszwa zewnętrzna ułatwia pewną grę na naturalnej nawierzchni.', 'Skórzane buty na miarę nowej ery piłkarskiej.', 'buty-copa-mindial1-fg', '', '', '', 'Buty Copa Mindial.1 FG', '', '', '', ''),
(195, 1, 1, 'Czas i przestrzeń. Wszystko jest względne, gdy grasz w innym wymiarze. Wkrocz do świata wielowymiarowej prędkości w adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki niskoprofilowej podeszwie środkowej Lightstrike i podeszwie zewnętrznej z wypustkami do gry na murawie. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, węglowa blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.', 'Lekkie buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-tf', '', '', '', 'Buty X Speedportal.1 TF', '', '', '', ''),
(196, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki elastycznej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na naturalnej nawierzchni. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-fg', '', '', '', 'Buty X Speedportal.1 FG', '', '', '', ''),
(197, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Opanuj piłkę w tych dopasowujących się do stopy butach piłkarskich adidas.', 'buty-predator-edge1-fg', '', '', '', 'Buty Predator Edge.1 FG', '', '', '', ''),
(198, 1, 1, 'Kiedy wychodzisz na boisko, robisz to nie tylko po to, aby grać. Poczuj ten klimat. Złap lepszy kontakt z piłką w butach adidas Copa Sense do gry na naturalnej nawierzchni. Miękka, bezszwowa przednia część stopy z luksusowej skóry i piankowa konstrukcja Touchpods łączą się, umożliwiając miękki i precyzyjny kontakt z piłką. W pięcie Sensepods wypełniają luki, gwarantując idealne dopasowanie, dzięki któremu poczujesz, że znalazłeś idealne buty dla siebie.', 'Wejdź do pięknej gry w butach stworzonych, aby zapewnić Ci doskonały kontakt z piłką.', 'buty-copa-sense1-fg', '', '', '', 'Buty Copa Sense.1 FG', '', '', '', ''),
(199, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na różnych nawierzchniach. Przyczepny nadruk Control Zone na powlekanej, tekstylnej cholewce pomoże Ci przy każdym kontakcie z piłką. Dopasowujący się do stopy kołnierz i nachylona podeszwa zewnętrzna z TPU gwarantują stabilizację i kontrolę na naturalnej i twardej nawierzchni oraz sztucznej trawie.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Kontroluj każde kopnięcie w butach adidas wykonanych częściowo z materiałów pochodzących z recyklingu.', 'predator-edge3-mg', '', '', '', 'Predator Edge.3 MG', '', '', '', ''),
(200, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Niesznurowana cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Zapanuj nad piłką w tych niesznurowanych butach piłkarskich adidas.', 'buty-predator-edge-fg', '', '', '', 'Buty Predator Edge+ FG', '', '', '', ''),
(201, 1, 1, 'Czas i przestrzeń. Wszystko jest względne, gdy grasz w innym wymiarze. Wkrocz do świata wielowymiarowej prędkości w butach adidas X Speedportal. Gumowa podeszwa zewnętrzna z wypustkami w tych butach piłkarskich zapewnia Ci szybkość na sztucznej murawie, a podeszwa środkowa z pianki EVA amortyzuje każdy krok. Miękka, powlekana cholewka z materiału tekstylnego ma wspierający kołnierz z dzianiny o płaskim splocie i sztywną, zewnętrzną klatkę pięty z TPU, które ułatwiają błyskawiczną grę.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty zapewniające stabilizację przy dużych prędkościach wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-tf', '', '', '', 'Buty X Speedportal.3 TF', '', '', '', ''),
(202, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Dodatkowe kołki w przedniej części stopy na lekkiej podeszwie zewnętrznej tych butów piłkarskich adidas zapewniają szybką reakcję na naturalnej nawierzchni. Miękka, powlekana cholewka tekstylna ma wspierający kołnierz z dzianiny o płaskim splocie i sztywną, zewnętrzną klatkę pięty z TPU, dzięki czemu możesz pewnie wykonywać sprinty i zwroty.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty zapewniające stabilizację przy dużych prędkościach wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-fg', '', '', '', 'Buty X Speedportal.3 FG', '', '', '', ''),
(203, 1, 1, 'Stworzone, aby zapewnić dopasowanie i kontakt z piłką na najwyższym poziomie buty Mundial kontynuują dominację na światowych boiskach. Wykonana z zamszu i skóry cholewka tych piłkarskich butów zapewnia odpowiedni poziom wygody i pełną kontrolę. Gumowa podeszwa zewnętrzna poprawia stabilizację na sztucznej murawie i twardej nawierzchni, zaś podeszwa środkowa z pianki amortyzuje każdy krok.', 'Legendarne buty na wysokim poziomie.', 'buty-mundial-team', '', '', '', 'Buty Mundial Team', '', '', '', ''),
(204, 1, 1, 'Inspirowany piłkarską arystokracją model Kaiser 5 niepodzielnie króluje na parkiecie dzięki swojej klasycznej konstrukcji wysokiej jakości. Te buty piłkarskie mają cholewkę ze skóry gruboziarnistej, która naturalnie dopasowuje się do skóry, i gwarantują pewną kontrolę nad piłką. Piankowa podeszwa środkowa amortyzuje każdy krok.  Miękki komfort Cholewka z gruboziarnistej skóry zapewnia poczucie naturalnego komfortu i pewny kontakt z piłką; miękka, syntetyczna wyściółka  Amortyzowany komfort Profilowana podeszwa środkowa z pianki EVA jest lekka i wygodna  Przyczepność na nawierzchniach halowych Niebrudząca, gumowa podeszwa zewnętrzna gwarantuje doskonałą przyczepność na wszystkich nawierzchniach halowych', 'Ikona futbolu kontynuuje swoje rządy.', 'buty-kaiser-5-goal', '', '', '', 'Buty Kaiser 5 Goal', '', '', '', ''),
(205, 1, 1, 'Inspirowany piłkarską arystokracją model Kaiser 5 niepodzielnie króluje na murawie dzięki swojej klasycznej konstrukcji wysokiej jakości. Te buty piłkarskie mają cholewkę ze skóry gruboziarnistej, która naturalnie dopasowuje się do skóry, i gwarantują pewną kontrolę nad piłką. Piankowa podeszwa środkowa amortyzuje każdy krok.  Miękki komfort Cholewka z gruboziarnistej skóry zapewnia poczucie naturalnego komfortu i pewny kontakt z piłką; miękka, syntetyczna wyściółka  Amortyzowany komfort Profilowana podeszwa środkowa z pianki EVA jest lekka i wygodna  Przyczepność na twardym podłożu Podeszwa zewnętrzna Traxion gwarantuje stabilizację na murawie i utwardzanej nawierzchni', 'Ikona futbolu kontynuuje swoje rządy.', 'buty-kaiser-5-team', '', '', '', 'Buty Kaiser 5 Team', '', '', '', ''),
(206, 1, 1, 'Model Samba został stworzony w latach 50. z myślą o treningach piłkarskich na zamarzniętej nawierzchni, ale od tamtej pory stał się niekwestionowanym klasykiem. Buty, które równie dobrze sprawdzą się na boisku co na ulicy, mają cholewkę ze skóry gruboziarnistej z zamszowymi, odpornymi na przetarcia nakładkami. Od spodu piankowa podeszwa środkowa amortyzuje każdy krok.  Trwały, wspierający design Cholewka z gruboziarnistej skóry z zamszowymi nakładkami zapewnia wsparcie   Charakterystyczne dla Samba detale Wykończenie części palców w kształcie litery T, długi język i ząbkowane 3 paski  Trakcja na płaskich nawierzchniach Niebrudząca, gumowa podeszwa zewnętrzna gwarantuje doskonałą przyczepność na wszystkich nawierzchniach halowych', 'Niekwestionowana ikona, stworzona z myślą o boiskach.', 'buty-samba-leather', '', '', '', 'Buty Samba Leather', '', '', '', ''),
(207, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach do gry na naturalnej nawierzchni. Niesznurowana cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Zapanuj nad piłką w tych niesznurowanych butach piłkarskich adidas.', 'buty-predator-edge-sg', '', '', '', 'Buty Predator Edge+ SG', '', '', '', ''),
(208, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Opanuj piłkę w tych dopasowujących się do stopy butach piłkarskich adidas.', 'buty-predator-edge1-fg', '', '', '', 'Buty Predator Edge.1 FG', '', '', '', ''),
(209, 1, 1, 'Wymykaj się oczekiwaniom. Zaskakuj stylem gry. Podawaj piłkę, kiedy wszyscy myślą, że wykonasz inny ruch. Pokaż swoje umiejętności i siłę nieprzewidywalności w butach adidas Nemeziz .3 do gry na naturalnej nawierzchni. Krój do kostki i idealne dopasowanie zapewniają wsparcie, którego potrzebujesz, aby pokazać na co naprawdę Cię stać. Miękka siateczka w przedniej części buta umożliwia lepszą kontrolę nad piłką. Przykuwająca wzrok grafika podkreśla każdy Twój ruch.', 'Elastyczne buty zapewniające niesamowitą pracę nóg na naturalnej nawierzchni.', 'buty-nemeziz-3-fg', '', '', '', 'Buty Nemeziz .3 FG', '', '', '', ''),
(210, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Dodatkowe kołki w przedniej części stopy na lekkiej podeszwie zewnętrznej tych butów piłkarskich adidas zapewniają szybką reakcję na naturalnej nawierzchni. Miękka, powlekana, tekstylna cholewka bez sznurowadeł ma wspierający kołnierz z dzianiny o płaskim splocie i sztywną, zewnętrzną klatkę pięty z TPU, dzięki czemu możesz pewnie wykonywać sprinty i zwroty.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty zapewniające stabilizację przy dużych prędkościach wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-laceless-fg', '', '', '', 'Buty X Speedportal.3 Laceless FG', '', '', '', ''),
(211, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i wygodne buty piłkarskie są przeznaczone do gry na naturalnej nawierzchni i wspomagają szybkie reakcje dzięki dodatkowym kołkom w przedniej części podeszwy zewnętrznej. Dzięki miękkiej cholewce z siateczki, dopasowującemu się kołnierzowi adidas PRIMEKNIT i blokadzie pięty z TPU wykonasz wszelkie sprinty i uniki z prędkością światła.', 'Lekkie buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-pilkarskie-x-speedportal2-fg', '', '', '', 'Buty piłkarskie X SPEEDPORTAL.2 FG', '', '', '', ''),
(212, 1, 1, 'Czas i przestrzeń. Wszystko jest względne, gdy grasz w innym wymiarze. Wkrocz do świata wielowymiarowej prędkości w butach adidas X Speedportal. Gumowa podeszwa zewnętrzna z wypustkami w tych butach piłkarskich zapewnia Ci szybkość na sztucznej murawie, a podeszwa środkowa z pianki EVA amortyzuje każdy krok. Miękka, powlekana cholewka z materiału tekstylnego ma wspierający kołnierz z dzianiny o płaskim splocie i sztywną, zewnętrzną klatkę pięty z TPU, które ułatwiają błyskawiczną grę.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty zapewniające stabilizację przy dużych prędkościach wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-laceless-tf', '', '', '', 'Buty X Speedportal.3 Laceless TF', '', '', '', '');
