(214, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki sprężystej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na naturalnej nawierzchni. Otulająca stopę cholewka adidas PRIMEKNIT bez sznurowadeł ma wstawki z pianki EVA po wewnętrznej stronie i lekką, węglową blokadę pięty po zewnętrznej stronie, która zapewnia Ci stabilizację podczas szybkiej gry.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Dynamiczne buty adidas bez sznurowadeł wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal-fg', '', '', '', 'Buty X Speedportal+ FG', '', '', '', ''),
