(216, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki sprężystej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na miękkiej nawierzchni. Otulająca stopę cholewka adidas PRIMEKNIT bez sznurowadeł ma wstawki z pianki EVA po wewnętrznej stronie i lekką, węglową blokadę pięty po zewnętrznej stronie, która zapewnia Ci stabilizację podczas szybkiej gry.', 'Dynamiczne buty adidas bez sznurowadeł wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal-sg', '', '', '', 'Buty X Speedportal+ SG', '', '', '', ''),
(217, 1, 1, 'Czas i przestrzeń. Wszystko jest względne, gdy grasz w innym wymiarze. Wkrocz do świata wielowymiarowej prędkości w butach adidas X Speedportal. Gumowa podeszwa zewnętrzna z wypustkami w tych butach piłkarskich zapewnia Ci szybkość na sztucznej murawie, a podeszwa środkowa z pianki EVA amortyzuje każdy krok. Miękka, powlekana cholewka z materiału tekstylnego ma wspierający kołnierz z dzianiny o płaskim splocie i sztywną, zewnętrzną klatkę pięty z TPU, które ułatwiają błyskawiczną grę.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty zapewniające stabilizację przy dużych prędkościach wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-laceless-tf', '', '', '', 'Buty X Speedportal.3 Laceless TF', '', '', '', ''),
(218, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki elastycznej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na naturalnej nawierzchni. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-fg', '', '', '', 'Buty X Speedportal.1 FG', '', '', '', ''),
(219, 1, 1, 'Gdy gra w klatce nabiera tempa, nic nie jest w stanie przytłumić Twojego piłkarskiego stylu. Wybierz Gamemode od adidas, a resztę zostaw swoim stopom. Te buty mają wygodny, uniwersalny krój i podeszwę zewnętrzną, która znakomicie sprawdza się na sztucznej murawie. Miękka, syntetyczna cholewka HybridTouch osadzona na amortyzowanej podeszwie środkowej z pianki EVA prezentuje żywe kolory inspirowane klockami LEGO®.', 'Stwórz swoją grę w miękkich, syntetycznych butach z kolekcji adidas x Classic LEGO®.', 'buty-gamemode-tf', '', '', '', 'Buty Gamemode TF', '', '', '', ''),
(220, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki giętkiej płytce węglowej Carbitex na całej długości podeszwy zewnętrznej przystosowanej do gry na utwardzanych nawierzchniach. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki. Śmiałe grafiki podkreślają miłość Lionela Messiego do piłki.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie buty w stylu Messiego wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal-messi1-fg', '', '', '', 'Buty X Speedportal Messi.1 FG', '', '', '', ''),
(221, 1, 1, 'Kiedy wychodzisz na boisko, robisz to nie tylko po to, aby grać. Poczuj ten klimat. Złap lepszy kontakt z piłką w butach adidas Copa Sense do gry na naturalnej nawierzchni. Kołnierz adidas PRIMEKNIT bez sznurowadeł i przednia część stopy z niezwykle miękkiej skóry zostały połączone bezszwowo przy pomocy technologii Fushionskin, aby ułatwić Ci płynną grę. Sensepods w pięcie i Touchpods po bokach optymalnie blokują stopę w bucie, gwarantując doskonały kontakt z piłką.', 'Wejdź do pięknej gry w butach bez sznurowadeł stworzonych z myślą o niezwykle płynnej grze.', 'buty-copa-sense-fg', '', '', '', 'Buty Copa Sense+ FG', '', '', '', ''),
(222, 1, 1, 'Niech Twoje buty robią całą robotę na boisku. Zachwycaj swoją piękną grą w butach adidas Gamemode, dostępnych w szerokiej gamie stylów i designów. Buty piłkarskie, zaprojektowane z myślą o wygodnym dopasowaniu do różnych kształtów stóp, oferują amortyzację dzięki miękkiej cholewce HybridTouch. Uniwersalna podeszwa zewnętrzna pomoże Ci pokazać swoje umiejętności na naturalnej nawierzchni i sztucznej trawie. Przyciągające wzrok grafiki czerpią inspirację z klocków LEGO®.', 'Stwórz swoją grę w miękkich, syntetycznych butach z kolekcji adidas x Classic LEGO®.', 'buty-gamemode-fg', '', '', '', 'Buty Gamemode FG', '', '', '', ''),
(223, 1, 1, 'Kiedy wychodzisz na boisko, robisz to nie tylko po to, aby grać. Poczuj ten klimat. Złap lepszy kontakt z piłką w butach adidas Copa Sense do gry na naturalnej nawierzchni. Miękka, bezszwowa przednia część stopy z luksusowej skóry i piankowa konstrukcja Touchpods łączą się, umożliwiając miękki i precyzyjny kontakt z piłką. W pięcie Sensepods wypełniają luki, gwarantując idealne dopasowanie, dzięki któremu poczujesz, że znalazłeś idealne buty dla siebie.', 'Wejdź do pięknej gry w butach stworzonych, aby zapewnić Ci doskonały kontakt z piłką.', 'buty-copa-sense1-fg', '', '', '', 'Buty Copa Sense.1 FG', '', '', '', ''),
(224, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki elastycznej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na naturalnej nawierzchni. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-fg', '', '', '', 'Buty X Speedportal.1 FG', '', '', '', ''),
(225, 1, 1, 'Kiedy wychodzisz na boisko, robisz to nie tylko po to, aby grać. Poczuj ten klimat. Złap lepszy kontakt z piłką w butach adidas Copa Sense do gry na miękkiej nawierzchni. Kołnierz adidas PRIMEKNIT bez sznurowadeł i przednia część stopy z niezwykle miękkiej skóry zostały połączone bezszwowo przy pomocy technologii Fushionskin, aby ułatwić Ci płynną grę. Sensepods w pięcie i Touchpods po bokach optymalnie blokują stopę w bucie, gwarantując doskonały kontakt z piłką.', 'Wejdź do pięknej gry w butach bez sznurowadeł stworzonych z myślą o niezwykle płynnej grze.', 'buty-copa-sense-sg', '', '', '', 'Buty Copa Sense+ SG', '', '', '', ''),
(226, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki elastycznej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na miękkiej nawierzchni. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-sg', '', '', '', 'Buty X Speedportal.1 SG', '', '', '', ''),
(227, 1, 1, 'Świętujemy debiut modelu, który daje w świecie piłki nożnej zdecydowaną przewagę, na najbardziej prestiżowym turnieju. Buty adidas z limitowanej kolekcji w odcieniach czerwieni, bieli i błękitu cofają czas dzięki miękkiej, skórzanej cholewce i elementom w stylu Predator 94. Nowoczesna, dzielona podeszwa zewnętrzna Predator Edge z mocnym Power Facet pozwoli Ci dominować na naturalnej nawierzchni.', 'Buty z limitowanej edycji, które upamiętniają debiut modelu Predator na największej piłkarskiej scenie.', 'buty-predator-edge-94-fg', '', '', '', 'Buty Predator Edge 94+ FG', '', '', '', ''),
(228, 1, 1, 'Buty adidas Mundial Goal są świetnym towarzyszem halowych rozgrywek piłki nożnej i futsalu. Mają doskonale dopasowaną cholewkę z gładkiej, bardzo miękkiej skóry oraz chroniącą przed ścieraniem, zamszową, warstwową wstawkę dla większej trwałości i wsparcia. Wyposażone są także w lekką, amortyzującą warstwę z pianki EVA oraz niebrudzącą, gumową podeszwę zewnętrzną.', 'Mundial Goal Shoes', 'mundial-goal-shoes', '', '', '', 'Mundial Goal Shoes', '', '', '', ''),
(229, 1, 1, 'Niektórzy wchodzą do klatki i widzą jej ograniczenia. Ale Ty dostrzegasz tylko możliwości. Bo przez całe życie robiłeś rzeczy niemożliwe. Teraz zmień oblicze gry w butach adidas Predator. Cholewka Control Zone ze strategicznie rozmieszczonymi obszarami z przyczepnym wzorem pomaga tym butom piłkarskim bez sznurowadeł kontrolować piłkę. Głęboko żłobiona podeszwa zewnętrzna ułatwia Ci kontrolę na sztucznej murawie.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Buty bez sznurowadeł zapewniające lepszą kontrolę, wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-predator-edge3-laceless-tf', '', '', '', 'Buty Predator Edge.3 Laceless TF', '', '', '', ''),
(230, 1, 1, 'Twoja pewność siebie jest niewzruszona. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w butach piłkarskich adidas Predator Mutator 20.3. Przylegająca cholewka do kostki zapewnia stabilne dopasowanie i pozwala Ci dominować na boisku. Połączenie dużej strefy uderzenia bez sznurowadeł i przyczepnych elementów wydrukowanych w 3D pomaga oddawać celne strzały.', 'Buty bez sznurowadeł zapewniające precyzję na boiskach halowych.', 'buty-predator-mutator-203-laceless-in', '', '', '', 'Buty Predator Mutator 20.3 Laceless IN', '', '', '', ''),
(231, 1, 1, 'Twoja pewność siebie pochłania przeciwników. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w tych butach piłkarskich adidas Predator Mutator 20.3. Design do kostki i otulająca stopę cholewka wspierają Cię podczas zdobywania przewagi na boisku. Trójwymiarowy, wypukły nadruk w przedniej części buta dodaje celności każdemu uderzeniu.', 'Buty do kostki zapewniające precyzję na naturalnej nawierzchni.', 'buty-predator-mutator-203-fg', '', '', '', 'Buty Predator Mutator 20.3 FG', '', '', '', ''),
(232, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki elastycznej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na miękkiej nawierzchni. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-sg', '', '', '', 'Buty X Speedportal.1 SG', '', '', '', ''),
(233, 1, 1, 'W sytuacji chaosu najlżejszy kontakt z piłką pozostawia trwałe wrażenie. Dostrój zmysły piłkarskie w butach adidas Copa. Elastyczny kołnierz tych butów stworzony z myślą o łatwym zakładaniu dopasowuje się do kształtu Twojej stopy, zapewniając Ci komfort i koncentrację. Miękka, skórzana przednia część buta dodaje pewności przy każdym kontakcie z piłką, a głęboko żłobiona podeszwa zewnętrzna doskonale sprawdza się podczas gry na sztucznej trawie.', 'Skórzane buty piłkarskie zaprojektowane z myślą o lepszym kontakcie z piłką.', 'buty-copa-sense3-tf', '', '', '', 'Buty Copa Sense.3 TF', '', '', '', ''),
(234, 1, 1, 'Twoja pewność siebie jest niewzruszona. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w tych butach piłkarskich adidas Predator Mutator 20.3. Cholewka przed kostkę otula stopę, gdy sterujesz grą na boiskach halowych. Trójwymiarowe elementy w strefie uderzenia trzymają się piłki, dbając o celność Twoich podań i strzałów.', 'Buty piłkarskie przed kostkę dające niewiarygodną precyzję na nawierzchni halowej.', 'buty-predator-mutator-203-in', '', '', '', 'Buty Predator Mutator 20.3 IN', '', '', '', ''),
(235, 1, 1, 'Inspirowany piłkarską arystokracją model Kaiser 5 niepodzielnie króluje na boisku dzięki swojej klasycznej konstrukcji wysokiej jakości. Te buty piłkarskie mają cholewkę ze skóry gruboziarnistej, która naturalnie dopasowuje się do skóry, i gwarantują pewną kontrolę nad piłką. Piankowa podeszwa wewnętrzna amortyzuje każdy krok.  Miękki komfort Cholewka z gruboziarnistej skóry zapewnia poczucie naturalnego komfortu i pewny kontakt z piłką  Amortyzowany komfort Lekka i wygodna formowana wkładka z pianki EVA  Przyczepność na miękkiej nawierzchni Podeszwa zewnętrzna z TPU z wkręcanymi kołkami zapewnia przyczepność na miękkiej i bardzo miękkiej nawierzchni naturalnej', 'Ikona futbolu kontynuuje swoje rządy.', 'buty-kaiser-5-cup', '', '', '', 'Buty Kaiser 5 Cup', '', '', '', ''),
(236, 1, 1, 'Twoja pewność siebie jest niewzruszona. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w tych butach piłkarskich adidas Predator Mutator 20.3. Cholewka do kostki przylega do stopy dając idealne dopasowanie i niezrównaną stabilizację podczas gry na sztucznej trawie.  Przyczepne, nadrukowane elementy wystają z przedniej części cholewki bez sznurowadeł, aby można było celnie wyprowadzić każde podanie i strzał.', 'Buty bez sznurowadeł do precyzyjnej gry na sztucznej murawie.', 'buty-predator-mutator-203-laceless-tf', '', '', '', 'Buty Predator Mutator 20.3 Laceless TF', '', '', '', ''),
(237, 1, 1, 'Nie potrzebujesz być ciągle w centrum uwagi. Wystarczy moment. Krótka chwila, w której gra zamieni się w wygraną. Dokonaj tego w butach piłkarskich adidas Copa 20+. Cholewka z miękkiej skóry ma rozciągliwy, tekstylny kołnierz o plecionym designie, który bezpiecznie blokuje stopę. Wypukłe prążki w przedniej części buta sprawią, że piłka będzie niczym przyklejona do stopy. Dzięki konstrukcji bez sznurowadeł strefa uderzenia jest większa, co przekłada się na większą precyzję i pewność strzałów.', 'Skórzane buty, dzięki którym spektakularnie rozpoczniesz grę na miękkiej nawierzchni.', 'buty-copa-20-sg', '', '', '', 'Buty Copa 20+ SG', '', '', '', ''),
(238, 1, 1, 'Twoja pewność siebie jest niewzruszona. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w butach piłkarskich adidas Predator Mutator 20.1. Będziesz zawsze dominować na boisku dzięki plecionej, tekstylnej cholewce, która dopasowuje się do kształtu stopy. Ostre, gumowe wypustki zapewniają niezrównaną przyczepność i dodają mocy dośrodkowaniom i rzutom wolnym. Dzielona podeszwa dominuje na miękkiej nawierzchni.', 'Buty przed kostkę do ofensywnej gry na miękkiej nawierzchni.', 'buty-predator-mutator-201-low-cut-sg', '', '', '', 'Buty Predator Mutator 20.1 Low-Cut SG', '', '', '', ''),
(239, 1, 1, 'Wymykaj się oczekiwaniom. Zaskakuj stylem gry. Podawaj piłkę, kiedy wszyscy myślą, że wykonasz inny ruch. Pokaż swoje umiejętności i siłę nieprzewidywalności w butach piłkarskich adidas Nemeziz .3. Krój do kostki i idealne dopasowanie blokują stopy, pomagając zwinnie wymknąć się rywalom. Podeszwa środkowa z pianki EVA zapewnia płynność kroków na sztucznej murawie. Charakterystyczna grafika na całej powierzchni podkreśla każdy zdecydowany ruch.', 'Elastyczne buty zapewniające niesamowitą pracę nóg na sztucznej murawie.', 'buty-nemeziz-3-tf', '', '', '', 'Buty Nemeziz .3 TF', '', '', '', ''),
(240, 1, 1, 'Widzisz to? Twoi przeciwnicy tak nie potrafią. Szybkość była wystarczająco szybka. Lecz teraz wszystkich zostawisz za sobą. Stań się niedościgły w tych piłkarskich butach adidas X Ghosted.3. Lekka cholewka z siateczki zapewnia szybkie zakładanie dzięki elastycznemu językowi. Po założeniu otula stopę, zapewniając doskonałe dopasowanie na naturalnej nawierzchni. Przednia część buta bez sznurowadeł pozwala na pewne dryblingi dzięki wyczuciu piłki.', 'Buty bez sznurowadeł zapewniające niewiarygodną szybkość na naturalnej nawierzchni.', 'buty-x-ghosted3-laceless-fg', '', '', '', 'Buty X Ghosted.3 Laceless FG', '', '', '', ''),
(241, 1, 1, 'Twoja pewność siebie jest niewzruszona. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w butach piłkarskich adidas Predator Mutator 20.3. Niski profil i otulający stopę krój cholewki pozwolą zachować kontrolę na naturalnych nawierzchniach i sztucznej trawie. Trójwymiarowy nadruk rozmieszczony w strefie uderzenia przyczepia się do piłki, zwiększając precyzję podań i strzałów.', 'Buty piłkarskie przed kostkę dające niewiarygodną precyzję na różnych nawierzchniach.', 'buty-predator-mutator-203-low-multi-ground', '', '', '', 'Buty Predator Mutator 20.3 Low Multi-Ground', '', '', '', ''),
(242, 1, 1, 'Widzisz to? Twoi przeciwnicy tak nie potrafią. Szybkość była wystarczająco szybka. Lecz teraz wszystkich zostawisz za sobą. Stań się niedościgły w tych butach piłkarskich adidas X Ghosted.3. Półprzezroczysta cholewka z siateczki zapewnia Ci kontrolę na boisku. Lekka i otulająca stopę konstrukcja stabilizuje Twoją postawę. Opływowa podeszwa zewnętrzna z gumy zwiększa szybkość reakcji na sztucznej murawie.', 'Lekkie buty stworzone z myślą o prędkości na sztucznej murawie.', 'buty-x-ghosted3-tf', '', '', '', 'Buty X Ghosted.3 TF', '', '', '', ''),
(243, 1, 1, 'Twoja pewność siebie ich onieśmiela. Twoja wizja jest jasna i czytelna. Wykorzystaj swoją przewagę i przejmij kontrolę w tych butach piłkarskich adidas Predator Mutator 20.3. Niska cholewka otula stopę, zapewniając stabilizację na sztucznej murawie. Przyczepne, wypukłe elementy w strefie uderzenia dbają o celność Twoich podań i strzałów.', 'Buty piłkarskie przed kostkę dające niewiarygodną precyzję na sztucznej nawierzchni.', 'buty-predator-mutator-203-low-cut-tf', '', '', '', 'Buty Predator Mutator 20.3 Low-Cut TF', '', '', '', ''),
(244, 1, 1, 'Zrezygnuj z przeciętności, aby odkryć swoje mocne strony. Wnieś nową jakość do swojej gry w butach piłkarskich adidas Predator do gry na murawie. Przyczepny nadruk Control Zone na powlekanej, tekstylnej cholewce bez sznurowadeł pomoże Ci przy każdym kontakcie z piłką. Dopasowujący się kołnierz i gumowa podeszwa zewnętrzna z wypustkami gwarantują stabilizację i kontrolę na sztucznej murawie.', 'Kontroluj każde kopnięcie w dopasowujących się do stopy butach piłkarskich adidas.', 'buty-predator-edge3-laceless-tf', '', '', '', 'Buty Predator Edge.3 Laceless TF', '', '', '', ''),
(245, 1, 1, 'Czas i przestrzeń. Wszystko jest względne, gdy grasz w innym wymiarze. Wkrocz do świata wielowymiarowej prędkości w butach adidas X Speedportal. Gumowa podeszwa zewnętrzna z wypustkami w tych butach piłkarskich zapewnia Ci szybkość na sztucznej murawie, a podeszwa środkowa z pianki EVA amortyzuje każdy krok. Miękka, powlekana cholewka z materiału tekstylnego ma wspierający kołnierz z dzianiny o płaskim splocie i sztywną, zewnętrzną klatkę pięty z TPU, które ułatwiają błyskawiczną grę.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Buty zapewniające stabilizację przy dużych prędkościach wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-tf', '', '', '', 'Buty X Speedportal.3 TF', '', '', '', ''),
(246, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Zgrabne i wygodne buty piłkarskie ułatwiają szybkie reakcje dzięki dodatkowym kołkom w przedniej części podeszwy zewnętrznej dostosowanej do gry na różnych nawierzchniach. Dzięki miękkiej cholewce z siateczki, dopasowującemu się kołnierzowi adidas PRIMEKNIT i blokadzie pięty z TPU wykonasz wszelkie sprinty i uniki z prędkością światła.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie buty wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal3-mg', '', '', '', 'Buty X Speedportal.3 MG', '', '', '', ''),
(247, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Przyczepny nadruk Control Zone na powlekanej, tekstylnej cholewce pomoże Ci przy każdym kontakcie z piłką. Przyciągająca wzrok, nachylona podeszwa zewnętrzna z TPU daje kontrolę na suchej, naturalnej trawie.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Kontroluj każde kopnięcie w butach adidas wykonanych częściowo z materiałów pochodzących z recyklingu.', 'buty-predator-edge3-fg', '', '', '', 'Buty Predator Edge.3 FG', '', '', '', ''),
(248, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki sprężystej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na sztucznej trawie. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-ag', '', '', '', 'Buty X Speedportal.1 AG', '', '', '', ''),
(249, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki elastycznej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na naturalnej nawierzchni. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-fg', '', '', '', 'Buty X Speedportal.1 FG', '', '', '', ''),
(250, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Przyciągająca wzrok podeszwa zewnętrzna z TPU daje Ci przewagę. Elastyczny kołnierz pewnie blokuje stopę.', 'Przejmij kontrolę nad piłką w butach adidas wykonanych częściowo z materiałów pochodzących z recyklingu.', 'buty-predator-edge2-fg', '', '', '', 'Buty Predator Edge.2 FG', '', '', '', ''),
(251, 1, 1, 'Niech Twoje buty robią całą robotę na boisku. Zachwycaj swoją piękną grą w butach adidas Gamemode, dostępnych w szerokiej gamie stylów i designów. Buty piłkarskie, zaprojektowane z myślą o wygodnym dopasowaniu do różnych kształtów stóp, oferują amortyzację dzięki miękkiej cholewce HybridTouch. Uniwersalna podeszwa zewnętrzna pomoże Ci pokazać swoje umiejętności na naturalnej nawierzchni i sztucznej trawie. Przyciągające wzrok grafiki czerpią inspirację z klocków LEGO®.', 'Stwórz swoją grę w miękkich, syntetycznych butach z kolekcji adidas x Classic LEGO®.', 'buty-gamemode-fg', '', '', '', 'Buty Gamemode FG', '', '', '', ''),
(252, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Niskoprofilowa cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Zapanuj nad piłką w tych niskich butach piłkarskich adidas.', 'buty-predator-edge1-low-fg', '', '', '', 'Buty Predator Edge.1 Low FG', '', '', '', ''),
(253, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki sprężystej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na sztucznej trawie. Część otulającej stopę cholewki Speedskin, dopasowujący się kołnierz adidas PRIMEKNIT i lekka, wykonana z domieszką węgla blokada pięty sprawiają, że możesz biec z prędkością światła, łamiąc wszystkie prawa fizyki.', 'Lekkie, dynamiczne buty adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal1-ag', '', '', '', 'Buty X Speedportal.1 AG', '', '', '', ''),
(254, 1, 1, 'Kiedy wychodzisz na boisko, robisz to nie tylko po to, aby grać. Poczuj ten klimat. Złap lepszy kontakt z piłką w butach adidas Copa Sense do gry na naturalnej nawierzchni. Kołnierz adidas PRIMEKNIT bez sznurowadeł i przednia część stopy z niezwykle miękkiej skóry zostały połączone bezszwowo przy pomocy technologii Fushionskin, aby ułatwić Ci płynną grę. Sensepods w pięcie i Touchpods po bokach optymalnie blokują stopę w bucie, gwarantując doskonały kontakt z piłką.', 'Wejdź do pięknej gry w butach bez sznurowadeł stworzonych z myślą o niezwykle płynnej grze.', 'buty-copa-sense-fg', '', '', '', 'Buty Copa Sense+ FG', '', '', '', ''),
(255, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Niskoprofilowa cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Zapanuj nad piłką w tych niskich butach piłkarskich adidas.', 'buty-predator-edge1-low-fg', '', '', '', 'Buty Predator Edge.1 Low FG', '', '', '', ''),
(256, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy samie je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki sprężystej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na naturalnej nawierzchni. Otulająca stopę cholewka adidas PRIMEKNIT bez sznurowadeł ma wstawki z pianki EVA po wewnętrznej stronie i lekką, węglową blokadę pięty po zewnętrznej stronie, która zapewnia Ci stabilizację podczas szybkiej gry.  Cholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Dynamiczne buty adidas bez sznurowadeł wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal-fg', '', '', '', 'Buty X Speedportal+ FG', '', '', '', ''),
(257, 1, 1, 'Kiedy wychodzisz na boisko, robisz to nie tylko po to, aby grać. Poczuj ten klimat. Złap lepszy kontakt z piłką w butach adidas Copa Sense do gry na miękkiej nawierzchni. Miękka, bezszwowa przednia część stopy z luksusowej skóry i piankowa konstrukcja Touchpods łączą się, umożliwiając miękki i precyzyjny kontakt z piłką. W pięcie Sensepods wypełniają luki, gwarantując idealne dopasowanie, dzięki któremu poczujesz, że znalazłeś idealne buty dla siebie. Przyciągająca wzrok grafika czerpie inspirację z największej piłkarskiej sceny.', 'Wejdź do pięknej gry w butach stworzonych, aby zapewnić Ci doskonały kontakt z piłką.', 'buty-copa-sense1-sg', '', '', '', 'Buty Copa Sense.1 SG', '', '', '', ''),
(258, 1, 1, 'Unik. Kontrola. Moc. adidas Predator ma wszystko, czego potrzebujesz. Ruszaj na boisko, aby wykorzystać swoją przewagę w butach piłkarskich do gry na naturalnej nawierzchni. Cholewka Zone Skin ma oddzielne, ściągaczowe sekcje, z których każda ułatwia inny rodzaj kontaktu z piłką. Pod spodem Power Facet przenosi ciężar ciała na przednią część buta, ułatwiając Ci mocne wykopy. Dopasowujący się do ciała kołnierz adidas PRIMEKNIT blokuje stopę, zapewniając Ci kontrolę.', 'Opanuj piłkę w tych dopasowujących się do stopy butach piłkarskich adidas.', 'buty-predator-edge1-sg', '', '', '', 'Buty Predator Edge.1 SG', '', '', '', ''),
(259, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Gładkie i superwygodne buty piłkarskie wspierają błyskawiczne reakcje dzięki sprężystej płytce Carbitex z włókna węglowego na całej długości podeszwy zewnętrznej przystosowanej do gry na sztucznej trawie. Otulająca stopę cholewka adidas PRIMEKNIT bez sznurowadeł ma wstawki z pianki EVA po wewnętrznej stronie i lekką, węglową blokadę pięty po zewnętrznej stronie, która zapewnia Ci stabilizację podczas szybkiej gry.', 'Dynamiczne buty adidas bez sznurowadeł wykonane częściowo z materiałów pochodzących z recyklingu.', 'buty-x-speedportal-ag', '', '', '', 'Buty X Speedportal+ AG', '', '', '', ''),
(260, 1, 1, 'Nie musisz niepotrzebnie komplikować sobie życia, bo ta koszulka adidas zapewni Ci wygodę. Wyglądaj świetnie dzięki dyskretnemu lookowi, który jednak nie jest całkiem minimalistyczny. Wyjątkowo miękka, bawełniana konstrukcja zapewnia wygodę na najwyższym poziomie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Dopasowana, bawełniana koszulka z kultowymi 3 paskami.', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(261, 1, 1, 'Nie musisz niepotrzebnie komplikować sobie życia, bo ta koszulka adidas zapewni Ci wygodę. Wyglądaj świetnie dzięki dyskretnemu lookowi, który jednak nie jest całkiem minimalistyczny. Wyjątkowo miękka, bawełniana konstrukcja zapewnia wygodę na najwyższym poziomie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Dopasowana, bawełniana koszulka z kultowymi 3 paskami.', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(262, 1, 1, 'Archiwalne linie kroju podkreślone lamówką nadają tej koszulce adidas swobodny, modny styl retro. Od relaksu w domu po spotkanie przy jedzeniu z przyjaciółmi miękka bawełna zapewni Ci komfort przez cały dzień. Logo Trefoil nadaje modelowi status must-have, który trudno nazwać zwyczajnym.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna koszulka inspirowana archiwalnymi modelami.', 'adicolor-seasonal-archive-tee', '', '', '', 'Adicolor Seasonal Archive Tee', '', '', '', ''),
(263, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Miękka bawełna sprawia, że czujesz się jak w domu za każdym razem, gdy ją zakładasz. Idealne dopasowanie zapewnia maksymalny komfort — nie za obcisłe, nie za luźne. Ta koszulka adidas została stworzona, aby nosić ją cały czas, więc możesz nosić ją wszędzie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Prosta koszulka, którą możesz nosić zawsze i wszędzie.', 'trefoil-essentials-tee', '', '', '', 'Trefoil Essentials Tee', '', '', '', ''),
(264, 1, 1, 'Czasem biegniesz tak swobodnie, jakby nie dotyczyły Cię prawa grawitacji. A niekiedy każdy krok to walka. Ta koszulka adidas zapewni Ci komfort podczas każdego biegu. AEROREADY pochłania wilgoć, gwarantując Ci suchy komfort. Odblaskowe detale błyszczą o świcie i zachodzie słońca.', 'Uniwersalna koszulka do biegania wykonana częściowo z materiałów pochodzących z recyklingu.', 'own-the-run-tee', '', '', '', 'Own the Run Tee', '', '', '', ''),
(265, 1, 1, 'Odkryj lepszą wersję siebie. Trenuj, jak chcesz, w koszulce adidas stworzonej z myślą o ruchu. AEROREADY reguluje wilgoć, gdy robi się gorąco, zapewniając Ci komfort. Design umożliwia pełną swobodę ruchu, gdy wykonujesz kolejną serię ćwiczeń z uniesionymi ramionami.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Uniwersalna koszulka do podnoszenia ciężarów uszyta z materiałów pochodzących z recyklingu.', 'train-essentials-training-tee', '', '', '', 'Train Essentials Training Tee', '', '', '', ''),
(266, 1, 1, 'Następny przystanek: Londyn. Ta koszulka adidas oddaje hołd Twojemu ulubionemu miastu przy pomocy zabawnej grafiki na przodzie. Uszyto ją z bawełnianej dzianiny, która zachowuje swój kształt i miękkość nawet przy regularnym noszeniu.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka koszulka w buntowniczym stylu na cześć Londynu.', 'graphic-tee', '', '', '', 'Graphic Tee', '', '', '', ''),
(267, 1, 1, 'Odkryj lepszą wersję siebie. Trenuj, jak chcesz, w koszulce adidas stworzonej z myślą o ruchu. AEROREADY reguluje wilgoć, gdy robi się gorąco, zapewniając Ci komfort. Design gwarantuje pełną swobodę ruchu, więc zdecyduj się na dodatkową serię ćwiczeń z uniesionymi ramionami.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka treningowa adidas z 3 paskami wykonana z materiałów pochodzących z recyklingu.', 'train-essentials-3-stripes-training-tee', '', '', '', 'Train Essentials 3-Stripes Training Tee', '', '', '', ''),
(268, 1, 1, 'Prawdziwa tradycja adidas dla prawdziwych piłkarskich legend. Ta koszulka Realu Madryt ma niewielkie, lecz doskonale widoczne logo Trefoil i wyszywane godło klubowe, dzięki czemu zachowuje prosty, minimalistyczny styl. Model z miękkiej dzianiny idealnie nadaje się do noszenia na zmianę z Twoją ukochaną koszulką klubową.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka koszulka w ponadczasowym stylu Realu Madryt.', 'real-madrid-essentials-trefoil-tee', '', '', '', 'Real Madrid Essentials Trefoil Tee', '', '', '', ''),
(269, 1, 1, 'Podaruj sobie coś z historii adidas. Miła w dotyku, swobodna koszulka adidas jest kultowa w każdym calu. Małe, wyszywane logo Trefoil wyróżnia się na piersi, podkreślając klasyczny, sportowy stylu.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Prosty t-shirt do noszenia na co dzień.', 'loungewear-adicolor-essentials-trefoil-tee', '', '', '', 'LOUNGEWEAR Adicolor Essentials Trefoil Tee', '', '', '', ''),
(270, 1, 1, 'Wybierz wygodną koszulkę adidas, która zapewni Ci swobodę. Czerpiąc inspirację z outdoorowych przygód, nadaliśmy jej nowoczesny charakter za sprawą odświeżonej wersji naszego archiwalnego logo w górskim klimacie i świeżych kolorów. Luźny krój z miękkiej bawełny zapewnia przewiewny komfort niezależnie od tego, jakie wyzwania stawia przed Tobą świat.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna koszulka na każdą przygodę.', 'adidas-adventure-mountain-front-tee', '', '', '', 'adidas Adventure Mountain Front Tee', '', '', '', ''),
(271, 1, 1, 'André Saraiva, znany również jako Mr. A, jest ikoną graffiti i orędownikiem praw Ziemi. Jego kreatywność umożliwia mu dzielenie się swoim przywiązaniem do naszej planety, a teraz pozwoliła mu nadać swój charakterystyczny akcent koszulce adidas. Niebarwiona bawełna organiczna jest wyjątkowo miękka i wygodna. Przyciągająca wzrok grafika jest wezwaniem do działania, aby połączyć siły na rzecz miłości.', 'Koszulka z kolekcji adidas x André Saraiva stworzona z troski o środowisko naturalne.', 'adidas-originals-x-andre-saraiva-tee', '', '', '', 'adidas Originals x André Saraiva Tee', '', '', '', ''),
(272, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Klasyczna koszulka adidas ma dopasowany krój i kontrastowy dół w wyszukanym stylu vintage. Zestaw ją z ulubionymi ciemnymi dżinsami, aby uzyskać swobodny, klasyczny look. Konstrukcja z miękkiej bawełny gwarantuje komfort.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna i uniwersalna koszulka stworzona z myślą o łatwości w zestawianiu stroju.', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(273, 1, 1, 'Logo Trefoil to historia sportu i stylu. Ale tu chodzi o coś więcej. O niepowstrzymaną energię i twórców, którzy dążą do perfekcji. Załóż tę wygodną koszulkę adidas i pokaż to.   Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Swobodna koszulka z dużą dawką energii adidas.', 'adicolor-classics-trefoil-tee', '', '', '', 'Adicolor Classics Trefoil Tee', '', '', '', ''),
(274, 1, 1, 'Podaruj sobie coś z historii adidas. Miła w dotyku, swobodna koszulka adidas jest kultowa w każdym calu. Małe, wyszywane logo Trefoil wyróżnia się na piersi, podkreślając klasyczny, sportowy stylu.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Prosty t-shirt do noszenia na co dzień.', 'loungewear-adicolor-essentials-trefoil-tee', '', '', '', 'LOUNGEWEAR Adicolor Essentials Trefoil Tee', '', '', '', ''),
(275, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Miękka bawełna sprawia, że czujesz się jak w domu za każdym razem, gdy ją zakładasz. Idealne dopasowanie zapewnia maksymalny komfort — nie za obcisłe, nie za luźne. Ta koszulka adidas została stworzona, aby nosić ją cały czas, więc możesz nosić ją wszędzie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Prosta koszulka, którą możesz nosić zawsze i wszędzie.', 'trefoil-essentials-tee', '', '', '', 'Trefoil Essentials Tee', '', '', '', ''),
(276, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Wyczynowa koszulka treningowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'techfit-training-tee', '', '', '', 'Techfit Training Tee', '', '', '', ''),
(277, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Wyczynowa koszulka treningowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'techfit-training-tee', '', '', '', 'Techfit Training Tee', '', '', '', ''),
(278, 1, 1, 'Odkryj lepszą wersję siebie. Trenuj, jak chcesz, w koszulce adidas stworzonej z myślą o ruchu. AEROREADY reguluje wilgoć, gdy robi się gorąco, zapewniając Ci komfort. Design gwarantuje pełną swobodę ruchu, więc zdecyduj się na dodatkową serię ćwiczeń z uniesionymi ramionami.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka treningowa adidas z 3 paskami wykonana z materiałów pochodzących z recyklingu.', 'train-essentials-3-stripes-training-tee', '', '', '', 'Train Essentials 3-Stripes Training Tee', '', '', '', ''),
(279, 1, 1, 'Nie pozostawiaj wątpliwości, komu kibicujesz na boisku do rugby. Ta koszulka adidas prezentuje nazwę All Blacks na przodzie i słynne godło drużyny na jednym rękawie. Miękka dzianina i klasyczny, zaokrąglony dekolt ze ściągaczem oznaczają, że jest także doskonałą opcją, kiedy Twoja koszulka meczowa jest akurat w praniu.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka koszulka, która pokazuje, że kibicujesz All Blacks.', 'all-blacks-rugby-supporters-tee', '', '', '', 'All Blacks Rugby Supporters Tee', '', '', '', ''),
(280, 1, 1, 'Zaprezentuj sportowego ducha adidas przy pomocy uniwersalnej koszulki. Detale takie jak 3 paski na rękawach i wyszywane logo adidas Badge of Sport nadają tej koszulce tradycyjny, sportowy charakter. Miękka, miła w dotyku dzianina sprawdzi się na co dzień, zarówno podczas kolacji z przyjaciółmi, jak i joggingu po parku.  Model zawiera materiały pochodzące z recyklingu, co stanowi część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Wybierz koszulkę, która sprawdzi się w każdej sytuacji.', 'essentials-3-stripes-tee', '', '', '', 'Essentials 3-Stripes Tee', '', '', '', ''),
(281, 1, 1, 'Tradycja adidas trzyma się mocno w tej uniwersalnej koszulce. Śmiałe 3 paski ozdabiają rękawy, a podwójne logo Trefoil pokażą każdemu, że kochasz sport. Uszyta z dzianiny bawełnianej koszulka, która powinna znaleźć się w każdej szafie, jest miękka w dotyku, aby zapewnić Ci komfort przez cały dzień.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Koszulka z logo Trefoil w swobodnym stylu retro.', 'adicolor-classics-trefoil-tee', '', '', '', 'Adicolor Classics Trefoil Tee', '', '', '', ''),
(282, 1, 1, 'Jedno logo Trefoil robi całą robotę. Pomnóż je, a otrzymasz zupełnie nowy look. Kultowe logo w podwojonej wersji na tej prostej koszulce adidas, prezentuje wzór złożony w monogramów w monochromatycznym stylu. Miękka dzianina bawełniana sprawia, że model jest wyjątkowo wygodny, a zaokrąglony dekolt ze ściągaczem stanowi miły w dotyku detal, który musi mieć każda dobra koszulka.', 'Koszulka do noszenia na co dzień, która w pełni wykorzystuje logo Trefoil w stonowanych odcieniach.', 'graphics-monogram-tee', '', '', '', 'Graphics Monogram Tee', '', '', '', ''),
(283, 1, 1, 'Wybierz koszulkę, która odświeży Twój styl. Pokaż, że kochasz sport, nosząc duże logo adidas Badge of Sport z przodu. Na szczęście model zaprojektowano do noszenia na co dzień, ponieważ pewnie tak jak my będziesz chcieć go ciągle zakładać.  Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Odśwież swoją podstawową garderobę za sprawą tej klasycznej koszulki.', 'essentials-big-logo-tee', '', '', '', 'Essentials Big Logo Tee', '', '', '', ''),
(284, 1, 1, 'Podaruj sobie coś z historii adidas. Miła w dotyku, swobodna koszulka adidas jest kultowa w każdym calu. Małe, wyszywane logo Trefoil wyróżnia się na piersi, podkreślając klasyczny, sportowy stylu.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Prosty t-shirt do noszenia na co dzień.', 'loungewear-adicolor-essentials-trefoil-tee', '', '', '', 'LOUNGEWEAR Adicolor Essentials Trefoil Tee', '', '', '', ''),
(285, 1, 1, 'Czerń. Biel. Klasyka. Subtelne logo Trefoil i wyszywana naszywka klubowa wyróżniają się na piersi koszulki adidas Juventus, pokazując światu, że lubisz piłkę nożną pierwszej klasy. Model doskonały do noszenia, gdy nie masz ochoty na koszulkę, ma konstrukcję z miękkiej dzianiny i zaokrąglony dekolt ze ściągaczem w ponadczasowym stylu.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Ponadczasowa koszulka Juventusu.', 'juventus-essentials-trefoil-tee', '', '', '', 'Juventus Essentials Trefoil Tee', '', '', '', ''),
(286, 1, 1, 'Klasyka w sercu. Piłkarska koszulka adidas z wyszywanym godłem Manchesteru United i subtelnym logo Trefoil pasuje do każdej epoki. Załóż ją, gdy Twoja koszulka piłkarska jest w praniu. Zaokrąglony dekolt wykończony ściągaczem i miękka dzianina wspólnie gwarantują stylowy look i wygodę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka koszulka Manchesteru United w ponadczasowym stylu.', 'manchester-united-essentials-trefoil-tee', '', '', '', 'Manchester United Essentials Trefoil Tee', '', '', '', ''),
(287, 1, 1, 'Wycieczki narciarskie, gorące kakao i przytulne noce przy kominku. Jest wiele powodów, by lubić święta. Poczuj klimat świętowania za każdym razem, gdy nosisz tę koszulkę adidas. Bawełna jest miękka i wygodna, niezależnie od pory roku. Ten model został uszyty z wykorzystaniem UNITEFIT — uniwersalnego systemu dopasowania uwzględniającego różne rozmiary, płcie i typy sylwetki.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Odświętna koszulka z zabawnym logo Treffy.', 'xmas-tee-gender-neutral', '', '', '', 'Xmas Tee (Gender Neutral)', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(288, 1, 1, 'Czas na wzbogacenie garderoby o podstawowy element: koszulkę. Koszulka z logo znanym na całym świecie to klasyk, który możesz nosić codziennie i zestawić ze wszystkim. Dopasowany krój i miękka dzianina sprawiają, że czujesz się świetnie za każdym razem, gdy wychodzisz na boisko lub wyciągasz się na kanapie.   Model zawiera materiały pochodzące z recyklingu, co stanowi część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Codzienna koszulka w dobrym stylu.', 'essentials-embroidered-linear-logo-tee', '', '', '', 'Essentials Embroidered Linear Logo Tee', '', '', '', ''),
(289, 1, 1, 'Po co wybierać prosty styl, skoro możesz postawić na odważny look? W tym klasycznym designie w kontrastowych kolorach zyskujesz zabawny nowy element stroju, który nie przytłacza Twojego stylu. Kiedy spędzasz dzień z przyjaciółmi, dopełnij swój look klasyczną parą dżinsów lub spodni. Kiedy próbujesz dotrwać do końca pracy, ciesz się komfortem miękkiej bawełny i wygodnych spodni dresowych. Ta koszulka adidas sprawdzi się zawsze i wszędzie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna koszulka w śmiałym stylu.', 'colourblock-tee', '', '', '', 'Colourblock Tee', '', '', '', ''),
(290, 1, 1, 'Logo Trefoil to historia sportu i stylu. Ale tu chodzi o coś więcej. O niepowstrzymaną energię i twórców, którzy dążą do perfekcji. Załóż tę wygodną koszulkę adidas i pokaż to.   Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Swobodna koszulka z dużą dawką energii adidas.', 'adicolor-classics-trefoil-tee', '', '', '', 'Adicolor Classics Trefoil Tee', '', '', '', ''),
(291, 1, 1, 'Jedno logo Trefoil robi całą robotę. Pomnóż je, a otrzymasz zupełnie nowy look. Kultowe logo w podwojonej wersji na tej prostej koszulce adidas, prezentuje wzór złożony w monogramów w monochromatycznym stylu. Miękka dzianina bawełniana sprawia, że model jest wyjątkowo wygodny, a zaokrąglony dekolt ze ściągaczem stanowi miły w dotyku detal, który musi mieć każda dobra koszulka.', 'Koszulka do noszenia na co dzień, która w pełni wykorzystuje logo Trefoil w stonowanych odcieniach.', 'graphics-monogram-tee', '', '', '', 'Graphics Monogram Tee', '', '', '', ''),
(292, 1, 1, 'Bez względu na to, czy decydujesz się na kolejne powtórzenie na siłowni, czy planujesz szybką sesję treningową w domu, koszulka Designed for Training pomoże Ci zrealizować plany.    Ćwicz z hantlami, wyciskaj sztangę i przekraczaj własne granice, ciesząc się pełnym wsparciem dynamicznych linii kroju i elastanu, który zapewnia swobodę ruchu podczas treningu siłowego górnych partii ciała. Produkty adidas AEROREADY z pochłaniających pot materiałów zapewniają Ci suchy komfort, kiedy się poruszasz. Nieważne, jak bardzo wymagający będzie trening.   Dbałość o detale oznacza wyjątkowy komfort, a specjalne rozmieszczenie szwów na barkach, ramionach i bokach zapobiega powstawaniu otarć. Unikalny panel wspomaga Twoje wysiłki podczas ćwiczeń z obciążeniem, a solidny materiał pozwoli stawić czoła wszelkim wyzwaniom. Kultowe logo adidas w nieoczekiwanym miejscu stanowi dopełniający akcent.', 'Elastyczna koszulka treningowa z kultowym logo Badge of Sport.', 'designed-for-training-tee', '', '', '', 'Designed for Training Tee', '', '', '', ''),
(293, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Klasyczna koszulka adidas ma dopasowany krój i kontrastowy dół w wyszukanym stylu vintage. Zestaw ją z ulubionymi ciemnymi dżinsami, aby uzyskać swobodny, klasyczny look. Konstrukcja z miękkiej bawełny gwarantuje komfort.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna i uniwersalna koszulka stworzona z myślą o łatwości w zestawianiu stroju.', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(294, 1, 1, 'Wybierz koszulkę, która ma same plusy. Mówimy tu o wysokiej jakości bawełnie organicznej, swobodnym designie i kultowym stylu adidas. Ta koszulka ma prosty design, co sprawia, że pasuje do wszystkiego i jest tak wygodna, że chce się ją nosić zawsze.   Ten produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Klasyczna koszulka adidas stworzona z myślą o naturze.', 'adicolor-contempo-tee', '', '', '', 'Adicolor Contempo Tee', '', '', '', ''),
(295, 1, 1, 'Śmiała koszulka w stylu breakdance przyciągnie spojrzenia w Paryżu i nie tylko. Koszulka adidas z miękkiej dzianiny bawełnianej jest miękka w dotyku. Pasuje do wszystkiego: od spodni dresowych po dżinsy.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka koszulka w buntowniczym stylu na cześć Paryża.', 'graphic-tee', '', '', '', 'Graphic Tee', '', '', '', ''),
(296, 1, 1, 'Gdy Mark Gonzales dorastał w South Gate w Kalifornii, graffiti było jednym z jego najwcześniejszych inspiracji. Koszulka z krótkim rękawem adidas Skateboarding Shmoo Logo prezentuje pomalowaną sprayem wersję kultowej postaci Shmoo autorstwa Gonza za sprawą konstrukcji z grubej, bawełnianej dzianiny.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Inspirowany sprayowym grafitti styl Shmoofoil.', 'graphic-shmoofoil-tee', '', '', '', 'Graphic Shmoofoil Tee', '', '', '', ''),
(297, 1, 1, 'Czy wszystko trzeba komplikować? Zadbaj o autentyczny look adidas, nosząc tę koszulkę. Kontrastowe detale nadają jej dyskretny styl, który pozwala zamienić zwykłą koszulkę w ponadprzeciętną. Jest taka miękka, że masz ochotę nosić ją codziennie.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Dopasowana, bawełniana koszulka z kultowymi 3 paskami.', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(298, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Miękka bawełna sprawia, że czujesz się jak w domu za każdym razem, gdy ją zakładasz. Idealne dopasowanie zapewnia maksymalny komfort — nie za obcisłe, nie za luźne. Ta koszulka adidas została stworzona, aby nosić ją cały czas, więc możesz nosić ją wszędzie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Prosta koszulka, którą możesz nosić zawsze i wszędzie.', 'trefoil-essentials-tee', '', '', '', 'Trefoil Essentials Tee', '', '', '', ''),
(299, 1, 1, 'Czasem biegniesz tak swobodnie, jakby nie dotyczyły Cię prawa grawitacji. A niekiedy każdy krok to walka. Ta koszulka adidas zapewni Ci komfort podczas każdego biegu. AEROREADY pochłania wilgoć, gwarantując Ci suchy komfort. Odblaskowe detale błyszczą o świcie i zachodzie słońca.', 'Uniwersalna koszulka do biegania wykonana częściowo z materiałów pochodzących z recyklingu.', 'own-the-run-tee', '', '', '', 'Own the Run Tee', '', '', '', ''),
(300, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Koszulka na intensywne sesje treningowe wykonana częściowo z materiałów pochodzących z recyklingu.', 'techfit-training-long-sleeve-tee', '', '', '', 'Techfit Training Long Sleeve Tee', '', '', '', ''),
(301, 1, 1, 'Miejski styl na co dzień, każdego dnia. Zwłaszcza jeśli chodzi o podstawowy element ubrania. Ta koszulka z długim rękawem zyskała nowy charakter dzięki detalom adidas: charakterystycznemu logo Trefoil. Kultowym 3 paskom wzdłuż ramion. Miękka bawełna zapewnia wygodę, sprawiając, że wyglądasz wspaniale.  Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Koszulka z długim rękawem w klasycznym stylu.', 'adicolor-classics-3-stripes-long-sleeve-tee', '', '', '', 'Adicolor Classics 3-Stripes Long Sleeve Tee', '', '', '', ''),
(302, 1, 1, 'Miejski styl na co dzień, każdego dnia. Zwłaszcza jeśli chodzi o podstawowy element ubrania. Ta koszulka z długim rękawem zyskała nowy charakter dzięki detalom adidas: charakterystycznemu logo Trefoil. Kultowym 3 paskom wzdłuż ramion. Miękka bawełna zapewnia wygodę, sprawiając, że wyglądasz wspaniale.  Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Koszulka z długim rękawem w klasycznym stylu.', 'adicolor-classics-3-stripes-long-sleeve-tee', '', '', '', 'Adicolor Classics 3-Stripes Long Sleeve Tee', '', '', '', ''),
(303, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Koszulka na intensywne sesje treningowe wykonana częściowo z materiałów pochodzących z recyklingu.', 'techfit-training-long-sleeve-tee', '', '', '', 'Techfit Training Long Sleeve Tee', '', '', '', ''),
(304, 1, 1, 'Kiedy klasyka powraca w nowej odsłonie, wiesz, że zachowuje moc i charakterystyczny styl. Załóż koszulkę adidas z długim rękawem i ruszaj w drogę w kontrastowym stylu. Kultowe 3 paski i wyszywane logo Trefoil nawiązują do stylu retro, ale w nowej wersji. Zaokrąglony dekolt i mankiety ze ściągaczem jak zawsze nadają klasyczny styl.', 'Wygodna koszulka z długimi rękawami w świeżym stylu z 3 paskami.', 'adicolor-classics-3-stripes-long-sleeve-tee', '', '', '', 'Adicolor Classics 3-Stripes Long Sleeve Tee', '', '', '', ''),
(305, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Koszulka treningowa z 3 paskami wykonana z materiałów pochodzących z recyklingu.', 'techfit-3-stripes-training-long-sleeve-tee', '', '', '', 'Techfit 3-Stripes Training Long Sleeve Tee', '', '', '', ''),
(306, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Koszulka treningowa z 3 paskami wykonana z materiałów pochodzących z recyklingu.', 'techfit-3-stripes-training-long-sleeve-tee', '', '', '', 'Techfit 3-Stripes Training Long Sleeve Tee', '', '', '', ''),
(307, 1, 1, 'Nowoczesna odsłona klasycznego modelu adidas z długimi rękawami ma wokół jednego z nich ząbkowane 3 paski, które nadają jej zaskakujący, asymetryczny look. Model z miękkiej dzianiny bawełnianej zapewni Ci komfort. W równym stopniu minimalistyczny co sportowy look wszędzie zaprezentuje się w dobrym stylu.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Odświeżona klasyka stworzona z myślą o komforcie przez cały dzień.', 'adicolor-neuclassics-long-sleeve-tee', '', '', '', 'Adicolor Neuclassics Long Sleeve Tee', '', '', '', ''),
(308, 1, 1, 'Wybierz koszulkę adidas, która zapewni Ci swobodę i wygodę. Czerpiąc inspirację z outdoorowych przygód, nadaliśmy temu modelowi nowoczesny charakter za sprawą odświeżonej wersji naszego archiwalnego logo górskiego i świeżych kolorów. Miękka bawełna o luźnym kroju zapewnia przewiewny komfort niezależnie od tego, co przyniesie dzień.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna koszulka na każdą przygodę.', 'adidas-adventure-mountain-back-tee', '', '', '', 'adidas Adventure Mountain Back Tee', '', '', '', ''),
(309, 1, 1, 'Twój codzienny t-shirt nie musi być tak zwanym „basikiem”. Ta klasyczna koszulka adidas z zaokrąglonym dekoltem została uszyta w 100% z siateczki z poliestru pochodzącego z recyklingu, dzięki czemu gwarantuje wyjątkową przewiewność podczas biegu w upalne dni. Zachowaj suchy komfort dzięki pochłaniającemu wilgoć AEROREADY. Odblaskowe detale dodają blasku po zachodzie słońca.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pochłaniająca wilgoć koszulka wykonana z materiałów pochodzących z recyklingu.', 'own-the-run-seasonal-tee', '', '', '', 'Own the Run Seasonal Tee', '', '', '', ''),
(310, 1, 1, 'Odkryj lepszą wersję siebie. Trenuj, jak chcesz, w koszulce adidas stworzonej z myślą o ruchu. AEROREADY reguluje wilgoć, gdy robi się gorąco, zapewniając Ci komfort. Design umożliwia pełną swobodę ruchu, gdy wykonujesz kolejną serię ćwiczeń z uniesionymi ramionami.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Uniwersalna koszulka do podnoszenia ciężarów uszyta z materiałów pochodzących z recyklingu.', 'train-essentials-training-tee', '', '', '', 'Train Essentials Training Tee', '', '', '', ''),
(311, 1, 1, 'Bez względu na to, czy decydujesz się na kolejne powtórzenie na siłowni, czy planujesz szybką sesję treningową w domu, koszulka Designed for Training pomoże Ci zrealizować plany.    Ćwicz z hantlami, wyciskaj sztangę i przekraczaj własne granice, ciesząc się pełnym wsparciem dynamicznych linii kroju i elastanu, który zapewnia swobodę ruchu podczas treningu siłowego górnych partii ciała. Produkty adidas AEROREADY z pochłaniających pot materiałów zapewniają Ci suchy komfort, kiedy się poruszasz. Nieważne, jak bardzo wymagający będzie trening.   Dbałość o detale oznacza wyjątkowy komfort, a specjalne rozmieszczenie szwów na barkach, ramionach i bokach zapobiega powstawaniu otarć. Unikalny panel wspomaga Twoje wysiłki podczas ćwiczeń z obciążeniem, a solidny materiał pozwoli stawić czoła wszelkim wyzwaniom. Kultowe logo adidas w nieoczekiwanym miejscu stanowi dopełniający akcent.', 'Elastyczna koszulka treningowa z kultowym logo Badge of Sport.', 'designed-for-training-tee', '', '', '', 'Designed for Training Tee', '', '', '', ''),
(312, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Klasyczna koszulka adidas ma dopasowany krój i kontrastowy dół w wyszukanym stylu vintage. Zestaw ją z ulubionymi ciemnymi dżinsami, aby uzyskać swobodny, klasyczny look. Konstrukcja z miękkiej bawełny gwarantuje komfort.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna i uniwersalna koszulka stworzona z myślą o łatwości w zestawianiu stroju.', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(313, 1, 1, 'Twój codzienny t-shirt nie musi być tak zwanym „basikiem”. Ta klasyczna koszulka adidas z zaokrąglonym dekoltem została uszyta w 100% z siateczki z poliestru pochodzącego z recyklingu, dzięki czemu gwarantuje wyjątkową przewiewność podczas biegu w upalne dni. Zachowaj suchy komfort dzięki pochłaniającemu wilgoć AEROREADY. Odblaskowe detale dodają blasku po zachodzie słońca.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pochłaniająca wilgoć koszulka wykonana z materiałów pochodzących z recyklingu.', 'own-the-run-seasonal-tee', '', '', '', 'Own the Run Seasonal Tee', '', '', '', ''),
(314, 1, 1, 'Zabierz ze sobą miłość do All Blacks poza linie boiska. Koszulka do rugby adidas z kontrastową, naszytą kieszenią na piersi i gumowanym godłem drużyny na jednym rękawie sprawi, że wyróżnisz się z tłumu nawet z daleka od boiska. Luźny krój i miękka dzianina zapewniają wygodę i swobodę, gdy podążasz za swoją drużyną.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Luźna koszulka w stylu All Blacks.', 'all-blacks-rugby-lifestyle-tee', '', '', '', 'All Blacks Rugby Lifestyle Tee', '', '', '', ''),
(315, 1, 1, '„Kolekcja Adicolor Heritage Now czerpie inspirację z archiwalnych modeli i klasyków stylu. Linia, która rzuca światło na detale jednoznacznie kojarzące się z adidas, łączy luksusowe i teksturowane materiały z jasną paletą barw, aby nadać kultowym sylwetkom nową, pełną energii formę.” — Senior Originals Designers, Florence Marrinier &amp; Lena Sophie Anders  Kultowy sportowy fason powraca w nowoczesnej odsłonie. Koszulka z długim rękawem Adicolor Heritage Now Vintage powstała z inspiracji modelami polo sprzed lat i ma konstrukcję z połyskującej dzianinowej piki z nostalgicznym monogramem z logo Trefoil. Śmiała paleta kolorów i wkomponowane 3 paski biegnące wzdłuż ramion nadają całości sportowy look.', 'Przebojowa koszulka z długim rękawem i klasycznym kołnierzykiem polo z kultowymi 3 paskami.', 'adicolor-heritage-now-vintage-long-sleeve-tee', '', '', '', 'Adicolor Heritage Now Vintage Long Sleeve Tee', '', '', '', ''),
(316, 1, 1, 'Ukłon w stronę największego turnieju w tej pięknej grze. Dopasowana koszulka tenisowa adidas ma design inspirowany koszulkami, które zobaczysz na boiskach piłkarskich w Katarze ― od ściągaczowego kołnierza po przedłużony tył. Ma również przewiewne wstawki z siateczki i chłodzący HEAT.RDY, dzięki czemu możesz dać z siebie wszystko w najbardziej upalne dni.', 'Zainspirowana piłką nożną koszulka tenisowa wykonana z materiałów pochodzących z recyklingu.', 'tennis-wc-tee', '', '', '', 'Tennis WC Tee', '', '', '', ''),
(317, 1, 1, 'Bez względu na to, czy decydujesz się na kolejne powtórzenie na siłowni, czy planujesz szybką sesję treningową w domu, koszulka Designed for Training pomoże Ci to osiągnąć.    Ćwicz z hantlami, wyciskaj sztangę i przekraczaj własne granice, ciesząc się pełnym wsparciem dynamicznych linii kroju i elastanu, który zapewnia swobodę ruchu podczas treningu siłowego górnych partii ciała. Produkty adidas AEROREADY z pochłaniających pot materiałów zapewniają Ci suchy komfort, kiedy się poruszasz. Nieważne, jak bardzo wymagający będzie trening.   Dbałość o detale oznacza wyjątkowy komfort, a specjalne rozmieszczenie szwów na ramionach, ramionach i bokach zapobiega powstawaniu otarć. Unikalny panel wspomaga Twoje wysiłki podczas ćwiczeń z obciążeniem, a solidny materiał pozwoli stawić czoła wszelkim wyzwaniom. Kultowe logo adidas w nieoczekiwanym miejscu stanowi dopełniający akcent.', 'Elastyczna koszulka treningowa z kultowym logo Badge of Sport.', 'designed-for-training-tee', '', '', '', 'Designed for Training Tee', '', '', '', ''),
(318, 1, 1, 'Nowa generacja. Nowa kolekcja Adicolor. Adicolor Neuclassics na nowo definiuje reguły kultowego stylu, zachowując wszystko to, co cenisz w klasykach, ale nadając im nowoczesny look. Weźmy tę koszulkę adidas. 3 paski owijają się nieoczekiwanie wokół jednego rękawa, a obniżone ramiona nadają całości swobodny charakter.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'T-shirt z obniżonymi ramionami i 3 paskami w nowoczesnym stylu.', 'adicolor-neuclassics-tee', '', '', '', 'Adicolor Neuclassics Tee', '', '', '', ''),
(319, 1, 1, 'No dobrze, ta koszulka adidas ewidentnie nie jest kultowym dresem SST. Ale czerpie z niego inspirację. Możesz to poznać po linii kroju, kolorach i kultowych 3 paskach na rękawach.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Nostalgiczna koszulka inspirowana dresem SST.', 'sst-short-sleeve-tee', '', '', '', 'SST Short Sleeve Tee', '', '', '', ''),
(320, 1, 1, 'Archiwalne linie kroju podkreślone lamówką nadają tej koszulce adidas swobodny, modny styl retro. Od relaksu w domu po spotkanie przy jedzeniu z przyjaciółmi miękka bawełna zapewni Ci komfort przez cały dzień. Logo Trefoil nadaje modelowi status must-have, który trudno nazwać zwyczajnym.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna koszulka inspirowana archiwalnymi modelami.', 'adicolor-seasonal-archive-tee', '', '', '', 'Adicolor Seasonal Archive Tee', '', '', '', ''),
(321, 1, 1, 'Nowa generacja. Nowa kolekcja Adicolor. Adicolor Neuclassics na nowo definiuje reguły kultowego stylu, zachowując wszystko to, co cenisz w klasykach, ale nadając im nowoczesny look. Weźmy tę koszulkę adidas. 3 paski owijają się nieoczekiwanie wokół jednego rękawa, a obniżone ramiona nadają całości swobodny charakter.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'T-shirt z obniżonymi ramionami i 3 paskami w nowoczesnym stylu.', 'adicolor-neuclassics-tee', '', '', '', 'Adicolor Neuclassics Tee', '', '', '', ''),
(322, 1, 1, 'Ukłon w stronę największego turnieju w tej pięknej grze. Dopasowana koszulka tenisowa adidas ma design inspirowany koszulkami, które zobaczysz na boiskach piłkarskich w Katarze ― od ściągaczowego kołnierza po przedłużony tył. Ma również przewiewne wstawki z siateczki i chłodzący HEAT.RDY, dzięki czemu możesz dać z siebie wszystko w najbardziej upalne dni.', 'Zainspirowana piłką nożną koszulka tenisowa wykonana z materiałów pochodzących z recyklingu.', 'tennis-wc-tee', '', '', '', 'Tennis WC Tee', '', '', '', ''),
(323, 1, 1, 'Nowa generacja. Nowa kolekcja Adicolor. Adicolor Neuclassics na nowo definiuje reguły kultowego stylu, zachowując wszystko to, co cenisz w klasykach, ale nadając im nowoczesny look. Weźmy tę koszulkę adidas. 3 paski owijają się nieoczekiwanie wokół jednego rękawa, a obniżone ramiona nadają całości swobodny charakter.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'T-shirt z obniżonymi ramionami i 3 paskami w nowoczesnym stylu.', 'adicolor-neuclassics-tee', '', '', '', 'Adicolor Neuclassics Tee', '', '', '', ''),
(324, 1, 1, 'To jest koszulka. To jest podstawowa warstwa. To jest Twoja nowa ulubiona koszulka hikingowa. Koszulka adidas z suwakiem do połowy długości Terrex Multi została wykonana z materiału AEROREADY, który odprowadza pot, zapewniając Ci suchy komfort przy każdym wysiłku. Przesunięte szwy na ramionach redukują możliwość powstawania otarć pod plecakiem, a przedłużony tył zapewnia okrycie tam, gdzie go potrzebujesz.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Techniczna koszulka stworzona z myślą o przygodach na szlaku, wykonana częściowo z materiałów pochodzących z recyklingu.', 'terrex-multi-half-zip-tee', '', '', '', 'Terrex Multi Half-Zip Tee', '', '', '', ''),
(325, 1, 1, '„Kolekcja Adicolor Heritage Now czerpie inspirację z archiwalnych modeli i klasyków stylu. Linia, która rzuca światło na detale jednoznacznie kojarzące się z adidas, łączy luksusowe i teksturowane materiały z jasną paletą barw, aby nadać kultowym sylwetkom nową, pełną energii formę.” — Senior Originals Designers, Florence Marrinier &amp; Lena Sophie Anders  Koszulka Adicolor Heritage Now Vintage Cali nawiązuje do koszulek piłkarskich retro i uosabia swobodę charakterystyczną dla minionych dekad za sprawą śmiałej palety barw i 3 pasków biegnących wzdłuż ramion. Koszulka o dopasowanym kroju została uszyta z wyjątkowo miękkiej dzianiny i wykończona wysokiej jakości ściągaczem przy kołnierzu i rękawach w nowoczesnym stylu.', 'Śmiała koszulka w archiwalnym stylu z 3 paskami i wysokiej jakości ściągaczowymi detalami.', 'adicolor-heritage-now-vintage-cali-tee', '', '', '', 'Adicolor Heritage Now Vintage Cali Tee', '', '', '', ''),
(326, 1, 1, 'Osiagaj wyznaczone cele treningowe, ciesząc się pełnym komfortem w koszulce adidas AEROREADY. Koszulka stworzona z myślą o regulacji wilgoci jest miękka i trwała, dzięki czemu doskonale sprawdzi się podczas kolejnej sesji na siłowni. Przedłużony dół z rozcięciami zapewnia swobodę ruchu, gdy podnosisz ciężary, biegasz lub po prostu energicznie spacerujesz.', 'Koszulka treningowa wykonana z materiałów pochodzących z recyklingu.', 'aeroready-designed-for-movement-tee', '', '', '', 'AEROREADY Designed for Movement Tee', '', '', '', ''),
(327, 1, 1, '32 drużyny marzą o jednym celu. Nie rezygnując ze stylu piłkarskiego, hiszpańscy zawodnicy wyróżniają się w takich koszulkach adidas, gdy podróżują na mecze podczas najważniejszego turnieju w tym sezonie. Miękka dzianina i przedłużony tył zapewniają wygodę i okrycie, umożliwiając ruch bez czynników rozpraszających. Nadrukowana naszywka podkreśla Twoją dumę z drużyny.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Bawełniana koszulka reprezentacji Hiszpanii stworzona z myślą o największym wydarzeniu piłkarskim.', 'spain-game-day-travel-tee', '', '', '', 'Spain Game Day Travel Tee', '', '', '', ''),
(328, 1, 1, 'Nadszedł dzień treningu klatki piersiowej, a Ty jesteś gotowa na to wyzwanie. Załóż tę koszulkę adidas i przygotuj się na zanurzenie, lot, wyciskanie i naciskanie. AEROREADY wytrzymuje pot, zapewniając Ci suchy komfort, gdy wykonujesz pompki. Dopasowany krój otula Twoje ciało, a dodatkowa przestrzeń na ramiona pomaga zmaksymalizować każdy ruch. Czas zacząć działać.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Miękka koszulka treningowa bez rękawów wykonana częściowo z materiałów pochodzących z recyklingu.', 'train-essentials-feelready-training-sleeveless-tee', '', '', '', 'Train Essentials Feelready Training Sleeveless Tee', '', '', '', ''),
(329, 1, 1, 'Jeśli ciężko pracujesz, pocisz się. Na szczęście dla Ciebie, ta koszulka treningowa adidas reaguje na pot przy pomocy pochłaniającego wilgoć AEROREADY, który zapewnia Ci suchy komfort, i pleców z siateczki, które maksymalizują przepływ powietrza. 3 paski owijające się wokół rękawów i logo z 3 paskami na przodzie nawiązują do sportowego dziedzictwa marki.', 'Koszulka treningowa z siateczkowym tyłem wykonana częściowo z materiałów pochodzących z recyklingu.', 'train-icons-3-stripes-training-tee', '', '', '', 'Train Icons 3-Stripes Training Tee', '', '', '', ''),
(330, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej treningowej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Koszulka z 3 paskami stworzona z myślą o ruchu i częściowo wykonana z materiałów pochodzących z recyklingu.', 'techfit-3-stripes-training-tee', '', '', '', 'Techfit 3-Stripes Training Tee', '', '', '', ''),
(331, 1, 1, 'Załóż koszulkę do jogi adidas, weź głęboki oddech i pozwól, aby stres, który towarzyszył Ci przez cały dzień, zniknął. Wyjątkowo miękki materiał ułatwia płynną zmianę pozycji i pozwala Ci odnaleźć swój rytm. AEROREADY reguluje wilgoć, dzięki czemu możesz skoncentrować się na tym, co robisz tu i teraz.  Ten produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', 'Ta koszulka została stworzona z myślą o naturze.', 'yoga-training-tee', '', '', '', 'Yoga Training Tee', '', '', '', ''),
(332, 1, 1, 'Prostota. Klasyka. Klubowa naszywka i małe logo Trefoil widnieją obok siebie na piersi tej koszulki piłkarskiej adidas FC Bayern. Ale to słynne czerwone barwy podstawowe naprawdę kradną show. Miękka dzianina bawełniana sprawia, że jest to wygodna opcja, gdy Twoja codzienna koszulka jest w praniu.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Bawełniana koszulka Bayernu Monachium w ponadczasowym stylu.', 'fc-bayern-essentials-trefoil-tee', '', '', '', 'FC Bayern Essentials Trefoil Tee', '', '', '', ''),
(333, 1, 1, 'Trudne warunki treningowe wymagają stroju, który weźmie to na klatę. Mocny, oddychający materiał, z którego uszyto tę koszulkę adidas, spełnia swoje zadanie. Wspinaj się po linie i rób, co tylko chcesz. Aby zużyć ten model, musisz bardziej się postarać. AEROREADY wytrzymuje pot, zapewniając Ci suchy komfort i gotowość na to, co nadejdzie.  Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka treningowa wykonana z materiałów pochodzących z recyklingu, która jest najlepsza w stresujących sytuacjach.', 'workout-tee', '', '', '', 'Workout Tee', '', '', '', ''),
(334, 1, 1, 'Oddaj hołd Realowi Madryt przy pomocy tej koszulki. Nazwa Twojego ulubionego klubu piłkarskiego wyróżnia się pod logo adidas Badge of Sport w klasycznym stylu. Konstrukcja wykonana w całości z bawełnianej dzianiny jest miękka i wygodna.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Bawełniana koszulka dla kibiców Realu Madryt.', 'real-madrid-dna-tee', '', '', '', 'Real Madrid DNA Tee', '', '', '', ''),
(335, 1, 1, 'Chcesz podkręcić tempo? Ta treningowa koszulka bez rękawów adidas zapewni Ci przewiewny komfort i swobodę ruchu, ułatwiając koncentrację na każdym ćwiczeniu mountain climber, burpee i przysiadzie, które wykonasz podczas sesji HIIT. Gdy robi się gorąco, HEAT.RDY oferuje przewiewny i suchy komfort.  Przędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Koszulka bez rękawów do intensywnych treningów wykonana częściowo z Parley Ocean Plastic.', 'heatrdy-hiit-elevated-training-tank-top', '', '', '', 'HEAT.RDY HIIT Elevated Training Tank Top', '', '', '', ''),
(336, 1, 1, 'To jest koszulka. To jest podstawowa warstwa. To jest Twoja nowa ulubiona koszulka hikingowa. Koszulka adidas z suwakiem do połowy długości Terrex Multi została wykonana z materiału AEROREADY, który odprowadza pot, zapewniając Ci suchy komfort przy każdym wysiłku. Przesunięte szwy na ramionach redukują możliwość powstawania otarć pod plecakiem, a przedłużony tył zapewnia okrycie tam, gdzie go potrzebujesz.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Techniczna koszulka stworzona z myślą o przygodach na szlaku, wykonana częściowo z materiałów pochodzących z recyklingu.', 'terrex-multi-half-zip-tee', '', '', '', 'Terrex Multi Half-Zip Tee', '', '', '', ''),
(337, 1, 1, 'Jedno logo Trefoil robi całą robotę. Pomnóż je, a otrzymasz zupełnie nowy look. Kultowe logo w podwojonej wersji na tej prostej koszulce adidas, prezentuje wzór złożony w monogramów w monochromatycznym stylu. Miękka dzianina bawełniana sprawia, że model jest wyjątkowo wygodny, a zaokrąglony dekolt ze ściągaczem stanowi miły w dotyku detal, który musi mieć każda dobra koszulka.', 'Koszulka do noszenia na co dzień, która w pełni wykorzystuje logo Trefoil w stonowanych odcieniach.', 'graphics-monogram-tee', '', '', '', 'Graphics Monogram Tee', '', '', '', ''),
(338, 1, 1, 'Nie ma wątpliwości, jakie miejsce skradło Twoje serce bez reszty. Ta koszulka adidas pozwoli wszędzie wyrazić Twoją miłość do Londynu. Miękka bawełna premium zapewnia wygodę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Swobodna koszulka z grafiką, która podkreśli Twoją miłość do Londynu.', 'key-city-london-brand-tee', '', '', '', 'Key City London Brand Tee', '', '', '', ''),
(339, 1, 1, 'Klasyczny krój tej koszulki adidas z zaokrąglonym dekoltem jest nie do pobicia, tak jak Ty podczas następnego biegu. Dopasowany krój nadaje całości gładki look. Zachowaj komfort, nawet gdy biegasz w gorące dni dzięki AEROREADY, który usuwa wilgoć, i poliestrowej siateczce ułatwiającej przepływ powietrza. Odblaskowe detale błyszczą, gdy na dworze robi się ciemno.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Odprowadzająca wilgoć koszulka z zaokrąglonym dekoltem uszyta z materiałów pochodzących z recyklingu.', 'run-icons-3-bar-logo-tee', '', '', '', 'Run Icons 3 Bar Logo Tee', '', '', '', ''),
(340, 1, 1, 'Co słychać? Jest dobrze? Załóż tę koszulkę bez rękawów adidas i dopasuj strój do swojego nastroju. Miękka bawełna i swobodne ramiona sprawiają, że nie musisz się martwić o nic. Podczas weekendu, w tygodniu lub kiedy tylko chcesz. Ubierz się i wyluzuj.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Koszulka bez rękawów w swobodnym stylu o sportowym rodowodzie.', 'adicolor-essentials-trefoil-tank-top', '', '', '', 'Adicolor Essentials Trefoil Tank Top', '', '', '', ''),
(341, 1, 1, 'Koszulka adidas AlphaStrength jma stylowy design stworzony z myślą o wydajności. Wywijane mankiety pozwalają regulować rękawy, gdy zmienia się temperatura Twojego ciała. Płaskie szwy sprawiają, że model jest gładki w dotyku. Zaokrąglony dół z tyłu i rozcięcia po bokach odświeżają klasyczną sylwetkę z zaokrąglonym dekoltem.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Koszulka treningowa na przejściowe pory roku wykonana częściowo z materiałów pochodzących z recyklingu.', 'alphastrength-tee', '', '', '', 'AlphaStrength Tee', '', '', '', ''),
(342, 1, 1, 'Wyzwanie. Ucieczka. Energia. Niezależnie od tego, co skłania Cię do biegania, ta koszulka do biegania adidas zapewni Ci komfort. Lekki i oddychający materiał wspiera Cię od pierwszego do ostatniego kroku. AEROREADY pochłania wilgoć, gwarantując Ci świeżość.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jeden z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka do biegania na co dzień z materiałów pochodzących z recyklingu.', 'run-it-tee', '', '', '', 'Run It Tee', '', '', '', ''),
(343, 1, 1, 'Styl i wydajność na korcie tenisowym. Koszulka z zaokrąglonym dekoltem z kolekcji adidas Club ma dodatkowy materiał pod ramionami, który uwalnia ramiona i zwiększa siłę uderzenia. Bez względu na to, jak intensywna jest Twoja gra na korcie, AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort i gotowość do kolejnej akcji.  Ten produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pochłaniająca wilgoć koszulka tenisowa z materiałów pochodzących z recyklingu.', 'club-tennis-tee', '', '', '', 'Club Tennis Tee', '', '', '', ''),
(344, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej treningowej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', 'Koszulka z 3 paskami stworzona z myślą o ruchu i częściowo wykonana z materiałów pochodzących z recyklingu.', 'techfit-3-stripes-training-tee', '', '', '', 'Techfit 3-Stripes Training Tee', '', '', '', ''),
(345, 1, 1, 'Wyzwanie. Ucieczka. Energia. Niezależnie od tego, co skłania Cię do biegania, ta koszulka do biegania adidas zapewni Ci komfort. Lekki i oddychający materiał wspiera Cię od pierwszego do ostatniego kroku. AEROREADY pochłania wilgoć, gwarantując Ci świeżość.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jeden z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka do biegania na co dzień z materiałów pochodzących z recyklingu.', 'run-it-tee', '', '', '', 'Run It Tee', '', '', '', ''),
(346, 1, 1, 'Pokaż swoje prawdziwe barwy w koszulce do rugby adidas All Blacks. Na piersi srebrny liść paproci wyróżnia się na imponującym, czarnym tle, które napełnia rywali z Nowej Zelandii strachem. Miękka dzianina zapewnia komfort przy każdym założeniu.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Lekka koszulka dla kibiców All Blacks.', 'all-blacks-rugby-cotton-tee', '', '', '', 'All Blacks Rugby Cotton Tee', '', '', '', ''),
(347, 1, 1, 'To uczucie, które nigdy się nie starzeje. Po raz czternasty Real Madryt jest mistrzem Europy, a niewiele zwycięstw było cenniejsze niż to ostatnie. Załóż koszulkę adidas, aby uczcić drużyny zwycięstwo w Paryżu. Miękka dzianina dba o Twoją wygodę. Grafiki sprawiają, że jest to idealna pamiątka niezrównanego piłkarskiego wyczynu.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Koszulka z dzianiny na cześć najlepszych w Europie.', 'real-madrid-ucl-champions-2022-tee', '', '', '', 'Real Madrid UCL Champions 2022 Tee', '', '', '', ''),
(348, 1, 1, 'Wyzwanie. Ucieczka. Energia. Niezależnie od tego, co skłania Cię do biegania, ta koszulka do biegania adidas zapewni Ci komfort. Lekki i oddychający materiał wspiera Cię od pierwszego do ostatniego kroku. AEROREADY pochłania wilgoć, gwarantując Ci świeżość.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jeden z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka do biegania na co dzień z materiałów pochodzących z recyklingu.', 'run-it-tee', '', '', '', 'Run It Tee', '', '', '', ''),
(349, 1, 1, 'Wybierz koszulkę, która ma same plusy. Mówimy tu o wysokiej jakości bawełnie organicznej, swobodnym designie i kultowym stylu adidas. Ta koszulka ma prosty design, co sprawia, że pasuje do wszystkiego i jest tak wygodna, że chce się ją nosić zawsze.   Ten produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Klasyczna koszulka adidas stworzona z myślą o naturze.', 'adicolor-contempo-tee', '', '', '', 'Adicolor Contempo Tee', '', '', '', ''),
(350, 1, 1, 'Archiwalne linie kroju podkreślone lamówką nadają tej koszulce adidas swobodny, modny styl retro. Od relaksu w domu po spotkanie przy jedzeniu z przyjaciółmi miękka bawełna zapewni Ci komfort przez cały dzień. Logo Trefoil nadaje modelowi status must-have, który trudno nazwać zwyczajnym.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna koszulka inspirowana archiwalnymi modelami.', 'adicolor-seasonal-archive-tee', '', '', '', 'Adicolor Seasonal Archive Tee', '', '', '', ''),
(351, 1, 1, 'Odkryj lepszą wersję siebie. Trenuj, jak chcesz, w koszulce adidas stworzonej z myślą o ruchu. AEROREADY reguluje wilgoć, gdy robi się gorąco, zapewniając Ci komfort. Design gwarantuje pełną swobodę ruchu, więc zdecyduj się na dodatkową serię ćwiczeń z uniesionymi ramionami.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Koszulka treningowa adidas z 3 paskami wykonana z materiałów pochodzących z recyklingu.', 'train-essentials-3-stripes-training-tee', '', '', '', 'Train Essentials 3-Stripes Training Tee', '', '', '', ''),
(352, 1, 1, 'Niech wszyscy wiedzą, że sport jest Twoją pasją. Koszulka adidas z logo Trefoil na piersi i kontrastowymi 3 paskami to ponadczasowy klasyk i podstawowy element garderoby. Noś ją jako element codziennego stroju w swobodnym stylu ze sportowym zacięciem i kolorami, które pokazują dumę narodową. Bawełniana dzianina rozciąga się wystarczająco, by zapewnić Ci komfort.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Charakterystyczna koszulka inspirowana piłką nożną i dumą drużyny.', '3-stripes-tee', '', '', '', '3-Stripes Tee', '', '', '', ''),
(353, 1, 1, 'Wybierz koszulkę, która ma same plusy. Mówimy tu o wysokiej jakości bawełnie organicznej, swobodnym designie i kultowym stylu adidas. Ta koszulka ma prosty design, co sprawia, że pasuje do wszystkiego i jest tak wygodna, że chce się ją nosić zawsze.   Ten produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Klasyczna koszulka adidas stworzona z myślą o naturze.', 'adicolor-contempo-tee', '', '', '', 'Adicolor Contempo Tee', '', '', '', ''),
(354, 1, 1, 'Niech wszyscy wiedzą, że sport jest Twoją pasją. Koszulka adidas z logo Trefoil na piersi i kontrastowymi 3 paskami to ponadczasowy klasyk i podstawowy element garderoby. Noś ją jako element codziennego stroju w swobodnym stylu ze sportowym zacięciem i kolorami, które pokazują dumę narodową. Bawełniana dzianina rozciąga się wystarczająco, by zapewnić Ci komfort.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Charakterystyczna koszulka inspirowana piłką nożną i dumą drużyny.', '3-stripes-tee', '', '', '', '3-Stripes Tee', '', '', '', ''),
(355, 1, 1, 'Jeśli ciężko pracujesz, pocisz się. Na szczęście dla Ciebie, ta koszulka treningowa adidas reaguje na pot przy pomocy pochłaniającego wilgoć AEROREADY, który zapewnia Ci suchy komfort, i pleców z siateczki, które maksymalizują przepływ powietrza. 3 paski owijające się wokół rękawów i logo z 3 paskami na przodzie nawiązują do sportowego dziedzictwa marki.', 'Koszulka treningowa z siateczkowym tyłem wykonana częściowo z materiałów pochodzących z recyklingu.', 'train-icons-3-stripes-training-tee', '', '', '', 'Train Icons 3-Stripes Training Tee', '', '', '', ''),
(356, 1, 1, 'Klasyczny styl. Poczujesz to za każdym razem, gdy założysz tę bluzę adidas z zaokrąglonym dekoltem. A gdy masz idealnie dopasowany krój, nie potrzebujesz dodatków, aby się wyróżnić. Subtelne logo Trefoil stanowi odpowiedni detal, który uzupełnia dopracowany, a jednocześnie wygodny look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Minimalistyczna bluza, która sprawdzi się w każdej sytuacji.', 'trefoil-essentials-crewneck-sweatshirt', '', '', '', 'Trefoil Essentials Crewneck Sweatshirt', '', '', '', ''),
(357, 1, 1, 'Bluza adidas Rekive Crew to najczystsza wersja designu adidas. Wygoda. Sportowe DNA za sprawą kultowych 3 pasków i logo adidas Trefoil. Minimalistyczny styl z odrobiną szaleństwa dzięki kontrastowym detalom.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka bluza z materiału frotté dla całkowitego komfortu.', 'adidas-rekive-crew-sweatshirt', '', '', '', 'adidas Rekive Crew Sweatshirt', '', '', '', ''),
(358, 1, 1, 'Klasyka zawsze się sprawdza. Ta bluza w oryginalnym stylu adidas ma charakterystyczne 3 paski i wyszywane logo Trefoil, które nadaje jej zawsze świeży look. Miękki polar zapewni Ci komfort, gdy odpoczywasz w domu lub spędzasz dzień z przyjaciółmi.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna bluza z zaokrąglonym dekoltem zapewniająca komfort i styl na co dzień.', 'adicolor-classics-3-stripes-crew-sweatshirt', '', '', '', 'Adicolor Classics 3-Stripes Crew Sweatshirt', '', '', '', ''),
(359, 1, 1, '„Kolekcja Adicolor Heritage Now czerpie inspirację z archiwalnych modeli i klasyków stylu. Linia, która rzuca światło na detale jednoznacznie kojarzące się z adidas, łączy luksusowe i teksturowane materiały z jasną paletą barw, aby nadać kultowym sylwetkom nową, pełną energii formę.” — Senior Originals Designers, Florence Marrinier &amp; Lena Sophie Anders  Przyciągająca wzrok, odważna i nostalgiczna bluza z kominem Adicolor Heritage Now z weluru to nowoczesna odsłona stylu sprzed lat. Bluza o standardowym kroju z suwakiem do połowy długości została uszyta z luksusowego weluru i ma zabawny, a jednocześnie stylowy nadruk z logo Trefoil na całej powierzchni. Przemyślane detale, takie jak spiralny suwak z brandingiem i wysokiej jakości ściągacz z 3 paskami, nadają nowoczesny charakter podstawowemu elementowi garderoby w stylu sprzed lat.', 'Miły w dotyku welurowy suwak do połowy długości z nadrukowanym na całości logo Trefoil.', 'adicolor-heritage-now-funnel-velour-top', '', '', '', 'Adicolor Heritage Now Funnel Velour Top', '', '', '', ''),
(360, 1, 1, 'Bluza nie musi być podstawowa. Może być bombowa.  Bluza z kapturem adidas ze wzorem na całej powierzchni, który oddaje hołd klasycznemu logo Trefoil łączy wygodę i rewelacyjny styl. Detale w stylu retro, takie jak naszyte logo na kieszeni, nadają jej klasyczny charakter, a kaptur ze sznurkiem do regulacji umożliwia idealne dopasowanie. Konstrukcja z bawełnianego, przytulnego polaru jest miękka w dotyku, dzięki czemu możesz nosić ją na co dzień.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wkładana przez głowę bluza z kapturem z logo Trefoil w artystycznej odsłonie.', 'original-athletic-club-allover-print-hoodie', '', '', '', 'Original Athletic Club Allover Print Hoodie', '', '', '', ''),
(361, 1, 1, 'Kiedy zmienia się pogoda, Twoje ubranie też powinno. Wykorzystaj okazję. Otul się miękkim, przytulnym polarem tej bluzy adidas i staw czoła chłodnej pogodzie w wyszukanym, minimalistycznym stylu. Małe logo Trefoil podkreśla dumny styl marki.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego. Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Miękka, wygodna bluza, która pasuje do wszystkiego.', 'adicolor-essentials-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Essentials Trefoil Crewneck Sweatshirt', '', '', '', ''),
(362, 1, 1, 'Jedno logo Trefoil robi całą robotę. Pomnóż je, a otrzymasz zupełnie nowy look. Kultowe logo w podwojonej wersji na tej prostej bluzie adidas, prezentuje wzór złożony w monogramów w monochromatycznym stylu. Miękki, bawełniany materiał frotté sprawia, że model jest wyjątkowo wygodny, a ściągacze na dole i mankietach stanowią miły w dotyku detal, który musi mieć każda dobra bluza.', 'Bluza, która w pełni wykorzystuje logo Trefoil w stonowanych odcieniach.', 'graphics-monogram-crew-sweatshirt', '', '', '', 'Graphics Monogram Crew Sweatshirt', '', '', '', ''),
(363, 1, 1, 'Klasyka w sercu. Małe logo Trefoil i wyszywana naszywka z godłem Manchesteru United nadają tej bluzie adidas ponadczasowy, piłkarski look. Miękki polar sprawia, że idealnie nadaje się do założenia na koszulkę klubową. Ściągaczowe detale stanowią doskonałe wykończenie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Bluza Manchesteru United z zaokrąglonym dekoltem w ponadczasowym stylu.', 'manchester-united-essentials-trefoil-sweatshirt', '', '', '', 'Manchester United Essentials Trefoil Sweatshirt', '', '', '', ''),
(364, 1, 1, 'Swobodny styl z pasją. Ta bluza piłkarska adidas pozwoli Ci pokazać, że kibicujesz Manchesterowi United, zachowując jednocześnie swobodny look. Luźny krój z bawełnianego materiału frotté zapewnia Ci komfort, gdy oglądasz mecz z przyjaciółmi. Godło na piersi pokazuje wszystkim, komu kibicujesz.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Swobodna i wygodna bluza dla kibiców Manchesteru United.', 'manchester-united-graphic-crew-sweatshirt', '', '', '', 'Manchester United Graphic Crew Sweatshirt', '', '', '', ''),
(365, 1, 1, 'Zwiększ swoją siłę rażenia na polu golfowym dzięki wkładanej przez głowę bluzie adidas z polaru do gry w golfa. Gdy dzień jest chłodny już od rana lub gdy chmurzy się dopiero po południu, ten model zapewni Ci ciepło i swobodę ruchu, ułatwiając koncentrację na uderzeniach. Został powleczony trwałym, wodoodpornym wykończeniem, które gwarantuje suchy komfort w mgliste poranki i podczas lekkich opadów. Swobodny krój sprawdzi się również poza polem golfowym.', 'Ciepła, wkładana przez głowę bluza z polaru uszyta z materiałów pochodzących z recyklingu.', 'dwr-colorblock-1-4-zip-pullover', '', '', '', 'DWR Colorblock 1/4-Zip Pullover', '', '', '', ''),
(366, 1, 1, 'Klasyczny styl. Poczujesz to za każdym razem, gdy założysz tę bluzę adidas z zaokrąglonym dekoltem. A gdy masz idealnie dopasowany krój, nie potrzebujesz dodatków, aby się wyróżnić. Subtelne logo Trefoil stanowi odpowiedni detal, który uzupełnia dopracowany, a jednocześnie wygodny look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Minimalistyczna bluza, która sprawdzi się w każdej sytuacji.', 'trefoil-essentials-crewneck-sweatshirt', '', '', '', 'Trefoil Essentials Crewneck Sweatshirt', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(367, 1, 1, 'Bądź w centrum uwagi. Dzięki logo Trefoil. Ikona stylu, która od 1972 roku zmienia obraz gry, wyróżnia się na przodzie tej bluzy adidas. A co najlepsze, gdy prezentujesz autentyczny styl adidas, miły w dotyku materiał frotté sprawia, że czujesz się komfortowo.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Miła w dotyku bluza z kapturem, która nawiązuje do tradycji adidas.', 'adicolor-classics-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Classics Trefoil Crewneck Sweatshirt', '', '', '', ''),
(368, 1, 1, 'Jeśli lubisz styl retro, nie przegap tej bluzy adidas. Jej design pochodzi wprost z archiwów, a kultowa grafika stanowi hołd dla naszej sportowej tradycji. Ale nie daj się zwieść sportowemu stylowi. Jej swobodny komfort został stworzony, aby się wyluzować.  Ten produkt zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 40% materiałów pochodzących z recyklingu.', 'Bluza o klasycznym designie częściowo wykonana z Parley Ocean Plastic.', 'adicolor-classics-cut-line-crew-sweatshirt', '', '', '', 'Adicolor Classics Cut Line Crew Sweatshirt', '', '', '', ''),
(369, 1, 1, 'Bądź w centrum uwagi. Dzięki logo Trefoil. Ikona stylu, która od 1972 roku zmienia obraz gry, wyróżnia się na przodzie tej bluzy adidas. A co najlepsze, gdy prezentujesz autentyczny styl adidas, miły w dotyku materiał frotté sprawia, że czujesz się komfortowo.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Miła w dotyku bluza z kapturem, która nawiązuje do tradycji adidas.', 'adicolor-classics-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Classics Trefoil Crewneck Sweatshirt', '', '', '', ''),
(370, 1, 1, 'Temperatura spadła, ale to nie znaczy, że Twój look musi na tym ucierpieć. Dzięki konstrukcji z grubego materiału frotté i kultowym 3 paskom bluza adidas zapewnia Ci przyjemny komfort i świeży styl.   Nasze bawełniane produkty wspierają uprawę ze zrównoważonych źródeł. Ten model zawiera też materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Klasyczna, ciepła bluza z zaokrąglonym dekoltem w dobrym stylu.', 'adicolor-classics-3-stripes-crew-sweatshirt', '', '', '', 'Adicolor Classics 3-Stripes Crew Sweatshirt', '', '', '', ''),
(371, 1, 1, 'Na boisku i poza nim będziesz przygotowany do działania w piłkarskiej bluzie treningowej adidas Entrada 22. Suwak do połowy długości umożliwia regulację stopnia osłony, a elastyczne mankiety utrzymują design na swoim miejscu. AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Odprowadzająca wilgoć bluza treningowa wykonana z materiałów pochodzących z recyklingu.', 'entrada-22-training-top', '', '', '', 'Entrada 22 Training Top', '', '', '', ''),
(372, 1, 1, 'Bluza adidas ma archiwalne detale, które nie przejdą niezauważone. Prosta linia kroju w jodełkę i duże, wyszywane logo Trefoil na przodzie podkreślają Twój oryginalny styl. Zrelaksuj się na maksa w miękkiej dzianinie bawełnianej. W tym modelu zechcesz żyć.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Nostalgiczna odsłona klasycznej bluzy.', 'adicolor-seasonal-archive-half-zip-crew-sweatshirt', '', '', '', 'Adicolor Seasonal Archive Half-Zip Crew Sweatshirt', '', '', '', ''),
(373, 1, 1, 'Kiedy zmienia się pogoda, Twoje ubranie też powinno. Wykorzystaj okazję. Otul się miękkim, przytulnym polarem tej bluzy adidas i staw czoła chłodnej pogodzie w wyszukanym, minimalistycznym stylu. Małe logo Trefoil podkreśla dumny styl marki.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego. Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Miękka, wygodna bluza, która pasuje do wszystkiego.', 'adicolor-essentials-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Essentials Trefoil Crewneck Sweatshirt', '', '', '', ''),
(374, 1, 1, 'Pokaż światu swój styl MVP dzięki bluzie adidas z zaokrąglonym dekoltem. Duża grafika z logo Trefoil na przodzie przyciąga uwagę i sprawia, że swobodny styl zamienia się w kultowy. Załóż ten model na koszulkę z kołnierzem, aby zyskać wyrazisty look, lub zestaw go z ulubionymi dżinsami lub spodniami dresowymi. Miękki materiał frotté zapewni Ci przytulny komfort niezależnie od okoliczności.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna bluza z zaokrąglonym dekoltem i grafiką.', 'adicolor-classics-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Classics Trefoil Crewneck Sweatshirt', '', '', '', ''),
(375, 1, 1, 'Klasyczny styl. Poczujesz to za każdym razem, gdy założysz tę bluzę adidas z zaokrąglonym dekoltem. A gdy masz idealnie dopasowany krój, nie potrzebujesz dodatków, aby się wyróżnić. Subtelne logo Trefoil stanowi odpowiedni detal, który uzupełnia dopracowany, a jednocześnie wygodny look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Minimalistyczna bluza, która sprawdzi się w każdej sytuacji.', 'trefoil-essentials-crewneck-sweatshirt', '', '', '', 'Trefoil Essentials Crewneck Sweatshirt', '', '', '', ''),
(376, 1, 1, 'Klasyka zawsze się sprawdza. Ta bluza w oryginalnym stylu adidas ma charakterystyczne 3 paski i wyszywane logo Trefoil, które nadaje jej zawsze świeży look. Miękki polar zapewni Ci komfort, gdy odpoczywasz w domu lub spędzasz dzień z przyjaciółmi.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczna bluza z zaokrąglonym dekoltem zapewniająca komfort i styl na co dzień.', 'adicolor-classics-3-stripes-crew-sweatshirt', '', '', '', 'Adicolor Classics 3-Stripes Crew Sweatshirt', '', '', '', ''),
(377, 1, 1, 'Klasyczny styl. Poczujesz to za każdym razem, gdy założysz tę bluzę adidas z zaokrąglonym dekoltem. A gdy masz idealnie dopasowany krój, nie potrzebujesz dodatków, aby się wyróżnić. Subtelne logo Trefoil stanowi odpowiedni detal, który uzupełnia dopracowany, a jednocześnie wygodny look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Minimalistyczna bluza, która sprawdzi się w każdej sytuacji.', 'trefoil-essentials-crewneck-sweatshirt', '', '', '', 'Trefoil Essentials Crewneck Sweatshirt', '', '', '', ''),
(378, 1, 1, 'Czekamy cztery lata na jeden z najbardziej ekscytujących momentów w piłce nożnej. Ta bluza adidas dla mężczyzn jest na to gotowa i pasuje do tych emocji, prezentując grafikę na całej powierzchni, która wprowadza nastrój oczekiwania. Miękki materiał ze ściągaczowymi wstawkami oznacza wygodę podczas kibicowania swojemu klubowi, ale szybko się przekonasz, że będziesz nosić wkładaną przez głowę bluzę także na co dzień.', 'Wygodna bluza wykonana częściowo z materiałów pochodzących z recyklingu.', 'designed-for-gameday-crew-sweatshirt', '', '', '', 'Designed for Gameday Crew Sweatshirt', '', '', '', ''),
(379, 1, 1, 'Niech Twój sezon trwa cały rok. Ta wkładana przez głowę bluza adidas do gry w golfa zapewnia lekki, ciepły komfort i ochronę przed niekorzystnymi warunkami atmosferycznymi, dzięki czemu możesz grać w różnych temperaturach. Model jest odporny na mgłę i lekki deszcz, dzięki czemu możesz cieszyć się ciepłem i suchym komfortem aż do ostatniego dołka.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekka, polarowa bluza golfowa z materiałów pochodzących z recyklingu.', 'dwr-1-4-zip-pullover', '', '', '', 'DWR 1/4-Zip Pullover', '', '', '', ''),
(380, 1, 1, 'Wesołych Świąt i każdego innego dnia! Podchodząc na luzie do designu klasycznego świątecznego swetra, ten wyróżniający się model adidas w nietypowy sposób oddaje ducha tych wyjątkowych dni. Powiększone detale o warkoczowym splocie nadają mu przytulny charakter, który dodatkowo podkreśla styl rękawów. Znajdziesz tam logo Trefoil w animowanej odsłonie, które wyraźnie wskazuje, że nie musisz daleko szukać przygody. Ten zabawny detal uosabia radość, jaka towarzyszy wakacyjnym wyprawom ― czy to w góry widoczne na jednym rękawie, czy na plażę, która widnieje na drugim. Ściągaczowy, stawiany kołnierz ogrzeje Ci szyję, a luźny krój pozwoli Ci zestawić ten model z długą, zapinaną na guziki koszulą lub po prostu t-shirtem. Ten model uszyto wykorzystując UNITEFIT — uniwersalny system dopasowania uwzględniający różne rozmiary, płcie i typy sylwetki.', 'Sweter pełen charakteru z detalami, które są zarówno klasyczne, jak i całkiem nowe.', 'xmas-sweater-gender-neutral', '', '', '', 'Xmas Sweater (Gender Neutral)', '', '', '', ''),
(381, 1, 1, 'Miej w swojej szafie bluzę, dzięki której ciepło pomyślisz o chłodnych dniach. Gruby polar w zestawieniu z prostym, klasycznym stylem adidas sprawia, że jednocześnie zyskujesz wygodę i świetny wygląd.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Minimalistyczna, mięsista bluza.', 'adicolor-contempo-crew-sweatshirt', '', '', '', 'Adicolor Contempo Crew Sweatshirt', '', '', '', ''),
(382, 1, 1, 'Bluza adidas daje Ci tak wiele możliwości: jest dwustronna, uniwersalna i niezwykle funkcjonalna. Jedna strona wykonana jest z mocnej tkaniny CORDURA®, a druga z ultramiękkiego polaru. Wszyte kieszenie z przodu pomieszczą najbardziej potrzebne drobiazgi, a dół regulowany stoperami pozwoli Ci ochronić się przed zimnym powietrzem. Możesz ją nosić jako warstwę na wszystkim dzięki obszernemu krojowi i suwakowi do połowy długości.', 'Ciepła bluza w podwójnym stylu wykonana z materiałów pochodzących z recyklingu.', 'adventure-fc-reversible-polar-half-zip-jacket', '', '', '', 'Adventure FC Reversible Polar Half Zip Jacket', '', '', '', ''),
(383, 1, 1, 'Minimalizm jest podstawą ekspresji w najnowszej kolekcji stworzonej we współpracy z Pharrellem. Ta bluza z zaokrąglonym dekoltem koncentruje się na kolorze i materiale, zachęcając do zabawy stylem. Poczuj komfort miękkiego materiału frotté. Duże, teksturowane logo Humanrace wyróżnia się z przodu, a wyszywane logo Trefoil widnieje nad prawym rękawem. Ten model został uszyty z wykorzystaniem UNITEFIT — uniwersalnego systemu dopasowania uwzględniającego różne rozmiary, płcie i typy sylwetki.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Prosta bluza do noszenia na co dzień stworzona z myślą o wyrażaniu siebie.', 'pharrell-williams-basics-crew-sweatshirt-uniseks', '', '', '', 'Pharrell Williams Basics Crew Sweatshirt (uniseks)', '', '', '', ''),
(384, 1, 1, 'W chłodne poranki ta golfowa bluza z kapturem adidas zapewni Ci komfort podczas gry. Ma prosty, swobodny styl, który sprawdzi się również poza polem golfowym. COLD.RDY zatrzymuje ciepło, aby zapewnić Ci ciepło bez zwiększania objętości ubrania. Krój gwarantujący pełną swobodę ruchu pozwoli poruszać się bez ograniczeń na polu golfowym i poza nim.', 'Ciepła, polarowa bluza z kapturem do gry w golfa uszyta z materiałów pochodzących z recyklingu.', '3-stripes-coldrdy-hoodie', '', '', '', '3-Stripes COLD.RDY Hoodie', '', '', '', ''),
(385, 1, 1, 'Niezależnie od tego, czy ćwiczysz dalekie uderzenia na polu treningowym, czy grasz całą rundę, ta golfowa bluza z kapturem adidas zapewni Ci komfort, gdy temperatura spada. Jest miękka i gładka w dotyku, co przekłada się na poczucie wygody. Elastyczny dół ze sznurkiem do regulacji umożliwia idealne dopasowanie.', 'Szybkoschnąca bluza z kapturem do gry w golfa, która zapewni Ci komfort na polu golfowym.', 'ripstop-1-4-zip-golf-hoodie', '', '', '', 'Ripstop 1/4-Zip Golf Hoodie', '', '', '', ''),
(386, 1, 1, 'W chłodne dni potrzebujesz lekkiej warstwy okrycia. Wkładana przez głowę bluza adidas do gry w golfa została uszyta z miękkiej dzianiny, która zapewnia komfort na polu golfowym. Pochłaniający wilgoć AEROREADY daje Ci poczucie suchości, a wbudowany filtr UV pozwala na pewną grę w słoneczne dni.  Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Lekka, wkładana przez głowę bluza do gry w golfa z materiałów pochodzących z recyklingu.', 'quarter-zip-pullover', '', '', '', 'Quarter-Zip Pullover', '', '', '', ''),
(387, 1, 1, 'Real Madryt i adidas. Dwa symbole Twojej sportowej pasji. Ta bluza piłkarska prezentuje duże, dwukolorowe logo adidas Badge of Sport i nazwę klubu, która pojawia się na ustach milionów kibiców na całym świecie. Konstrukcja z materiału frotté i zaokrąglony dekolt ze ściągaczem zapewniają wygodę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka bluza, w której pokażesz, że kibicujesz Realowi Madryt.', 'real-madrid-dna-crew-sweatshirt', '', '', '', 'Real Madrid DNA Crew Sweatshirt', '', '', '', ''),
(388, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Dzięki konstrukcji z miękkiego polaru ta bluza adidas zapewni Ci komfort w drodze na trening. Długie rękawy zapewniają lepsze okrycie, gdy przygotowujesz się na wieczorne sesje w chłodne dni.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bluza wykonana częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweatshirt', '', '', '', 'Entrada 22 Sweatshirt', '', '', '', ''),
(389, 1, 1, 'Temperatura spadła, ale to nie znaczy, że Twój look musi na tym ucierpieć. Dzięki konstrukcji z grubego materiału frotté i kultowym 3 paskom bluza adidas zapewnia Ci przyjemny komfort i świeży styl.   Nasze bawełniane produkty wspierają uprawę ze zrównoważonych źródeł. Ten model zawiera też materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Klasyczna, ciepła bluza z zaokrąglonym dekoltem w dobrym stylu.', 'adicolor-classics-3-stripes-crew-sweatshirt', '', '', '', 'Adicolor Classics 3-Stripes Crew Sweatshirt', '', '', '', ''),
(390, 1, 1, 'Ubieranie się rano często oznacza zakładanie wielu warstw. Zapewnij sobie wygodę przez całą rundę w tej wkładanej przez głowę bluzie adidas do gry w golfa. Design z krótkim suwakiem umożliwia regulację przepływu powietrza, gdy temperatura rozgrywki rośnie na ostatnich dziewięciu dołkach. Mankiety i dół wykończone taśmą utrzymują design na swoim miejscu, gdy wykonujesz zamachy i wyginasz się.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Miękka w dotyku, wkładana przez głowę bluza do gry w golfa wykonana częściowo z materiałów pochodzących z recyklingu.', 'elevated-1-4-zip-pullover', '', '', '', 'Elevated 1/4-Zip Pullover', '', '', '', ''),
(391, 1, 1, 'Bluza adidas ma archiwalne detale, które nie przejdą niezauważone. Prosta linia kroju w jodełkę i duże, wyszywane logo Trefoil na przodzie podkreślają Twój oryginalny styl. Zrelaksuj się na maksa w miękkiej dzianinie bawełnianej. W tym modelu zechcesz żyć.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Nostalgiczna odsłona klasycznej bluzy.', 'adicolor-seasonal-archive-half-zip-crew-sweatshirt', '', '', '', 'Adicolor Seasonal Archive Half-Zip Crew Sweatshirt', '', '', '', ''),
(392, 1, 1, 'Na boisku i poza nim będziesz przygotowany do działania w piłkarskiej bluzie treningowej adidas Entrada 22. Suwak do połowy długości umożliwia regulację stopnia osłony, a elastyczne mankiety utrzymują design na swoim miejscu. AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Odprowadzająca wilgoć bluza treningowa wykonana z materiałów pochodzących z recyklingu.', 'entrada-22-training-top', '', '', '', 'Entrada 22 Training Top', '', '', '', ''),
(393, 1, 1, 'W chłodne dni potrzebujesz lekkiej warstwy okrycia. Wkładana przez głowę bluza adidas do gry w golfa została uszyta z miękkiej dzianiny, która zapewnia komfort na polu golfowym. Pochłaniający wilgoć AEROREADY daje Ci poczucie suchości, a wbudowany filtr UV pozwala na pewną grę w słoneczne dni.  Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Lekka, wkładana przez głowę bluza do gry w golfa z materiałów pochodzących z recyklingu.', 'quarter-zip-pullover', '', '', '', 'Quarter-Zip Pullover', '', '', '', ''),
(394, 1, 1, 'W chłodne poranki ta golfowa bluza z kapturem adidas zapewni Ci komfort podczas gry. Ma prosty, swobodny styl, który sprawdzi się również poza polem golfowym. COLD.RDY zatrzymuje ciepło, aby zapewnić Ci ciepło bez zwiększania objętości ubrania. Krój gwarantujący pełną swobodę ruchu pozwoli poruszać się bez ograniczeń na polu golfowym i poza nim.', 'Ciepła, polarowa bluza z kapturem do gry w golfa uszyta z materiałów pochodzących z recyklingu.', '3-stripes-coldrdy-hoodie', '', '', '', '3-Stripes COLD.RDY Hoodie', '', '', '', ''),
(395, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Dzięki konstrukcji z miękkiego polaru ta bluza adidas zapewni Ci komfort w drodze na trening. Długie rękawy zapewniają lepsze okrycie, gdy przygotowujesz się na wieczorne sesje w chłodne dni.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bluza wykonana częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweatshirt', '', '', '', 'Entrada 22 Sweatshirt', '', '', '', ''),
(396, 1, 1, 'Wygoda i wyrażanie siebie. Ta bluza adidas z dzianiny łączy miękką bawełnę z zaskakującym półgolfem. Subtelny branding na piersi nadaje świeży, unikalny charakter klasycznemu stylowi. Minimalistyczny i świeży model pasuje do wszystkiego: od dresu po spodnie w kancik.', 'Wyróżniająca się, wygodna bluza z dzianiny, którą możesz nosić nawet codziennie.', 'reclaim-knit-jumper', '', '', '', 'Reclaim Knit Jumper', '', '', '', ''),
(397, 1, 1, 'Zawsze jesteś VIP-em w klubie sportowym adidas. Załóż tę bluzę z materiału frotté w dniu treningu lub każdego innego dnia, a automatycznie dołączysz do klubu. Gdy temperatura treningu rośnie, AEROREADY zapewnia Ci komfort i gotowość na wszystko, co może się wydarzyć.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Bluza treningowa wykonana z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'sports-club-sweatshirt', '', '', '', 'Sports Club Sweatshirt', '', '', '', ''),
(398, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Dzięki konstrukcji z miękkiego polaru ta bluza adidas zapewni Ci komfort w drodze na trening. Długie rękawy zapewniają lepsze okrycie, gdy przygotowujesz się na wieczorne sesje w chłodne dni.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bluza wykonana częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweatshirt', '', '', '', 'Entrada 22 Sweatshirt', '', '', '', ''),
(399, 1, 1, 'Klasyczny styl. Poczujesz to za każdym razem, gdy założysz tę bluzę adidas z zaokrąglonym dekoltem. A gdy masz idealnie dopasowany krój, nie potrzebujesz dodatków, aby się wyróżnić. Subtelne logo Trefoil stanowi odpowiedni detal, który uzupełnia dopracowany, a jednocześnie wygodny look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Minimalistyczna bluza, która sprawdzi się w każdej sytuacji.', 'trefoil-essentials-crewneck-sweatshirt', '', '', '', 'Trefoil Essentials Crewneck Sweatshirt', '', '', '', ''),
(400, 1, 1, 'Niepowtarzalny styl Ajaksu Amsterdam łączy się z klasycznym designem adidas. Małe logo Trefoil i wyszywana naszywka klubowa prezentują się w ponadczasowym, sportowym stylu na piersi prostego, wyrazistego designu tej bluzy piłkarskiej. Bluza z miękkiego polaru została dla Twojej wygody wykończona ściągaczowymi detalami.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Zaprezentuj się w ponadczasowym stylu piłkarskim w tej miękkiej bluzie Ajaksu Amsterdam.', 'ajax-amsterdam-essentials-trefoil-sweatshirt', '', '', '', 'Ajax Amsterdam Essentials Trefoil Sweatshirt', '', '', '', ''),
(401, 1, 1, 'Bluza z kapturem adidas ma luźny krój i szerokie rękawy, które zapewniają swobodę ruchu przez cały dzień. To doskonały styl, gdy chcesz być incognito lub po prostu czuć się komfortowo, zajmując się swoimi sprawami. Nawet jeśli jest ciepły dzień, poczujesz idealną równowagę dzięki miękkiej bawełnie i krótkim rękawom.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Bluza z kapturem i krótkim rękawem stworzona, aby poruszać się razem z Tobą.', 'adicolor-classics-short-sleeve-hoodie', '', '', '', 'Adicolor Classics Short Sleeve Hoodie', '', '', '', ''),
(402, 1, 1, 'Na boisku i poza nim będziesz przygotowany do działania w piłkarskiej bluzie treningowej adidas Entrada 22. Suwak do połowy długości umożliwia regulację stopnia osłony, a elastyczne mankiety utrzymują design na swoim miejscu. AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Odprowadzająca wilgoć bluza treningowa wykonana z materiałów pochodzących z recyklingu.', 'entrada-22-training-top', '', '', '', 'Entrada 22 Training Top', '', '', '', ''),
(403, 1, 1, 'Na boisku i poza nim będziesz przygotowany do działania w piłkarskiej bluzie treningowej adidas Entrada 22. Suwak do połowy długości umożliwia regulację stopnia osłony, a elastyczne mankiety utrzymują design na swoim miejscu. AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Odprowadzająca wilgoć bluza treningowa wykonana z materiałów pochodzących z recyklingu.', 'entrada-22-training-top', '', '', '', 'Entrada 22 Training Top', '', '', '', ''),
(404, 1, 1, 'Swobodny strój jeszcze nigdy nie wyglądał tak dobrze. Zachowaj luźny styl dzięki tej bluzie adidas, która ma gładki, minimalistyczny look i pluszowy, luksusowy charakter. Zasuń suwak i ściągnij dół, aby chronić się przed chłodnym powietrzem. A potem ciesz się komfortem przez cały dzień.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'A heavyweight sweatshirt with adjustable details.', 'adicolor-contempo-half-zip-crew-sweatshirt', '', '', '', 'Adicolor Contempo Half-Zip Crew Sweatshirt', '', '', '', ''),
(405, 1, 1, 'Zrób trochę miejsca w szafie. Przecież trzeba gdzieś odłożyć kolejną bluzę z zaokrąglonym dekoltem. Zwłaszcza, gdy ma świeży, klasyczny look i odrobinę stylu retro jak ten model od adidas. A co najlepsze, pluszowy materiał frotté, który zapewni Ci ciepło.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Twoja nowa bluza z kultowym brandingiem adidas.', 'adicolor-classics-lock-up-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Classics Lock-Up Trefoil Crewneck Sweatshirt', '', '', '', ''),
(406, 1, 1, 'Kiedy temperatura spada, musisz być przygotowany. Ponieważ masz wiele do zrobienia, a te plany nie zmienią się tylko dlatego, że pogoda się zmieniła. Załóż tę kurtkę adidas. Uszyto ją z miękkiego, przyjemnego polaru, co oznacza, że zapewnia jedynie komfort i ciepło. I styl, który jest oczywisty.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Wygodna kurtka z polaru uszyta z materiałów pochodzących z recyklingu.', 'adicolor-classics-trefoil-teddy-fleece-jacket', '', '', '', 'Adicolor Classics Trefoil Teddy Fleece Jacket', '', '', '', ''),
(407, 1, 1, 'Zwiększ swoją siłę rażenia na polu golfowym dzięki wkładanej przez głowę bluzie adidas z polaru do gry w golfa. Gdy dzień jest chłodny już od rana lub gdy chmurzy się dopiero po południu, ten model zapewni Ci ciepło i swobodę ruchu, ułatwiając koncentrację na uderzeniach. Został powleczony trwałym, wodoodpornym wykończeniem, które gwarantuje suchy komfort w mgliste poranki i podczas lekkich opadów. Swobodny krój sprawdzi się również poza polem golfowym.', 'Ciepła, wkładana przez głowę bluza z polaru uszyta z materiałów pochodzących z recyklingu.', 'dwr-colorblock-1-4-zip-pullover', '', '', '', 'DWR Colorblock 1/4-Zip Pullover', '', '', '', ''),
(408, 1, 1, 'Bluza adidas Rekive Crew to najczystsza wersja designu adidas. Wygoda. Sportowe DNA za sprawą kultowych 3 pasków i logo adidas Trefoil. Minimalistyczny styl z odrobiną szaleństwa dzięki kontrastowym detalom.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka bluza z materiału frotté dla całkowitego komfortu.', 'adidas-rekive-crew-sweatshirt', '', '', '', 'adidas Rekive Crew Sweatshirt', '', '', '', ''),
(409, 1, 1, 'Kiedy czujesz się komfortowo, możesz wiele osiągnąć. Albo po prostu cieszyć się wygodą. Ta bluza adidas sprawdzi się podczas aktywności i relaksu. Miękki polar sprawia, że czujesz się dobrze niezależnie od tego, co robisz i w jakim tempie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wkładana przez głowę bluza z krótkim suwakiem uszyta z miłego w dotyku polaru.', '1-4-zip-sweatshirt', '', '', '', '1/4 Zip Sweatshirt', '', '', '', ''),
(410, 1, 1, 'Zawsze jesteś VIP-em w klubie sportowym adidas. Załóż tę bluzę z materiału frotté w dniu treningu lub każdego innego dnia, a automatycznie dołączysz do klubu. Gdy temperatura treningu rośnie, AEROREADY zapewnia Ci komfort i gotowość na wszystko, co może się wydarzyć.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Bluza treningowa wykonana z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'sports-club-sweatshirt', '', '', '', 'Sports Club Sweatshirt', '', '', '', ''),
(411, 1, 1, 'Zdejmij buty i rozpocznij relaks w komfortowej bluzie z kapturem po całodniowej wędrówce. Bluza z kapturem adidas Terrex zachowuje prosty, klasyczny styl dzięki konstrukcji z miękkiej dzianiny bawełnianej ze typowymi detalami, jakich się spodziewasz, takimi jak ściągacze w mankietach i u dołu oraz oczywiście kaptur.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bluza z kapturem Terrex wykonana częściowo z materiału pochodzącego z recyklingu.', 'terrex-logo-graphic-hoodie', '', '', '', 'Terrex Logo Graphic Hoodie', '', '', '', ''),
(412, 1, 1, 'Kiedy zmienia się pogoda, Twoje ubranie też powinno. Wykorzystaj okazję. Otul się miękkim, przytulnym polarem tej bluzy adidas i staw czoła chłodnej pogodzie w wyszukanym, minimalistycznym stylu. Małe logo Trefoil podkreśla dumny styl marki.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego. Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Miękka, wygodna bluza, która pasuje do wszystkiego.', 'adicolor-essentials-trefoil-crewneck-sweatshirt', '', '', '', 'Adicolor Essentials Trefoil Crewneck Sweatshirt', '', '', '', ''),
(413, 1, 1, 'Zachowaj ciepły komfort na polu golfowym i poza nim. Ta bluza adidas z zaokrąglonym dekoltem jest miła w dotyku i dba o Twój komfort podczas rundy w chłodne dni. Rękawy z mankietami utrzymują design na swoim miejscu, dzięki czemu możesz bez przeszkód wykonywać zamachy. Załóż ją na t-shirt lub koszulkę polo, gdy temperatura spada.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Bluza z zaokrąglonym dekoltem, która zapewni Ci ciepło, wykonana częściowo z materiałów pochodzących z recyklingu.', 'core-crew-sweatshirt', '', '', '', 'Core Crew Sweatshirt', '', '', '', ''),
(414, 1, 1, '3 paski i logo Trefoil są noszone na całym świecie od dziesięcioleci: na kipiących emocjami stadionach, ulicach miast i we wszystkich innych miejscach. Ich zasięg nie ma granic. Dlatego zakładając tę koszulkę polo adidas, zyskujesz coś więcej niż tylko świeży look. Staniesz się częścią historii. Luźny krój i miękki materiał frotté zapewniają Ci wygodę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Ten sweter polo jest inspirowany archiwalnymi modelami i prezentuje się w nowej odsłonie.', 'adicolor-3-stripes-long-sleeve-polo-shirt', '', '', '', 'Adicolor 3-Stripes Long Sleeve Polo Shirt', '', '', '', ''),
(415, 1, 1, 'Przenieś swoją miłość do All Blacks poza linie boiska. Ta bluza adidas do rugby przyciąga wzrok poza boiskiem za sprawą kontrastowej kieszeni, gumowanego godła drużyny i niewyraźnych nadrukowanych 3 pasków. Miękki polar zapewni Ci ciepły komfort, gdy wspierasz swoją drużynę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka bluza w stylu All Blacks.', 'all-blacks-rugby-lifestyle-crewneck-sweatshirt', '', '', '', 'All Blacks Rugby Lifestyle Crewneck Sweatshirt', '', '', '', ''),
(416, 1, 1, 'W chłodne poranki ta golfowa bluza z kapturem adidas zapewni Ci komfort podczas gry. Ma prosty, swobodny styl, który sprawdzi się również poza polem golfowym. COLD.RDY zatrzymuje ciepło, aby zapewnić Ci ciepło bez zwiększania objętości ubrania. Krój gwarantujący pełną swobodę ruchu pozwoli poruszać się bez ograniczeń na polu golfowym i poza nim.', 'Ciepła, polarowa bluza z kapturem do gry w golfa uszyta z materiałów pochodzących z recyklingu.', '3-stripes-coldrdy-hoodie', '', '', '', '3-Stripes COLD.RDY Hoodie', '', '', '', ''),
(417, 1, 1, 'Czekamy cztery lata na jeden z najbardziej ekscytujących momentów w piłce nożnej. Ta bluza adidas dla mężczyzn jest na to gotowa i pasuje do tych emocji, prezentując grafikę na całej powierzchni, która wprowadza nastrój oczekiwania. Miękki materiał ze ściągaczowymi wstawkami oznacza wygodę podczas kibicowania swojemu klubowi, ale szybko się przekonasz, że będziesz nosić wkładaną przez głowę bluzę także na co dzień.', 'Wygodna bluza wykonana częściowo z materiałów pochodzących z recyklingu.', 'designed-for-gameday-crew-sweatshirt', '', '', '', 'Designed for Gameday Crew Sweatshirt', '', '', '', ''),
(418, 1, 1, '3 paski i logo Trefoil są noszone na całym świecie od dziesięcioleci: na kipiących emocjami stadionach, ulicach miast i we wszystkich innych miejscach. Ich zasięg nie ma granic. Dlatego zakładając tę koszulkę polo adidas, zyskujesz coś więcej niż tylko świeży look. Staniesz się częścią historii. Luźny krój i miękki materiał frotté zapewniają Ci wygodę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Ten sweter polo jest inspirowany archiwalnymi modelami i prezentuje się w nowej odsłonie.', 'adicolor-3-stripes-long-sleeve-polo-shirt', '', '', '', 'Adicolor 3-Stripes Long Sleeve Polo Shirt', '', '', '', ''),
(419, 1, 1, 'Na boisku i poza nim będziesz przygotowany do działania w piłkarskiej bluzie treningowej adidas Entrada 22. Suwak do połowy długości umożliwia regulację stopnia osłony, a elastyczne mankiety utrzymują design na swoim miejscu. AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Odprowadzająca wilgoć bluza treningowa wykonana z materiałów pochodzących z recyklingu.', 'entrada-22-training-top', '', '', '', 'Entrada 22 Training Top', '', '', '', ''),
(420, 1, 1, 'Niezależnie od tego, czy ćwiczysz dalekie uderzenia na polu treningowym, czy grasz całą rundę, ta golfowa bluza z kapturem adidas zapewni Ci komfort, gdy temperatura spada. Jest miękka i gładka w dotyku, co przekłada się na poczucie wygody. Elastyczny dół ze sznurkiem do regulacji umożliwia idealne dopasowanie.', 'Szybkoschnąca bluza z kapturem do gry w golfa, która zapewni Ci komfort na polu golfowym.', 'ripstop-1-4-zip-golf-hoodie', '', '', '', 'Ripstop 1/4-Zip Golf Hoodie', '', '', '', ''),
(421, 1, 1, 'Zwróć na siebie uwagę, nie mówiąc ani słowa. Ta bluza adidas do gry w golfa wnosi świeżą energię do Twojej gry za sprawą inspirowanego polem golfowym wzoru na całej powierzchni. Miękki polar gwarantuje ciepło w chłodne poranki i chłodne popołudnia na polu golfowym w stylu, który sprawdzi się także po meczu. Ten model odprowadza lekki deszcz, aby dać Ci suchy komfort podczas rozgrywki w mgliste, deszczowe dni.', 'Wygodna, polarowa bluza do gry w golfa wykonana z materiałów pochodzących z recyklingu.', 'texture-print-crew-sweatshirt', '', '', '', 'Texture-Print Crew Sweatshirt', '', '', '', ''),
(422, 1, 1, 'Ubieranie się rano często oznacza zakładanie wielu warstw. Zapewnij sobie wygodę przez całą rundę w tej wkładanej przez głowę bluzie adidas do gry w golfa. Design z krótkim suwakiem umożliwia regulację przepływu powietrza, gdy temperatura rozgrywki rośnie na ostatnich dziewięciu dołkach. Mankiety i dół wykończone taśmą utrzymują design na swoim miejscu, gdy wykonujesz zamachy i wyginasz się.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Miękka w dotyku, wkładana przez głowę bluza do gry w golfa wykonana częściowo z materiałów pochodzących z recyklingu.', 'elevated-1-4-zip-pullover', '', '', '', 'Elevated 1/4-Zip Pullover', '', '', '', ''),
(423, 1, 1, 'W chłodne dni potrzebujesz lekkiej warstwy okrycia. Wkładana przez głowę bluza adidas do gry w golfa została uszyta z miękkiej dzianiny, która zapewnia komfort na polu golfowym. Pochłaniający wilgoć AEROREADY daje Ci poczucie suchości, a wbudowany filtr UV pozwala na pewną grę w słoneczne dni.  Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Lekka, wkładana przez głowę bluza do gry w golfa z materiałów pochodzących z recyklingu.', 'quarter-zip-pullover', '', '', '', 'Quarter-Zip Pullover', '', '', '', ''),
(424, 1, 1, 'Wędruj beztrosko. Gdy podążasz tam, gdzie pokieruje Cię dzień, ta kurtka adidas otula Cię komfortem za sprawą polaru. Zasuń wysoki kołnierz, aby zatrzymać ciepło. Wyróżnij się akademickimi kolorami i naszywką na piersi na cześć outdoorowej tradycji adidas.', 'Inspirowana outdoorem bluza z polaru na zatrzaski stworzona z myślą o pełnym komforcie.', 'wander-hour-quarter-snap-polar-fleece-jacket', '', '', '', 'Wander Hour Quarter-Snap Polar Fleece Jacket', '', '', '', ''),
(425, 1, 1, 'Klasyczna bluza w kontrastowych kolorach ma prosty, przewiewny krój, który pomoże Ci skoncentrować się na najważniejszym zadaniu: pełnym relaksie. Dzianina o podwójnym splocie miękko przylega do skóry, zachowując jednocześnie swoje właściwości szybkoschnące. Dzięki suwakowi do połowy długości nigdy nie będzie Ci za ciepło ani za zimno, a stawiany kołnierz nadaje całości sportową strukturę.', 'Bluza z suwakiem do połowy długości uszyta z miękkiej, szybkoschnącej dzianiny o podwójnym splocie.', 'colorblock-quarter-zip-sweatshirt', '', '', '', 'Colorblock Quarter Zip Sweatshirt', '', '', '', ''),
(426, 1, 1, 'W chłodne dni potrzebujesz lekkiej warstwy okrycia. Wkładana przez głowę bluza adidas do gry w golfa została uszyta z miękkiej dzianiny, która zapewnia komfort na polu golfowym. Pochłaniający wilgoć AEROREADY daje Ci poczucie suchości, a wbudowany filtr UV pozwala na pewną grę w słoneczne dni.  Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Lekka, wkładana przez głowę bluza do gry w golfa z materiałów pochodzących z recyklingu.', 'quarter-zip-pullover', '', '', '', 'Quarter-Zip Pullover', '', '', '', ''),
(427, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Dzięki konstrukcji z miękkiego polaru ta bluza adidas zapewni Ci komfort w drodze na trening. Długie rękawy zapewniają lepsze okrycie, gdy przygotowujesz się na wieczorne sesje w chłodne dni.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bluza wykonana częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweatshirt', '', '', '', 'Entrada 22 Sweatshirt', '', '', '', ''),
(428, 1, 1, 'Stworzona z myślą o dynamice piłki nożnej. Gdy supergwiazdy Arsenalu przygotowują się do rozgrywek w zimowe popołudnia i mroźne wieczory, biegają po boisku w takich bluzach. Polarowa podszewka, wycięcia na kciuki w mankietach i odprowadzający wilgoć AEROREADY zapewniają ciepło i wygodę. Godło drużyny i dwukolorowe logo adidas Badge of Sport wyróżniają się na piersi.  Ten produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Ocieplana bluza rozgrzewkowa Arsenalu wykonana z materiałów pochodzących z recyklingu.', 'arsenal-pre-match-warm-top', '', '', '', 'Arsenal Pre-Match Warm Top', '', '', '', ''),
(429, 1, 1, 'Kiedy czujesz się komfortowo, możesz wiele osiągnąć. Albo po prostu cieszyć się wygodą. Ta bluza adidas sprawdzi się podczas aktywności i relaksu. Miękki polar sprawia, że czujesz się dobrze niezależnie od tego, co robisz i w jakim tempie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wkładana przez głowę bluza z krótkim suwakiem uszyta z miłego w dotyku polaru.', '1-4-zip-sweatshirt', '', '', '', '1/4 Zip Sweatshirt', '', '', '', ''),
(430, 1, 1, 'Gdy wspierasz piłkarską arystokrację, nie musisz krzyczeć na cały głos. Linia adidas Lifestyler oferuje najwyższy poziom komfortu i ułatwia dyskretne wsparcie. Bluza Realu Madryt zapożycza limonkowo-zielone elementy z trzeciego zestawu klubu i prezentuje małą naszywkę na piersi. Miękki materiał frotté jest idealnym wyborem na dni, w które nie musisz pokazywać piłkarskich emocji, a masz czas na relaks.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Bluza Realu Madryt stworzona z myślą o subtelnym kibicowaniu.', 'real-madrid-lifestyler-crew-sweatshirt', '', '', '', 'Real Madrid Lifestyler Crew Sweatshirt', '', '', '', ''),
(431, 1, 1, 'Niech Twój sezon trwa cały rok. Ta wkładana przez głowę bluza adidas do gry w golfa zapewnia lekki, ciepły komfort i ochronę przed niekorzystnymi warunkami atmosferycznymi, dzięki czemu możesz grać w różnych temperaturach. Model jest odporny na mgłę i lekki deszcz, dzięki czemu możesz cieszyć się ciepłem i suchym komfortem aż do ostatniego dołka.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekka, polarowa bluza golfowa z materiałów pochodzących z recyklingu.', 'dwr-1-4-zip-pullover', '', '', '', 'DWR 1/4-Zip Pullover', '', '', '', ''),
(432, 1, 1, 'Wygodna koszulka adidas Terrex stworzona z myślą o biegach przełajowych pomoże Ci odnaleźć swój rytm na szosie i zostawić za sobą czynniki rozpraszające. Elastyczny materiał z przodu nie ogranicza Twoich ruchów, a ukryty krótki suwak zapewnia wentylację, gdy jej potrzebujesz. Z tyłu AEROREADY usuwa wilgoć z powierzchni Twojej skóry, ułatwiając Ci koncentrację. Dopasowany krój oznacza, że możesz nosić ją pod kurtką. A co najważniejsze, jest wykonana z materiałów pochodzących z recyklingu, a więc pozwoli Ci korzystać z uroków outdooru bez szkody dla jego stanu.', 'Odprowadzająca wilgoć koszulka na zimowe zajęcia wytrzymałościowe.', 'terrex-xperior-top', '', '', '', 'Terrex Xperior Top', '', '', '', ''),
(433, 1, 1, 'Zwróć na siebie uwagę, nie mówiąc ani słowa. Ta bluza adidas do gry w golfa wnosi świeżą energię do Twojej gry za sprawą inspirowanego polem golfowym wzoru na całej powierzchni. Miękki polar gwarantuje ciepło w chłodne poranki i chłodne popołudnia na polu golfowym w stylu, który sprawdzi się także po meczu. Ten model odprowadza lekki deszcz, aby dać Ci suchy komfort podczas rozgrywki w mgliste, deszczowe dni.', 'Wygodna, polarowa bluza do gry w golfa wykonana z materiałów pochodzących z recyklingu.', 'texture-print-crew-sweatshirt', '', '', '', 'Texture-Print Crew Sweatshirt', '', '', '', ''),
(434, 1, 1, 'Wędruj beztrosko. Gdy podążasz tam, gdzie pokieruje Cię dzień, ta kurtka adidas otula Cię komfortem za sprawą polaru. Zasuń wysoki kołnierz, aby zatrzymać ciepło. Wyróżnij się akademickimi kolorami i naszywką na piersi na cześć outdoorowej tradycji adidas.', 'Inspirowana outdoorem bluza z polaru na zatrzaski stworzona z myślą o pełnym komforcie.', 'wander-hour-quarter-snap-polar-fleece-jacket', '', '', '', 'Wander Hour Quarter-Snap Polar Fleece Jacket', '', '', '', ''),
(435, 1, 1, 'Zdejmij buty i rozpocznij relaks w komfortowej bluzie z kapturem po całodniowej wędrówce. Bluza z kapturem adidas Terrex zachowuje prosty, klasyczny styl dzięki konstrukcji z miękkiej dzianiny bawełnianej ze typowymi detalami, jakich się spodziewasz, takimi jak ściągacze w mankietach i u dołu oraz oczywiście kaptur.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bluza z kapturem Terrex wykonana częściowo z materiału pochodzącego z recyklingu.', 'terrex-logo-graphic-hoodie', '', '', '', 'Terrex Logo Graphic Hoodie', '', '', '', ''),
(436, 1, 1, 'Pozwól, by przygoda trwała. Załóż bluzę adidas Terrex z polaru, aby zapewnić sobie przewiewny, ciepły komfort. Jej design z polaru o strukturze waflowej oznacza lepszą oddychalność i ciepło, zapewniając regulację temperatury i szybkoschnącą wygodę.', 'Przewiewna bluza z polaru o strukturze waflowej do warstwowych stylizacji.', 'terrex-multi-primegreen-full-zip-fleece-jacket', '', '', '', 'Terrex Multi Primegreen Full-Zip Fleece Jacket', '', '', '', ''),
(437, 1, 1, 'Nie ma nic lepszego niż znalezienie idealnej warstwy podstawowej. Nigdy nie pomijaj szansy na przygodę dzięki polarowej bluzie adidas Terrex z suwakiem do połowy długości. Tekstura o waflowej strukturze po wewnętrznej stronie zapewnia dodatkowy komfort. Ta bluza została uszyta z materiałów pochodzących z recyklingu i jest dowodem na zaangażowanie adidas w walkę z zanieczyszczeniem plastikiem.', 'Cienka bluza z suwakiem do połowy długości, która sprawdzi się jako warstwa.', 'terrex-everyhike-half-zip-fleece-jacket', '', '', '', 'Terrex Everyhike Half-Zip Fleece Jacket', '', '', '', ''),
(438, 1, 1, 'Zachowaj ciepły komfort na polu golfowym i poza nim. Ta bluza adidas z zaokrąglonym dekoltem jest miła w dotyku i dba o Twój komfort podczas rundy w chłodne dni. Rękawy z mankietami utrzymują design na swoim miejscu, dzięki czemu możesz bez przeszkód wykonywać zamachy. Załóż ją na t-shirt lub koszulkę polo, gdy temperatura spada.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Bluza z zaokrąglonym dekoltem, która zapewni Ci ciepło, wykonana częściowo z materiałów pochodzących z recyklingu.', 'core-crew-sweatshirt', '', '', '', 'Core Crew Sweatshirt', '', '', '', ''),
(439, 1, 1, 'Jeśli lubisz styl retro, nie przegap tej bluzy adidas. Jej design pochodzi wprost z archiwów, a kultowa grafika stanowi hołd dla naszej sportowej tradycji. Ale nie daj się zwieść sportowemu stylowi. Jej swobodny komfort został stworzony, aby się wyluzować.  Ten produkt zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 40% materiałów pochodzących z recyklingu.', 'Bluza o klasycznym designie częściowo wykonana z Parley Ocean Plastic.', 'adicolor-classics-cut-line-crew-sweatshirt', '', '', '', 'Adicolor Classics Cut Line Crew Sweatshirt', '', '', '', ''),
(440, 1, 1, 'Czerń. Biel. Klasyka. Minimalistyczne logo Trefoil i progresywne logo klubu wyróżniają się na piersi bluzy piłkarskiej adidas Juventus, nawiązując do dwóch symboli tego pięknego sportu. Konstrukcja z miękkiego polaru jest wygodna w noszeniu, nawet gdy na boisku piłkarskim robi się gorąco.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka bluza Juventusu w sportowym stylu.', 'juventus-essentials-trefoil-crewneck-sweatshirt', '', '', '', 'Juventus Essentials Trefoil Crewneck Sweatshirt', '', '', '', ''),
(441, 1, 1, 'Kiedy czujesz się komfortowo, możesz wiele osiągnąć. Albo po prostu cieszyć się wygodą. Ta bluza adidas sprawdzi się podczas aktywności i relaksu. Miękki polar sprawia, że czujesz się dobrze niezależnie od tego, co robisz i w jakim tempie.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wkładana przez głowę bluza z krótkim suwakiem uszyta z miłego w dotyku polaru.', '1-4-zip-sweatshirt', '', '', '', '1/4 Zip Sweatshirt', '', '', '', ''),
(442, 1, 1, 'Juventus jest bliski Twojemu sercu. Ta bluza piłkarska adidas ma luźny krój i stanowi miłą w dotyku warstwę wierzchnią. Wyjątkowo miękki materiał frotté z dużą zawartością bawełny zapewnia Ci komfort, gdy cieszysz się grą z przyjaciółmi. Grafika na plecach stanowi ukłon w stronę zestawu wyjazdowego Juventusu, dzięki czemu możesz reprezentować ukochany klub, gdziekolwiek jesteś.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękka i minimalistyczna bluza z grafiką dla kibiców Juventusu.', 'juventus-graphic-crew-sweatshirt', '', '', '', 'Juventus Graphic Crew Sweatshirt', '', '', '', ''),
(443, 1, 1, 'Temperatura spadła, ale to nie znaczy, że Twój look musi na tym ucierpieć. Dzięki konstrukcji z grubego materiału frotté i kultowym 3 paskom bluza adidas zapewnia Ci przyjemny komfort i świeży styl.   Nasze bawełniane produkty wspierają uprawę ze zrównoważonych źródeł. Ten model zawiera też materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Klasyczna, ciepła bluza z zaokrąglonym dekoltem w dobrym stylu.', 'adicolor-classics-3-stripes-crew-sweatshirt', '', '', '', 'Adicolor Classics 3-Stripes Crew Sweatshirt', '', '', '', ''),
(444, 1, 1, 'Zwróć na siebie uwagę, nie mówiąc ani słowa. Ta bluza adidas do gry w golfa wnosi świeżą energię do Twojej gry za sprawą inspirowanego polem golfowym wzoru na całej powierzchni. Miękki polar gwarantuje ciepło w chłodne poranki i chłodne popołudnia na polu golfowym w stylu, który sprawdzi się także po meczu. Ten model odprowadza lekki deszcz, aby dać Ci suchy komfort podczas rozgrywki w mgliste, deszczowe dni.', 'Wygodna, polarowa bluza do gry w golfa wykonana z materiałów pochodzących z recyklingu.', 'texture-print-crew-sweatshirt', '', '', '', 'Texture-Print Crew Sweatshirt', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(445, 1, 1, 'Wędruj beztrosko. Gdy podążasz tam, gdzie pokieruje Cię dzień, ta kurtka adidas otula Cię komfortem za sprawą polaru. Zasuń wysoki kołnierz, aby zatrzymać ciepło. Wyróżnij się akademickimi kolorami i naszywką na piersi na cześć outdoorowej tradycji adidas.', 'Inspirowana outdoorem bluza z polaru na zatrzaski stworzona z myślą o pełnym komforcie.', 'wander-hour-quarter-snap-polar-fleece-jacket', '', '', '', 'Wander Hour Quarter-Snap Polar Fleece Jacket', '', '', '', ''),
(446, 1, 1, 'Bluza Juventusu nie tylko wyróżnia się w tłumie, ale też pokazuje Twoją piłkarską lojalność. Model, będący częścią uniwersalnej kolekcji adidas, która skupia się na komforcie i subtelnym wsparciu, ma barwy trzeciego zestawu klubu w żywych kolorach. Luźny krój i miękki materiał frotté sprawiają, że idealnie nadaje się do relaksu. Mała naszywka klubowa przypomina Ci Twoim zadaniu jako kibica.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Luźna bluza Juventusu subtelnie pokazująca, komu kibicujesz.', 'juventus-lifestyler-crew-sweatshirt', '', '', '', 'Juventus Lifestyler Crew Sweatshirt', '', '', '', ''),
(447, 1, 1, 'Nieprzewidywalna pogoda może się zdarzyć. Przygotuj się na jej kaprysy na polu golfowym dzięki anorakowi adidas. Jest uszyty z elastycznego materiału, który zapewnia pełną swobodę ruchu. Kieszeń kangurka ogrzewa ręce między uderzeniami, a kaptur regulowany sznurkiem zapewnia dodatkową ochronę, gdy jej potrzebujesz. Graj w golfa na przekór pogodzie.', 'Anorak do gry w golfa w chłodne dni wykonany z materiałów pochodzących z recyklingu.', 'adicross-anorak', '', '', '', 'Adicross Anorak', '', '', '', ''),
(448, 1, 1, 'Wygodna koszulka adidas Terrex stworzona z myślą o biegach przełajowych pomoże Ci odnaleźć swój rytm na szosie i zostawić za sobą czynniki rozpraszające. Elastyczny materiał z przodu nie ogranicza Twoich ruchów, a ukryty krótki suwak zapewnia wentylację, gdy jej potrzebujesz. Z tyłu AEROREADY usuwa wilgoć z powierzchni Twojej skóry, ułatwiając Ci koncentrację. Dopasowany krój oznacza, że możesz nosić ją pod kurtką. A co najważniejsze, jest wykonana z materiałów pochodzących z recyklingu, a więc pozwoli Ci korzystać z uroków outdooru bez szkody dla jego stanu.', 'Odprowadzająca wilgoć koszulka na zimowe zajęcia wytrzymałościowe.', 'terrex-xperior-top', '', '', '', 'Terrex Xperior Top', '', '', '', ''),
(449, 1, 1, 'Kiedy wyglądasz dobrze, czujesz się dobrze i grasz najlepiej jak potrafisz. Ta wkładana przez głowę bluza adidas do gry w golfa wykonana z polaru łączy styl turniejowy z ciepłem, którego potrzebujesz, aby zachować koncentrację w chłodne dni. COLD.RDY Hollowfleece zatrzymuje ciepłe powietrze, a odpowiedni design pozwala Ci wykonywać zamachy i skręty. Dodaj do tego prosty, klasyczny look, a otrzymasz nową bluzę gotową na zawody.', 'Wyczynowa, wkładana przez głowę bluza z polaru do gry w golfa, częściowo wykonana z materiałów pochodzących z recyklingu.', 'statement-fleece-1-4-zip-pullover', '', '', '', 'Statement Fleece 1/4-Zip Pullover', '', '', '', ''),
(450, 1, 1, 'Poruszaj się swobodnie podczas gry we wkładanym przez głowę swetrze do golfa. Konstrukcja z adidas PRIMEKNIT, zaawansowanego technicznie, pracującego materiału, pozwala Ci na swobodne zamachy, skręty i uderzenia. Wzorzyste paski nadają mu nowoczesny look.', 'Wkładany przez głowę sweter do gry w golfa stworzony z myślą o jego ponownym wykorzystaniu.', 'made-to-be-remade-crewneck-pullover-sweater', '', '', '', 'Made to be Remade Crewneck Pullover Sweater', '', '', '', ''),
(451, 1, 1, 'Minimalizm jest podstawą ekspresji w najnowszej kolekcji stworzonej we współpracy z Pharrellem. Ta bluza z zaokrąglonym dekoltem koncentruje się na kolorze i materiale, zachęcając do zabawy stylem. Poczuj komfort miękkiego materiału frotté. Duże, teksturowane logo Humanrace wyróżnia się z przodu, a wyszywane logo Trefoil widnieje nad prawym rękawem. Ten model został uszyty z wykorzystaniem UNITEFIT — uniwersalnego systemu dopasowania uwzględniającego różne rozmiary, płcie i typy sylwetki.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Prosta bluza do noszenia na co dzień stworzona z myślą o wyrażaniu siebie.', 'pharrell-williams-basics-crew-sweatshirt-uniseks', '', '', '', 'Pharrell Williams Basics Crew Sweatshirt (uniseks)', '', '', '', ''),
(452, 1, 1, 'Wybierz spodnie adidas do gry w golfa, które zapewnią Ci optymalny komfort na polu golfowym w każdy dzień. Mocna tkanina o ukośnym splocie stworzona do całorocznej gry jest przewiewna i rozciąga się w czterech kierunkach, gwarantując pełną swobodę ruchu. Wbudowana ochrona przed promieniowaniem UV zapewnia odpowiednią osłonę w słoneczne dni. Zwężany krój dopełnia całości.   Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Zwężane spodnie do golfa z materiałów pochodzących z recyklingu.', 'ultimate365-tapered-pants', '', '', '', 'Ultimate365 Tapered Pants', '', '', '', ''),
(453, 1, 1, 'Wybierz spodnie adidas do gry w golfa, które zapewnią Ci optymalny komfort na polu golfowym w każdy dzień. Mocna tkanina o ukośnym splocie stworzona do całorocznej gry jest przewiewna i rozciąga się w czterech kierunkach, gwarantując pełną swobodę ruchu. Wbudowana ochrona przed promieniowaniem UV zapewnia odpowiednią osłonę w słoneczne dni. Zwężany krój dopełnia całości.   Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Zwężane spodnie do golfa z materiałów pochodzących z recyklingu.', 'ultimate365-tapered-pants', '', '', '', 'Ultimate365 Tapered Pants', '', '', '', ''),
(454, 1, 1, 'Obiekty pozostają w nieustannym ruchu. Nawet po zakończeniu treningu potrzebujesz tej samej swobody, która zapewni Ci komfort i wygodne poruszanie. Załóż te spodnie adidas i ruszaj na podbój dnia bez przeszkód.  Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. Ten model jest także wykonany z materiałów pochodzących z recyklingu. Stanowi to część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Klasyczne spodnie z polaru stworzone z myślą o komforcie w dzień i w nocy.', 'essentials-fleece-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials Fleece Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(455, 1, 1, 'Obiekty pozostają w nieustannym ruchu. Nawet po zakończeniu treningu potrzebujesz tej samej swobody, która zapewni Ci komfort i wygodne poruszanie. Załóż te spodnie adidas i ruszaj na podbój dnia bez przeszkód.  Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. Ten model jest także wykonany z materiałów pochodzących z recyklingu. Stanowi to część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Klasyczne spodnie z polaru stworzone z myślą o komforcie w dzień i w nocy.', 'essentials-fleece-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials Fleece Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(456, 1, 1, 'Styl adidas bez dwóch zdań. Zachowaj stonowany, autentyczny look w tych spodniach. Kontrastowe 3 paski i logo Trefoil sprawiają, że są w pełni oryginalne. Miły w dotyku, ciepły polar zapewni Ci wygodę. Przechowuj swoje rzeczy w kieszeniach na suwak. I już.  Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. Ten model zawiera też materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Spodnie z polaru z kultowymi detalami adidas.', 'adicolor-classics-3-stripes-pants', '', '', '', 'Adicolor Classics 3-Stripes Pants', '', '', '', ''),
(457, 1, 1, 'Doskonałe spodnie spełniają trzy podstawowe warunki: wygody, stylu prostoty. Ta para od adidas ma minimalistyczny design i jest uszyta z grubego polaru, który zapewni Ci komfort w ruchu i w porze relaksu.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego. Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Gładkie, wygodne spodnie gwarantujące komfort przez cały dzień.', 'adicolor-essentials-trefoil-pants', '', '', '', 'Adicolor Essentials Trefoil Pants', '', '', '', ''),
(458, 1, 1, 'Doskonałe spodnie spełniają trzy podstawowe warunki: wygody, stylu prostoty. Ta para od adidas ma minimalistyczny design i jest uszyta z grubego polaru, który zapewni Ci komfort w ruchu i w porze relaksu.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego. Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Gładkie, wygodne spodnie gwarantujące komfort przez cały dzień.', 'adicolor-essentials-trefoil-pants', '', '', '', 'Adicolor Essentials Trefoil Pants', '', '', '', ''),
(459, 1, 1, 'Plotka głosi, że pierwszy dres adidas powstał w 1964 roku. Nie potwierdzimy tego, jednak nie mamy wątpliwości, że 3 paski od lat wyróżniają się na boiskach, stadionach, ulicach, po prostu wszędzie. Bez względu na to, gdzie jesteś, jakoś zawsze jest na miejscu. Te spodnie dresowe są na to jednoznacznym dowodem. Poza gwarancją swobody i komfortu, miękki materiał zawiera przędzę Parley Ocean Plastic, która została wyprodukowana z upcyklingowanych plastikowych odpadów.', 'Połowa klasycznego dresu oferująca wygodę na miarę pełnego zestawu.', 'adicolor-classics-primeblue-sst-track-pants', '', '', '', 'Adicolor Classics Primeblue SST Track Pants', '', '', '', ''),
(460, 1, 1, 'Zaprezentuj swój codzienny styl podczas popołudniowej rundy dzięki spodniom adidas do golfa. Model ma elastyczną konstrukcję i luźny krój, gwarantujący swobodę ruchów. Specjalna kieszeń z suwakiem bezpiecznie przechowa Twój telefon. Zwężane nogawki z częściowo elastycznymi mankietami stanowią dopełniający akcent.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Luźne spodnie do golfa wykonane częściowo z materiałów pochodzących z recyklingu.', 'go-to-commuter-pants', '', '', '', 'Go-To Commuter Pants', '', '', '', ''),
(461, 1, 1, 'Podkręć swój look w chłodne dni dzięki spodniom adidas do gry w golfa. Konstrukcja z wygodnego polaru z COLD.RDY zapewni Ci ciepło. Szczotkowany od wewnątrz materiał jest miękki i miły w dotyku, a elastyczna talia z tyłu sprawia, że spodnie pozostają na swoim miejscu podczas gry. Design spodni dresowych sprawdzi się na polu golfowym, i wniesie swobodny styl do Twoich zajęć po grze.', 'Spodnie do gry w golfa w chłodne dni, częściowo wykonane z materiałów pochodzących z recyklingu.', 'coldrdy-jogger-pants', '', '', '', 'COLD.RDY Jogger Pants', '', '', '', ''),
(462, 1, 1, 'Wybierz spodnie cargo od adidas, które są idealnym połączeniem stylu outdoorowego i kanapowego. Mają średniowysoką, elastyczną talię i zwężane nogawki, które nadają im opływowy look i zapewniają swobodę. Model z miękkiego polaru idealnie sprawdzi się podczas zimowych spacerów. Wsuń nogawki do butów i włóż rękawiczki do dodatkowych kieszeni.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Ciepłe spodnie, które możesz nosić w domu lub na wędrówce, wykonane częściowo z materiałów pochodzących z recyklingu.', 'essentials-fleece-regular-tapered-cargo-pants', '', '', '', 'Essentials Fleece Regular Tapered Cargo Pants', '', '', '', ''),
(463, 1, 1, 'Czekasz na przygodę? Nie ma takiej opcji. Wyrusz jej naprzeciw. Albo jeszcze lepiej ― stwórz ją. Po prostu załóż te spodnie adidas cargo, aby zyskać trwałość, wygodę i funkcjonalny styl. Tkanina ripstop sprawdzi się podczas długich, aktywnych dni, a liczne kieszenie dają wiele możliwości przechowywania.', 'Spodnie cargo dla miejskich odkrywców.', 'adicolor-contempo-cargo-pants', '', '', '', 'Adicolor Contempo Cargo Pants', '', '', '', ''),
(464, 1, 1, 'Śmiałe 3 paski adidas na nogawkach zdominowały look tych sportowych spodni do noszenia na co dzień. Dopasowany krój nadaje całości prosty styl. Polar sprawia, że są wyjątkowo przyjemne w dotyku.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł.', 'Sportowe spodnie z kieszeniami i sznurkiem do regulacji w talii.', 'essentials-fleece-fitted-3-stripes-pants', '', '', '', 'Essentials Fleece Fitted 3-Stripes Pants', '', '', '', ''),
(465, 1, 1, 'Niezależnie od tego, czy pedałujesz, zasuwasz po asfalcie, czy leżysz kołami do góry, te spodnie dresowe adidas są tak miękkie, że z łatwością zapomnisz, że masz je na sobie. Spodnie z bawełnianego materiału frotté, który jest miły w dotyku i nie zwiększa ciężaru stroju, idealnie nadają się do regularnego noszenia. Boczne kieszenie i kieszeń na nogawce ułatwiają organizację niezbędnych drobiazgów.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękkie spodnie dresowe, które sprawdzą się przy biurku i podczas relaksu.', 'essentials-french-terry-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials French Terry Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(466, 1, 1, 'Śmiałe 3 paski adidas na nogawkach zdominowały look tych sportowych spodni do noszenia na co dzień. Dopasowany krój nadaje całości prosty styl. Polar sprawia, że są wyjątkowo przyjemne w dotyku.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł.', 'Sportowe spodnie z kieszeniami i sznurkiem do regulacji w talii.', 'essentials-fleece-fitted-3-stripes-pants', '', '', '', 'Essentials Fleece Fitted 3-Stripes Pants', '', '', '', ''),
(467, 1, 1, 'Dodaj te wygodne spodnie do swojej codziennej garderoby. Spodnie dresowe adidas z miękkiego w dotyku polaru o dużej zawartości bawełny i poliestru zapewnią Ci komfort przez cały dzień, gdy grasz, trenujesz lub robisz zakupy.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Ciepłe spodnie dresowe ze sznurkiem do regulacji w talii, który umożliwia indywidualne dopasowanie.', 'lounge-fleece-pants', '', '', '', 'Lounge Fleece Pants', '', '', '', ''),
(468, 1, 1, 'Plotka głosi, że pierwszy dres adidas powstał w 1964 roku. Nie potwierdzimy tego, jednak nie mamy wątpliwości, że 3 paski od lat wyróżniają się na boiskach, stadionach, ulicach, po prostu wszędzie. Bez względu na to, gdzie jesteś, jakoś zawsze jest na miejscu. Te spodnie dresowe są na to jednoznacznym dowodem. Poza gwarancją swobody i komfortu, miękki materiał zawiera przędzę Parley Ocean Plastic, która została wyprodukowana z upcyklingowanych plastikowych odpadów.', 'Połowa klasycznego dresu oferująca wygodę na miarę pełnego zestawu.', 'adicolor-classics-primeblue-sst-track-pants', '', '', '', 'Adicolor Classics Primeblue SST Track Pants', '', '', '', ''),
(469, 1, 1, 'Graj ostro, odpoczywaj na całego. Te dopasowane spodnie dresowe adidas spełniają wszystkie Twoje wymagania. Kieszenie na suwak pomieszczą niezbędne drobiazgi na kanapie lub w drodze. Zaprojektowany z myślą o Twoim komforcie model z pewnością będzie Twoim ulubionym elementem garderoby.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna para bawełnianych spodni.', 'trefoil-essentials-pants', '', '', '', 'Trefoil Essentials Pants', '', '', '', ''),
(470, 1, 1, '3 paski od lat są symbolem sportu. Ale nie musisz być na bieżni ani na boisku, aby nosić je z dumą. Ciesz się komfortem tych spodni dresowych adidas i poruszaj we własnym rytmie. Na przykład spaceruj po parku lub relaksuj w wolne dni. Te spodnie są wykonane z materiałów pochodzących z recyklingu. Gdziekolwiek będziesz je nosić, poczujesz się dobrze na wiele sposobów.   Ten produkt został wykonany z Primeblue – wysokiej jakości materiału pochodzącego z recyklingu, powstałego częściowo z Parley Ocean Plastic.', 'Kultowe spodnie dresowe adidas z nową porcją energii.', 'adicolor-classics-beckenbauer-primeblue-track-pants', '', '', '', 'Adicolor Classics Beckenbauer Primeblue Track Pants', '', '', '', ''),
(471, 1, 1, 'Plotka głosi, że pierwszy dres adidas powstał w 1964 roku. Nie potwierdzimy tego, jednak nie mamy wątpliwości, że 3 paski od lat wyróżniają się na boiskach, stadionach, ulicach, po prostu wszędzie. Bez względu na to, gdzie jesteś, jakoś zawsze jest na miejscu. Te spodnie dresowe są na to jednoznacznym dowodem. Poza gwarancją swobody i komfortu, miękki materiał zawiera przędzę Parley Ocean Plastic, która została wyprodukowana z upcyklingowanych plastikowych odpadów.', 'Połowa klasycznego dresu oferująca wygodę na miarę pełnego zestawu.', 'adicolor-classics-primeblue-sst-track-pants', '', '', '', 'Adicolor Classics Primeblue SST Track Pants', '', '', '', ''),
(472, 1, 1, 'Niezbędny element wyposażenia treningowego od adidas. Zanim wyjdziesz na boisko na zimową sesję, załóż spodnie piłkarskie Tiro 23 Club. Dopasowany, opływowy krój i pochłaniający wilgoć AEROREADY zapewnią Ci swobodę ruchu podczas sprintów i okrążeń. Suwaki w kostkach ułatwiają zdejmowanie bez ściągania butów.  Ten produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Treningowe spodnie dresowe o dopasowanym kroju uszyte z materiałów pochodzących z recyklingu.', 'tiro-23-club-training-pants', '', '', '', 'Tiro 23 Club Training Pants', '', '', '', ''),
(473, 1, 1, 'Niezbędny element wyposażenia treningowego od adidas. Zanim wyjdziesz na boisko na zimową sesję, załóż spodnie piłkarskie Tiro 23 Club. Dopasowany, opływowy krój i pochłaniający wilgoć AEROREADY zapewnią Ci swobodę ruchu podczas sprintów i okrążeń. Suwaki w kostkach ułatwiają zdejmowanie bez ściągania butów.  Ten produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Treningowe spodnie dresowe o dopasowanym kroju uszyte z materiałów pochodzących z recyklingu.', 'tiro-23-club-training-pants', '', '', '', 'Tiro 23 Club Training Pants', '', '', '', ''),
(474, 1, 1, 'Styl adidas bez dwóch zdań. Zachowaj stonowany, autentyczny look w tych spodniach. Kontrastowe 3 paski i logo Trefoil sprawiają, że są w pełni oryginalne. Miły w dotyku, ciepły polar zapewni Ci wygodę. Przechowuj swoje rzeczy w kieszeniach na suwak. I już.  Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. Ten model zawiera też materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Spodnie z polaru z kultowymi detalami adidas.', 'adicolor-classics-3-stripes-pants', '', '', '', 'Adicolor Classics 3-Stripes Pants', '', '', '', ''),
(475, 1, 1, '3 paski od lat są symbolem sportu. Ale nie musisz być na bieżni ani na boisku, aby nosić je z dumą. Ciesz się komfortem tych spodni dresowych adidas i poruszaj we własnym rytmie. Na przykład spaceruj po parku lub relaksuj w wolne dni. Te spodnie są wykonane z materiałów pochodzących z recyklingu. Gdziekolwiek będziesz je nosić, poczujesz się dobrze na wiele sposobów.   Ten produkt został wykonany z Primeblue – wysokiej jakości materiału pochodzącego z recyklingu, powstałego częściowo z Parley Ocean Plastic.', 'Kultowe spodnie dresowe adidas z nową porcją energii.', 'adicolor-classics-beckenbauer-primeblue-track-pants', '', '', '', 'Adicolor Classics Beckenbauer Primeblue Track Pants', '', '', '', ''),
(476, 1, 1, 'Funkcjonalne i jednocześnie wygodne. Te spodnie adidas z miłego w dotyku polaru sprawdzą się podczas zimowych wędrówek i dojazdów w chłodne poranki. Mają wbudowany pasek dla bezpiecznego dopasowania. Gdziekolwiek się wybierasz, możesz zabezpieczyć niezbędne drobiagi w licznych kieszeniach.   Te zimowe spodnie 4CMTE wykonane są z materiałów naturalnych i odnawialnych oraz z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Praktyczne spodnie wykonane częściowo z materiałów pochodzących z recyklingu.', 'winter-4cmte-pants', '', '', '', 'Winter 4CMTE Pants', '', '', '', ''),
(477, 1, 1, 'Niezależnie od tego, czy pedałujesz, zasuwasz po asfalcie, czy leżysz kołami do góry, te spodnie dresowe adidas są tak miękkie, że z łatwością zapomnisz, że masz je na sobie. Spodnie z bawełnianego materiału frotté, który jest miły w dotyku i nie zwiększa ciężaru stroju, idealnie nadają się do regularnego noszenia. Boczne kieszenie i kieszeń na nogawce ułatwiają organizację niezbędnych drobiazgów.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękkie spodnie dresowe, które sprawdzą się przy biurku i podczas relaksu.', 'essentials-french-terry-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials French Terry Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(478, 1, 1, 'Trenuj jak profesjonaliści, relaksuj się w dobrym stylu. Te piłkarskie spodnie dresowe adidas zostały uszyte z pochłaniającego wilgoć AEROREADY, aby zapewnić Ci suchy komfort i gotowość na wszystko, co dzieje się na boisku i poza nim. Talia regulowana sznurkiem utrzymuje je na swoim miejscu, a suwaki w kostkach ułatwiają zakładanie i zdejmowanie, gdziekolwiek zaprowadzi Cię dzień.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Piłkarskie spodnie treningowe uszyte z materiałów pochodzących z recyklingu.', 'entrada-22-training-pants', '', '', '', 'Entrada 22 Training Pants', '', '', '', ''),
(479, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Konstrukcja z miękkiego polaru sprawia, że te spodnie dresowe adidas to wygodny strój w drodze na trening. Zwężane nogawki i mankiety ze ściągaczem nadają modelowi opływowy kształt, dzięki czemu możesz zaprezentować swoją wyszukaną pracę nóg, gdy już dotrzesz na miejsce.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Polarowe spodnie dresowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweat-pants', '', '', '', 'Entrada 22 Sweat Pants', '', '', '', ''),
(480, 1, 1, 'Jedna drużyna, jedna pasja. Wybierając 3 paski, zyskujesz coś więcej niż tylko spodnie adidas. Dołączasz do wspólnoty ludzi na całym świecie. Te spodnie zostały uszyte z materiału frotté, który zapewnia uniwersalny komfort na co dzień.  Nasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. Ten model zawiera też materiały pochodzące z recyklingu, co stanowi część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Sportowe spodnie, które dodadzą Ci stylu na co dzień.', 'essentials-french-terry-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials French Terry Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(481, 1, 1, 'Gdy na łonie natury jest zimno, oznacza to jedno: mniej ludzi. A dokładnie: mniej ludzi i okazję na świetną przygodę. Te spodnie adidas Terrex są gotowe na zimową trasę dzięki dołączonym stuptutom. Rozciągający się w czterech kierunkach materiał ułatwia unikanie trudnych sytuacji lub wyjście z nich dzięki nieograniczonej swobodzie ruchów. Zapewnia również wyjątkową wygodę.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Pokonaj chłód w spodniach z wyjmowanymi stuptutami.', 'terrex-yearound-soft-shell-pants', '', '', '', 'Terrex Yearound Soft Shell Pants', '', '', '', ''),
(482, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Konstrukcja z miękkiego polaru sprawia, że te spodnie dresowe adidas to wygodny strój w drodze na trening. Zwężane nogawki i mankiety ze ściągaczem nadają modelowi opływowy kształt, dzięki czemu możesz zaprezentować swoją wyszukaną pracę nóg, gdy już dotrzesz na miejsce.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Polarowe spodnie dresowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweat-pants', '', '', '', 'Entrada 22 Sweat Pants', '', '', '', ''),
(483, 1, 1, 'Spodnie adidas, będące częścią wyjątkowej, piłkarskiej kolekcji Entrada 22, zostały stworzone, aby przyciągać spojrzenia. Minimalistyczny, klasyczny model zapewni Twojej drużynie jednolity look na boisku i poza nim. Odprowadzający wilgoć AEROREADY oferuje wygodę. Suwaki w kostkach ułatwiają szybkie zdejmowanie spodni, gdy nadchodzi czas meczu.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Pochłaniające wilgoć spodnie piłkarskie wykonane z materiałów pochodzących z recyklingu.', 'entrada-22-presentation-pants', '', '', '', 'Entrada 22 Presentation Pants', '', '', '', ''),
(484, 1, 1, 'Niech nic Cię nie spowolni. Poruszaj się swobodnie podczas intensywnych sesji, nosząc te legginsy jako warstwę podstawową. Wykonuj wyroki i kopnięcia na treningu cardio, ciesząc się pełnym komfortem dzięki formowanej wypukłej wstawce. Detale z siateczki i pochłaniający wilgoć AEROREADY zapewniają Ci suchy komfort, dzięki czemu możesz trenować bez przeszkód.', 'Legginsy, które pomogą Ci zachować koncentrację, wykonane częściowo z materiałów pochodzących z recyklingu.', 'techfit-aeroready-training-long-tights', '', '', '', 'Techfit AEROREADY Training Long Tights', '', '', '', ''),
(485, 1, 1, 'Najwyższa jakość na boisku i nie tylko. Spodnie adidas Tiro zostały zaprojektowane do noszenia podczas piłkarskich treningów, ale stały się kultowym elementem mody miejskiej. Suwaki w kostkach pozwalają na wygodne zakładanie i zdejmowanie spodni bez ściągania butów. Pochłaniający wilgoć materiał AEROREADY zapewnia suchy komfort niezależnie od tego, w jakiej sytuacji się znajdziesz.', 'Zwężane spodnie dresowe z materiałów pochodzących z recyklingu.', 'tiro-21-track-pants', '', '', '', 'Tiro 21 Track Pants', '', '', '', ''),
(486, 1, 1, 'Spodnie adidas, będące częścią wyjątkowej, piłkarskiej kolekcji Entrada 22, zostały stworzone, aby przyciągać spojrzenia. Minimalistyczny, klasyczny model zapewni Twojej drużynie jednolity look na boisku i poza nim. Odprowadzający wilgoć AEROREADY oferuje wygodę. Suwaki w kostkach ułatwiają szybkie zdejmowanie spodni, gdy nadchodzi czas meczu.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Pochłaniające wilgoć spodnie piłkarskie wykonane z materiałów pochodzących z recyklingu.', 'entrada-22-presentation-pants', '', '', '', 'Entrada 22 Presentation Pants', '', '', '', ''),
(487, 1, 1, 'Spodnie adidas będące subtelnym ukłonem w stronę Twojej ulubionej drużyny zapewniają wyjątkową wygodę przez cały dzień. Małe logotypy Trefoil i klubu piłkarskiego widnieją na obu bokach, tuż obok kieszeni na suwak, w których przechowasz niezbędne na co dzień drobiazgi. Średnio zabudowana talia ze sznurkiem do regulacji gwarantuje idealne dopasowanie, a mankiety ze ściągaczami nadają całości dopracowany look w sportowym stylu.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękkie, bawełniane spodnie, które nawiązują do adidas i Manchesteru United.', 'manchester-united-essentials-trefoil-pants', '', '', '', 'Manchester United Essentials Trefoil Pants', '', '', '', ''),
(488, 1, 1, 'Wybierz oryginalny styl na chłodne dni. Te spodnie dresowe adidas idealnie nadają się na chwile relaksu, ale są również na tyle klasyczne, że możesz je nosić na co dzień. Kultowe 3 paski na bokach nadają sportowemu stylowi charakter retro. Zestaw je z koszulką lub bluzą z kapturem i ruszaj w drogę. Miękka mieszanka bawełniana zapewni Ci komfort przez cały dzień.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczne spodnie dresowe z mieszanki materiałów pochodzących z recyklingu i odnawialnych.', 'adicolor-classics-beckenbauer-track-pants', '', '', '', 'Adicolor Classics Beckenbauer Track Pants', '', '', '', ''),
(489, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Konstrukcja z miękkiego polaru sprawia, że te spodnie dresowe adidas to wygodny strój w drodze na trening. Zwężane nogawki i mankiety ze ściągaczem nadają modelowi opływowy kształt, dzięki czemu możesz zaprezentować swoją wyszukaną pracę nóg, gdy już dotrzesz na miejsce.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Polarowe spodnie dresowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'entrada-22-sweat-pants', '', '', '', 'Entrada 22 Sweat Pants', '', '', '', ''),
(490, 1, 1, 'Osiąganie celów treningowych nie wymaga nadludzkich wysiłków. Chodzi o codzienną pracę nad tym, aby stać się silniejszą, sprawniejszą i szybszą wersją siebie. Te krótkie legginsy adidas wspierają Cię na każdym kroku. Techfit ma gładki, kompresyjny design, który zapewnia komfort bez czynników rozpraszających. Pochłaniający wilgoć AEROREADY oznacza suchy komfort podczas wspinaczki, przysiadów i skoków na skrzynię.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Elastyczne, krótkie legginsy treningowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'techfit-training-short-tights', '', '', '', 'Techfit Training Short Tights', '', '', '', ''),
(491, 1, 1, 'Rozpocznij dzień, ciesząc się swobodnym komfortem dzięki spodniom dresowym adidas. Mają design zaczerpnięty z archiwalnych katalogów i odświeżony w wersji na co dzień. Niezależnie od tego, czy tylko relaksujesz się, czy po prostu wychodzisz, kultowe 3 paski i wyszywane logo Trefoil podkreślą Twój styl MVP.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodne spodnie dresowe w swobodnym stylu.', 'adicolor-seasonal-archive-sweat-pants', '', '', '', 'Adicolor Seasonal Archive Sweat Pants', '', '', '', ''),
(492, 1, 1, 'Do życia nie można się przygotować. Ale można żyć w dobrym stylu. Spodnie treningowe adidas Tiro 21 są inspirowane światem futbolu. Pochłaniający wilgoć materiał AEROREADY zapewnia wygodę. Klasyczne zwężane nogawki kolekcji Tiro oraz suwaki przy kostkach pozwalają zaprezentować dobrze dobraną parę butów.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Dopasowane spodnie z piłkarskim DNA.', 'tiro-21-training-pants', '', '', '', 'Tiro 21 Training Pants', '', '', '', ''),
(493, 1, 1, 'Real Madryt to wyjątkowa drużyna, a te spodnie adidas doskonale o tym świadczą. Dopasowany, podkreślający sylwetkę krój został uszyty z wyjątkowo miłego w dotyku polaru z dużą zawartością bawełny, który sprawdzi się i na dworze, i w domu. Elastyczne mankiety nadają modelowi opływowy look, a średnio zabudowana talia zapewnia komfort przy każdym założeniu. Sznurek do regulacji w elastycznej talii ułatwia dopasowanie.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Dopasowane spodnie, które gwarantują stylowy look i komfort na miarę Realu Madryt.', 'real-madrid-essentials-trefoil-pants', '', '', '', 'Real Madrid Essentials Trefoil Pants', '', '', '', ''),
(494, 1, 1, 'Dla najlepszych drużyn piłkarskich boisko treningowe jest podstawą największych sukcesów. Spodnie dresowe reprezentacji Argentyny mają dopasowany, opływowy krój i są częścią drużynowej kolekcji treningowej adidas. Pochłaniający wilgoć AEROREADY i wstawka z siateczki oferują komfort na boisku niezależnie od tego, jak intensywnie ćwiczysz.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Dopasowane spodnie treningowe reprezentacji Argentyny uszyte z materiałów pochodzących z recyklingu.', 'argentina-tiro-23-training-pants', '', '', '', 'Argentina Tiro 23 Training Pants', '', '', '', ''),
(495, 1, 1, 'Dres SST od dawna jest podstawowym elementem w katalogach adidas. Jak wszystko, co dobre, ten model przeszedł ewolucję, a dzisiaj nadal jest ulubionym designem Adicolor. Spodnie dresowe SST jasno pokazują, dlaczego — mają rozpoznawalną sylwetkę, kultowe 3 paski i logo adidas Trefoil w idealnym odcieniu sportowej nostalgii. Przez lata look pozostawał dość niezmienny, ale jedną z rzeczy, które się zmieniły, jest materiał – model jest teraz wykonany z materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'Spodnie dresowe z archiwalnych katalogów wykonane częściowo z materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'adicolor-classics-track-pants', '', '', '', 'Adicolor Classics Track Pants', '', '', '', ''),
(496, 1, 1, 'Najwyższa jakość na boisku i nie tylko. Spodnie adidas Tiro zostały zaprojektowane do noszenia podczas piłkarskich treningów, ale stały się kultowym elementem mody miejskiej. Suwaki w kostkach pozwalają na wygodne zakładanie i zdejmowanie spodni bez ściągania butów. Pochłaniający wilgoć materiał AEROREADY zapewnia suchy komfort niezależnie od tego, w jakiej sytuacji się znajdziesz.', 'Zwężane spodnie dresowe z materiałów pochodzących z recyklingu.', 'tiro-21-track-pants', '', '', '', 'Tiro 21 Track Pants', '', '', '', ''),
(497, 1, 1, 'Trenuj jak profesjonaliści, relaksuj się w dobrym stylu. Te piłkarskie spodnie dresowe adidas zostały uszyte z pochłaniającego wilgoć AEROREADY, aby zapewnić Ci suchy komfort i gotowość na wszystko, co dzieje się na boisku i poza nim. Talia regulowana sznurkiem utrzymuje je na swoim miejscu, a suwaki w kostkach ułatwiają zakładanie i zdejmowanie, gdziekolwiek zaprowadzi Cię dzień.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Piłkarskie spodnie treningowe uszyte z materiałów pochodzących z recyklingu.', 'entrada-22-training-pants', '', '', '', 'Entrada 22 Training Pants', '', '', '', ''),
(498, 1, 1, 'Plotka głosi, że pierwszy dres adidas powstał w 1964 roku. Nie potwierdzimy tego, jednak nie mamy wątpliwości, że 3 paski od lat wyróżniają się na boiskach, stadionach, ulicach, po prostu wszędzie. Bez względu na to, gdzie jesteś, jakoś zawsze jest na miejscu. Te spodnie dresowe są na to jednoznacznym dowodem. Poza gwarancją swobody i komfortu, miękki materiał zawiera przędzę Parley Ocean Plastic, która została wyprodukowana z upcyklingowanych plastikowych odpadów.', 'Połowa klasycznego dresu oferująca wygodę na miarę pełnego zestawu.', 'adicolor-classics-primeblue-sst-track-pants', '', '', '', 'Adicolor Classics Primeblue SST Track Pants', '', '', '', ''),
(499, 1, 1, 'Niezbędny element wyposażenia treningowego od adidas. Zanim wyjdziesz na boisko na zimową sesję, załóż spodnie piłkarskie Tiro 23 Club. Dopasowany, opływowy krój i pochłaniający wilgoć AEROREADY zapewnią Ci swobodę ruchu podczas sprintów i okrążeń. Suwaki w kostkach ułatwiają zdejmowanie bez ściągania butów.  Ten produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Treningowe spodnie dresowe o dopasowanym kroju uszyte z materiałów pochodzących z recyklingu.', 'tiro-23-club-training-pants', '', '', '', 'Tiro 23 Club Training Pants', '', '', '', ''),
(500, 1, 1, '3 paski od lat są symbolem sportu. Ale nie musisz być na bieżni ani na boisku, aby nosić je z dumą. Ciesz się komfortem tych spodni dresowych adidas i poruszaj we własnym rytmie. Na przykład spaceruj po parku lub relaksuj w wolne dni. Te spodnie są wykonane z materiałów pochodzących z recyklingu. Gdziekolwiek będziesz je nosić, poczujesz się dobrze na wiele sposobów.   Ten produkt został wykonany z Primeblue – wysokiej jakości materiału pochodzącego z recyklingu, powstałego częściowo z Parley Ocean Plastic.', 'Kultowe spodnie dresowe adidas z nową porcją energii.', 'adicolor-classics-beckenbauer-primeblue-track-pants', '', '', '', 'Adicolor Classics Beckenbauer Primeblue Track Pants', '', '', '', ''),
(501, 1, 1, 'Piłkarski design do noszenia na co dzień. Te spodnie adidas Tiro zabiorą Cię na boisko treningowe i nie tylko. Pochłaniający wilgoć AEROREADY zapewnia suchy komfort i świeżość niezależnie od intensywności Twojego dnia. Suwaki w kostkach ułatwiają zakładanie i zdejmowanie.  Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Odprowadzające wilgoć spodnie piłkarskie z materiałów pochodzących z recyklingu.', 'tiro-essential-pants', '', '', '', 'Tiro Essential Pants', '', '', '', ''),
(502, 1, 1, 'Wygoda, ciepło i klimat z początku XXI wieku. Te spodnie dresowe adidas mają wszystko, czego potrzebujesz. Zrób, co masz do zrobienia i odpoczywaj, ciesząc się miękkością polaru. Albo ruszaj do miasta z niezbędnymi rzeczami schowanymi w bocznych kieszeniach.   Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Miękkie i ciepłe spodnie dresowe wykonane z materiałów pochodzących z recyklingu.', 'polar-fleece-sweat-pants', '', '', '', 'Polar Fleece Sweat Pants', '', '', '', ''),
(503, 1, 1, 'Styl klasyczny czy łyżwowy – chodzi o pobijanie rekordów życiowych. Zapewnij sobie komfort na szlaku i w górach, nosząc te legginsy adidas Terrex Agravic XC. Noś je samodzielnie w chłodne dni lub jako warstwę podstawową w mroźną pogodę. Skup się na założonym celu i pozwól ciału oddychać. Kiedy osiągniesz swój cel, nadal będziesz cieszyć się suchym komfortem.', 'Oddychające legginsy do narciarstwa biegowego.', 'terrex-agravic-xc-tights', '', '', '', 'Terrex Agravic XC Tights', '', '', '', ''),
(504, 1, 1, '3 paski zawsze oznaczały oryginalność. Nic więc dziwnego, że owinięte wokół dolnej części nogawki tych spodni dresowych adidas stanowią nową odsłonę tradycyjnego stylu. Niezależnie od tego, czy wybierzesz ten model na chwile relaksu, czy w zabiegany dzień, dopasowany i miękki w dotyku design zapewni Ci wyrazisty styl i wysoki poziom komfortu.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Spodnie dresowe w świeżym stylu wykonane częściowo z materiałów pochodzących z recyklingu.', 'adicolor-neuclassics-sweat-pants', '', '', '', 'Adicolor Neuclassics Sweat Pants', '', '', '', ''),
(505, 1, 1, 'Zrelaksuj się na maksa w spodniach adidas z 3 paskami. Idealnie pasują do Twoich ulubionych ubrań i sprawdzą się w leniwe dni lub podczas wypadu na zakupy. Dopasowany krój nadaje modelowi nowoczesny, dopracowany look. Gdziekolwiek się udasz, miękki polar zapewni Ci komfort przez cały dzień.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Dopasowane spodnie, które pasują do wszystkiego.', 'adicolor-classics-3-stripes-pants', '', '', '', 'Adicolor Classics 3-Stripes Pants', '', '', '', ''),
(506, 1, 1, 'Pokaż, komu kibicujesz, i zrób to w dobrym stylu. Logo adidas Trefoil w połączeniu z logo Arsenal Football Club sprawia, że te spodnie stanowią wyraz Twojego zaufania do klubu. Średnio zabudowana talia ze sznurkiem do regulacji gwarantuje wygodę i dobre samopoczucie, gdy uprawiasz sport lub po prostu odpoczywasz. Model z miękkiego polaru z dużą zawartością bawełny to miły w dotyku wybór, który sprawdzi się na co dzień.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Klasyczne spodnie z dużą zawartością bawełny, które dumnie prezentują piłkarski klub.', 'arsenal-fc-essentials-trefoil-pants', '', '', '', 'Arsenal FC Essentials Trefoil Pants', '', '', '', ''),
(507, 1, 1, 'Dumny styl Juventusu nie ma sobie równych, a dzięki tym spodniom adidas Ty również możesz się nim cieszyć. Dopasowany, podkreślający sylwetkę krój został uszyty z wyjątkowo miłego w dotyku polaru o dużej zawartości bawełny, który możesz nosić na co dzień w domu. Elastyczne mankiety nadają mu opływowy look, a średnio zabudowana talia zapewnia Ci komfort przy każdym założeniu. Sznurek do regulacji w elastycznej talii ułatwia odpowiednie dopasowanie modelu.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Dopasowane spodnie, które gwarantują stylowy look i komfort na miarę Juventusu.', 'juventus-essentials-trefoil-pants', '', '', '', 'Juventus Essentials Trefoil Pants', '', '', '', ''),
(508, 1, 1, 'Do wspierania elitarnego klubu piłkarskiego potrzebujesz tego, co najlepsze. Czyli spodni treningowych adidas Real Madrid Condivo 22. Konstrukcja z pochłaniającym wilgoć AEROREADY pozwoli Ci skoncentrować się na akcji bez czynników rozpraszających. Suwaki w kostkach pozwalają na łatwe zakładanie i zdejmowanie spodni.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Treningowe spodnie dresowe Realu Madryt uszyte z materiałów pochodzących z recyklingu.', 'real-madrid-condivo-22-training-pants', '', '', '', 'Real Madrid Condivo 22 Training Pants', '', '', '', ''),
(509, 1, 1, 'Niezależnie od tego, czy trenujesz do najszybszego maratonu na świecie (witaj, Berlinie), czy do kolejnego biegu na 10 kilometrów, te legginsy do biegania adidas pomogą Ci pokonać każdy dystans. Płaskie szwy redukują ryzyko otarć, a AEROREADY usuwa wilgoć, zapewniając Ci suchy komfort podczas całego biegu. Odblaskowe detale są dobrze widoczne, kiedy trenujesz po zmroku.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Legginsy do biegania stworzone na cześć Berlina i wykonane częściowo z materiałów pochodzących z recyklingu.', 'berlin-marathon-2022-tights', '', '', '', 'Berlin Marathon 2022 Tights', '', '', '', ''),
(510, 1, 1, 'Klasyka w sercu. Spodnie dresowe adidas z wyszywanym godłem Manchesteru United i subtelnym logo Trefoil pasują do każdej epoki. Poza prostym, klasycznym designem, mają dopasowany, opływowy krój i mankiety ze ściągaczami, które pozwolą Ci zaprezentować buty.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to tylko jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Ponadczasowe spodnie Manchesteru United wykonane częściowo z materiałów pochodzących z recyklingu.', 'manchester-united-essentials-trefoil-track-pants', '', '', '', 'Manchester United Essentials Trefoil Track Pants', '', '', '', ''),
(511, 1, 1, 'Świetny wybór w chłodne dni i chłód na siłowni. Te spodnie treningowe adidas zostały uszyte z AEROREADY, aby zapewnić Ci suchy komfort, gdy podkręcasz tempo. Sznurek do regulacji w talii umożliwia bezpieczne dopasowanie, a gładkie, zwężane nogawki gwarantują swobodę ruchów.  Ten produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Uniwersalne spodnie dresowe z materiałów pochodzących z recyklingu.', 'train-essentials-3-stripes-training-pants', '', '', '', 'Train Essentials 3-Stripes Training Pants', '', '', '', ''),
(512, 1, 1, 'Stworzone z myślą o zapewnieniu komfortu i pewności siebie piłkarzom podczas podróżowania między ważnymi meczami. Te spodnie dresowe adidas Manchester United czerpią inspirację z barw wyjazdowych klubu. Dopasowany krój i zwężane nogawki nadają im opływowy, gładki wygląd, który sprawdza się, gdy przestrzeń jest na wagę złota. Wyszywana klubowa naszywka na nogawce pokazuje, co sprawia, że wszędzie poczujesz się jak w domu.', 'Zwężane spodnie Manchesteru United, które zapewnią Ci komfort, gdy ruszasz w drogę.', 'manchester-united-travel-pants', '', '', '', 'Manchester United Travel Pants', '', '', '', ''),
(513, 1, 1, 'Spodnie dresowe powinny być wyjątkowo wygodne, a ta para od adidas bierze to sobie do serca. Konstrukcja z najmiększego polaru o dużej zawartości bawełny i poliestru zapewni Ci swobodę ruchu przez cały dzień. Boczne kieszenie na suwak pomieszczą wszystko, czego potrzebujesz, a średnia talia nie przesuwa się ani nie zwisa zbyt nisko.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wyjątkowo miękkie spodnie dresowe do noszenia na co dzień.', 'fleece-sst-track-pants', '', '', '', 'Fleece SST Track Pants', '', '', '', ''),
(514, 1, 1, 'Spodnie dresowe adidas oferują pełną swobodę. Można się tego spodziewać, ponieważ są uszyte z miękkiego materiału frotté, który zapewni Ci komfort. Lamówka wzdłuż charakterystycznych 3 pasków tworzy estetykę w stylu vintage.   Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Swobodne spodnie z materiału frotté gwarantujące całkowity komfort.', 'adidas-rekive-sweat-pants', '', '', '', 'adidas Rekive Sweat Pants', '', '', '', ''),
(515, 1, 1, 'Oto Twoje nowe ulubione spodnie dresowe. Spodnie dresowe adidas Firebird zostały stworzone z myślą o ikonach. Połączenie klasycznych, archiwalnych elementów z nowoczesnymi akcentami tworzy uniwersalny element garderoby. Zestaw je ze sprawdzoną koszulką i butami sportowymi, aby uzyskać swobodny look. Model idealnie sprawdzi się też w Twoim domowym biurze, ponieważ trykot jest miękki i wygodny.  Przędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Spodnie dresowe adidas wykonane częściowo z Parley Ocean Plastic.', 'adicolor-classics-firebird-track-pants', '', '', '', 'Adicolor Classics Firebird Track Pants', '', '', '', ''),
(516, 1, 1, 'Twoim największym problemem w sobotni poranek jest to, gdzie napić się kawy przed południem. Sięgnij po spodnie dresowe adidas i ciesz się przytulnym komfortem niczym pod pierzynką przez cały dzień. Kawa się skończyła? Minimalistyczny styl sprawdza się, gdy musisz iść do pobliskiego sklepu.   Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Wyszukane spodnie dresowe o wyjątkowo wygodnym kroju.', 'adicolor-trefoil-sweat-pants', '', '', '', 'Adicolor Trefoil Sweat Pants', '', '', '', ''),
(517, 1, 1, 'Graj ostro, odpoczywaj na całego. Te dopasowane spodnie dresowe adidas spełniają wszystkie Twoje wymagania. Kieszenie na suwak pomieszczą niezbędne drobiazgi na kanapie lub w drodze. Zaprojektowany z myślą o Twoim komforcie model z pewnością będzie Twoim ulubionym elementem garderoby.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna para bawełnianych spodni.', 'trefoil-essentials-pants', '', '', '', 'Trefoil Essentials Pants', '', '', '', ''),
(518, 1, 1, 'To jeden z elementów stroju do biegania, po który możesz także sięgnąć w leniwe dni. Spodnie adidas oferują wszystkie elementy, które przydadzą się podczas pokonywania kolejnych kilometrów, od kieszeni z osłoną przeciwpotną po odblaskowe detale na całej powierzchni. Są tak elastyczne, że trening możesz zakończyć sesją jogi, a klucze schowasz w kieszeniach bocznych. A dzięki klasycznemu krojowi możesz nawet wybrać się w nich na drinka z towarzyszami biegu.', 'Odblaskowe spodnie na trening i relaks po biegu.', 'adidas-own-the-run-astro-pants', '', '', '', 'adidas Own The Run Astro Pants', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(519, 1, 1, 'Wybierz oryginalny styl na chłodne dni. Te spodnie dresowe adidas idealnie nadają się na chwile relaksu, ale są również na tyle klasyczne, że możesz je nosić na co dzień. Kultowe 3 paski na bokach nadają sportowemu stylowi charakter retro. Zestaw je z koszulką lub bluzą z kapturem i ruszaj w drogę. Miękka mieszanka bawełniana zapewni Ci komfort przez cały dzień.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczne spodnie dresowe z mieszanki materiałów pochodzących z recyklingu i odnawialnych.', 'adicolor-classics-beckenbauer-track-pants', '', '', '', 'Adicolor Classics Beckenbauer Track Pants', '', '', '', ''),
(520, 1, 1, 'Niech nic Cię nie spowolni. Poruszaj się swobodnie podczas intensywnych sesji, nosząc te legginsy jako warstwę podstawową. Wykonuj wyroki i kopnięcia na treningu cardio, ciesząc się pełnym komfortem dzięki formowanej wypukłej wstawce. Detale z siateczki i pochłaniający wilgoć AEROREADY zapewniają Ci suchy komfort, dzięki czemu możesz trenować bez przeszkód.', 'Legginsy z 3 paskami do intensywnych treningów wykonane częściowo z materiałów pochodzących z recyklingu.', 'techfit-3-stripes-training-long-tights', '', '', '', 'Techfit 3-Stripes Training Long Tights', '', '', '', ''),
(521, 1, 1, 'Możesz zrobić wszystko. Ale możesz też nic nie robić. Tak czy inaczej, te spodnie dresowe adidas zapewnią Ci wyluzowany, swobodny styl. Bawełna gwarantuje o wygodę podczas pracy z domu i wypadów na miasto. A prosty styl? Zawsze wygląda dobrze.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękkie spodnie dresowe w prostym, wygodnym stylu.', 'reclaim-logo-sweat-pants', '', '', '', 'Reclaim Logo Sweat Pants', '', '', '', ''),
(522, 1, 1, '„Kolekcja Adicolor Heritage Now czerpie inspirację z archiwalnych modeli i klasyków stylu. Linia, która rzuca światło na detale jednoznacznie kojarzące się z adidas, łączy luksusowe i teksturowane materiały z jasną paletą barw, aby nadać kultowym sylwetkom nową, pełną energii formę.” — Senior Originals Designers, Florence Marrinier &amp; Lena Sophie Anders  Spodnie dresowe retro w nowoczesnej odsłonie. Spodnie dresowe Adicolor Heritage Now w paski wzorowane na kultowym dresie Beckenbauer mają dopasowany krój i zostały uszyte z wysokiej jakości materiału w śmiałych, żywych odcieniach. Nawiązują do sportowego dziedzictwa adidas, a zarazem wpisują się w dzisiejsze trendy za sprawą zamszowego logo Trefoil i suwaków z brandingiem.', 'Spodnie dresowe w stylu Beckenbauer w nowoczesnej odsłonie z funkcjonalnymi detalami.', 'adicolor-heritage-now-striped-track-pants', '', '', '', 'Adicolor Heritage Now Striped Track Pants', '', '', '', ''),
(523, 1, 1, 'Nie ma znaczenia, czy wpadasz tylko na chwilę, czy zostajesz na dłużej. Kamuflaż zawsze robi wrażenie. To właśnie dlatego pojawia się w każdym sezonie w nowej odsłonie. Tak jak na przykład na tych spodniach dresowych adidas. 3 paski współgrają z kamuflażowymi panelami na bokach, łącząc styl klasyczny ze sportowym.', 'Luźne spodnie z polaru z mocnym, kamuflażowym wzorem.', 'camo-series-sweat-pants', '', '', '', 'Camo Series Sweat Pants', '', '', '', ''),
(524, 1, 1, 'Trenuj jak profesjonalista w spodniach piłkarskich adidas Condivo 22. Mają przylegający krój z dużą ilością streczu, który zapewnia pełną swobodę ruchu, gdy szlifujesz swoje umiejętności. Pochłaniający wilgoć AEROREADY dba o Twój suchy komfort, gdy Twoja wyszukana praca nóg nabiera tempa.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Odprowadzające wilgoć spodnie dresowe uszyte z materiału pochodzącego z recyklingu.', 'condivo-22-pants', '', '', '', 'Condivo 22 Pants', '', '', '', ''),
(525, 1, 1, 'Przejdź płynnie w tryb treningowy. Te spodnie adidas ze średnio zabudowaną talią zostały uszyte z mieszanki bawełny i materiału frotté, który jest wyjątkowo miękki w dotyku. Technologia AEROREADY zapewnia Ci suchy komfort podczas sesji, a kieszenie na suwaki pomieszczą Twój telefon — i playlistę — w zasięgu ręki.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Te spodnie dresowe zostały uszyte z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'sports-club-pants', '', '', '', 'Sports Club Pants', '', '', '', ''),
(526, 1, 1, 'Klasyka w świeżym wydaniu. Inspiracją dla tych spodni dresowych adidas Firebird stał się japoński design vintage. Wykonane są też z materiałów pochodzących z recyklingu. Kto by pomyślał, że upcyklingowane plastikowe odpady mogą zostać przekształcone w Twoje nowe ulubione spodnie?  Ten produkt został wykonany z Primeblue – wysokiej jakości materiału pochodzącego z recyklingu, powstałego częściowo z Parley Ocean Plastic.', 'Spodnie dresowe Firebird, które prezentują nowoczesne spojrzenie na styl vintage.', 'adicolor-classics-firebird-primeblue-track-pants', '', '', '', 'Adicolor Classics Firebird Primeblue Track Pants', '', '', '', ''),
(527, 1, 1, '32 drużyny marzą o jednym celu. Argentyńscy zawodnicy, marząc o zwycięskim hat tricku, noszą takie spodnie dresowe adidas w drodze na najważniejszy piłkarski turniej. Dopasowany krój i zwężane nogawki zapewniają swobodę ruchu, nawet gdy się spieszysz. Zarówno zawodnicy, jak i kibice chcą wierzyć w to,  że na nadrukowanej naszywce pojawi się kolejna gwiazdka.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Zwężane spodnie dresowe reprezentacji Argentyny wykonane częściowo z materiałów pochodzących z recyklingu.', 'argentina-game-day-travel-pants', '', '', '', 'Argentina Game Day Travel Pants', '', '', '', ''),
(528, 1, 1, 'Najważniejsza jest pełna swoboda ruchu. Te spodnie adidas Terrex Liteflex Hiking mają szeroką, elastyczną taśmę w talii z silikonowym uchwytem, który idealnie sprawdzi się do przyczepienia plecaka lub torby-biodrówki. Dodatek streczu pozwala Ci bez przeszkód poruszać się po nierównym terenie. Wodoodporna tkanina zapewnia spokój ducha, gdy stawiasz czoła brzydkiej pogodzie. Ruszaj na długą wędrówkę po szlaku.', 'Spodnie hikingowe ze streczem, które sprawdzą się na długich dystansach.', 'terrex-liteflex-hiking-pants', '', '', '', 'Terrex Liteflex Hiking Pants', '', '', '', ''),
(529, 1, 1, '„W tym sezonie kolekcja Blue Version nawiązuje do stylu prosto z klubów tenisowych, zapożyczając detale od mistrzów krawiectwa sportowego. To piękne połączenie odzieży sportowej i krawiectwa, nawiązujące do chwil z naszej sportowej historii, a jednocześnie pokazane z nowej perspektywy” ― Starszy Dyrektor Projektowy Originals, Stefano Pierre Beruschi.   Blue Version to nowa odsłona luksusowej odzieży rekreacyjnej. Zwolnij tempo w spodniach dresowych Blue Version Essentials. Model z materiału frotté jest jednocześnie luksusowy i miły w dotyku. Zakorzenione w sportowej tradycji spodnie zostały zaprojektowane z myślą o optymalnym komforcie w salonie lub klubie.', 'Luksusowe spodnie dresowe na co dzień z podszewką z satynowymi 3 paskami.', 'blue-version-essentials-sweat-pants', '', '', '', 'Blue Version Essentials Sweat Pants', '', '', '', ''),
(530, 1, 1, 'Pierwszy priorytet dnia? Wygoda. Odhacz ten punkt szybko, zakładając spodnie dresowe od adidas. Gruba bawełna organiczna daje poczucie luksusu bez dodatkowego obciążenia, a swobodny krój zapewnia wygodę. Teraz, gdy już się tym zajmiesz, wszystko, co robisz w ciągu dnia, staje się łatwiejsze.  Ten produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', 'Uniwersalne spodnie dresowe stworzone z myślą o naturze.', 'adicolor-contempo-french-terry-sweat-pants', '', '', '', 'Adicolor Contempo French Terry Sweat Pants', '', '', '', ''),
(531, 1, 1, 'Rozpocznij dzień, ciesząc się swobodnym komfortem dzięki spodniom dresowym adidas. Mają design zaczerpnięty z archiwalnych katalogów i odświeżony w wersji na co dzień. Niezależnie od tego, czy tylko relaksujesz się, czy po prostu wychodzisz, kultowe 3 paski i wyszywane logo Trefoil podkreślą Twój styl MVP.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodne spodnie dresowe w swobodnym stylu.', 'adicolor-seasonal-archive-sweat-pants', '', '', '', 'Adicolor Seasonal Archive Sweat Pants', '', '', '', ''),
(532, 1, 1, 'Ten sam klasyczny look. Nowe pole gry. Te spodnie adidas wychodzą z archiwów ze wszystkimi niezbędnymi detalami, które sportowcy uwielbiali w tamtych czasach, takimi jak dopasowany krój, 3 paski i suwaki w kostkach, które ułatwiają ich zakładanie i zdejmowanie. Tak jak oryginalny model, te również zostały stworzone, aby gwarantować dobry nastrój. A dzięki miękkiemu materiałowi zapewnisz sobie pełen komfort.  Ten produkt zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 40% materiałów pochodzących z recyklingu.', 'Swobodne spodnie dresowe o sportowym rodowodzie wykonane częściowo z Parley Ocean Plastic.', 'adicolor-classics-cutline-pant', '', '', '', 'Adicolor Classics Cutline Pant', '', '', '', ''),
(533, 1, 1, 'Biegacze czują się jeszcze lepiej w tych spodniach adidas. Zwężane nogawki nadają im klasyczny look biegowy, a suwaki w kostkach ułatwiają zakładanie i zdejmowanie przed ważnym wydarzeniem i po nim. Sznurek do regulacji w talii zapewni wygodę i pewność siebie. Odprowadzająca wilgoć technologia AEROREADY zwiększa komfort, dając Ci suchy komfort przez cały bieg. Boczne i wewnętrzne kieszenie na monety pomieszczą niezbędne drobiazgi, a odblaskowe detale pozwolą Ci wyróżnić się w ciemności.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Zwężane, odprowadzające wilgoć spodnie wykonane częściowo z materiałów pochodzących z recyklingu.', 'own-the-run-astro-knit-pants', '', '', '', 'Own the Run Astro Knit Pants', '', '', '', ''),
(534, 1, 1, 'Dres SST od dawna jest podstawowym elementem w katalogach adidas. Jak wszystko, co dobre, ten model przeszedł ewolucję, a dzisiaj nadal jest ulubionym designem Adicolor. Spodnie dresowe SST jasno pokazują, dlaczego — mają rozpoznawalną sylwetkę, kultowe 3 paski i logo adidas Trefoil w idealnym odcieniu sportowej nostalgii. Przez lata look pozostawał dość niezmienny, ale jedną z rzeczy, które się zmieniły, jest materiał – model jest teraz wykonany z materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'Spodnie dresowe z archiwalnych katalogów wykonane częściowo z materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'adicolor-classics-track-pants', '', '', '', 'Adicolor Classics Track Pants', '', '', '', ''),
(535, 1, 1, 'Znalazłeś swój nowy ulubiony sprzęt, który doda Ci mocy podczas intensywnych treningów. Krótkie legginsy, idealne jako warstwa podstawowa lub noszone solo, poruszają się razem z Tobą, dzięki czemu możesz skoncentrować się na swojej formie. Techfit nadaje im gładki, kompresyjny krój, gwarantując komfort i optymalne wsparcie przez cały dzień. Ciesz się suchym komfortem bez względu na to, jak ciężko trenujesz, dzięki adidas AEROREADY.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Kompresyjne, krótkie legginsy treningowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'techfit-3-stripes-training-short-tights', '', '', '', 'Techfit 3-Stripes Training Short Tights', '', '', '', ''),
(536, 1, 1, 'Styl klasyczny czy łyżwowy – chodzi o pobijanie rekordów życiowych. Zapewnij sobie komfort na szlaku i w górach, nosząc te legginsy adidas Terrex Agravic XC. Noś je samodzielnie w chłodne dni lub jako warstwę podstawową w mroźną pogodę. Skup się na założonym celu i pozwól ciału oddychać. Kiedy osiągniesz swój cel, nadal będziesz cieszyć się suchym komfortem.', 'Oddychające legginsy do narciarstwa biegowego.', 'terrex-agravic-xc-tights', '', '', '', 'Terrex Agravic XC Tights', '', '', '', ''),
(537, 1, 1, 'Błękitne niebo. Nieodkryte trasy zjazdowe. Każdy dzień na stoku oznacza nowe przygody. Ruszaj śmiało na ich spotkanie w tych ocieplanych spodniach adidas. Dwuwarstwowy design stworzony, aby zapewnić ciepło, ma syntetyczne wypełnienie PrimaLoft® wykonane z Parley Ocean Plastic. A gdy pojawią się szare chmury, RAIN.RDY ochroni Cię przed silnym wiatrem i śniegiem. Elastyczne ochraniacze w kostkach sprawiają, że spodnie idealnie dopasowują się do szerokiej gamy butów narciarskich i snowboardowych.', 'Ocieplane spodnie na śnieg, które zapewnią Ci ciepło i suchy komfort na stoku.', 'resort-two-layer-insulated-pants', '', '', '', 'Resort Two-Layer Insulated Pants', '', '', '', ''),
(538, 1, 1, 'Czas na relaks i odzyskanie sił. Te spodnie dresowe adidas idealnie nadają się na spokojniejsze chwile, takie jak rozciąganie przed meczem czy powrót do domu po zakończonym treningu. Polar z mieszanki bawełny jest miękki i przyjemny w dotyku. Kieszenie zapinane na suwak pomieszczą niezbędne drobiazgi w zasięgu ręki.  Model zawiera materiały pochodzące z recyklingu, co stanowi część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Zwężane spodnie dresowe gwarantujące komfort poza boiskiem.', 'tiro-21-sweat-pants', '', '', '', 'Tiro 21 Sweat Pants', '', '', '', ''),
(539, 1, 1, 'Błękitne niebo. Nieodkryte trasy zjazdowe. Każdy dzień na stoku oznacza nowe przygody. Ruszaj śmiało na ich spotkanie w tych ocieplanych spodniach adidas z szelkami. Dwuwarstwowy design stworzony, aby zapewnić wygodę i ciepło, ma syntetyczne wypełnienie PrimaLoft® wykonane z Parley Ocean Plastic. Konstrukcja przypominająca spodnie-ogrodniczki zapewnia dodatkowe okrycie, a technologia RAIN.RDY chroni przed śniegiem i wiatrem. Spodnie mają też elastyczne ochraniacze przeciwśniegowe, więc możesz je nosić do wielu modelu butów narciarskich i snowboardowych.', 'Ocieplane spodnie z szelkami na śnieg, które zapewnią Ci ciepło i suchy komfort na stoku.', 'resort-two-layer-insulated-bib-pants', '', '', '', 'Resort Two-Layer Insulated Bib Pants', '', '', '', ''),
(540, 1, 1, 'Ten sam klasyczny look. Nowe pole gry. Te spodnie adidas wychodzą z archiwów ze wszystkimi niezbędnymi detalami, które sportowcy uwielbiali w tamtych czasach, takimi jak dopasowany krój, 3 paski i suwaki w kostkach, które ułatwiają ich zakładanie i zdejmowanie. Tak jak oryginalny model, te również zostały stworzone, aby gwarantować dobry nastrój. A dzięki miękkiemu materiałowi zapewnisz sobie pełen komfort.  Ten produkt zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 40% materiałów pochodzących z recyklingu.', 'Swobodne spodnie dresowe o sportowym rodowodzie wykonane częściowo z Parley Ocean Plastic.', 'adicolor-classics-cutline-pant', '', '', '', 'Adicolor Classics Cutline Pant', '', '', '', ''),
(541, 1, 1, 'Dzień treningu nóg. Cardio. Kickboxing. Wybierz odpowiedni dla siebie rodzaj treningu, a te legginsy treningowe adidas pomogą Ci stawić mu czoła z całkowitą pewnością siebie. Techfit zapewnia gładki, kompresyjny krój, gwarantując komfort i wsparcie przez cały dzień. AEROREADY pochłania wilgoć, aby ułatwić Ci budowanie mocy bez czynników rozpraszających. Załóż ten model pod szorty lub noś solo i poruszaj się swobodnie.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Kompresyjne legginsy treningowe wykonane częściowo z materiałów pochodzących z recyklingu.', 'techfit-allover-print-training-tights', '', '', '', 'Techfit Allover Print Training Tights', '', '', '', ''),
(542, 1, 1, 'Czarny strój treningowy i ciemne ulice to nie jest dobre połączenie. Te spodnie dresowe adidas z odblaskowymi liniami zapewnią Ci widoczność w słabym świetle, a jednocześnie stylowy i dyskretny look. Miła w dotyku bawełna i polar sprawdzą się podczas zimowych spacerów z psem i wypraw na siłownię, a kieszenie pomieszczą telefon i latarkę w zasięgu ręki.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców. Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Ciepłe spodnie dresowe o jasnych liniach wykonane częściowo z materiałów pochodzących z recyklingu.', 'essentials-reflect-in-the-dark-fleece-pants', '', '', '', 'Essentials Reflect-in-the-Dark Fleece Pants', '', '', '', ''),
(543, 1, 1, 'Niezależnie od tego, czy pedałujesz, zasuwasz po asfalcie, czy leżysz kołami do góry, te spodnie dresowe adidas są tak miękkie, że z łatwością zapomnisz, że masz je na sobie. Spodnie z bawełnianego materiału frotté, który jest miły w dotyku i nie zwiększa ciężaru stroju, idealnie nadają się do regularnego noszenia. Boczne kieszenie i kieszeń na nogawce ułatwiają organizację niezbędnych drobiazgów.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękkie spodnie dresowe, które sprawdzą się przy biurku i podczas relaksu.', 'essentials-french-terry-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials French Terry Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(544, 1, 1, 'Do życia nie można się przygotować. Ale można żyć w dobrym stylu. Spodnie treningowe adidas Tiro 21 są inspirowane światem futbolu. Pochłaniający wilgoć materiał AEROREADY zapewnia wygodę. Klasyczne zwężane nogawki kolekcji Tiro oraz suwaki przy kostkach pozwalają zaprezentować dobrze dobraną parę butów.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Dopasowane spodnie z piłkarskim DNA.', 'tiro-21-training-pants', '', '', '', 'Tiro 21 Training Pants', '', '', '', ''),
(545, 1, 1, 'Niezależnie od tego, czy nosisz je z klasyczną, białą koszulką, czy z koszulką drużynową, te dyskretne spodnie adidas mogą przyciągać uwagę. Od dopasowanych i prostych linii po subtelne detale, takie jak taśma w kostkach, są stylowe, a jednocześnie skupiają się na sporcie. Wygodne suwaki w kostkach ułatwiają zakładanie i zdejmowanie.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Stylowe spodnie dresowe z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'designed-for-gameday-pants', '', '', '', 'Designed for Gameday Pants', '', '', '', ''),
(546, 1, 1, 'Wszyscy sportowcy potrzebują czasu na regenerację. Załóż te wygodne spodnie w stylu piłkarskim zaraz po treningu. Suwaki w kostkach ułatwiają zakładanie, a AEROREADY zapewnia Ci suchy komfort. Te spodnie dresowe ze średnio zabudowaną talią mają kieszenie na suwak, a więc jest miejsce na telefon.  Ten produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Zwężane spodnie dresowe z materiałów pochodzących z recyklingu.', 'tiro-pants', '', '', '', 'Tiro Pants', '', '', '', ''),
(547, 1, 1, 'Podziel się swoją piłkarską dumą. Te spodnie dresowe Ajax Amsterdam powstały w wyniku współpracy adidas z amsterdamską marką modową Daily Paper. Subtelne detale na dole nogawki, inspirowane kolorami flagi panafrykańskiej, stanowią wyróżniający się akcent. Zyskujesz także zwycięskie połączenie klasycznych zwężanych nogawek Tiro i odprowadzającego wilgoć AEROREADY, które zapewnia komfort.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Przyciągające wzrok spodnie dresowe Ajaksu Amsterdam wykonane z materiałów pochodzących z recyklingu.', 'ajax-amsterdam-tiro-21-track-pants', '', '', '', 'Ajax Amsterdam Tiro 21 Track Pants', '', '', '', ''),
(548, 1, 1, 'Mówi się, że skarpetki były kiedyś wyznacznikiem statusu społecznego i bogactwa. Z trzema parami skarpetek o długości do pół łydki poczujesz się jak ktoś z wyższej klasy. Jedne do pokazania, drugie do noszenia i jedne do zagubienia w pralce.', 'Trio skarpetek w szykownym stylu.', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid Cut Crew Socks 3 Pairs', '', '', '', ''),
(549, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wspierające skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(550, 1, 1, 'Mówi się, że skarpetki były kiedyś wyznacznikiem statusu społecznego i bogactwa. Z trzema parami skarpetek o długości do pół łydki poczujesz się jak ktoś z wyższej klasy. Jedne do pokazania, drugie do noszenia i jedne do zagubienia w pralce.', 'Trio skarpetek w szykownym stylu.', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid Cut Crew Socks 3 Pairs', '', '', '', ''),
(551, 1, 1, 'Mówi się, że skarpetki były kiedyś wyznacznikiem statusu społecznego i bogactwa. Z trzema parami skarpetek o długości do pół łydki poczujesz się jak ktoś z wyższej klasy. Jedne do pokazania, drugie do noszenia i jedne do zagubienia w pralce.', 'Trio skarpetek w szykownym stylu.', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid Cut Crew Socks 3 Pairs', '', '', '', ''),
(552, 1, 1, 'Częściowo amortyzowana wyściółka podeszwy sprawia, że każdy krok w skarpetach Solid Crew jest niezwykle komfortowy. Wykonane z lekko elastycznej bawełny skarpety dla mężczyzn mają długość za kostkę i są ozdobione 3 paskami oraz logo Trefoil na wykończonych ściągaczami mankietach.', 'Crew Socks 3 Pairs', 'crew-socks-3-pairs', '', '', '', 'Crew Socks 3 Pairs', '', '', '', ''),
(553, 1, 1, 'Skarpety adidas do łydki uszyte z miękkiej w dotyku bawełny i poliestru. Wspierające podbicie, amortyzacja w pięcie i palcach komfortowo otulają Twoją stopę, a zintegrowane szwy w palcach zapobiegają otarciom.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Amortyzowane skarpety wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'cushioned-sportswear-crew-socks-6-pairs', '', '', '', 'Cushioned Sportswear Crew Socks 6 Pairs', '', '', '', ''),
