(556, 1, 1, 'Skarpety do kostki zapewniają nadzwyczajny komfort za sprawą amortyzacji na całej długości. Wplecione wsparcie podbicia i gładkie szwy na palcach nadają im doskonale dopasowany, wygodny krój. Design o dużej zawartości bawełny został wykończony sportowym brandingiem adidas.', 'Komplet trzech par sportowych skarpet z imponującą amortyzacją.', 'cushioned-ankle-socks-3-pairs', '', '', '', 'Cushioned Ankle Socks 3 Pairs', '', '', '', ''),
(557, 1, 1, 'Stworzony z myślą o całodziennym komforcie komplet trzech par skarpet do łydki ma amortyzację na całej długości i konstrukcję o dużej zawartości bawełny. Gładkie szwy na palcach i wplecione wsparcie podbicia gwarantują jeszcze lepsze dopasowanie i większy komfort. Prosty branding adidas uzupełnia klasyczny, sportowy look.', 'Klasyczne skarpety do łydki udoskonalone za sprawą amortyzacji na całej długości.', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(558, 1, 1, 'Skarpety adidas do łydki uszyte z miękkiej w dotyku bawełny i poliestru. Wspierające podbicie, amortyzacja w pięcie i palcach komfortowo otulają Twoją stopę, a zintegrowane szwy w palcach zapobiegają otarciom.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Amortyzowane skarpety wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'cushioned-sportswear-crew-socks-6-pairs', '', '', '', 'Cushioned Sportswear Crew Socks 6 Pairs', '', '', '', ''),
(559, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(560, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczne skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
