(563, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczne skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(564, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wspierające skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(565, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wygodne skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(566, 1, 1, 'Częściowo amortyzowana wyściółka podeszwy sprawia, że każdy krok w skarpetach Solid Crew jest niezwykle komfortowy. Wykonane z lekko elastycznej bawełny skarpety dla mężczyzn mają długość za kostkę i są ozdobione 3 paskami oraz logo Trefoil na wykończonych ściągaczami mankietach.', 'Crew Socks 3 Pairs', 'crew-socks-3-pairs', '', '', '', 'Crew Socks 3 Pairs', '', '', '', ''),
(567, 1, 1, 'Komplet trzech par niskoprofilowych skarpet stworzonych z myślą o całodziennym komforcie dodaje stopom mocy tam, gdzie najbardziej jej potrzeba. Dzianina o dużej zawartości bawełny ma wbudowane wsparcie w podbiciu, dzięki czemu doskonale dopasowuje się do stopy. Prosty branding adidas nadaje całości sportowy look.', 'Niskoprofilowe skarpety z amortyzacją na całej długości.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(568, 1, 1, 'Skorzystaj z zasobnego archiwum adidas za sprawą tych skarpet do łydki z monogramem. Nadruk z logo Trefoil na całej powierzchni dodaje witalności i wyszukanego stylu każdemu strojowi. Mocna, miękka dzianina zapewnia stopom komfort. Załóż je i poczuj się równie dobrze, jak wyglądasz.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Logo Trefoil rozkwita na tych skarpetkach z grafiką wykonanych częściowo z materiałów pochodzących z recyklingu.', 'monogram-thin-crew-socks-2-pairs', '', '', '', 'Monogram Thin Crew Socks 2 Pairs', '', '', '', ''),
(569, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(570, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczne skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(571, 1, 1, 'Dodaj sportowy akcent za sprawą tych skarpet adidas do kostki. Konstrukcja z mieszanki bawełny i poliestru jest miękka i przewiewna, a zintegrowane szwy w palcach zapobiegają otarciom. Amortyzacja w pięcie i palcach oraz wspierające dopasowanie w łuku stopy zapewniają komfort przez cały dzień.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-sportswear-ankle-socks-6-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(572, 1, 1, 'Niezbędny element Twojej garderoby treningowej. Te skarpety treningowe adidas o długości do łydki są lekkie i cienkie, dzięki czemu zapewniają wygodę noszenia na korcie, na siłowni lub w domu. AEROREADY pochłania wilgoć, dbając o Twój suchy komfort podczas najcięższych sesji. Klasyczny branding adidas stanowi sportowe wykończenie. W opakowaniu znajdują się trzy pary.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Odprowadzające wilgoć skarpety wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'performance-light-crew-socks-3-pairs', '', '', '', 'Performance Light Crew Socks 3 Pairs', '', '', '', ''),
(573, 1, 1, 'Częściowo amortyzowana wyściółka podeszwy sprawia, że każdy krok w skarpetach Solid Crew jest niezwykle komfortowy. Wykonane z lekko elastycznej bawełny skarpety dla mężczyzn mają długość za kostkę i są ozdobione 3 paskami oraz logo Trefoil na wykończonych ściągaczami mankietach.', 'Crew Socks 3 Pairs', 'crew-socks-3-pairs', '', '', '', 'Crew Socks 3 Pairs', '', '', '', ''),
(574, 1, 1, 'Lekkie, cienkie skarpety do kostki powstały z myślą o komforcie i dostępne są w zestawie zawierającym trzy pary. Mają konstrukcję z materiału o dużej zawartości bawełny we wplecionym wsparciu podbicia i gładkimi szwami na palcach. Logo adidas podkreśla ściągaczowy mankiet w sportowym stylu.', 'Skarpety do kostek o wygodnej konstrukcji z bawełny.', 'ankle-socks-3-pairs', '', '', '', 'Ankle Socks 3 Pairs', '', '', '', ''),
(575, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(576, 1, 1, 'Komplet trzech par niskoprofilowych skarpet stworzonych z myślą o całodziennym komforcie dodaje stopom mocy tam, gdzie najbardziej jej potrzeba. Dzianina o dużej zawartości bawełny ma wbudowane wsparcie w podbiciu, dzięki czemu doskonale dopasowuje się do stopy. Prosty branding adidas nadaje całości sportowy look.', 'Niskoprofilowe skarpety z amortyzacją na całej długości.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(577, 1, 1, 'Komplet trzech par niskoprofilowych, cienkich i lekkich skarpet zapewnia komfort na co dzień. Bawełniany design ma wbudowane wsparcie w podbiciu, dzięki czemu nie przesuwa się na stopie. Całość została wykończona logo adidas poniżej ściągaczowego brzegu.', 'Trzypak swobodnych, krótkich skarpet do noszenia z ulubionymi butami sportowymi.', 'low-cut-socks-3-pairs', '', '', '', 'Low-Cut Socks 3 Pairs', '', '', '', ''),
(578, 1, 1, 'Częściowo amortyzowana wyściółka podeszwy sprawia, że każdy krok w skarpetach Solid Crew jest niezwykle komfortowy. Wykonane z lekko elastycznej bawełny skarpety dla mężczyzn mają długość za kostkę i są ozdobione 3 paskami oraz logo Trefoil na wykończonych ściągaczami mankietach.', 'Crew Socks 3 Pairs', 'crew-socks-3-pairs', '', '', '', 'Crew Socks 3 Pairs', '', '', '', ''),
(579, 1, 1, 'Buty adidas Ultraboost to nowoczesna ikona stylu. Stworzyliśmy je, aby pomóc biegaczom biegać dalej i czuć się lepiej. Skarpety adidas oddają hołd tej historii przy pomocy grafiki przedstawiającej buty do biegania. Miękka, gładka mieszanka z lyocellem ma domieszkę streczu, a amortyzacja pod stopą zapewnia stopom komfort.  Ten produkt został stworzony z naturalnych i pozyskanych z odnawialnych źródeł materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Te skarpety powstały na cześć butów Ultraboost i powstały z myślą o naturze.', 'run-x-ultraboost-shoe-love-graphic-socks-2-pairs', '', '', '', 'Run x Ultraboost Shoe Love Graphic Socks 2 Pairs', '', '', '', ''),
(580, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(581, 1, 1, 'Udało Ci się stworzyć idealny strój na Twój dzień pełen zajęć ― jest wygodny, a jednocześnie stylowy i podkreśla osobowość. Ciesz się nim aż po palce w tych skarpetkach adidas. Śmiała grafika zaczerpnięta z archiwalnych katalogów nadaje jednej parze charyzmę, podczas gdy druga para prezentuje subtelniejsze podejście za sprawą brandingu adidas Adventure. Oba style powstały z myślą o komforcie przez cały dzień.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety z grafiką wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'adidas-adventure-socks-2-pairs', '', '', '', 'adidas Adventure Socks 2 Pairs', '', '', '', ''),
(582, 1, 1, 'Buty adidas Ultraboost to nowoczesna ikona stylu. Stworzyliśmy je, aby pomóc biegaczom biegać dalej i czuć się lepiej. Skarpety adidas oddają hołd tej historii przy pomocy grafiki przedstawiającej buty do biegania. Miękka, gładka mieszanka z lyocellem ma domieszkę streczu, a amortyzacja pod stopą zapewnia stopom komfort.  Ten produkt został stworzony z naturalnych i pozyskanych z odnawialnych źródeł materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Te skarpety powstały na cześć butów Ultraboost i powstały z myślą o naturze.', 'run-x-ultraboost-shoe-love-graphic-socks-2-pairs', '', '', '', 'Run x Ultraboost Shoe Love Graphic Socks 2 Pairs', '', '', '', ''),
(583, 1, 1, 'Znajdź swoje ulubione miejsce między piętą a łydką. Skarpety adidas do pół łydki nie są ani za krótkie, ani za długie. Zapewnią Ci świetny look podczas treningu lub odpoczynku. Bawełniana konstrukcja gwarantuje idealny komfort i dopasowanie.', 'Trzy pary miękkich, wygodnych skarpet o uniwersalnej długości do połowy łydki.', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid-Cut Crew Socks 3 Pairs', '', '', '', ''),
(584, 1, 1, 'Niezbędne na co dzień, wykonane z dzianiny o dużej zawartości bawełny skarpety o długości do łydki, w poręcznym opakowaniu po trzy pary. Lekkie i cienkie skarpety mają wplecione wsparcie podbicia i gładką część palców, która nadaje im wygodny krój. Klasyczny design do pół łydki ma logo adidas, aby zaakcentować ich sportowy look.', 'Klasyczne sportowe skarpetki w praktycznym trójpaku.', 'crew-socks-3-pairs', '', '', '', 'Crew Socks 3 Pairs', '', '', '', ''),
(585, 1, 1, 'Lekkie, cienkie skarpety do kostki powstały z myślą o komforcie i dostępne są w zestawie zawierającym trzy pary. Mają konstrukcję z materiału o dużej zawartości bawełny we wplecionym wsparciu podbicia i gładkimi szwami na palcach. Logo adidas podkreśla ściągaczowy mankiet w sportowym stylu.', 'Skarpety do kostek o wygodnej konstrukcji z bawełny.', 'ankle-socks-3-pairs', '', '', '', 'Ankle Socks 3 Pairs', '', '', '', ''),
(586, 1, 1, 'Komplet trzech par niskoprofilowych, cienkich i lekkich skarpet zapewnia komfort na co dzień. Bawełniany design ma wbudowane wsparcie w podbiciu, dzięki czemu nie przesuwa się na stopie. Całość została wykończona logo adidas poniżej ściągaczowego brzegu.', 'Trzypak swobodnych, krótkich skarpet do noszenia z ulubionymi butami sportowymi.', 'low-cut-socks-3-pairs', '', '', '', 'Low-Cut Socks 3 Pairs', '', '', '', ''),
(587, 1, 1, 'W tym modelu znajdziesz wiele detali, które zapewnią Ci komfort przez cały trening. Załóż te skarpetki i ruszaj na podbój świata. Elementy z siateczki usprawniają przepływ powietrza. Ciesz się suchym komfortem dzięki adidas AEROREADY. Elastyczne strefy tam, gdzie ich potrzebujesz, i wsparcie w podbiciu sprawiają, że możesz się ruszać, jak tylko zechcesz. Każde opakowanie zawiera trzy pary skarpet.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Trójpak wydajnych skarpet stworzonych z myślą o uniwersalności w czasie treningu.', 'performance-cushioned-crew-socks-3-pairs', '', '', '', 'Performance Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(588, 1, 1, 'Oddychaj w pozycji psa z głową w dół. Trzymaj się pewnie w pozycji drzewa. Przyczepne, gumowe kropki na tych skarpetkach adidas ułatwiają praktykowanie jogi i skupienie podczas kolejnych asan. Bawełna jest miękka, elastyczna i przewiewna, dzięki czemu zapewnia Ci komfort.', 'Przyczepne skarpetki do jogi, które nie przesuwają się podczas sesji.', 'yoga-socks', '', '', '', 'Yoga Socks', '', '', '', ''),
(589, 1, 1, 'Komplet trzech par niskoprofilowych, cienkich i lekkich skarpet zapewnia komfort na co dzień. Bawełniany design ma wbudowane wsparcie w podbiciu, dzięki czemu nie przesuwa się na stopie. Całość została wykończona logo adidas poniżej ściągaczowego brzegu.', 'Trzypak swobodnych, krótkich skarpet do noszenia z ulubionymi butami sportowymi.', 'low-cut-socks-3-pairs', '', '', '', 'Low-Cut Socks 3 Pairs', '', '', '', ''),
(590, 1, 1, 'Co łączy ten model z innymi elementami stroju treningowego adidas? Wygoda to podstawa w tych skarpetkach do kostki. Wszystko w nich (na przykład pochłaniający wilgoć AEROREADY) zostało stworzone, aby pomóc Ci osiągać lepsze wyniki, i rozciąga się tam, gdzie tego potrzebujesz. Opakowanie zawiera trzy pary.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety treningowe wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'performance-light-mid-cut-socks-3-pairs', '', '', '', 'Performance Light Mid-Cut Socks 3 Pairs', '', '', '', ''),
(591, 1, 1, 'Skarpetki adidas o długości do kostki mają subtelnie ściągaczowe brzegi, które utrzymują je na swoim miejscu. Model wykonany z mieszanki lekkiego, miękkiego materiału jest dostępny w opakowaniach po trzy pary i stanowi sportowe uzupełnienie Twojej szuflady na skarpetki.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'think-linear-ankle-socks-3-pairs', '', '', '', 'Think Linear Ankle Socks 3 Pairs', '', '', '', ''),
(592, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wspierające skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(593, 1, 1, 'Znajdź swoje ulubione miejsce między piętą a łydką. Skarpety adidas do pół łydki nie są ani za krótkie, ani za długie. Zapewnią Ci świetny look podczas treningu lub odpoczynku. Bawełniana konstrukcja gwarantuje idealny komfort i dopasowanie.', 'Trzy pary miękkich, wygodnych skarpet o uniwersalnej długości do połowy łydki.', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid-Cut Crew Socks 3 Pairs', '', '', '', ''),
(594, 1, 1, 'Podaruj swojej szufladzie na skarpetki trochę miłości. Klasyczny, ściągaczowy design skarpetek adidas do łydki zapewnia Ci idealne dopasowanie, a konstrukcja z dużą zawartością bawełny organicznej jest wygodna przez cały dzień. Naszyte logo Trefoil stanowi subtelny, autentyczny akcent.  Ten produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Para luksusowych, bawełnianych skarpet stworzonych z myślą o naturze.', 'premium-essentials-crew-socks-2-pairs', '', '', '', 'Premium Essentials Crew Socks 2 Pairs', '', '', '', ''),
(595, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', 'Dopasowane w sportowym stylu.', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(596, 1, 1, 'Dodaj sportowy akcent za sprawą tych skarpet adidas do kostki. Konstrukcja z mieszanki bawełny i poliestru jest miękka i przewiewna, a zintegrowane szwy w palcach zapobiegają otarciom. Amortyzacja w pięcie i palcach oraz wspierające dopasowanie w łuku stopy zapewniają komfort przez cały dzień.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-sportswear-ankle-socks-6-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(597, 1, 1, 'Lekkie, cienkie skarpety do kostki powstały z myślą o komforcie i dostępne są w zestawie zawierającym trzy pary. Mają konstrukcję z materiału o dużej zawartości bawełny we wplecionym wsparciu podbicia i gładkimi szwami na palcach. Logo adidas podkreśla ściągaczowy mankiet w sportowym stylu.', 'Skarpety do kostek o wygodnej konstrukcji z bawełny.', 'ankle-socks-3-pairs', '', '', '', 'Ankle Socks 3 Pairs', '', '', '', ''),
(598, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczne skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(599, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wspierające skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(600, 1, 1, 'Co łączy ten model z innymi elementami stroju treningowego adidas? Wygoda to podstawa w tych skarpetkach do kostki. Wszystko w nich (na przykład pochłaniający wilgoć AEROREADY) zostało stworzone, aby pomóc Ci osiągać lepsze wyniki, i rozciąga się tam, gdzie tego potrzebujesz. Opakowanie zawiera trzy pary.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety treningowe wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'performance-light-mid-cut-socks-3-pairs', '', '', '', 'Performance Light Mid-Cut Socks 3 Pairs', '', '', '', ''),
(601, 1, 1, 'Ciesz się widokiem, gdy przemierzasz miasto. Te skarpety adidas zostały stworzone z myślą o bieganiu w pełnym skupieniu i mają ultralekką konstrukcję z technologią HEAT.RDY, która zapewni Ci przewiewny komfort na kolejnych kilometrach. FORMOTION zapewnia elastyczne, wspierające dopasowanie, a siateczkowa wentylacja zwiększa przewiewność.   Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Odblaskowe skarpety do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'running-x-city-heatrdy-reflective-socks', '', '', '', 'Running X-City HEAT.RDY Reflective Socks', '', '', '', ''),
(602, 1, 1, 'Nie ześlizgują się. Nie przegrzewają się. Te skarpety do biegania adidas amortyzują, otulają i chłodzą Twoje stopy dokładnie tam, gdzie tego potrzebujesz. Technologia FORMOTION zapewnia wsparcie na każdym kroku, a miękkie szwy i HEAT.RDY gwarantują wygodę.  Ten produkt zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 40% materiałów pochodzących z recyklingu.', 'Przewiewne skarpetki do biegania wykonane częściowo z Parley Ocean Plastic.', 'adidas-running-x-supernova-quarter-performance-socks', '', '', '', 'adidas Running x Supernova Quarter Performance Socks', '', '', '', ''),
(603, 1, 1, 'Zadbaj o przewiewny komfort stóp podczas treningu interwałowego i biegów długodystansowych. Te skarpety do biegania adidas zostały uszyte z lekkiego, szybkoschnącego materiału z technologią HEAT.RDY, która odprowadza pot. FORMOTION zapewnia elastyczne dopasowanie i wsparcie tam, gdzie go potrzebujesz, a płaskie szwy w palcach chronią przed pęcherzami. Elastyczne mankiety pozostają na swoim miejscu podczas biegu.   Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekkie skarpetki do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'running-adizero-heatrdy-socks', '', '', '', 'Running Adizero HEAT.RDY Socks', '', '', '', ''),
(604, 1, 1, 'Podczas swojej pełnej sukcesów historii Juventus był w równym stopniu kojarzony z gwiazdkami co z paskami. Te getry piłkarskie adidas są częścią zestawu podstawowego, który łączy oba te elementy. Getry stworzone, aby dać Ci pewność na boisku i poza nim, mają strategicznie rozmieszczoną amortyzację, wygodny krój FORMOTION i odprowadzający wilgoć AEROREADY.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Getry dla kibiców przesycone DNA klubu i częściowo wykonane z materiałów pochodzących z recyklingu.', 'juventus-22-23-home-socks', '', '', '', 'Juventus 22/23 Home Socks', '', '', '', ''),
(605, 1, 1, 'Lekkie skarpety do kostki ze wsparciem łuku stopy, bezszwową konstrukcją w palcach i odrobiną streczu idealnie nadają się do noszenia na co dzień. Kontrastowe logo adidas Badge of Sport wyróżnia się w kostce. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Lekkie skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-and-light-ankle-socks-3-pairs', '', '', '', 'Thin and Light Ankle Socks 3 Pairs', '', '', '', ''),
(606, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wygodne skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(607, 1, 1, 'Skarpetki adidas o długości do kostki mają subtelnie ściągaczowe brzegi, które utrzymują je na swoim miejscu. Model wykonany z mieszanki lekkiego, miękkiego materiału jest dostępny w opakowaniach po trzy pary i stanowi sportowe uzupełnienie Twojej szuflady na skarpetki.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'think-linear-ankle-socks-3-pairs', '', '', '', 'Think Linear Ankle Socks 3 Pairs', '', '', '', ''),
(608, 1, 1, 'Lekkie skarpety do kostki ze wsparciem łuku stopy, bezszwową konstrukcją w palcach i odrobiną streczu idealnie nadają się do noszenia na co dzień. Kontrastowe logo adidas Badge of Sport wyróżnia się w kostce. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Lekkie skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-and-light-ankle-socks-3-pairs', '', '', '', 'Thin and Light Ankle Socks 3 Pairs', '', '', '', ''),
(609, 1, 1, 'Podaruj swojej szufladzie na skarpetki trochę miłości. Klasyczny, ściągaczowy design skarpetek adidas do łydki zapewnia Ci idealne dopasowanie, a konstrukcja z dużą zawartością bawełny organicznej jest wygodna przez cały dzień. Naszyte logo Trefoil stanowi subtelny, autentyczny akcent.  Ten produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Para luksusowych, bawełnianych skarpet stworzonych z myślą o naturze.', 'premium-essentials-crew-socks-2-pairs', '', '', '', 'Premium Essentials Crew Socks 2 Pairs', '', '', '', ''),
(610, 1, 1, 'Biegając, wymagasz wiele od swoich stóp. Zadbaj o ich komfort dzięki tym skarpetkom do biegania adidas. Technologia HEAT.RDY i siateczkowa wentylacja zapewnią Ci przewiewny komfort na każdym kilometrze. FORMOTION zapewnia elastyczne dopasowanie i wsparcie tam, gdzie go potrzebujesz, a płaskie szwy w palcach chronią przed pęcherzami. Wyściełanie w pięcie amortyzuje każdy krok.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Oddychające skarpety do biegania wykonane częściowo z materiałów pochodzących z recyklingu.', 'running-ub23-heatrdy-socks', '', '', '', 'Running UB23 HEAT.RDY Socks', '', '', '', ''),
(611, 1, 1, 'Skarpetek adidas typu balerina nie da się zobaczyć w sneakerach przed kostkę ani w loafersach. Te niewidoczne w butach skarpetki dostępne są w opakowaniach po dwie pary i zostały uszyte z mieszanki bawełny i poliestru, dzięki czemu są miękkie i lekkie jak piórko. Zapewniają stopom przewiewny komfort nawet w wilgotne dni.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'thin-linear-ballerina-socks-2-pairs', '', '', '', 'Thin Linear Ballerina Socks 2 Pairs', '', '', '', ''),
(612, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', 'Dopasowane w sportowym stylu.', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(613, 1, 1, 'Niskie skarpetki adidas miękko przylegają do Twoich stóp. Konstrukcja z mieszanki lekkiej bawełny i poliestru idealnie dopasowuje się do łuku stopy, a zintegrowane szwy w palcach zapobiegają otarciom.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-and-light-sportswear-low-cut-socks-3-pairs', '', '', '', 'Thin and Light Sportswear Low-Cut Socks 3 Pairs', '', '', '', ''),
(614, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', 'Dopasowane w sportowym stylu.', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(615, 1, 1, 'Unoś się na korcie w tych skarpetach tenisowych o długości do łydki Strategicznie rozmieszczona amortyzacja, kompresyjne wsparcie łuku stopy i dopasowanie do prawej i lewej stopy zapewniają Ci komfort podczas najszybszych sprintów i najcięższych lądowań, a AEROREADY pochłania wilgoć, dodając pewności siebie. Nawet szwy w palcach są płaskie, więc nic Cię nie rozprasza.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Skarpety tenisowe do łydki wykonane częściowo z materiałów pochodzących z recyklingu.', 'tennis-cushioned-crew-socks-1-pair', '', '', '', 'Tennis Cushioned Crew Socks 1 Pair', '', '', '', ''),
(616, 1, 1, 'Skarpetek adidas typu balerina nie da się zobaczyć w sneakerach przed kostkę ani w loafersach. Te niewidoczne w butach skarpetki dostępne są w opakowaniach po dwie pary i zostały uszyte z mieszanki bawełny i poliestru, dzięki czemu są miękkie i lekkie jak piórko. Zapewniają stopom przewiewny komfort nawet w wilgotne dni.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'thin-linear-ballerina-socks-2-pairs', '', '', '', 'Thin Linear Ballerina Socks 2 Pairs', '', '', '', ''),
(617, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(618, 1, 1, 'Wybierz uniwersalny komfort i klasyczny styl dzięki tym skarpetom adidas do gry w golfa. Noś je do spodni w chłodne dni lub zestaw z ulubionymi szortami, gdy świeci słońce i pozwól im zabłysnąć.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Trzy pary skarpet do golfa do noszenia na co dzień.', 'crew-socks-3-pairs', '', '', '', 'Crew Socks 3 Pairs', '', '', '', ''),
(619, 1, 1, 'Noś getry piłkarskie adidas z zainspirowaną grą w karty koszulką i szortami Bayernu Monachium, aby skompletować trzeci zestaw. Kompresja wokół kostki i łuku stopy zapewnia wsparcie, którego potrzebujesz, gdy grasz lub oglądasz mecz za linią boczną. Pochłaniający wilgoć AEROREADY oraz amortyzacja w pięcie i palcach dbają o wygodę, dzięki czemu możesz skupić się na grze.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Amortyzowane getry z trzeciego zestawu Bayernu Monachium wykonane częściowo z materiałów pochodzących z recyklingu.', 'fc-bayern-22-23-third-socks', '', '', '', 'FC Bayern 22/23 Third Socks', '', '', '', ''),
(620, 1, 1, 'Skarpetki do biegania adidas z pewnością staną się gwiazdą w Twojej szufladzie. Fason za kostkę zapewnia dodatkowe okrycie, a elastyczne strefy w skarpetkach i FORMOTION oferują dodatkowe wsparcie. Polegaj na pochłanianiu wilgoci i wentylacji HEAT.RDY, aby zapewnić swoim stopom przewiewny komfort, gdy robi się gorąco. Strategicznie rozmieszczona amortyzacja zapobiega otarciom i dba o Twoją wygodę.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Przewiewne skarpety do łydki wykonane częściowo z materiałów pochodzących z recyklingu.', 'running-x-4d-heatrdy-socks', '', '', '', 'Running x 4D HEAT.RDY Socks', '', '', '', ''),
(621, 1, 1, 'Wyróżniający się, sportowy look w połączeniu z miękkim komfortem stóp. Stworzony z myślą o całodziennym komforcie komplet trzech par skarpet do łydki ma amortyzację na całej długości i konstrukcję o dużej zawartości bawełny. Wplecione wsparcie podbicia i gładkie szwy na palcach gwarantują jeszcze lepsze dopasowanie i większy komfort. Kultowe 3 paski już na pierwszy rzut oka kojarzą się z adidas.', 'Klasyczne skarpety do łydki z brandingiem z 3 paskami i solidną amortyzacją.', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(622, 1, 1, 'Dodaj klasyczny, sportowy styl do swojego wyszukanego looku na polu golfowym za sprawą tych golfowych skarpet adidas. Noś je do spodni jako dodatkową warstwę w chłodne dni lub zestaw z ulubionymi szortami, gdy świeci słońce i pozwól im zabłysnąć.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Skarpety do golfa do noszenia na co dzień.', 'basic-crew-socks', '', '', '', 'Basic Crew Socks', '', '', '', ''),
(623, 1, 1, 'Niewidoczne w butach skarpetki adidas idealnie nadają się do noszenia ze sneakerami. Wsparcie łuku stopy i lekka konstrukcja zapewniają wygodne dopasowanie, gdy odpoczywasz na kanapie lub wychodzisz pobiegać. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Niewidoczne w butach skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'thin-and-light-no-show-socks-3-pairs', '', '', '', 'Thin and Light No-Show Socks 3 Pairs', '', '', '', ''),
(624, 1, 1, 'Skoncentruj się na formie, a nie na skarpetkach. Wszystko w tych skarpetkach sportowych od adidas zostało zaprojektowane tak, aby minimalizować czynniki rozpraszające. Ciesz się przewiewnym, suchym komfortem i pewnością siebie, ponieważ HEAT.RDY chłodzi i pochłania wilgoć. Każda stopa ma dedykowaną skarpetkę o kroju pasującym na lewą lub prawą stopę. Dodatkowe wsparcie dzięki technologii FORMOTION i strategicznie rozmieszczonej siateczce zapewnia Ci komfort przez cały trening  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Niskie skarpetki treningowe adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'designed-4-sport-performance-low-socks-1-pair', '', '', '', 'Designed 4 Sport Performance Low Socks 1 Pair', '', '', '', ''),
(625, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(626, 1, 1, 'TRX TRL AGR SCK', 'TRX TRL AGR SCK', 'trx-trl-agr-sck', '', '', '', 'TRX TRL AGR SCK', '', '', '', ''),
(627, 1, 1, 'Skarpetki adidas do kostki, które idealnie pasują do sneakerów.c Uszyto je z mieszanki bawełny i poliestru, dzięki czemu są miękkie i niemal niewyczuwalne w dotyku. Zintegrowane szwy w palcach zapobiegają otarciom, a idealnie dopasowany krój wokół łuku stopy zapewnia wsparcie.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'thin-and-light-sportswear-ankle-socks-6-pairs', '', '', '', 'Thin and Light Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(628, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(629, 1, 1, 'Niskie skarpetki adidas miękko przylegają do Twoich stóp. Konstrukcja z mieszanki lekkiej bawełny i poliestru idealnie dopasowuje się do łuku stopy, a zintegrowane szwy w palcach zapobiegają otarciom.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-and-light-sportswear-low-cut-socks-3-pairs', '', '', '', 'Thin and Light Sportswear Low-Cut Socks 3 Pairs', '', '', '', ''),
(630, 1, 1, 'Skoncentruj się na formie, a nie na skarpetkach. Wszystko w tych skarpetkach sportowych od adidas zostało zaprojektowane tak, aby minimalizować czynniki rozpraszające. Ciesz się przewiewnym, suchym komfortem i pewnością siebie, ponieważ HEAT.RDY chłodzi i pochłania wilgoć. Każda stopa ma dedykowaną skarpetkę o kroju pasującym na lewą lub prawą stopę. Dodatkowe wsparcie dzięki technologii FORMOTION i strategicznie rozmieszczonej siateczce zapewnia Ci komfort przez cały trening  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Niskie skarpetki treningowe adidas wykonane częściowo z materiałów pochodzących z recyklingu.', 'designed-4-sport-performance-low-socks-1-pair', '', '', '', 'Designed 4 Sport Performance Low Socks 1 Pair', '', '', '', ''),
(631, 1, 1, 'Skarpetki Trefoil Liner dodają trochę oryginalności temu najbardziej powszechnemu elementowi garderoby. Mają niski krój, niewidoczny w połączeniu ze sneakerami, wykonany z lekko elastycznej bawełny i ozdobiony logo Trefoil na wierzchu stopy.', 'Trefoil Liner Socks 3 Pairs', 'trefoil-liner-socks-3-pairs', '', '', '', 'Trefoil Liner Socks 3 Pairs', '', '', '', ''),
(632, 1, 1, 'Proste i wygodne. To oznacza, że możesz nosić te skarpetki adidas bez przerwy. Dlatego masz trzy pary. Zasznuruj sneakery lub załóż klapki i ruszaj w drogę. Amortyzacja zapewnia miękki krok i wsparcie łuku stopy.   Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Trzy pary klasycznych skarpet do łydki w autentycznym stylu adidas.', 'cushioned-trefoil-mid-cut-crew-socks-3-pairs', '', '', '', 'Cushioned Trefoil Mid-Cut Crew Socks 3 Pairs', '', '', '', ''),
(633, 1, 1, 'W tym modelu znajdziesz wiele detali, które zapewnią Ci komfort przez cały trening. Załóż te skarpetki i ruszaj na podbój świata. Elementy z siateczki usprawniają przepływ powietrza. Ciesz się suchym komfortem dzięki adidas AEROREADY. Elastyczne strefy tam, gdzie ich potrzebujesz, i wsparcie w podbiciu sprawiają, że możesz się ruszać, jak tylko zechcesz. Każde opakowanie zawiera trzy pary skarpet.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Trójpak wydajnych skarpet stworzonych z myślą o uniwersalności w czasie treningu.', 'performance-cushioned-crew-socks-3-pairs', '', '', '', 'Performance Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(634, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
(635, 1, 1, 'Detale mają znaczenie. Wybierz skarpetki do łydki, aby zyskać całodzienny komfort. Mają elastyczną, wspierającą konstrukcję, która pozostaje na swoim miejscu. Linearne logo adidas dumnie wyróżnia się na boku. Dostępne w opakowaniu po trzy pary.', 'Elastyczne skarpetki do łydki.', 'half-cushioned-crew-socks-3-pairs', '', '', '', 'Half-Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(636, 1, 1, 'Skarpetki Trefoil Liner dodają trochę oryginalności temu najbardziej powszechnemu elementowi garderoby. Mają niski krój, niewidoczny w połączeniu ze sneakerami, wykonany z lekko elastycznej bawełny i ozdobiony logo Trefoil na wierzchu stopy.', 'Trefoil Liner Socks 3 Pairs', 'trefoil-liner-socks-3-pairs', '', '', '', 'Trefoil Liner Socks 3 Pairs', '', '', '', ''),
(637, 1, 1, 'Niezbędny element Twojej garderoby treningowej. Te skarpety treningowe adidas o długości do łydki są lekkie i cienkie, dzięki czemu zapewniają wygodę noszenia na korcie, na siłowni lub w domu. AEROREADY pochłania wilgoć, dbając o Twój suchy komfort podczas najcięższych sesji. Klasyczny branding adidas stanowi sportowe wykończenie. W opakowaniu znajdują się trzy pary.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Odprowadzające wilgoć skarpety wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'performance-light-crew-socks-3-pairs', '', '', '', 'Performance Light Crew Socks 3 Pairs', '', '', '', ''),
(638, 1, 1, 'Buty adidas Ultraboost to nowoczesna ikona stylu. Stworzyliśmy je, aby pomóc biegaczom biegać dalej i czuć się lepiej. Skarpety adidas oddają hołd tej historii przy pomocy grafiki przedstawiającej buty do biegania. Miękka, gładka mieszanka z lyocellem ma domieszkę streczu, a amortyzacja pod stopą zapewnia stopom komfort.  Ten produkt został stworzony z naturalnych i pozyskanych z odnawialnych źródeł materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Te skarpety powstały na cześć butów Ultraboost i powstały z myślą o naturze.', 'run-x-ultraboost-shoe-love-graphic-socks-2-pairs', '', '', '', 'Run x Ultraboost Shoe Love Graphic Socks 2 Pairs', '', '', '', ''),
(639, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Miękkie skarpetki wykonane częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
(640, 1, 1, 'W tym modelu znajdziesz wiele detali, które zapewnią Ci komfort przez cały trening. Załóż te skarpetki do kostki i ruszaj na podbój świata. Elementy z siateczki usprawniają przepływ powietrza. Ciesz się suchym komfortem dzięki adidas AEROREADY. Elastyczne strefy tam, gdzie ich potrzebujesz i wsparcie w podbiciu sprawiają, że możesz się ruszać, jak tylko zechcesz. Każde opakowanie zawiera trzy pary skarpet.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Dzianinowe skarpetki stworzone z myślą o uniwersalnym treningu i ruchu.', 'performance-cushioned-mid-cut-socks-3-pairs', '', '', '', 'Performance Cushioned Mid-Cut Socks 3 Pairs', '', '', '', ''),
(641, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.  Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Skarpety do noszenia na co dzień wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(642, 1, 1, 'Lekkie skarpety do kostki ze wsparciem łuku stopy, bezszwową konstrukcją w palcach i odrobiną streczu idealnie nadają się do noszenia na co dzień. Kontrastowe logo adidas Badge of Sport wyróżnia się w kostce. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Lekkie skarpetki wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'thin-and-light-ankle-socks-3-pairs', '', '', '', 'Thin and Light Ankle Socks 3 Pairs', '', '', '', ''),
(643, 1, 1, 'Miękkie skarpetki na szybkie stopy. Te skarpety adidas do łydki zostały uszyte z lekko elastycznej bawełny, która zapewnia poczucie komfortu. Noś je z butami do biegania i ruszaj na siłownię lub bieżnię, kort tenisowy czy murawę.   Skarpety Best Label (1 para) zostały wykonane z naturalnych i pozyskanych z odnawialnych źródeł materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', 'Wygodne skarpetki stworzone z myślą o naturze.', 'best-label-socks-1-pair', '', '', '', 'Best Label Socks 1 Pair', '', '', '', ''),
(644, 1, 1, 'Czapka beanie z wywijanym brzegiem zyskała w tym sezonie świeżą kolorystykę. Naszywka z logo Trefoil nadaje jej subtelny akcent adidas. Szew na górze zapewnia jej odpowiedni kształt.', 'Prosty styl na co dzień.', 'adicolor-cuff-beanie', '', '', '', 'Adicolor Cuff Beanie', '', '', '', ''),
(645, 1, 1, 'Jest parę fajnych rzeczy po treningu. Energia wciąż Cię nie opuszcza.  Ciało jest rozgrzane i czujesz się dobrze. A nawet znakomicie. Gdy zamykasz za sobą drzwi siłowni, załóż tę czapkę adidas typu beanie i pozwól endorfinom krążyć. Pozostań dłużej w tej strefie. I trzymaj się ciepło.', 'Miła w dotyku czapka typu beanie z dzianiny, która zapewni Ci ciepło na co dzień.', 'logo-beanie', '', '', '', 'Logo Beanie', '', '', '', ''),
(646, 1, 1, 'Inspirowany klasycznymi fasonami rybackimi, wyjątkowo wygodny wybór adidas zapewni Ci ciepło, gdy jesteś na stoku lub w drodze. Krótki profil ma wywijany brzeg, który w pełni eksponuje wyszywane logo Trefoil. Konstrukcja z miękkiej dzianiny zachowuje swój kształt i jest wyjątkowo wygodna w noszeniu.', 'Miękka i miła w dotyku czapka beanie o krótkim profilu z wywijanym brzegiem.', 'adicolor-contempo-short-beanie', '', '', '', 'Adicolor Contempo Short Beanie', '', '', '', ''),
(647, 1, 1, 'Mówią, że nie ma czegoś takiego jak zła pogoda, są tylko niewłaściwe ubrania. Załóż czapkę beanie adidas i przygotuj się na wszystko, co dzieje się na zewnątrz. Konstrukcja z miękkiej dzianiny dba o ciepły komfort od czubka głowy aż po uszy. Design w stylu retro nawiązuje do lat 70., a pompon na górze nadaje całości zabawny charakter. Tak naprawdę bez niego nie byłaby klasyczną czapką.', 'Klasyczna czapka inspirowana stylem retro, idealna na chłodne dni.', 'adicolor-archive-bobble-beanie', '', '', '', 'Adicolor Archive Bobble Beanie', '', '', '', ''),
(648, 1, 1, 'Inspirowany klasycznymi fasonami rybackimi, wyjątkowo wygodny wybór adidas zapewni Ci ciepło, gdy jesteś na stoku lub w drodze. Krótki profil ma wywijany brzeg, który w pełni eksponuje wyszywane logo Trefoil. Konstrukcja z miękkiej dzianiny zachowuje swój kształt i jest wyjątkowo wygodna w noszeniu.', 'Miękka i miła w dotyku czapka beanie o krótkim profilu z wywijanym brzegiem.', 'adicolor-contempo-short-beanie', '', '', '', 'Adicolor Contempo Short Beanie', '', '', '', ''),
(649, 1, 1, 'Pokaż, że kochasz tę piękną grę. Ta czapka adidas Tiro League wyróżnia się wyszywanym logo z 3 paskami nad lekko wygiętym daszkiem. Regulowane zapięcie z tyłu umożliwia indywidualne dopasowanie. Wyściełana opaska przeciwpotna wewnątrz eliminuje czynniki rozpraszające.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka piłkarska wykonana częściowo z materiałów pochodzących z recyklingu.', 'tiro-league-cap', '', '', '', 'Tiro League Cap', '', '', '', ''),
(650, 1, 1, 'Czapka-bejsbolówka z idealnie zaokrąglonym daszkiem sprawdzi się w każdej sytuacji. Konstrukcja z wygodnej bawełny jest wykończona dużym, wyszywanym logo Trefoil na środku z przodu. Regulowany pasek z tyłu umożliwia indywidualne dopasowanie.', 'Sportowy klasyk o wygodnej konstrukcji z bawełny.', 'trefoil-baseball-cap', '', '', '', 'Trefoil Baseball Cap', '', '', '', ''),
(651, 1, 1, 'Od górskich wycieczek po miejskie spacery czapka adidas do wielu dyscyplin zapewni Ci ciepło w chłodne dni. Syntetyczna wiskoza jest wyjątkowo miękka i pochłania wilgoć. Zawsze w dobrym stylu i gotowości na wszystko.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Ciepła czapka beanie z dzianiny wykonana częściowo z materiałów pochodzących z recyklingu.', 'terrex-multisport-beanie', '', '', '', 'Terrex Multisport Beanie', '', '', '', ''),
(652, 1, 1, 'Skoncentruj się na treningu w tej opasce na włosy. Model z cienkiej, elastycznej dzianiny nie przesuwa się podczas intensywnych ćwiczeń. Każdy trzypak zawiera egzemplarze w trzech różnych kolorach.', 'Trzypak cienkich, elastycznych opasek na włosy w różnych kolorach.', 'hairband-3-pack', '', '', '', 'Hairband 3 Pack', '', '', '', ''),
(653, 1, 1, 'Podobnie jak sama gra, czapka bejsbolówka staje się coraz lepsza, odważniejsza i bardziej ekscytująca. Klasyczny design w nowej odsłonie zyskał wbudowaną ochronę przeciwsłoneczną oraz miękkość w dotyku. Zaprezentuj dumę z 3 pasków za sprawą akcentu adidas Badge of Sport.', 'Klasyczna czapka bejsbolówka z podwójnym brandingiem adidas.', 'baseball-3-stripes-twill-cap', '', '', '', 'Baseball 3-Stripes Twill Cap', '', '', '', ''),
(654, 1, 1, 'Esencja stylu adidas. Ta czapka beanie zapewni Ci ciepły komfort dzięki elastycznej konstrukcji z dzianiny, która jest przyjemna z wyglądu i w dotyku. Bardzo duże logo adidas to ukłon w stronę sportowych korzeni modelu.', 'Wygodna czapka beanie na chłodniejsze dni.', 'lt-daily-beanie', '', '', '', 'LT Daily Beanie', '', '', '', ''),
(655, 1, 1, 'Najwięcej dobrej zabawy czeka Cię na dworze. Dlatego załóż czapkę adidas i ruszaj na outdoorowy trening. Gładką, lekką konstrukcję można regulować.   Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Czapka z regulacją wykonana z materiałów pochodzących z recyklingu.', 'lightweight-metal-badge-baseball-cap', '', '', '', 'Lightweight Metal Badge Baseball Cap', '', '', '', ''),
(656, 1, 1, 'Przytulnie w domu. Wygodnie na mieście. Czapka beanie adidas zapewnia ciepło i wygodę, gdziekolwiek ją założysz. Minimalistyczny model ma sportowy akcent w tradycyjnym stylu, ponieważ zawsze stawiasz na oryginalność.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Dzianinowa czapka typu beanie, która pasuje do wszystkiego, wykonana częściowo z materiałów pochodzących z recyklingu.', 'adidas-rifta-beanie', '', '', '', 'adidas RIFTA Beanie', '', '', '', ''),
(657, 1, 1, 'Przygotuj zimowe nakrycie głowy, zanim temperatura spadnie. Ta czapka adidas typu beanie została wyposażona w technologię COLD.RDY, która zatrzymuje ciepło przy ciele. Wykonana jest z wełny merynosowej o wyjątkowych właściwościach izolacyjnych i pochłaniających zapachy. Odblaskowe logo sprawi, że zachowasz widoczność w zimowe, szare dni. Więc możesz jeszcze pokusić się o poranny bieg. Albo spacer z kubkiem termicznym pełnym gorącej kawy.', 'Wyjątkowo miła w dotyku czapka, która uzupełnia zimowy look.', 'x-city-coldrdy-beanie', '', '', '', 'X-City COLD.RDY Beanie', '', '', '', ''),
(658, 1, 1, 'Trzymaj się ciepło i przygotuj na wszystko, co przyniesie pogoda. Ta czapka adidas typu beanie została uszyta z miękkiej dzianiny i wyposażona w technologię COLD.RDY, która gwarantuje komfort w chłodne dni na polu golfowym. Bez względu na to, czy szykujesz się na grę w chłodny dzień, czy relaks poza klubem, branding golfowy nad brzegiem czapki podkreśla Twoją miłość do tego sportu.  Ten produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka beanie z pomponem wykonana z materiałów pochodzących z recyklingu na chłodne dni.', 'golf-pompom-beanie', '', '', '', 'Golf Pompom Beanie', '', '', '', ''),
(659, 1, 1, 'Trzymaj się ciepło i wyglądaj świetnie. Ta czapka adidas typu beanie została uszyta ze skręconej, melanżowej przędzy o subtelnym, dwukolorowym efekcie. Dlatego będzie stanowić doskonały dodatek do Twojej zimowej garderoby: bluz z kapturem po dopasowany płaszcz.', 'Czapka beanie z wyszywanym logo dla prawdziwych miłośników marki adidas.', 'melange-beanie', '', '', '', 'Mélange Beanie', '', '', '', ''),
(660, 1, 1, 'Najwięcej dobrej zabawy czeka Cię na dworze. Dlatego załóż czapkę adidas i ruszaj na outdoorowy trening. Gładką, lekką konstrukcję można regulować.   Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Czapka z regulacją wykonana z materiałów pochodzących z recyklingu.', 'lightweight-metal-badge-baseball-cap', '', '', '', 'Lightweight Metal Badge Baseball Cap', '', '', '', ''),
(661, 1, 1, 'Co masz w planach na dziś? Skoki na skrzynię i burpeesy czy może tylko łagodne rozciąganie? Niezależnie od rodzaju ćwiczeń, przyda Ci się trójpak treningowych opasek na głowę od adidas. Wybieraj spośród trzech różnych stylów i szerokości. Na miejsca. Do startu... Start!', 'Trójpak opasek na głowę, które zapewnią Ci przewiewny, suchy komfort i ułatwią koncentrację.', 'training-headbands-3-per-pack', '', '', '', 'Training Headbands 3 Per Pack', '', '', '', ''),
(662, 1, 1, 'Załóż tę czapkę z logo adidas na zatrzask z tyłu i ruszaj na lunch z przyjaciółmi lub odpocznij w domu. Model ma płaski daszek i opaskę przeciwpotną z siateczki, aby zapewnić Ci komfort niezależnie od tego, dokąd zaprowadzi Cię dzień. Wypukłe logo Badge of Sport podkreśla Twój dumny styl adidas.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Gładka czapka na zatrzask z tyłu wykonana częściowo z materiałów pochodzących z recyklingu.', 'snapback-logo-cap', '', '', '', 'Snapback Logo Cap', '', '', '', ''),
(663, 1, 1, 'Czapka adidas Adventure Dad czerpie inspirację z ery zwężanych dżinsów i dżinsowych koszul. Czapka w nostalgicznym stylu, którą mogą nosić ojcowie i nie tylko, ma wyszywaną grafiką nawiązującą do outdoorowych designów z lat 90. Daszek ze sztucznego zamszu z przodu i regulowane zapięcie z tyłu wspólnie tworzą wygodny, odświeżony look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Czapka w stylu retro idealna na nowe przygody.', 'adidas-adventure-dad-cap', '', '', '', 'adidas Adventure Dad Cap', '', '', '', ''),
(664, 1, 1, 'Zanim wyjdziesz, sięgnij po tę czapkę adidas. Filtr UV 50 zapewnia ochronę podczas treningu i spacerów po mieście. Lekka tkanina jest gładka w dotyku. Wyreguluj pasek z tyłu, aby znaleźć doskonałe dopasowanie.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Czapka z regulacją wykonana z materiałów pochodzących z recyklingu.', 'lightweight-embroidered-baseball-cap', '', '', '', 'Lightweight Embroidered Baseball Cap', '', '', '', ''),
(665, 1, 1, 'Palące słońce. Walące serce. Gdy robi się gorąco, ta czapka do biegania adidas zapewni Ci przewiewny komfort dzięki HEAT.RDY i wbudowanej wentylacji. Lekko wygięty daszek chroni oczy i pozwala Ci skoncentrować się na dotarciu do linii mety.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka do biegania w ciepłe dni wykonana częściowo z materiałów pochodzących z recyklingu.', 'running-adizero-heatrdy-cap', '', '', '', 'Running Adizero HEAT.RDY Cap', '', '', '', ''),
(666, 1, 1, 'Dla fanów 3 pasków. Ta czapka adidas typu beanie ma konstrukcję z miękkiego i trwałego materiału z wywijanym brzegiem, który zapewnia odpowiednie okrycie. A gdy kibicujesz z trybun, będzie wyglądać równie dobrze z wyściełanym płaszczem, jak z kardiganem czy marynarką w dni powszednie.', 'Klasyczna czapka beanie, która dopełni każdy strój.', '3-stripes-beanie', '', '', '', '3-Stripes Beanie', '', '', '', ''),
(667, 1, 1, 'Palące słońce. Walące serce. Gdy robi się gorąco, ta czapka do biegania adidas zapewni Ci przewiewny komfort dzięki HEAT.RDY i wbudowanej wentylacji. Lekko wygięty daszek chroni oczy i pozwala Ci skoncentrować się na dotarciu do linii mety.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka do biegania w ciepłe dni wykonana częściowo z materiałów pochodzących z recyklingu.', 'running-adizero-heatrdy-cap', '', '', '', 'Running Adizero HEAT.RDY Cap', '', '', '', ''),
(668, 1, 1, 'Zanim wyjdziesz, sięgnij po tę czapkę adidas. Filtr UV 50 zapewnia ochronę podczas treningu i spacerów po mieście. Lekka tkanina jest gładka w dotyku. Wyreguluj pasek z tyłu, aby znaleźć doskonałe dopasowanie.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Czapka z regulacją wykonana z materiałów pochodzących z recyklingu.', 'lightweight-embroidered-baseball-cap', '', '', '', 'Lightweight Embroidered Baseball Cap', '', '', '', ''),
(669, 1, 1, 'Graj dłużej, gdy robi się chłodno. Ta czapka adidas typu beanie ma dwuwarstwową konstrukcję z COLD.RDY, która zapewnia ciepły komfort, gdy wędrujesz, biegasz i jesteś w ruchu w zimne dni. Dzianina merynosowa gwarantuje naturalną oddychalność, regulując temperaturę i spełnia normy Responsible Wool Standard, co oznacza, że pochodzi z gospodarstw o odpowiedzialnym podejściu do uprawy ziemi i hodowli zwierząt.  Ten produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', 'Czapka beanie z wełny merynosowej stworzona z myślą o naturze.', 'terrex-coldrdy-merino-beanie', '', '', '', 'Terrex COLD.RDY Merino Beanie', '', '', '', ''),
(670, 1, 1, 'Czapka-bejsbolówka z idealnie zaokrąglonym daszkiem sprawdzi się w każdej sytuacji. Konstrukcja z wygodnej bawełny jest wykończona dużym, wyszywanym logo Trefoil na środku z przodu. Regulowany pasek z tyłu umożliwia indywidualne dopasowanie.', 'Sportowy klasyk o wygodnej konstrukcji z bawełny.', 'trefoil-baseball-cap', '', '', '', 'Trefoil Baseball Cap', '', '', '', ''),
(671, 1, 1, 'Odłóż w kąt wszystkie inne czapki bejsbolowe. Czapka adidas x FARM Rio z pewnością zwróci na Ciebie uwagę, oddając hołd witalności skąpanych w słońcu kwiatów. Zaokrąglony daszek zapewnia odpowiednią ochronę przed palącymi promieniami słońca. AEROREADY reguluje wilgoć, zapewniając Ci komfort nawet w ciepłe dni. Regulowane zapięcie z tyłu sprawia, że czapka pozostaje na swoim miejscu podczas wędrówek lub jogi na desce.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Śmiała, jasna czapka bejsbolówka wykonana częściowo z materiałów pochodzących z recyklingu.', 'adidas-x-farm-rio-aeroready-baseball-cap', '', '', '', 'adidas x FARM Rio AEROREADY Baseball Cap', '', '', '', ''),
(672, 1, 1, 'Szlak nadal wzywa niezależnie od pogody. Ruszaj do biegu lub na wędrówkę w deszczowe dni w czapce Terrex. adidas RAIN.RDY nie przepuszcza wody, dzięki czemu możesz biegać, wędrować lub odkrywać świat bez obawy, że zmokniesz. Design z uszczelnionymi szwami gwarantuje wodoodporność, a odprowadzająca wilgoć opaska na głowę usuwa pot z powierzchni Twojej twarzy.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Wodoodporna czapka wykonana częściowo z materiałów pochodzących z recyklingu.', 'terrex-rainrdy-cap', '', '', '', 'Terrex RAIN.RDY Cap', '', '', '', ''),
(673, 1, 1, 'Niezależnie od tego, jak nosisz tę czapkę adidas Real Madrid, zawsze będzie Ci ona przypominać, że klub Bernabéu odgrywa kluczową rolę w Twoim życiu. Wyszywane, asymetryczne godło z przodu i zapięcie na zatrzask z tyłu zapewniają wygodne wsparcie. Miękka i pochłaniająca wilgoć opaska przeciwpotna po wewnętrznej stronie pomaga Ci utrzymać koncentrację na piłce.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Pokaż swoje wsparcie w czapce piłkarskiej wykonanej częściowo z materiałów pochodzących z recyklingu.', 'real-madrid-snapback-cap', '', '', '', 'Real Madrid Snapback Cap', '', '', '', ''),
(674, 1, 1, 'Gdy masz w planach wyjście na siłownię w chłodny poranek lub chcesz spędzić czas na zimowych szaleństwach, ciesz się ciepłem i stylem dzięki tej czapce typu beanie z pomponem. Mieszanka poliestru jest wyjątkowo miękka w dotyku, a ściągacz na dole dodatkowo osłoni uszy i kark. Bardzo duże logo adidas podkreśla Twój sportowy styl.', 'Miła w dotyku czapka na aktywności w chłodne dni.', 'pompom-beanie', '', '', '', 'Pompom Beanie', '', '', '', ''),
(675, 1, 1, 'Lekka czapka adidas przyciągnie spojrzenia na trybunach. Tylny panel jest wykonany z siateczki, która zapewnia przepływ powietrza, a pochłaniająca pot opaska utrzymuje wilgoć pod kontrolą. Model zapewni Ci przewiewny komfort, nawet gdy gra — i pogoda — się rozkręca.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Stylowa czapka wykonana częściowo z materiałów pochodzących z recyklingu.', 'snapback-trucker-cap', '', '', '', 'Snapback Trucker Cap', '', '', '', ''),
(676, 1, 1, 'Czapka bejsbolówka adidas podkreśla Twój indywidualny styl za sprawą kamuflażowego wzoru na całej powierzchni. Kamuflaż jest jednym z tych rzadkich wzorów, który może być jednocześnie neutralny i wyróżniający się. Koszulka, która doskonale uzupełnia zarówno dżinsowe spodnie, jak i sportowy look, dobrze łączy się z innymi wzorami. Wypróbuj style inspirowane zwierzęcymi motywami, kwiatowe nadruki lub Twoje ulubione paski.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Czapka bejsbolówka adidas z kamuflażowym wzorem, która ma rzucać się w oczy.', 'camo-baseball-cap', '', '', '', 'Camo Baseball Cap', '', '', '', ''),
(677, 1, 1, 'Czapka-bejsbolówka z idealnie zaokrąglonym daszkiem sprawdzi się w każdej sytuacji. Konstrukcja z wygodnej bawełny jest wykończona dużym, wyszywanym logo Trefoil na środku z przodu. Regulowany pasek z tyłu umożliwia indywidualne dopasowanie.', 'Sportowy klasyk o wygodnej konstrukcji z bawełny.', 'trefoil-baseball-cap', '', '', '', 'Trefoil Baseball Cap', '', '', '', ''),
(678, 1, 1, 'Nigdy nie trać koncentracji na korcie. Ta tenisowa wiązana opaska adidas ma odprowadzający wilgoć AEROREADY, który pomoże Ci zachować koncentrację się na piłce. Konstrukcja z miękkiej dzianiny zapewnia Ci komfort i eliminuje czynniki rozpraszające.  Przędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Pochłaniająca wilgoć wiązana opaska wykonana z Parley Ocean Plastic.', 'aeroready-tennis-tie-band', '', '', '', 'AEROREADY Tennis Tie Band', '', '', '', ''),
(679, 1, 1, 'Jesteś prawie gotowy. Jedyna rzecz, której Ci brakuje to ta czapka adidas. Załóż ją, a natychmiast dopełnisz swój look klasycznym, swobodnym akcentem. Nieważne, czy dzień upływa Ci powoli, czy w szybkim tempie ― eleganckie płótno na górze podkreśla Twój styl.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Dopełnij swój look nowoczesnym, sportowym akcentem.', 'adicolor-five-panel-cap', '', '', '', 'Adicolor Five-Panel Cap', '', '', '', ''),
(680, 1, 1, 'Chłodne dni. Przyjemne chwile. Zadbaj o ciepły komfort uszu w czapce adidas, gdy ruszasz do skateparku, rozgrzewasz się ciepłym napojem lub podziwiasz światła miasta. Pompon na górze wyróżnia się w tłumie.', 'Klasyczna czapka beanie z pomponem, która podkreśli Twoją dumę z marki.', 'adicolor-collegiate-pom-beanie', '', '', '', 'Adicolor Collegiate Pom Beanie', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(681, 1, 1, 'Wędrówki, jazda na rowerze czy wypady na festiwale — nie da się nie zauważyć sportowych korzeni tej czapki bejsbolówki adidas. Konstrukcja z bawełny jest miękka i przewiewna, a zapięcie na zatrzask z tyłu umożliwia idealne dopasowanie.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczna czapka bejsbolówka wykonana częściowo z połączenia materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'daily-cap', '', '', '', 'Daily Cap', '', '', '', ''),
(682, 1, 1, 'Pokaż, że kibicujesz Realowi Madryt. Ta czapka piłkarska prezentuje sławną na całym świecie nazwę klubu na przodzie główki, tuż poniżej dwukolorowego logo adidas Badge of Sport. Godło drużyny widnieje z tyłu nad regulowanym paskiem. Pochłaniająca wilgoć opaska przeciwpotna ułatwia koncentrację wyłącznie na grze.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Czapka Realu Madryt z lekko wygiętym daszkiem.', 'real-madrid-dna-cap', '', '', '', 'Real Madrid DNA Cap', '', '', '', ''),
(683, 1, 1, 'Niezależnie od tego, jak nosisz tę czapkę adidas Manchester United, zawsze będzie Ci ona przypominać, że klub z Old Trafford odgrywa kluczową rolę w Twoim życiu. Wyszywana, przesunięta na bok naszywka z przodu i zapięcie na zatrzask z tyłu zapewniają wygodę i wsparcie. Pochłaniająca wilgoć opaska przeciwpotna w środku sprawia, że nic nie utrudnia Ci koncentracji na tym, co naprawdę się liczy.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Czapka z płaskim daszkiem i detalami Manchesteru United wykonana częściowo z materiałów pochodzących z recyklingu.', 'manchester-united-snapback-cap', '', '', '', 'Manchester United Snapback Cap', '', '', '', ''),
(684, 1, 1, 'Gdy świeci słońce i robi się gorąco, ta czapka do biegania adidas pomoże Ci pozostać na trasie. Lekko wygięty daszek chroni oczy na skąpanym w słońcu chodniku, a konstrukcja z siateczki gwarantuje przepływ powietrza. AEROREADY pochłania wilgoć, dbając o Twój suchy komfort, nawet gdy tętno skacze w górę na podbiegu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka do biegania z siateczki wykonana częściowo z materiałów pochodzących z recyklingu.', 'running-aeroready-four-panel-mesh-cap', '', '', '', 'Running AEROREADY Four-Panel Mesh Cap', '', '', '', ''),
(685, 1, 1, 'Jest powód, dla którego moda na czapki w formie kapelusików utrzymuje się od lat 80. Po prostu są zawsze na czasie. Ten prosty model adidas ma jednobarwną, wygodną konstrukcję, na której wyróżnia się kontrastowe logo adidas Trefoil.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Sportowa czapka typu kapelusik w swobodnym stylu.', 'adicolor-trefoil-bucket-hat', '', '', '', 'Adicolor Trefoil Bucket Hat', '', '', '', ''),
(686, 1, 1, 'Czapki z głów! Ten kapelusik adidas przyciąga uwagę w chłodne dni dzięki swojemu wyjątkowo puszystemu stylowi. Polar jest miły w dotyku i wyróżnia się jasnymi barwami z efektem tie-dye.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to tylko jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Kolorowa czapka-kapelusik z polaru wykonana częściowo z materiałów pochodzących z recyklingu.', 'bucket-hat', '', '', '', 'Bucket Hat', '', '', '', ''),
(687, 1, 1, 'Wykonuj uderzenia w turniejowym stylu dzięki czapce adidas do gry w golfa. Konstrukcja z pochłaniającego wilgoć AEROREADY zapewni Ci suchy komfort, gdy temperatura gry wzrośnie. Wygięty daszek osłoni Twoje oczy w słoneczne dni. Zatrzask z tyłu pozwoli Ci znaleźć idealne dopasowanie.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Czapka do gry w golfa w słoneczne dni wykonana częściowo z materiałów pochodzących z recyklingu.', 'tour-snapback-hat', '', '', '', 'Tour Snapback Hat', '', '', '', ''),
(688, 1, 1, 'Zaprezentuj się w sportowym stylu w tej piłkarskiej czapce Manchesteru United. Z przodu główki widnieje logo adidas Badge of Sport i nazwa klubu, któremu kibicujesz. Regulowane zapięcie na pasek z tyłu pozwoli Ci ją wygodnie dopasować.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Czapka z wygiętym daszkiem dla kibiców Manchesteru United.', 'manchester-united-dna-cap', '', '', '', 'Manchester United DNA Cap', '', '', '', ''),
(689, 1, 1, 'Zaprezentuj w niej dumę z marki. Prosta, sportowa czapka na zatrzask z tyłu ma konstrukcję z bawełnianego diagonalu, która ma niezobowiązujący charakter z wyglądu i w dotyku.', 'Czapka w wyrózniającym się stylu adidas.', 'daily-cap', '', '', '', 'Daily Cap', '', '', '', ''),
(690, 1, 1, 'Sportowa czapka-kapelusik prezentuje oldschoolowy charakter z nowej, luksusowej perspektywy. Dyskretny nadruk z monogramem z logo Trefoil z archiwalnych katalogów doda Twojemu codziennemu strojowi dokładnie tyle stylu, ile potrzebujesz.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Kapelusik wykonany z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'monogram-print-bucket-hat', '', '', '', 'Monogram Print Bucket Hat', '', '', '', ''),
(691, 1, 1, 'Zestaw sportowych opasek, które utrzymują włosy na miejscu, gdy biegasz, trenujesz lub podnosisz ciężary. Te dopasowane, elastyczne opaski na włosy adidas mają silikonowe, przyczepne kropki, które utrzymują je na swoim miejscu. Wybierz kolor, który najbardziej pasuje do Twojego treningowego looku.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Elastyczne opaski na włosy wykonane częściowo z materiałów pochodzących z recyklingu.', 'hairband-3-pack', '', '', '', 'Hairband 3-Pack', '', '', '', ''),
(692, 1, 1, 'Czapka-bejsbolówka z idealnie zaokrąglonym daszkiem sprawdzi się w każdej sytuacji. Konstrukcja z wygodnej bawełny jest wykończona dużym, wyszywanym logo Trefoil na środku z przodu. Regulowany pasek z tyłu umożliwia indywidualne dopasowanie.', 'Sportowy klasyk o wygodnej konstrukcji z bawełny.', 'trefoil-baseball-cap', '', '', '', 'Trefoil Baseball Cap', '', '', '', ''),
(693, 1, 1, 'Zanim wyjdziesz, sięgnij po tę czapkę adidas. Filtr UV 50 zapewnia ochronę podczas treningu i spacerów po mieście. Lekka tkanina jest gładka w dotyku. Wyreguluj pasek z tyłu, aby znaleźć doskonałe dopasowanie.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Czapka z regulacją wykonana z materiałów pochodzących z recyklingu.', 'lightweight-embroidered-baseball-cap', '', '', '', 'Lightweight Embroidered Baseball Cap', '', '', '', ''),
(694, 1, 1, 'Czapka-bejsbolówka z idealnie zaokrąglonym daszkiem sprawdzi się w każdej sytuacji. Konstrukcja z wygodnej bawełny jest wykończona dużym, wyszywanym logo Trefoil na środku z przodu. Regulowany pasek z tyłu umożliwia indywidualne dopasowanie.', 'Sportowy klasyk o wygodnej konstrukcji z bawełny.', 'trefoil-baseball-cap', '', '', '', 'Trefoil Baseball Cap', '', '', '', ''),
(695, 1, 1, 'Ciepłe wieczory, lody i czapka bejsbolówka. No i mamy lato! Ruszaj na trening w słońcu, nosząc czapkę adidas. AEROREADY usuwa pot, zapewniając Ci poczucie świeżości na boisku. Wygięty daszek chroni oczy, a 3 paski podkreślają sportowy charakter.   Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Klasyczna czapka, która osłoni Cię przed słońcem.', 'aeroready-3-stripes-baseball-cap', '', '', '', 'AEROREADY 3-Stripes Baseball Cap', '', '', '', ''),
(696, 1, 1, 'Czapka z daszkiem o niskim profilu, która nawiązuje do początku XXI wieku. Model z płótna z poliestru pochodzącego z recyklingu ma design z siateczką wzdłuż boków i z tyłu (jak każda szanująca się czapka z daszkiem). Lekko wygięty daszek sprawia, że od razu wyglądasz dobrze, a zapięcie na zatrzask z tyłu zapewnia lepsze dopasowanie.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Wyjątkowa czapka z mieszanki materiałów wykonana częściowo z materiałów pochodzących z recyklingu.', 'adicolor-archive-trucker-cap', '', '', '', 'Adicolor Archive Trucker Cap', '', '', '', ''),
(697, 1, 1, 'Podobnie jak sama gra, czapka bejsbolówka staje się coraz lepsza, odważniejsza i bardziej ekscytująca. Klasyczny design w nowej odsłonie zyskał wbudowaną ochronę przeciwsłoneczną oraz miękkość w dotyku. Zaprezentuj dumę z 3 pasków za sprawą akcentu adidas Badge of Sport.', 'Klasyczna czapka bejsbolówka z podwójnym brandingiem adidas.', 'baseball-3-stripes-twill-cap', '', '', '', 'Baseball 3-Stripes Twill Cap', '', '', '', ''),
(698, 1, 1, 'Od górskich wycieczek po miejskie spacery czapka adidas do wielu dyscyplin zapewni Ci ciepło w chłodne dni. Syntetyczna wiskoza jest wyjątkowo miękka i pochłania wilgoć. Zawsze w dobrym stylu i gotowości na wszystko.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Ciepła czapka beanie z dzianiny wykonana częściowo z materiałów pochodzących z recyklingu.', 'terrex-multisport-beanie', '', '', '', 'Terrex Multisport Beanie', '', '', '', ''),
(699, 1, 1, 'Czapka z daszkiem adidas jest lekka i wytrzymała. Model idealny do treningów outdoorowych ma po bokach i z tyłu wycinane laserowo otwory, które zapewniają Ci przewiewny komfort, a technologia AEROREADY gwarantuje suchy komfort. Wypukłe, silikonowe logo uzupełnia całość.  Ten produkt został wykonany z przędzy zawierającej 50% Parley Ocean Plastic — tworzywa z przetworzonych plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Oddychająca czapka z daszkiem wykonana częściowo z Parley Ocean Plastic.', 'aeroready-sport-trucker-cap', '', '', '', 'AEROREADY Sport Trucker Cap', '', '', '', ''),
(700, 1, 1, 'Skoncentruj się na piłce. Załóż tenisową opaskę adidas na głowę, by usunąć czynniki rozpraszające na korcie. Miękki i elastyczny model zapewni Ci komfort przez całą drogę do zdobycia gemu, setu i meczu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Miękka opaska na głowę wykonana częściowo z materiałów pochodzących z recyklingu.', 'tennis-headband', '', '', '', 'Tennis Headband', '', '', '', ''),
(701, 1, 1, 'Załóż tę czapkę z logo adidas na zatrzask z tyłu i ruszaj na lunch z przyjaciółmi lub odpocznij w domu. Model ma płaski daszek i opaskę przeciwpotną z siateczki, aby zapewnić Ci komfort niezależnie od tego, dokąd zaprowadzi Cię dzień. Wypukłe logo Badge of Sport podkreśla Twój dumny styl adidas.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Gładka czapka na zatrzask z tyłu wykonana częściowo z materiałów pochodzących z recyklingu.', 'snapback-logo-cap', '', '', '', 'Snapback Logo Cap', '', '', '', ''),
(702, 1, 1, 'Zachowaj ciepły komfort w chłodne dni na polu golfowym. Gdy pogoda wymaga czegoś więcej niż zwykła czapka, sięgnij po golfową czapkę adidas typu beanie. Model z miękkiej, melanżowej dzianiny ma izolację COLD.RDY, która zapewni Ci ciepło od pierwszego do ostatniego dołka. Napis Par 3 podkreśla Twoje oddanie dla tego sportu.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Miękka czapka beanie na chłodne dni, częściowo wykonana z materiałów pochodzących z recyklingu.', 'par-3-beanie', '', '', '', 'Par 3 Beanie', '', '', '', ''),
(703, 1, 1, 'Osłoń się przed słońcem podczas treningu w południe w tej czapce treningowej. Lekko wygięty daszek chroni Twoją twarz przed słońcem i osłania oczy przed blaskiem. Wewnętrzna opaska przeciwpotna i pochłaniający wilgoć AEROREADY zapewnią Ci suchy komfort.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka treningowa do noszenia na co dzień wykonana częściowo z materiałów pochodzących z recyklingu.', 'essential-aeroready-cap', '', '', '', 'Essential AEROREADY Cap', '', '', '', ''),
(704, 1, 1, 'Pada deszcz? Nie pozwól, żeby miało to wpływ na Twój kalendarz treningów. Załóż czapkę adidas i biegaj w deszczowe, wietrzne i szare dni. RAIN.RDY chroni oczy i włosy przed deszczem, a odblaskowe detale błyszczą w słabym świetle.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka do biegania w deszczowe dni wykonana częściowo z materiałów pochodzących z recyklingu.', 'x-city-running-rainrdy-cap', '', '', '', 'X-City Running RAIN.RDY Cap', '', '', '', ''),
(705, 1, 1, 'Gdy świeci słońce i robi się gorąco, ta czapka do biegania adidas pomoże Ci pozostać na trasie. Lekko wygięty daszek chroni oczy na skąpanym w słońcu chodniku, a konstrukcja z siateczki gwarantuje przepływ powietrza. AEROREADY pochłania wilgoć, dbając o Twój suchy komfort, nawet gdy tętno skacze w górę na podbiegu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka do biegania z siateczki wykonana częściowo z materiałów pochodzących z recyklingu.', 'running-aeroready-four-panel-mesh-cap', '', '', '', 'Running AEROREADY Four-Panel Mesh Cap', '', '', '', ''),
(706, 1, 1, 'Jesteś prawie gotowy. Jedyna rzecz, której Ci brakuje to ta czapka adidas. Załóż ją, a natychmiast dopełnisz swój look klasycznym, swobodnym akcentem. Nieważne, czy dzień upływa Ci powoli, czy w szybkim tempie ― eleganckie płótno na górze podkreśla Twój styl.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Dopełnij swój look nowoczesnym, sportowym akcentem.', 'adicolor-five-panel-cap', '', '', '', 'Adicolor Five-Panel Cap', '', '', '', ''),
(707, 1, 1, 'Jest powód, dla którego moda na czapki w formie kapelusików utrzymuje się od lat 80. Po prostu są zawsze na czasie. Ten prosty model adidas ma jednobarwną, wygodną konstrukcję, na której wyróżnia się kontrastowe logo adidas Trefoil.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Sportowa czapka typu kapelusik w swobodnym stylu.', 'adicolor-trefoil-bucket-hat', '', '', '', 'Adicolor Trefoil Bucket Hat', '', '', '', ''),
(708, 1, 1, 'Nie pozwól, by chłodna pogoda wpłynęła na Twoją grę. Zachowaj ciepły komfort na polu golfowym w tej czapce beanie do gry w golfa. Dwustronny design pozwoli Ci zmienić look. Branding po obu stronach podkreśli Twój styl adidas niezależnie od tego, którą stronę modelu wybierzesz.', 'Dwustronna czapka beanie do gry w golfa na chłodne dni na polu golfowym.', 'reversible-knit-beanie', '', '', '', 'Reversible Knit Beanie', '', '', '', ''),
(709, 1, 1, 'Miej chłodną głowę i gorące serce. Opaska na głowę adidas Terrex ochroni oczy przed potem i pozwoli Ci się skoncentrować na szlaku. AEROREADY odprowadza pot, gwarantując gotowość na kolejne wyzwania. Szybkoschnąca konstrukcja zapewnia chłód i suchy komfort.  Ten produkt został wykonany z Primeblue, wysokiej jakości materiału pochodzącego z recyklingu, który zawiera 50% Parley Ocean Plastic — tworzywa z przetworzonych plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten model zawiera co najmniej 40% komponentów pochodzących z odzysku.', 'Techniczna opaska na głowę stworzona z Parley Ocean Plastic.', 'terrex-headband', '', '', '', 'Terrex Headband', '', '', '', ''),
(710, 1, 1, 'Podobnie jak sama gra, czapka bejsbolówka staje się coraz lepsza, odważniejsza i bardziej ekscytująca. Klasyczny design w nowej odsłonie zyskał wbudowaną ochronę przeciwsłoneczną oraz miękkość w dotyku. Zaprezentuj dumę z 3 pasków za sprawą akcentu adidas Badge of Sport.', 'Klasyczna czapka bejsbolówka z podwójnym brandingiem adidas.', 'baseball-3-stripes-twill-cap', '', '', '', 'Baseball 3-Stripes Twill Cap', '', '', '', ''),
(711, 1, 1, 'Nigdy nie trać koncentracji na korcie. Ta tenisowa wiązana opaska adidas ma odprowadzający wilgoć AEROREADY, który pomoże Ci zachować koncentrację się na piłce. Konstrukcja z miękkiej dzianiny zapewnia Ci komfort i eliminuje czynniki rozpraszające.  Przędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Pochłaniająca wilgoć wiązana opaska wykonana z Parley Ocean Plastic.', 'aeroready-tennis-tie-band', '', '', '', 'AEROREADY Tennis Tie Band', '', '', '', ''),
(712, 1, 1, 'Zachowaj komfort, gdy wspierasz swoją ulubioną drużynę piłkarską. Ta czapka adidas typu beanie ma konstrukcję z miękkiej dzianiny i wywijany brzeg w uniwersalnym stylu. Godło Belgii podkreśla Twoje oddanie dla Czerwonych Diabłów.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Ciepła czapka beanie dla kibiców reprezentacji Belgii wykonana częściowo z materiałów pochodzących z recyklingu.', 'belgium-beanie', '', '', '', 'Belgium Beanie', '', '', '', ''),
(713, 1, 1, 'Czego jeszcze nie wiecie o czapkach à la kapelusz? No cóż ― wielu rzeczy, jeśli mowa o modelu Adicolor Classic ze specjalnym, dekatyzowanym wykończeniem. Wyszywane logo Trefoil stanowi akcent w autentycznym stylu adidas, który uzupełnia nowoczesny look.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Uwielbiany przez kolejne pokolenia design tej czapki dodatkowo podkręca look.', 'adicolor-classic-stonewashed-bucket-hat', '', '', '', 'Adicolor Classic Stonewashed Bucket Hat', '', '', '', ''),
(714, 1, 1, 'Zachowaj ciepły komfort w chłodne dni na polu golfowym. Gdy pogoda wymaga czegoś więcej niż zwykła czapka, sięgnij po golfową czapkę adidas typu beanie. Model z miękkiej, melanżowej dzianiny ma izolację COLD.RDY, która zapewni Ci ciepło od pierwszego do ostatniego dołka. Napis Par 3 podkreśla Twoje oddanie dla tego sportu.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Miękka czapka beanie na chłodne dni, częściowo wykonana z materiałów pochodzących z recyklingu.', 'par-3-beanie', '', '', '', 'Par 3 Beanie', '', '', '', ''),
(715, 1, 1, 'Klasyczna sylwetka zyskuje nowy look w postaci tej czapki adidas. Inspirowane latami 90. akcesorium zachowuje swój kształt, nadając każdemu strojowi swobodny, swobodny styl. Szeroki daszek i subtelne logo Trefoil dopełniają całości.     Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Wygodna czapka z szerokim daszkiem.', 'adicolor-archive-bucket-hat', '', '', '', 'Adicolor Archive Bucket Hat', '', '', '', ''),
(716, 1, 1, 'Osłoń się przed słońcem podczas treningu w południe w tej czapce treningowej. Lekko wygięty daszek chroni Twoją twarz przed słońcem i osłania oczy przed blaskiem. Wewnętrzna opaska przeciwpotna i pochłaniający wilgoć AEROREADY zapewnią Ci suchy komfort.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka treningowa do noszenia na co dzień wykonana częściowo z materiałów pochodzących z recyklingu.', 'essential-aeroready-cap', '', '', '', 'Essential AEROREADY Cap', '', '', '', ''),
(717, 1, 1, 'Czapka z daszkiem adidas jest lekka i wytrzymała. Model idealny do treningów outdoorowych ma po bokach i z tyłu wycinane laserowo otwory, które zapewniają Ci przewiewny komfort, a technologia AEROREADY gwarantuje suchy komfort. Wypukłe, silikonowe logo uzupełnia całość.  Ten produkt został wykonany z przędzy zawierającej 50% Parley Ocean Plastic — tworzywa z przetworzonych plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Oddychająca czapka z daszkiem wykonana częściowo z Parley Ocean Plastic.', 'aeroready-sport-trucker-cap', '', '', '', 'AEROREADY Sport Trucker Cap', '', '', '', ''),
(718, 1, 1, 'Zachowaj ciepły komfort w chłodne dni na polu golfowym. Gdy pogoda wymaga czegoś więcej niż zwykła czapka, sięgnij po golfową czapkę adidas typu beanie. Model z miękkiej, melanżowej dzianiny ma izolację COLD.RDY, która zapewni Ci ciepło od pierwszego do ostatniego dołka. Napis Par 3 podkreśla Twoje oddanie dla tego sportu.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Miękka czapka beanie na chłodne dni, częściowo wykonana z materiałów pochodzących z recyklingu.', 'par-3-beanie', '', '', '', 'Par 3 Beanie', '', '', '', ''),
(719, 1, 1, 'Jest powód, dla którego moda na czapki w formie kapelusików utrzymuje się od lat 80. Po prostu są zawsze na czasie. Ten prosty model adidas ma jednobarwną, wygodną konstrukcję, na której wyróżnia się kontrastowe logo adidas Trefoil.   Nasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Sportowa czapka typu kapelusik w swobodnym stylu.', 'adicolor-trefoil-bucket-hat', '', '', '', 'Adicolor Trefoil Bucket Hat', '', '', '', ''),
(720, 1, 1, 'Wędrówki, jazda na rowerze czy wypady na festiwale — nie da się nie zauważyć sportowych korzeni tej czapki bejsbolówki adidas. Konstrukcja z bawełny jest miękka i przewiewna, a zapięcie na zatrzask z tyłu umożliwia idealne dopasowanie.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczna czapka bejsbolówka wykonana częściowo z połączenia materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'daily-cap', '', '', '', 'Daily Cap', '', '', '', ''),
(721, 1, 1, 'TRX TRUCKER CAP', 'TRX TRUCKER CAP', 'trx-trucker-cap', '', '', '', 'TRX TRUCKER CAP', '', '', '', ''),
(722, 1, 1, 'Uzupełnij swoją garderobę o klasyczną czapkę bejsbolówkę. Miękka tkanina przeznaczona na słoneczne dni ochroni Cię przed promieniami słońca. Logo adidas Badge of Sport zajmuje główne miejsce na przodzie.', 'Lekka czapka z regulacją.', 'baseball-cap', '', '', '', 'Baseball Cap', '', '', '', ''),
(723, 1, 1, 'Kiedy założysz tę czapkę adidas, natychmiast staniesz się częścią klubu — klubu adidas Athletic. To właśnie symbolizuje grafika na przodzie, ale nie musisz być sportowcem, gdy ją nosisz. Możesz po prostu wyglądać lekko i swobodnie przez cały dzień.', 'Czapka, która zaprasza Cię do klubu adidas.', 'adidas-rifta-baseball-cap', '', '', '', 'adidas RIFTA Baseball Cap', '', '', '', ''),
(724, 1, 1, 'Najwięcej dobrej zabawy czeka Cię na dworze. Dlatego załóż czapkę adidas i ruszaj na outdoorowy trening. Gładką, lekką konstrukcję można regulować.   Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Czapka z regulacją wykonana z materiałów pochodzących z recyklingu.', 'lightweight-metal-badge-baseball-cap', '', '', '', 'Lightweight Metal Badge Baseball Cap', '', '', '', ''),
(725, 1, 1, 'Wędrówki, jazda na rowerze czy wypady na festiwale — nie da się nie zauważyć sportowych korzeni tej czapki bejsbolówki adidas. Konstrukcja z bawełny jest miękka i przewiewna, a zapięcie na zatrzask z tyłu umożliwia idealne dopasowanie.   Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Klasyczna czapka bejsbolówka wykonana częściowo z połączenia materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'daily-cap', '', '', '', 'Daily Cap', '', '', '', ''),
(726, 1, 1, 'Podobnie jak sama gra, czapka bejsbolówka staje się coraz lepsza, odważniejsza i bardziej ekscytująca. Klasyczny design w nowej odsłonie zyskał wbudowaną ochronę przeciwsłoneczną oraz miękkość w dotyku. Zaprezentuj dumę z 3 pasków za sprawą akcentu adidas Badge of Sport.', 'Klasyczna czapka bejsbolówka z podwójnym brandingiem adidas.', 'baseball-3-stripes-twill-cap', '', '', '', 'Baseball 3-Stripes Twill Cap', '', '', '', ''),
(727, 1, 1, 'Nie ma wątpliwości, komu kibicujesz. Wyszywana, asymetryczna naszywka Bayernu Monachium wyróżnia się na przodzie tej czapki piłkarskiej adidas. Miękka, wewnętrzna opaska pochłania wilgoć, zapewniając Ci komfort. Klasyczne zapięcie na zatrzask z tyłu zapewnia idealne dopasowanie.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Czapka z płaskim daszkiem wykonana częściowo z materiałów pochodzących z recyklingu dla kibiców Bayernu Monachium.', 'fc-bayern-snapback-cap', '', '', '', 'FC Bayern Snapback Cap', '', '', '', ''),
(728, 1, 1, 'Dwa nakrycia głowy w jednej czapce adidas. Jedna strona jest wykonana z poliestru, a druga z ciepłego polaru, dzięki czemu ten model dopasowuje się do warunków na dworze i Twojego samopoczucia. Niezależnie od tego, jak ją nosisz, możesz liczyć na izolację COLD.RDY i trwałą ochronę przed kaprysami pogody, co zapewni Ci ciepły i suchy komfort.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Ciepła czapka 2-w-1 wykonana częściowo z materiałów pochodzących z recyklingu.', 'terrex-winterised-reversible-cap', '', '', '', 'Terrex Winterised Reversible Cap', '', '', '', ''),
(729, 1, 1, 'Zachowaj ciepły komfort pomiędzy kolejnymi wyprawami. Załóż czapkę adidas Five Ten, aby poczuć się przytulnie na skałkach lub na obozie. Wywijany brzeg umożliwia dopasowanie do różnych stylów, a metka ma inną grafikę po każdej stronie, dzięki czemu możesz zmieniać swój look.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Ta czapka beanie z dzianiny została uszyta z materiałów pochodzących z recyklingu.', 'five-ten-beanie', '', '', '', 'Five Ten Beanie', '', '', '', ''),
(730, 1, 1, 'Prostota. O to chodzi w tej czapce. Dopasuj ją i gotowe. Dzięki pochłaniającemu wilgoć AEROREADY chroni Twoje oczy i twarz przed wilgocią. Lekko wygięty daszek sprawi, że od razu ją polubisz.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Czapka adidas z 3 paskami wykonana częściowo z materiałów pochodzących z recyklingu.', '3-stripes-aeroready-baseball-cap', '', '', '', '3-Stripes AEROREADY Baseball Cap', '', '', '', ''),
(731, 1, 1, 'To, że poważnie traktujesz piłkę nożną, nie oznacza, że nie możesz zachować swobodnego stylu. Elastyczna czapka-kapelusik adidas z miękkim rondem rezygnuje z formalności i pokazuje Twoje przywiązanie do Bayernu Monachium. Miękka opaska przeciwpotna wewnątrz pochłania wilgoć, dając Ci poczucie relaksu i swobody.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Elastyczny kapelusz z bawełnianego diagonalu w barwach Bayernu Monachium.', 'fc-bayern-bucket-hat', '', '', '', 'FC Bayern Bucket Hat', '', '', '', ''),
(732, 1, 1, 'Sportowa czapka, która osłoni Twoje oczy przed słońcem. Ta czapka-kapelusik adidas została uszyta z miękkiej, a jednocześnie mocnej bawełnianej tkaniny ripstop i ma klasyczny design, który możesz nosić przez cały rok. Siateczkowa opaska przeciwpotna zapewnia przewiewność.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Ta oddychająca czapka-kapelusik pasuje do każdego stroju.', 'classic-cotton-bucket-hat', '', '', '', 'Classic Cotton Bucket Hat', '', '', '', ''),
(733, 1, 1, 'Daszek adidas idealnie nadaje się na kort, pole golfowe i bieżnię. Pochłaniający wilgoć AEROREADY zapewnia Ci suchy komfort, a zaokrąglony daszek osłania oczy. Wypukłe, silikonowe logo stanowi sportowy akcent.  Ten produkt został wykonany z przędzy zawierającej 50% Parley Ocean Plastic — tworzywa z przetworzonych plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Lekki daszek wykonany częściowo z Parley Ocean Plastic.', 'aeroready-visor', '', '', '', 'AEROREADY Visor', '', '', '', ''),
(734, 1, 1, 'Schowaj się w cieniu podczas popołudniowego biegu. Daszek do biegania adidas chroni oczy przed słońcem za sprawą wygiętego daszka. Oddychająca siateczka i pochłaniający wilgoć AEROREADY zapewniają Ci suchy komfort, gdy robi się gorąco. Zapięcie na rzepy umożliwia idealne dopasowanie.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Daszek do biegania w słoneczne dni wykonany częściowo z materiałów pochodzących z recyklingu.', 'aeroready-running-visor', '', '', '', 'AEROREADY Running Visor', '', '', '', ''),
(735, 1, 1, 'To nie czapka Twojego taty. Ale może być. Ta czapka adidas w swobodnym stylu sprawdzi się podczas grilla lub na basenie, ale możesz też nosić ją podczas codziennych zajęć i załatwiania codziennych spraw na mieście. Lekko wygięty daszek osłoni Cię przed słońcem, a pochłaniająca wilgoć opaska przeciwpotna zapewni Ci komfort, gdy na dworze jest ciepło.  Ten produkt został poddany barwieniu przy pomocy technologii przyjaznych dla środowiska.', 'Komfortowa czapka barwiona w ramach bardziej ekologicznego procesu.', 'comfort-dad-cap', '', '', '', 'Comfort Dad Cap', '', '', '', ''),
(736, 1, 1, 'Juventus przede wszystkim. Pokaż swoje wsparcie w tej czapce piłkarskiej adidas. Miękka opaska przeciwpotna wewnątrz pochłania wilgoć, aby można było całą uwagę poświęcić meczowi.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Regulowana czapka z wygiętym daszkiem dla kibiców Juventusu.', 'juventus-dna-cap', '', '', '', 'Juventus DNA Cap', '', '', '', ''),
(737, 1, 1, 'Niezależnie od tego, czy trenujesz do następnego wyścigu, czy wybierasz się na szybki jogging, ta czapka bejsbolówka adidas zapewni Ci okrycie. Odprowadzający wilgoć AEROREADY i oddychająca podszewka z siateczki zapewniają Ci suchy komfort. Regulowane zapięcie z tyłu umożliwia indywidualne dopasowanie, a wypukłe, silikonowe logo stanowi sportowe wykończenie.  Ten produkt został wykonany z przędzy zawierającej 50% Parley Ocean Plastic — tworzywa z przetworzonych plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', 'Oddychająca, odprowadzająca wilgoć czapka wykonana częściowo z Parley Ocean Plastic.', 'aeroready-training-running-baseball-cap', '', '', '', 'AEROREADY Training Running Baseball Cap', '', '', '', ''),
(738, 1, 1, 'Kibicuj swojej drużynie. Pokaż swoje barwy. Ta czapka piłkarska adidas wyróżnia się sławnymi, żółtymi barwami podstawowymi reprezentacji Kolumbii. Nad lekko wygiętym daszkiem dumnie prezentuje się naszywka drużyny. Regulowany pasek z tyłu zapewnia wygodę.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Czapka z diagonalu w sławnych barwach podstawowych reprezentacji Kolumbii.', 'colombia-home-dad-cap', '', '', '', 'Colombia Home Dad Cap', '', '', '', ''),
(739, 1, 1, 'Reprezentuj piłkarską arystokrację w stylu, który nie rzuca się w oczy. Kapelusz adidas prezentuje zielono-czarne barwy imponującego trzeciego zestawu Realu Madryt. Elastyczny brzeg chroni oczy przed słońcem, a naszywka klubowa podkreśla Twoje wsparcie. Miękka, wewnętrzna opaska pochłania wilgoć, zapewniając Ci komfort.  Nasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', 'Miękki kapelusz dla zagorzałych kibiców Realu Madryt.', 'real-madrid-22-23-bucket-hat', '', '', '', 'Real Madrid 22/23 Bucket Hat', '', '', '', ''),
(740, 1, 1, 'Jeśli chodzi o wybór torby na aktywny dzień, kluczowe znaczenie ma pojemność. Wybierz ten plecak adidas i przenoś swoje rzeczy wygodnie. Pojemna komora główna oraz kieszenie z przodu i po bokach sprawią, że Twój sprzęt będzie zawsze uporządkowany i pod ręką. Dodatkowo plecak jest ozdobiony logo Trefoil, dzięki czemu możesz zaprezentować przywiązanie do marki adidas na co dzień.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Pojemny plecak o klasycznym designie.', 'adicolor-backpack', '', '', '', 'Adicolor Backpack', '', '', '', ''),
(741, 1, 1, 'Przenoszenie rzeczy na siłownię możesz potraktować jako dodatkowe ćwiczenie. Spakuj wszystko, co potrzebne do tego plecaka adidas i ruszaj, ciesząc się wygodą. Kompresyjne paski sprawiają, że ciężar równomiernie się rozkłada, a liczne przegrody oznaczają porządek. Jest nawet przegroda na laptopa, jeśli jedziesz do pracy po treningu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów pochodzących z recyklingu, co stanowi tylko jedno z naszych rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Trwały plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'power-vi-backpack', '', '', '', 'Power VI Backpack', '', '', '', ''),
(742, 1, 1, 'Każdy dzień to przygoda, a dzięki temu plecakowi adidas będziesz na nią przygotowany. Model inspirowany sprzętem outdoorowym ma górną kieszeń na suwak, dzięki czemu możesz szybko dostać się do kluczy, portfela lub telefonu. W łatwo dostępnej wewnętrznej przegrodzie bezpiecznie schowasz laptopa.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Funkcjonalny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', '4athlts-camper-backpack', '', '', '', '4ATHLTS Camper Backpack', '', '', '', ''),
(743, 1, 1, 'Plecak powraca. Klasyczny model adidas to stylowy sposób na przechowywanie wszystkich rzeczy. Od termicznego kubka na kawę, poprzez laptopa, aż po sprzęt do biegania. Ma również boczną kieszeń na bidon.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Wielozadaniowa, pojemna torba wykonana częściowo z materiałów pochodzących z recyklingu.', 'classic-badge-of-sport-backpack', '', '', '', 'Classic Badge of Sport Backpack', '', '', '', ''),
(744, 1, 1, 'Z domu na siłownię i z powrotem. Noś swój sprzęt w dobrym stylu dzięki temu plecakowi adidas. Pakowana od góry komora główna ułatwia dostęp do rzeczy, a wyściełane szelki i wyściełany panel z tyłu zapewniają komfort podczas długotrwałego noszenia. Odblaskowe logo zwiększy Twoją widoczność w słabym świetle.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Mocny plecak o technicznym designie wykonany częściowo z materiałów pochodzących z recyklingu.', '4athlts-id-gear-up-backpack', '', '', '', '4ATHLTS ID Gear Up Backpack', '', '', '', ''),
(745, 1, 1, 'Przenoszenie rzeczy na siłownię możesz potraktować jako dodatkowe ćwiczenie. Spakuj wszystko, co potrzebne do tego plecaka adidas i ruszaj, ciesząc się wygodą. Kompresyjne paski sprawiają, że ciężar równomiernie się rozkłada, a liczne przegrody oznaczają porządek. Jest nawet przegroda na laptopa, jeśli jedziesz do pracy po treningu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów pochodzących z recyklingu, co stanowi tylko jedno z naszych rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Trwały plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'power-vi-backpack', '', '', '', 'Power VI Backpack', '', '', '', ''),
(746, 1, 1, 'Przenoszenie rzeczy na siłownię możesz potraktować jako dodatkowe ćwiczenie. Spakuj wszystko, co potrzebne do tego plecaka adidas i ruszaj, ciesząc się wygodą. Kompresyjne paski sprawiają, że ciężar równomiernie się rozkłada, a liczne przegrody oznaczają porządek. Jest nawet przegroda na laptopa, jeśli jedziesz do pracy po treningu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów pochodzących z recyklingu, co stanowi tylko jedno z naszych rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Trwały plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'power-vi-backpack', '', '', '', 'Power VI Backpack', '', '', '', ''),
(747, 1, 1, 'Jeśli chodzi o wybór torby na aktywny dzień, kluczowe znaczenie ma pojemność. Wybierz ten plecak adidas i przenoś swoje rzeczy wygodnie. Pojemna komora główna oraz kieszenie z przodu i po bokach sprawią, że Twój sprzęt będzie zawsze uporządkowany i pod ręką. Dodatkowo plecak jest ozdobiony logo Trefoil, dzięki czemu możesz zaprezentować przywiązanie do marki adidas na co dzień.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Pojemny plecak o klasycznym designie.', 'adicolor-backpack', '', '', '', 'Adicolor Backpack', '', '', '', ''),
(748, 1, 1, 'Oldschoolowy look z nowym akcentem. Taki właśnie będzie Twój styl dzięki tej torbie-nerce adidas. Dwie przegrody na suwaki i regulowany pasek pozwolą Ci cieszyć się tym, co przyniesie dzień. Nawet gdy nie wiesz, jaka będzie pogoda, połyskujący, powlekany materiał sprawdzi się w deszczu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Torba-nerka adidas wykonana częściowo z materiałów pochodzących z recyklingu.', 'adicolor-archive-waist-bag', '', '', '', 'Adicolor Archive Waist Bag', '', '', '', ''),
(749, 1, 1, 'Kompaktowa, przewieszana przez tułów torba od adidas jest ozdobiona napisem „The Brand with the 3-Stripes” w różnych językach. Niezależnie od tego, czy spacerujesz po okolicy, czy przemierzasz świat, ten model przechowa wszystko — od telefonu po paszport — dokładnie tam, gdzie tego potrzebujesz. Wyreguluj pasek na ramię zgodnie ze swoimi potrzebami i upodobaniami. A potem ruszaj w świat.   Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Uniwersalna torba wykonana częściowo z materiałów pochodzących z recyklingu.', 'classic-foundation-crossbody-lounge-bag', '', '', '', 'Classic Foundation Crossbody Lounge Bag', '', '', '', ''),
(750, 1, 1, 'W drodze na siłownię lub na lunch z tą torbą-nerką adidas będziesz mieć wolne ręce.  Komora główna zamyka się na suwak bezpiecznie przechowa Twoje rzeczy, a przednia kieszeń na suwak i wewnętrzna kieszeń z siateczki ułatwiają organizację małych przedmiotów. Dzięki szybkiej regulacji pasków możesz nosić ją w talii lub przewieszoną przez tułów.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekka torba-nerka wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-bum-bag', '', '', '', 'Essentials Bum Bag', '', '', '', ''),
(751, 1, 1, 'Zapnij tę torbę-nerkę adidas i ruszaj na trening biegowy o wschodzie słońca lub na poranną wędrówkę. Pojemna kieszeń główna pomieści wszystkie niezbędne drobiazgi, a mniejsza kieszeń bezpiecznie przechowa klucze i pieniądze z przodu. Noś ją przewieszoną przez tułów, aby zyskać mocny, miejski look podczas dużego śniadania na zwieńczenie aktywnego poranka.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Torba-nerka, którą możesz nosić na dwa sposoby, wykonana częściowo z materiałów pochodzących z recyklingu.', '4athlts-id-waist-bag', '', '', '', '4ATHLTS ID Waist Bag', '', '', '', ''),
(752, 1, 1, 'Klasyczny i wygodny portfel adidas ma wszystkie przegrody potrzebne do uporządkowania kart i gotówki. Schowaj go do torby sportowej lub kieszeni z tyłu. Śmiała grafika adidas jasno i wyraźnie głosi Twoje oddanie marce.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Lekki portfel wykonany częściowo z materiałów pochodzących z recyklingu.', 'essentials-wallet', '', '', '', 'Essentials Wallet', '', '', '', ''),
(753, 1, 1, 'Masz sporo sprzętu do noszenia. Ta torba-worek adidas go pomieści. Trwała torba ma idealną pojemność na zawody i treningi szkoleniowe poza miastem. W zamykanej na suwak przegrodzie możesz schować mokre ubrania z dala od butów.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Średniej wielkości torba-worek wykonana częściowo z materiałów pochodzących z recyklingu.', '4athlts-duffel-bag-medium', '', '', '', '4ATHLTS Duffel Bag Medium', '', '', '', ''),
(754, 1, 1, 'Sprytne pakowanie to klucz do podróżowania z lekkim bagażem. Ta bardzo mała torba-worek adidas jest wystarczająco pojemna, aby szybko ją zabrać na siłownię. W siateczkowej kieszeni na suwak możesz schować mokre ubrania z dala od butów.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Mała torba-worek wykonana częściowo z materiałów pochodzących z recyklingu.', '4athlts-duffel-bag-small', '', '', '', '4ATHLTS Duffel Bag Small', '', '', '', ''),
(755, 1, 1, 'Wybierz lekki bagaż. Ta bardzo mała torba-worek adidas pomoże Ci przenosić niezbędne drobiazgi w stylu z 3 paskami. Niezależnie od tego, czy wybierasz się do studia, czy na ściankę wspinaczkową duże logo jasno pokazuje, że sport jest tym, co kochasz. Regulowany pasek na ramię zapewni Ci komfort podczas noszenia.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Mała, sportowa torba wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-linear-duffel-bag-extra-small', '', '', '', 'Essentials Linear Duffel Bag Extra Small', '', '', '', ''),
(756, 1, 1, 'Klasyczny plecak adidas w sportowym stylu pomieści cały Twój sprzęt. Od kultowych 3 pasków po mocny, powlekany TPU spód — każdy detal został zaprojektowany z myślą o stylu i funkcjonalności. Schowaj swoje rzeczy, włóż bidon do jednej z bocznych, wsuwanych kieszeni i wyreguluj wyściełane szelki, aby uzyskać wygodne dopasowanie. Tę torbę możesz nosić od rana do wieczora i jeszcze przez wiele lat.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Solidny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'back-to-school-backpack', '', '', '', 'Back to School Backpack', '', '', '', ''),
(757, 1, 1, 'Od nocnych zajęć po nadgodziny, od wypadów na zakupy po weekendowe wyprawy — czy jest coś, czego ten plecak adidas nie wytrzyma? (Wskazówka: odpowiedź brzmi — nie). Materiał CORDURA® jest wytrzymały i lekki, a liczne kieszenie pomieszczą wszystkie potrzebne rzeczy. Profilowane, wyściełane, regulowane paski przylegają do ramion i klatki piersiowej. W dodatku, dzięki przewiewnemu panelowi z siateczki na plecach, nigdy się nie zgrzejesz.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Nowoczesny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'adicolor-contempo-utility-backpack-large', '', '', '', 'Adicolor Contempo Utility Backpack Large', '', '', '', ''),
(758, 1, 1, 'Jeden plecak na wszystkie outdoorowe przygody. Wybierz ten plecak adidas Terrex na dłuższe dni na szlaku lub ruszaj na podbój miasta i ściągnij go za pomocą kompresyjnych pasków. W obu przypadkach tylny panel AEROREADY zapewnia Ci suchy komfort i ułatwia koncentrację. Model ma mnóstwo funkcji, w tym wyściełaną przegrodę wewnętrzną na nawodnienie na szlaku lub na laptopa, gdy jesteś w mieście. Zewnętrzne paski pozwalają zabezpieczyć kask lub warstwę okrycia, aby mieć do nich szybki dostęp. Wewnętrzne kieszenie z siateczki chronią małe przedmioty przed zgubieniem, a boczne kieszenie z siateczki pomieszczą bidon lub czapkę. Gdy potrzebujesz pełnego dostępu, panel z suwakiem z tyłu pozwoli Ci szybko znaleźć to, czego potrzebujesz.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Sportowy plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'terrex-aeroready-multisport-backpack', '', '', '', 'Terrex AEROREADY Multisport Backpack', '', '', '', ''),
(759, 1, 1, 'Nowy sezon, nowy dodatek do listy. Przedstawiamy ten plecak od adidas, choć wiesz już to na podstawie kultowych 3 pasków. Jak wszystkie najlepsze plecaki ten jest sportowy i elastyczny. Może pomieścić Twój strój na siłownię, ubrania na zmianę i kartę pokładową.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Torba do pracy i zabawy wykonana częściowo z materiałów pochodzących z recyklingu.', 'classic-future-icon-3-stripes-backpack', '', '', '', 'Classic Future Icon 3-Stripes Backpack', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(760, 1, 1, 'Przyjrzyjmy się temu plecakowi adidas. Ma konstrukcję z wytrzymałej poliestrowej tkaniny o splocie płóciennym, dzięki czemu wygląda jak nowy nawet przy intensywnym użytkowaniu. W zapinanej przegrodzie na suwak zabezpieczysz swoje rzeczy w zabiegany dzień pracy lub w drodze na siłownię. Kieszeń na suwak z przodu pomieści Twój telefon i etui na karty, a bidon możesz schować do jednej z bocznych kieszeni.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Praktyczny plecak o uproszczonym designie wykonany częściowo z materiałów pochodzących z recyklingu.', 'classic-badge-of-sport-3-stripes-backpack', '', '', '', 'Classic Badge of Sport 3-Stripes Backpack', '', '', '', ''),
(761, 1, 1, 'Plecak adidas z kamuflażowym wzorem nie wie, co to kompromis. Jeśli chodzi o przechowywanie, to ma praktycznie nieograniczone możliwości dzięki przednim i bocznym kieszeniom na suwaki (nie wspominając nawet o pojemnej komorze głównej). Regulowane, wyściełane szelki zapewniają doskonałe wsparcie w zabiegane dni, które płynnie przechodzą w pełne aktywności noce.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Pojemny plecak wykonany z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'camo-classic-backpack', '', '', '', 'Camo Classic Backpack', '', '', '', ''),
(762, 1, 1, 'Na długie dojazdy i małe przygody. Ten plecak adidas ma solidny spód, która ochroni Twoje rzeczy. Ukryta kieszeń na suwak z przodu pomieści karty w zasięgu ręki, a w kieszeniach z siateczki po bokach przechowasz niezbędne drobiazgi.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Solidny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'essentials-linear-backpack', '', '', '', 'Essentials Linear Backpack', '', '', '', ''),
(763, 1, 1, 'Plecak powraca. Klasyczny model adidas to stylowy sposób na przechowywanie wszystkich rzeczy. Od termicznego kubka na kawę, poprzez laptopa, aż po sprzęt do biegania. Ma również boczną kieszeń na bidon.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Wielozadaniowa, pojemna torba wykonana częściowo z materiałów pochodzących z recyklingu.', 'classic-badge-of-sport-backpack', '', '', '', 'Classic Badge of Sport Backpack', '', '', '', ''),
(764, 1, 1, 'Kiedy przygotowujesz się na sezon festiwalowy, zabierz ze sobą tę torbę adidas, a wygodnie dotrzesz do celu. Replika z naszego archiwum została odświeżona odpowiednio do wymogów współczesnego stylu życia. Suwaki przy komorze głównej i przedniej kieszeni zabezpieczają niezbędne drobiazgi przed wypadnięciem. Martwisz się, że może padać? Ale przecież deszcz nie może pokrzyżować Ci planów. Błyszczący, powlekany materiał sprawdzi się w niepogodę.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Przełomowa torba festiwalowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'adicolor-archive-festival-bag', '', '', '', 'Adicolor Archive Festival Bag', '', '', '', ''),
(765, 1, 1, 'Od dojazdów do pracy po bieg po kawę ta torba-organizer adidas pozwoli Ci pozostać w ruchu. Komora główna na suwak bezpiecznie pomieści klucze, karty i telefon. W kieszeni na suwak z przodu przechowasz wszystkie inne drobiazgi. Wyreguluj pasek na ramię zgodnie ze swoimi preferencjami i ruszaj na podbój świata.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Praktyczna torba-organizer wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-organizer', '', '', '', 'Essentials Organizer', '', '', '', ''),
(766, 1, 1, 'Ruszaj przed siebie, nie martwiąc się o niezbędne wyposażenie. Zapnij suwak i ciesz się swobodą rąk dzięki tej torbie adidas w festiwalowym stylu. Pasek z taśmy można łatwo przypiąć i odpiąć, dzięki czemu możesz nosić ten model jako kopertówkę lub przewieszoną przez tułów torbę. Logotypy Trefoil OG nadają całości klasyczny charakter.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Uniwersalna, wygodna torba festiwalowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'adicolor-classic-festival-bag', '', '', '', 'Adicolor Classic Festival Bag', '', '', '', ''),
(767, 1, 1, 'Torba adidas nie obudzi Cię na trening przed świtem ani nie pomoże Ci przygotować się do podnoszenia ciężarów. Ale jeśli spakujesz swoje wyposażenie i pojawisz się na treningu, to będzie to godny zaufania partner w podróży do lepszej wersji siebie. Duży, śmiały branding na boku przypomina o znaczeniu śmiałych planów i odwagi w ich realizacji.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pojemna torba w śmiałym stylu wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-training-duffel-bag-medium', '', '', '', 'Essentials Training Duffel Bag Medium', '', '', '', ''),
(768, 1, 1, 'Niezależnie od tego, dokąd zaprowadzi Cię dzień, na tę torbę adidas możesz liczyć. Pojemna komora główna pomieści cały Twój sprzęt na trening, siłownię lub basen. Przednia kieszeń na suwak i wsuwana kieszeń zapewniają łatwy dostęp do mniejszych przedmiotów. Wyreguluj pasek na ramię, aby przewiesić torbę przez tułów lub użyj uchwytów przy bardziej tradycyjnym podejściu.   Torba wykonana z serii materiałów pochodzących z recyklingu zawiera co najmniej 40% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Pojemna torba na niezbędne drobiazgi wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-seasonal-duffel-bag-medium', '', '', '', 'Essentials Seasonal Duffel Bag Medium', '', '', '', ''),
(769, 1, 1, 'Z zajęć jogi na plażę i do biura. Gdziekolwiek się wybierasz, w tej torbie adidas schowasz wszystko, czego potrzebujesz, aby dotrzeć do celu. Duża komora główna pomieści całe Twoje wyposażenie, od ręcznika po ubrania na zmianę, a do bocznych, wsuwanych kieszeni spakujesz bidon lub telefon. A co w niej najlepsze? Niebarwiony materiał pasuje do każdego stroju.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pojemna torba na co dzień wykonana częściowo z materiałów pochodzących z recyklingu.', 'classic-foundation-lounge-tote-bag', '', '', '', 'Classic Foundation Lounge Tote Bag', '', '', '', ''),
(770, 1, 1, 'Masz sporo sprzętu do noszenia. Ta torba-worek adidas go pomieści. Trwała torba ma idealną pojemność na zawody i treningi szkoleniowe poza miastem. W zamykanej na suwak przegrodzie możesz schować mokre ubrania z dala od butów.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Średniej wielkości torba-worek wykonana częściowo z materiałów pochodzących z recyklingu.', '4athlts-duffel-bag-medium', '', '', '', '4ATHLTS Duffel Bag Medium', '', '', '', ''),
(771, 1, 1, 'Torba adidas nie obudzi Cię na trening przed świtem ani nie pomoże Ci przygotować się do podnoszenia ciężarów. Ale jeśli spakujesz swoje wyposażenie i pojawisz się na treningu, to będzie to godny zaufania partner w podróży do lepszej wersji siebie. Duży, śmiały branding na boku przypomina o znaczeniu śmiałych planów i odwagi w ich realizacji.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pojemna torba w śmiałym stylu wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-training-duffel-bag-medium', '', '', '', 'Essentials Training Duffel Bag Medium', '', '', '', ''),
(772, 1, 1, 'Dojazdy? Nie ma problemu. Dłuższa podróż? Chętnie. A może nieoczekiwana przygoda? Czemu nie? Ten pojemny plecak jest Twoim godnym zaufania towarzyszem. Wyściełane, regulowane szelki ułatwiają przenoszenie dużego obciążenia, a zwijane zapięcie na górze podkreśla stylowy fason. Wygodne kieszenie boczne sprawiają, że mniejsze przedmioty są w zasięgu ręki.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Pojemny plecak ze zwijaną górną częścią wykonany częściowo z materiałów pochodzących z recyklingu.', 'adicolor-classic-roll-top-backpack', '', '', '', 'Adicolor Classic Roll-Top Backpack', '', '', '', ''),
(773, 1, 1, 'Na długie dojazdy i małe przygody. Ten plecak adidas ma solidny spód, która ochroni Twoje rzeczy. Ukryta kieszeń na suwak z przodu pomieści karty w zasięgu ręki, a w kieszeniach z siateczki po bokach przechowasz niezbędne drobiazgi.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Solidny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'essentials-linear-backpack', '', '', '', 'Essentials Linear Backpack', '', '', '', ''),
(774, 1, 1, 'Plecak adidas z kamuflażowym wzorem nie wie, co to kompromis. Jeśli chodzi o przechowywanie, to ma praktycznie nieograniczone możliwości dzięki przednim i bocznym kieszeniom na suwaki (nie wspominając nawet o pojemnej komorze głównej). Regulowane, wyściełane szelki zapewniają doskonałe wsparcie w zabiegane dni, które płynnie przechodzą w pełne aktywności noce.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Pojemny plecak wykonany z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł.', 'camo-classic-backpack', '', '', '', 'Camo Classic Backpack', '', '', '', ''),
(775, 1, 1, 'Telefon, karty, notatnik, żel do odkażania rąk, polar — niezależnie od rodzaju aktywności, jest wiele rzeczy, których potrzebujesz. Dzięki temu plecakowi adidas masz mnóstwo miejsca, aby je przechować. Znajdziesz tu elastyczne kieszenie boczne z siateczki, przednie kieszenie na suwak i ukrytą kieszeń wewnątrz na klucze. Ten plecak ma plecy z przewiewnej siateczki i regulowane szelki. Gdy już się spakujesz, nie będzie Cię spowalniał.    Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Uniwersalna, wygodna torba wykonana z serii materiałów pochodzących z recyklingu.', 'motion-badge-of-sport-backpack', '', '', '', 'Motion Badge of Sport Backpack', '', '', '', ''),
(776, 1, 1, 'Klasyczny, kamuflażowy styl na wszystkie Twoje wyprawy. Ten plecak adidas został zaprojektowany z myślą o organizacji — od wyściełanej przegrody na laptopa po odpinany brelok na klucze i liczne kieszenie. Wyściełane szelki i panel z tyłu zostały uszyte z przewiewnej siateczki, która zapewnia maksymalny komfort, a regulowany pasek na piersi gwarantuje pewne dopasowanie.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Wygodny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'city-xplorer-backpack', '', '', '', 'City Xplorer Backpack', '', '', '', ''),
(777, 1, 1, 'Każdy dzień to przygoda, a dzięki temu plecakowi adidas będziesz na nią przygotowany. Model inspirowany sprzętem outdoorowym ma górną kieszeń na suwak, dzięki czemu możesz szybko dostać się do kluczy, portfela lub telefonu. W łatwo dostępnej wewnętrznej przegrodzie bezpiecznie schowasz laptopa.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Funkcjonalny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', '4athlts-camper-backpack', '', '', '', '4ATHLTS Camper Backpack', '', '', '', ''),
(778, 1, 1, 'Wybierając plecak adidas, wybierasz wygodę. Plecak ma tylni panel z siateczki, który zapewnia cyrkulację powietrza, oraz wyściełane szelki gwarantujące amortyzowane dopasowanie. Ma też odpowiednio rozmieszczone kieszenie: wsuwane na bidon i ukrytą kieszonkę na klucze. Czyli to, co sportowcy lubią najbardziej.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Opływowa torba o wspierającym kroju wykonana z serii materiałów pochodzących z recyklingu.', 'motion-linear-backpack', '', '', '', 'Motion Linear Backpack', '', '', '', ''),
(779, 1, 1, 'Nie jest łatwo zmieścić tyle stylu w jednym modelu, ale w przypadku tego plecaka adidas udało się nam to doskonale. Model, który sprawdzi się podczas porannych dojazdów, wygląda tak dobrze, że może Ci towarzyszyć przez cały dzień. Owijająca przegroda na suwak ułatwia pakowanie, a błyszcząca powłoka i naniesione sitodrukiem logo Trefoil stanowią wykończenie w wyszukanym stylu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Stylowy i trwały plecak został częściowo wykonany z materiałów pochodzących z recyklingu.', 'adicolor-archive-backpack', '', '', '', 'Adicolor Archive Backpack', '', '', '', ''),
(780, 1, 1, 'Wyłącz powiadomienia. Podziwiaj otoczenie. Ta torba-nerka adidas ma pojemną komorę główną i kieszeń z suwakiem na drobne przedmioty. Wewnętrzna przegroda pomoże Ci uporządkować cały sprzęt, jednocześnie pozwalając Ci cieszyć się swobodą rąk.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Praktyczna torba-nerka wykonana częściowo z materiałów pochodzących z recyklingu.', 'city-xplorer-bum-bag', '', '', '', 'City Xplorer Bum Bag', '', '', '', ''),
(781, 1, 1, 'Przypnij ją w talii i w drogę. Niezależnie od tego, czy spacerujesz z psem, czy wybierasz się na pieszą wędrówkę, ta torba łączy modę i funkcjonalność. Model inspirowany designem vintage pomieści niezbędne drobiazgi w dwóch oddzielnych kieszeniach z wygodnymi suwakami. Regulowany pasek i miękka wyściółka zapewniają wygodne dopasowanie.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Torba-nerka, w której pomieścisz potrzebne rzeczy, wykonana częściowo z materiałów pochodzących z recyklingu.', 'adicolor-classic-waist-bag', '', '', '', 'Adicolor Classic Waist Bag', '', '', '', ''),
(782, 1, 1, 'Zawsze miło jest mieć towarzystwo, gdy wyruszasz na przygodę. W tej torbie-nerce adidas z kamuflażowym wzorem będziesz mieć zaufanego towarzysza podczas kolejnej wędrówki, biegu do warzywnika lub spaceru po mieście o wschodzie słońca. Regulowany pasek pozwoli Ci nosić ją jako pasek lub przypiąć na biodrach.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wygodna torba-nerka adidas z kamuflażowym wzorem, która pomieści wszystko, czego potrzebujesz.', 'camo-waist-bag', '', '', '', 'Camo Waist Bag', '', '', '', ''),
(783, 1, 1, 'Zawsze miło jest mieć towarzystwo, gdy wyruszasz na przygodę. W tej torbie-nerce adidas z kamuflażowym wzorem będziesz mieć zaufanego towarzysza podczas kolejnej wędrówki, biegu do warzywnika lub spaceru po mieście o wschodzie słońca. Regulowany pasek pozwoli Ci nosić ją jako pasek lub przypiąć na biodrach.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wygodna torba-nerka adidas z kamuflażowym wzorem, która pomieści wszystko, czego potrzebujesz.', 'camo-waist-bag', '', '', '', 'Camo Waist Bag', '', '', '', ''),
(784, 1, 1, 'Jeśli zmienisz spodnie cargo w plecak, otrzymasz właśnie to. Ten solidny, bawełniany plecak adidas bezpiecznie przechowa Twój sprzęt dzięki łatwo dostępnej komorze głównej i dodatkowym kieszeniom na wszystkie niezbędne drobiazgi. Gładka, minimalistyczna torba w uniwersalnym stylu.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wielofunkcyjny plecak wykonany częściowo z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'adidas-rifta-backpack', '', '', '', 'adidas RIFTA Backpack', '', '', '', ''),
(785, 1, 1, 'Przygotuj się na wszystko, co przyniesie dzień dzięki temu plecakowi adidas. Ma mnóstwo miejsca, w tym przednią kieszeń na suwak, w której schowasz niezbędne drobiazgi, oraz boczne, wsuwane kieszenie na bidon lub inne przedmioty, które chcesz mieć pod ręką. Regulowane, ergonomiczne szelki pozwalają znaleźć odpowiednie dopasowanie, gwarantując Ci komfort niezależnie od tego, dokąd zaprowadzi Cię dzień.  Ten plecak jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Pojemny i wygodny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'classic-foundation-backpack', '', '', '', 'Classic Foundation Backpack', '', '', '', ''),
(786, 1, 1, 'Uwzględnij w planie swojego dnia pobudzający spacer z plecakiem adidas. Model ma przegrodę na laptopa i odpinany brelok na klucze, dzięki czemu łatwo odszukasz cenne drobiazgi. Pleciony pasek z przodu i boczne kieszenie pomieszczą niezbędne przedmioty, takie jak bidon i dodatkowe, ciepłe okrycie. Wyściełane szelki i panel z tyłu zostały uszyte z siateczki, aby zapewnić Ci komfort, gdy podkręcasz tempo.   Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Praktyczny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'city-xplorer-backpack', '', '', '', 'City Xplorer Backpack', '', '', '', ''),
(787, 1, 1, 'Lekkość to podstawa na szlaku. Ten outdoorowy plecak adidas Terrex ma wystarczająco dużo miejsca, aby pomieścić ekwipunek na mało wymagające szlaki i rekreacyjne wędrówki. Panel z tyłu AEROREADY umożliwia cyrkulację powietrza, zapewniając Ci suchy komfort i ułatwiając koncentrację. Odpinany pas w talii i pasek na piersi pozwolą zabrać ze sobą wszystko, czego potrzebujesz. Wewnętrzna, wsuwana kieszeń pomieści nawodnienie niezbędne na szlaku lub laptopa w mieście. Dzięki paskom kompresyjnym wyposażenie idealnie przylega do ciała, a dodatkowa warstwa okrycia jest w zasięgu ręki.   Ten produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', 'Lekki plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'terrex-aeroready-hiking-backpack', '', '', '', 'Terrex AEROREADY Hiking Backpack', '', '', '', ''),
(788, 1, 1, 'Im dalej biegasz, tym więcej rzeczy potrzebujesz na trasie. Noś wszystko w torbie-nerce adidas z paskiem. Jest w niej miejsce na smartfona, klucze i żele, a całość wygodnie układa się na ciele, pozwalając Ci skupić się wyłącznie na treningu. Odblaskowe detale sprawdzą się, gdy zachodzi słońce.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Pas do biegania na niezbędne drobiazgi wykonany częściowo z materiałów pochodzących z recyklingu.', 'running-belt-waist-bag', '', '', '', 'Running Belt Waist Bag', '', '', '', ''),
(789, 1, 1, 'Swoboda rąk oznacza brak niepotrzebnych zmartwień. W tym tkwi piękno tej torby-nerki adidas. Załóż ją i ruszaj w drogę. Ma komorę główną i kieszeń na suwak z przodu, w której przechowasz niezbędne drobiazgi w zasięgu ręki.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Torba-nerka w archiwalnym stylu wykonana częściowo z materiałów pochodzących z recyklingu.', 'adidas-adventure-waist-bag-small', '', '', '', 'adidas Adventure Waist Bag Small', '', '', '', ''),
(790, 1, 1, 'Nie trać z oczu małych rzeczy. Ta saszetka treningowa adidas pomieści klucze, portfel i telefon, gdy idziesz na siłownię lub wychodzisz na miasto. Przednia kieszeń na suwak i wewnętrzna przegroda ułatwiają organizację niezbędnych drobiazgów, bez których nie możesz się obyć.', 'Saszetka treningowa na niezbędne drobiazgi.', '4athlts-organizer', '', '', '', '4ATHLTS Organizer', '', '', '', ''),
(791, 1, 1, 'Torba-nerka adidas przestrzega klasycznej zasady designu, zgodnie z którą forma jest konsekwencją funkcjonalności. Proste detale i wyrazista estetyka sprawiają, że przyda się zarówno miłośnikom dobrego stylu, jak i osobom o bardziej praktycznym nastawieniu. Dopasuj ją ściślej, aby podkreślić swój sportowy styl, lub pozwól, aby paski swobodnie zwisały wzdłuż dżinsów.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Wygodna torba-nerka adidas w funkcjonalnym stylu.', 'adidas-rifta-waist-bag', '', '', '', 'adidas RIFTA Waist Bag', '', '', '', ''),
(792, 1, 1, 'Plecaki, które kiedyś były zarezerwowane głównie dla wojska i dzieci w wieku szkolnym, dzięki swojej funkcjonalności i wygodzie stały się uniwersalnym elementem naszego codziennego wyposażenia. Ten model od adidas ma konstrukcję z bawełnianego płótna, które jest wystarczająco trwałe, aby wytrzymać najcięższe obciążenia, i wyściełane szelki ułatwiające zakładanie.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Funkcjonalny, pakowany od góry plecak.', 'adidas-rifta-toploader-backpack', '', '', '', 'adidas RIFTA Toploader Backpack', '', '', '', ''),
(793, 1, 1, 'Twój dzień może się skomplikować. Uprość go dzięki temu plecakowi treningowemu adidas, zaprojektowanemu z myślą o organizacji całego sprzętu. Pojemna komora główna pomieści ubrania treningowe, buty i inne rzeczy potrzebne na siłownię. Osobna, wyściełana kieszeń bezpiecznie przechowa laptopa, a wsuwane rękawy zapewniają łatwy dostęp do małych przedmiotów. Szelki Loadspring amortyzują obciążenie, odciążając plecy. Spakuj go, załóż i ruszaj w drogę.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Plecak treningowy, w którym uporządkujesz swój sprzęt, częściowo wykonany z materiałów pochodzących z recyklingu.', 'endurance-packing-system-backpack', '', '', '', 'Endurance Packing System Backpack', '', '', '', ''),
(794, 1, 1, 'Uwzględnij w planie swojego dnia pobudzający spacer z plecakiem adidas. Model ma przegrodę na laptopa i odpinany brelok na klucze, dzięki czemu łatwo odszukasz cenne drobiazgi. Pleciony pasek z przodu i boczne kieszenie pomieszczą niezbędne przedmioty, takie jak bidon i dodatkowe, ciepłe okrycie. Wyściełane szelki i panel z tyłu zostały uszyte z siateczki, aby zapewnić Ci komfort, gdy podkręcasz tempo.   Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Praktyczny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'city-xplorer-backpack', '', '', '', 'City Xplorer Backpack', '', '', '', ''),
(795, 1, 1, 'Przygotuj się na wszystko, co przyniesie dzień z tym plecakiem adidas. Ma pojemną komorę główną i przegrodę na laptopa, dzięki czemu oddzielisz sprzęt elektroniczny od książek i ubrań. Przednia kieszeń na suwak pomieści niezbędne drobiazgi w zasięgu ręki, a wsuwane kieszenie pomieszczą bidon, telefon lub inne drobiazgi. Regulowane szelki pozwalają znaleźć odpowiednie dopasowanie.  Ten plecak jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', 'Pojemny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'essentials-seasonal-backpack', '', '', '', 'Essentials Seasonal Backpack', '', '', '', ''),
(796, 1, 1, 'Gdy potrzebujesz zabrać ze sobą swoje wyposażenia, ta torba sportowa do biegania adidas została zaprojektowana z myślą o porankach na bieżni lub spotkaniu z lokalną grupą biegaczy. Wrzuć buty, baton i bidon do pojemnej przegrody, ściągnij sznurek i ruszaj w drogę.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Biegowa torba-worek wykonana częściowo z materiałów pochodzących z recyklingu.', 'running-gymbag-shoebag-gymsack', '', '', '', 'Running Gymbag Shoebag Gymsack', '', '', '', ''),
(797, 1, 1, 'Dzięki swojej miękkiej, elastycznej konstrukcji sportowa torba jest wyjątkowo uniwersalna. W kieszeni bocznej na suwak przechowasz swoje drobiazgi w zasięgu ręki. Torba prezentuje duże logo Trefoil z przodu.', 'Uniwersalna torba sportowa na niezbędne przedmioty.', 'sportowa-torba-worek-trefoil', '', '', '', 'Sportowa torba-worek Trefoil', '', '', '', ''),
(798, 1, 1, 'Torba gimnastyczna adidas sprosta wszelkim planom treningowym. Uszyto ją z lekkiego, poliestrowego materiału, który jest wystarczająco mocny, aby sprostać trudnom codziennego użytkowania. Ma górę ściąganą sznurkiem i przednią kieszeń na suwak, w której schowasz słuchawki. Teraz, gdy masz już wszystko pod ręką, łatwiej będzie Ci przejść od obrotowego fotela do głębokiego przysiadu.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Lekka torba sportowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'power-gym-sack', '', '', '', 'Power Gym Sack', '', '', '', ''),
(799, 1, 1, 'Torba gimnastyczna adidas sprosta wszelkim planom treningowym. Uszyto ją z lekkiego, poliestrowego materiału, który jest wystarczająco mocny, aby sprostać trudnom codziennego użytkowania. Ma górę ściąganą sznurkiem i przednią kieszeń na suwak, w której schowasz słuchawki. Teraz, gdy masz już wszystko pod ręką, łatwiej będzie Ci przejść od obrotowego fotela do głębokiego przysiadu.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Lekka torba sportowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'power-gym-sack', '', '', '', 'Power Gym Sack', '', '', '', ''),
(800, 1, 1, 'Dotrzyj do celu w stylu piłkarskim. Plecak adidas będący częścią kolekcji podróżnej Arsenalu prezentuje klasyczną naszywkę klubową z wizerunkiem armaty. Wewnętrzne przegrody i kieszenie na suwak pomieszczą wszystko, czego potrzebujesz. Stabilizujący pasek na piersi i przewiewny panel z siateczki na plecach zadbają o Twoje poczucie świeżości nawet na końcu podróży.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Plecak dla dumnych kibiców Arsenalu wykonany częściowo z materiałów pochodzących z recyklingu.', 'arsenal-travel-backpack', '', '', '', 'Arsenal Travel Backpack', '', '', '', ''),
(801, 1, 1, 'Noś swój sprzęt treningowy w dobrym stylu. Ta mocna torba na ramię adidas ma komorę główną z wewnętrzną przegrodą, która pomoże Ci uporządkować rzeczy. Schowaj telefon i inne niezbędne drobiazgi do przedniej kieszeni i ruszaj. Regulowany pasek na ramię umożliwia wygodne przenoszenie, a wyróżniający się branding z 3 paskami stanowi sportowe wykończenie.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Kompaktowa torba na ramię wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-training-shoulder-bag', '', '', '', 'Essentials Training Shoulder Bag', '', '', '', ''),
(802, 1, 1, 'Dodaj tę małą torbę o nieregularnym kształcie do swojej codziennej garderoby. Torba adidas o idealnym rozmiarze, w której pomieścisz klucze, telefon i karty, doskonale sprawdzi się jako dodatek do wszystkiego, od stroju treningowego po ulubiony sweter. Model jest wykonany ze sztucznej skóry, która chroni przed deszczem, i ma klapkę zapinaną na sprzączkę na górze, dzięki czemu doskonale ukryjesz swoje wyposażenie.', 'Kompaktowa, uniwersalna torba, którą możesz nosić na ramieniu lub przewieszoną przez tułów.', 'torba-essentials-small-bag', '', '', '', 'Torba Essentials Small Bag', '', '', '', ''),
(803, 1, 1, 'Słyszysz „wyjazd na weekend” i Twoje oczy zaczynają radośnie lśnić. Teraz również pakowanie może być przyjemnością dzięki opływowej torbie adidas na weekend. Jest uszyta z nylonowej tkaniny, która sprawdzi się w drodze, gdy Ty szukasz słońca lub śniegu. Ma również mnóstwo przegródek, w których uporządkujesz swoje ubrania.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Wyjeżdżając na dzień lub trzy wybierz ten sportowy bagaż wykonany częściowo z materiałów pochodzących z recyklingu.', 'weekender-bag', '', '', '', 'Weekender Bag', '', '', '', ''),
(804, 1, 1, 'Sprytne pakowanie to klucz do podróżowania z lekkim bagażem. Ta bardzo mała torba-worek adidas jest wystarczająco pojemna, aby szybko ją zabrać na siłownię. W siateczkowej kieszeni na suwak możesz schować mokre ubrania z dala od butów.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Mała torba-worek wykonana częściowo z materiałów pochodzących z recyklingu.', '4athlts-duffel-bag-small', '', '', '', '4ATHLTS Duffel Bag Small', '', '', '', ''),
(805, 1, 1, 'Trzymaj swoje drobiazgi pod ręką, gdy wspierasz gigantów z Realu Madryt. Ta torba piłkarska adidas prezentuje barwy zapożyczone z przyciągającej wzrok trzeciej koszulki klubowej i ma miejsce na wszystko, co może Ci się przydać. Kompresyjne paski i zapięcie na sprzączkę gwarantują komfort noszenia.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Bezpieczna torba Realu Madryt wykonana częściowo z materiałów pochodzących z recyklingu.', 'real-madrid-crossbody-bag', '', '', '', 'Real Madrid Crossbody Bag', '', '', '', ''),
(806, 1, 1, 'RACKET BAG CONTROL 3.0', 'RACKET BAG CONTROL 3.0', 'racket-bag-control-30', '', '', '', 'RACKET BAG CONTROL 3.0', '', '', '', ''),
(807, 1, 1, 'Sitodrukowe logo Juventusu na boku tej piłkarskiej torby adidas pokazuje, z kim trzymasz. Duża komora główna pomieści wszystko, czego potrzebujesz, niezależnie od tego, czy wybierasz się na trening, czy na weekendowy wypad. Uniwersalny design sprawia, że możesz nosić ją jak plecak.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Pojemna torba dla kibiców Juventusu wykonana częściowo z materiałów pochodzących z recyklingu.', 'juventus-duffel-bag-medium', '', '', '', 'Juventus Duffel Bag Medium', '', '', '', ''),
(808, 1, 1, 'Wybierz torbę zainspirowaną hantlami. Torba adidas wykonana ze sztucznej skóry stanowi uroczy i kompaktowy dodatek do Twojej garderoby. Dzięki uchwytom i regulowanemu paskowi do noszenia na ukos przez tułów model będzie Ci towarzyszyć od maty do jogi po centrum handlowe oraz od zajęć fitness po koktajle.', 'Ta mała, sportowa torba ma miejsce na Twój telefon, klucze i karty.', 'back-to-school-small-bag', '', '', '', 'Back to School Small Bag', '', '', '', ''),
(809, 1, 1, 'Minitorba adidas została zaprojektowana z myślą o spędzaniu czasu na łonie natury. Lekki i gładki model ma kieszenie z suwakiem na telefon i karty. Zewnętrzny karabińczyk pozwala mieć klucze zawsze pod ręką.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Opływowa torba wykonana częściowo z materiałów pochodzących z recyklingu.', 'city-xplorer-mini-bag', '', '', '', 'City Xplorer Mini-Bag', '', '', '', ''),
(810, 1, 1, 'Już weekend? Wiesz, co to oznacza. Nadszedł czas, aby spakować tę torbę weekendową adidas i wyjechać z miasta. W środku jest mnóstwo miejsca na wszystkie rzeczy, których potrzebujesz na kilka nocy, oraz wsuwana kieszeń na końcu, która zapewnia szybki dostęp do biletów na pociąg. Kto wie, może dwie noce zamienią się w kilka.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Sportowa torba podróżna wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-seasonal-weekender', '', '', '', 'Essentials Seasonal Weekender', '', '', '', ''),
(811, 1, 1, 'Daj z siebie wszystko. Nawet jeśli załatwiasz sprawy na mieście, ten plecak pozwoli Ci zaprezentować się w roztańczonym stylu. Gładki, nowoczesny design i stylizowane logo adidas dopełniają całości.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Minimalistyczny plecak inspirowany tańcem wykonany częściowo z materiałów pochodzących z recyklingu.', 'adidas-street-dance-backpack', '', '', '', 'adidas Street Dance Backpack', '', '', '', ''),
(812, 1, 1, 'Karta na siłownię – jest. Słuchawki douszne – są. Masz większe szanse, by utrzymać formę, mając pod ręką cały swój sprzęt. Ta mała torba adidas na słuchawki ma odpinany pasek, więc możesz trzymać ją pod ręką lub schować do torby sportowej. Konstrukcja ze sztucznej skóry stanowi elegancki, sportowy akcent w zestawieniu z każdym strojem, niezależnie od tego, czy bierzesz udział w rozmowie wideo, czy akurat trenujesz.', 'Sportowa torba na słuchawki pomieści słuchawki w zasięgu ręki i zapewni im ochronę.', 'essentials-tiny-earbud-bag', '', '', '', 'Essentials Tiny Earbud Bag', '', '', '', ''),
(813, 1, 1, 'Klasyczna sylwetka torby na kręgle w stylu adidas z mnóstwem nowoczesnych dodatków. Unikalny, teksturowany wzór powstał z inspiracji zestawem bramkarskim. Zaskakujące? Odpinane opcje. Etui na okulary przeciwsłoneczne, karabińczyk, przypinane etui na słuchawki i odpinany pasek. Czy to nie oznacza pełnej uniwersalności?', 'Teksturowana minitorba na kręgle z odpinanymi dodatkami.', 'blue-version-mini-bowling-bag', '', '', '', 'Blue Version Mini Bowling Bag', '', '', '', ''),
(814, 1, 1, 'Podróżowanie właśnie stało się proste. A przynajmniej ta część, która wiąże się z pakowaniem. Wrzuć niezbędne weekendowe rzeczy do torby adidas Vintage Airliner i ruszaj w drogę. Kultowy design i teksturowany materiał mogą przypominać styl sprzed lat, ale przegroda na laptopa sprawia, że torba jest gotowa na podbój nowoczesnego świata.   Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', 'Gładka torba lotnicza w stylu vintage.', 'vintage-airliner-bag', '', '', '', 'Vintage Airliner Bag', '', '', '', ''),
(815, 1, 1, 'Nic tak nie jest tak wygodne jak torba na ramię w swobodnym stylu. Uzupełnij swój niezobowiązujący, codzienny look o tę torbę adidas. Ma wystarczająco dużo miejsca, aby pomieścić wszystko, czego potrzebujesz, więc włóż niezbędne drobiazgi, wyreguluj pasek i ruszaj w drogę. Kontrastowe logotypy adidas Trefoil nadają sportowy charakter każdemu strojowi.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Wygodna torba uszyta z materiałów pochodzących z recyklingu.', 'adicolor-sling-bag', '', '', '', 'Adicolor Sling Bag', '', '', '', ''),
(816, 1, 1, 'Każdy dzień to przygoda, a dzięki temu plecakowi adidas będziesz na nią przygotowany. Model inspirowany sprzętem outdoorowym ma górną kieszeń na suwak, dzięki czemu możesz szybko dostać się do kluczy, portfela lub telefonu. W łatwo dostępnej wewnętrznej przegrodzie bezpiecznie schowasz laptopa.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Funkcjonalny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', '4athlts-camper-backpack', '', '', '', '4ATHLTS Camper Backpack', '', '', '', ''),
(817, 1, 1, 'Zabezpiecz niezbędne drobiazgi w tym portfelu adidas podczas aktywnego dnia. Liczne przegrody i wewnętrzna kieszeń z siateczki ułatwiają organizację. Przednia kieszeń na suwak bezpiecznie pomieści cenne drobiazgi, dzięki czemu model idealnie nadaje się na siłownię, szlak lub do codziennego użytku.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Praktyczny portfel wykonany częściowo z materiałów pochodzących z recyklingu.', 'essentials-training-wallet', '', '', '', 'Essentials Training Wallet', '', '', '', ''),
(818, 1, 1, 'Zachowaj spokój i noś w niej swoje rzeczy. Zapinana na suwak torba typu shopper od adidas z wyściełaną przegrodą na laptopa lub tablet. Jeśli prosto z pracy idziesz na trening swojej drużyny, schowasz w niej też swój strój. Ma również wewnętrzną kieszeń z siateczki z suwakiem na cenne drobiazgi. Nie zgubisz więc karty kredytowej ani niczego innego.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Stylowa i funkcjonalna torba wykonana częściowo z materiałów pochodzących z recyklingu.', 'shopper-bag', '', '', '', 'Shopper Bag', '', '', '', ''),
(819, 1, 1, 'Zawodnik, którego chcesz mieć w swojej drużynie. To znaczy na plecach. Ten plecak adidas ma mnóstwo kieszeni, które pomogą Ci mieć wszystko pod kontrolą. Konstrukcja z nylonu jest wytrzymała, więc możesz spakować do niej kilka rzeczy więcej. Dzięki przewiewnej siateczce z tyłu i paskom na ramię model umożliwia przepływ powietrza podczas biegu na siłownię oraz sprintu na autobus.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Zgrabny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'classic-backpack', '', '', '', 'Classic Backpack', '', '', '', ''),
(820, 1, 1, 'Każdy detal ma znaczenie, gdy wychodzisz pobiegać. Ta torba adidas do biegania bezpiecznie pomieści niezbędne drobiazgi, dzięki czemu możesz skupić się na trasie. Schowaj telefon i kartę do wsuwanych kieszeni i przypnij klucze do haczyka. Odblaskowe detale są dobrze widoczne w słabym oświetleniu.', 'Mała, regulowana torba-nerka, w której bezpiecznie przechowasz niezbędne drobiazgi podczas biegu.', 'running-gear-pocket-bag', '', '', '', 'Running Gear Pocket Bag', '', '', '', ''),
(821, 1, 1, 'Jeśli biegasz długie trasy, potrzebujesz kilku rzeczy. Na przykład kluczy, telefonu i przekąsek. Ta torba-nerka adidas o kompaktowym designie pomieści wszystkie te rzeczy. Materiał jest wyjątkowo elastyczny, więc zmieści się w niej więcej, niż Ci się wydaje. Kompresyjna taśma po bokach utrzymuje wszystko pod kontrolą, co oznacza mniej wstrząsów i kołysania się podczas biegu po chodniku.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Bezpiecznie dopasowana torba-nerka wykonana częściowo z materiałów pochodzących z recyklingu.', 'running-gear-waist-bag', '', '', '', 'Running Gear Waist Bag', '', '', '', ''),
(822, 1, 1, 'Bidon na wodę i buty do wspinaczki. Rękawice do podnoszenia ciężarów i przekąski po treningu. Niezależnie od tego, czego potrzebujesz na sesję treningową, możesz nosić swoje rzeczy w dobrym stylu dzięki tej torbie-workowi adidas. Zamknięcie na ściągany sznurek ułatwia sprawne pakowanie rzeczy i wyjście.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', 'Klasyczna torba-worek adidas wykonana częściowo z materiałów pochodzących z recyklingu.', 'essentials-gym-sack', '', '', '', 'Essentials Gym Sack', '', '', '', ''),
(823, 1, 1, 'Gdy chcesz dotrzeć do celu w świeżym stylu i w gotowości do akcji, kluczem do sukcesu jest wygoda. Dlatego dodaliśmy ten piłkarski plecak do podróżnego zestawu adidas Bayernu Monachium. Pasek na piersi dba o stabilizację, a siateczkowy panel na plecach gwarantuje wentylację dokładnie tam, gdzie jej potrzebujesz. W ogromnej gamie kieszeni i przegród możesz schować cały sprzęt.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Pojemny plecak Bayernu Monachium wykonany częściowo z materiałów pochodzących z recyklingu.', 'fc-bayern-travel-backpack', '', '', '', 'FC Bayern Travel Backpack', '', '', '', ''),
(824, 1, 1, 'Przenoszenie rzeczy na siłownię możesz potraktować jako dodatkowe ćwiczenie. Spakuj wszystko, co potrzebne do tego plecaka adidas i ruszaj, ciesząc się wygodą. Kompresyjne paski sprawiają, że ciężar równomiernie się rozkłada, a liczne przegrody oznaczają porządek. Jest nawet przegroda na laptopa, jeśli jedziesz do pracy po treningu.  Ten produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów pochodzących z recyklingu, co stanowi tylko jedno z naszych rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Trwały plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'power-vi-backpack', '', '', '', 'Power VI Backpack', '', '', '', ''),
(825, 1, 1, 'Mały rozmiar nie musi ograniczać stylu. Dodaj odrobinę archiwalnego polotu do swojego looku, nosząc ten plecak adidas z logo Trefoil. Twój telefon i klucze zawsze są w zasięgu ręki dzięki przedniej kieszeni na suwak.  Ten produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', 'Swobodny plecak w klasycznym stylu adidas.', 'adicolor-classic-backpack-small', '', '', '', 'Adicolor Classic Backpack Small', '', '', '', ''),
(826, 1, 1, 'Czas nie jest czymś, na co zawsze zwracamy uwagę, ale ważne jest, aby go wygospodarować. A jeśli oznacza to 48 godzin (co najmniej) spędzone poza Twoim miastem, wybierz ten plecak adidas. Mnóstwo miejsca i kieszeni wewnątrz i na zewnątrz sprawiają, że jest on idealnym towarzyszem na długie wypady.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Regulowany plecak z możliwością dopasowania, częściowo wykonany z materiałów pochodzących z recyklingu.', 'escape-backpack', '', '', '', 'Escape Backpack', '', '', '', ''),
(827, 1, 1, 'Gdziekolwiek się wybierasz, zadbaj o styl. Ten piłkarski plecak z kieszeniami na suwak i wewnętrzną przegrodą jest częścią podróżnej kolekcji adidas Manchesteru United i pomieści wszystko, czego potrzebujesz. Panel z siateczki na plecach i regulowany pasek na piersi oznaczają, że dotrzesz do celu ciesząc się świeżością i stawisz czoła każdemu wyzwaniu.  Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Pojemny plecak Manchesteru United częściowo wykonany z materiałów pochodzących z recyklingu.', 'manchester-united-travel-backpack', '', '', '', 'Manchester United Travel Backpack', '', '', '', ''),
(828, 1, 1, 'Zawodnik, którego chcesz mieć w swojej drużynie. To znaczy na plecach. Ten plecak adidas ma mnóstwo kieszeni, które pomogą Ci mieć wszystko pod kontrolą. Konstrukcja z nylonu jest wytrzymała, więc możesz spakować do niej kilka rzeczy więcej. Dzięki przewiewnej siateczce z tyłu i paskom na ramię model umożliwia przepływ powietrza podczas biegu na siłownię oraz sprintu na autobus.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', 'Zgrabny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', 'classic-backpack', '', '', '', 'Classic Backpack', '', '', '', ''),
(829, 1, 1, 'Noś ją na zakupy na targu lub używaj jako torby na co dzień. Ta torba typu shopper adidas jest wystarczająco pojemna, aby pomieścić wszystko, czego potrzebujesz. Bawełniany, płócienny materiał zapewnia trwałość, a zapięcie na rzepy zabezpiecza Twoje rzeczy, gdy pakujesz torbę do pełna.  Kupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', 'Torba na zakupy z logo Trefoil uszyta z mocnego płótna.', 'adicolor-shopper-bag', '', '', '', 'Adicolor Shopper Bag', '', '', '', ''),
(830, 1, 1, 'Podziel się swoją miłością do Manchesteru United, mając swoje cenne drobiazgi zawsze pod ręką. Torba piłkarska adidas zapożycza przyciągające wzrok barwy od trzeciej koszulki klubowej, aby podkreślić Twoje wsparcie dla klubu z Old Trafford. Kompresyjne paski i sprzączka zapewniają wygodne dopasowanie.  Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Schowaj swoje rzeczy do torby Manchesteru United wykonanej częściowo z materiałów pochodzących z recyklingu.', 'manchester-united-crossbody-bag', '', '', '', 'Manchester United Crossbody Bag', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(831, 1, 1, 'Pośród miejskiego zgiełku ten plecak typu shopper od adidas czuje się jak w domu. Jest prosty, minimalistyczny i funkcjonalny, a więc jest dokładnie tym, czego potrzebujesz, gdy jesteś w ruchu. Mocna bawełniana tkanina o ukośnym splocie sprawdzi się przy dużym obciążeniu, a liczne kieszenie pomogą Ci uporządkować swoje rzeczy.  Co najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', 'Plecak typu shopper wykonany z mieszanki materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł.', 'adidas-rifta-shopper-backpack', '', '', '', 'adidas RIFTA Shopper Backpack', '', '', '', ''),
(832, 1, 1, 'Wyglądaj stylowo na rowerze i trendy w biurze. Ten plecak adidas jest gładki i dopasowany, dzięki czemu wytrzyma starcie z deszczem. Model z lekkiej i mocnej nylonowej tkaniny ripstop ma wodoodporne wykończenie. Dzięki temu chroni Twojego laptopa w wyściełanej przegrodzie przed wilgocią. Szelki Loadspring i pasek na piersi wspólnie dbają o komfort ramion. Więc Ty i Twój sprzęt dotrzecie do celu w dobrej formie.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Odporna na deszcz torba na codzienne dojazdy wykonana częściowo z materiałów pochodzących z recyklingu.', 'x-city-backpack', '', '', '', 'X-City Backpack', '', '', '', ''),
(833, 1, 1, 'Niepowtarzalny styl i szacunek dla środowiska. Torba adidas Weekend Bag 2.0 została wykonana z unikalnego materiału, który w 100% nadaje się do recyklingu i ulega biodegradacji.', 'Noś się stylowo w torbie, która może zostać poddana recyklingowi.', 'weekend-bag-20', '', '', '', 'Weekend Bag 2.0', '', '', '', ''),
(834, 1, 1, 'Każdy dzień to przygoda, a dzięki temu plecakowi adidas będziesz na nią przygotowany. Model inspirowany sprzętem outdoorowym ma górną kieszeń na suwak, dzięki czemu możesz szybko dostać się do kluczy, portfela lub telefonu. W łatwo dostępnej wewnętrznej przegrodzie bezpiecznie schowasz laptopa.   Model wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', 'Funkcjonalny plecak wykonany częściowo z materiałów pochodzących z recyklingu.', '4athlts-camper-backpack', '', '', '', '4ATHLTS Camper Backpack', '', '', '', ''),
(835, 1, 1, 'Torba gimnastyczna adidas sprosta wszelkim planom treningowym. Uszyto ją z lekkiego, poliestrowego materiału, który jest wystarczająco mocny, aby sprostać trudnom codziennego użytkowania. Ma górę ściąganą sznurkiem i przednią kieszeń na suwak, w której schowasz słuchawki. Teraz, gdy masz już wszystko pod ręką, łatwiej będzie Ci przejść od obrotowego fotela do głębokiego przysiadu.   Ten model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', 'Lekka torba sportowa wykonana częściowo z materiałów pochodzących z recyklingu.', 'power-gym-sack', '', '', '', 'Power Gym Sack', '', '', '', '');
