(26, 1, 'Product available', 'Produkt dostępny', 'EmailsSubject', NULL),
(27, 1, 'Pick a category and highlight its items, enhance customer experience with a lively homepage.', 'Wybierz kategorię i wyróżnij jej produkty, popraw jakość obsługi klienta dzięki tętniącej życiem stronie głównej.', 'ModulesFeaturedproductsAdmin', NULL),
(28, 1, 'The product will be removed from \"%nameofthewishlist%\".', 'Produkt zostanie usunięty z „%nameofthewishlist%”.', 'ModulesBlockwishlistShop', NULL),
(29, 1, 'Delete wishlist', 'Usuń listę życzeń', 'ModulesBlockwishlistShop', NULL),
(30, 1, 'Remove product from wishlist', 'Usuń produkt z listy życzeń', 'ModulesBlockwishlistShop', NULL),
(31, 1, 'Product successfully updated', 'Pomyślnie zaktualizowano produkt', 'ModulesBlockwishlistShop', NULL),
(32, 1, 'Product successfully removed', 'Produkt pomyślnie usunięty', 'ModulesBlockwishlistShop', NULL),
(33, 1, 'The list name is invalid', 'Nazwa listy jest nieprawidłowa', 'ModulesBlockwishlistShop', NULL),
(34, 1, 'The list name is invalid.', 'Nazwa listy jest nieprawidłowa.', 'ModulesBlockwishlistShop', NULL),
(35, 1, 'There was an error while adding the product attributes', 'Wystąpił błąd podczas dodawania atrybutów produktu', 'ModulesBlockwishlistShop', NULL),
(36, 1, 'You need to choose a specific shop to display the top 10 most added products', 'Musisz wybrać konkretny sklep, aby wyświetlić 10 najczęściej dodawanych produktów', 'ModulesBlockwishlistAdmin', NULL),
(37, 1, 'Allow customers to create wishlists to save their favorite products for later.', 'Pozwól klientom tworzyć listy życzeń, aby zachować swoje ulubione produkty na później.', 'ModulesBlockwishlistAdmin', NULL),
(38, 1, 'Enrich your stats, add information about your registered customers and learn more about them!', 'Wzbogać swoje statystyki, dodaj informacje o swoich zarejestrowanych klientach i dowiedz się o nich więcej!', 'ModulesStatspersonalinfosAdmin', NULL),
(39, 1, 'Display your brands on your catalog and allow your visitors to filter their search by brand.', 'Wyświetlaj swoje marki w swoim katalogu i pozwól odwiedzającym filtrować wyszukiwanie według marki.', 'ModulesBrandlistAdmin', NULL),
(40, 1, 'Accept cash payments on delivery to make it easy for customers to purchase on your store.', 'Akceptuj płatności gotówką przy odbiorze, aby ułatwić klientom zakupy w Twoim sklepie.', 'ModulesCashondeliveryAdmin', NULL),
(41, 1, 'A word by itself is easy to guess', 'Samo słowo jest łatwe do odgadnięcia', 'AdminAdvparametersFeature', NULL),
(42, 1, 'Disable non built-in modules', 'Wyłącz moduły niewbudowane', 'AdminAdvparametersFeature', NULL),
(43, 1, 'Read the [1]developer documentation[/1].', 'Przeczytaj [1]dokumentację programisty[/1].', 'AdminAdvparametersFeature', NULL),
(44, 1, 'It seems that the webservice endpoint is not functional. If you are using httpd/apache2, you need to enable URL rewriting on your server.', 'Wygląda na to, że punkt końcowy usługi internetowej nie działa. Jeśli używasz httpd/apache2, musisz włączyć przepisywanie adresów URL na swoim serwerze.', 'AdminAdvparametersFeature', NULL),
(45, 1, 'Webservice is enabled. Main entry point is', 'Usługa internetowa jest włączona. Głównym punktem wejścia jest', 'AdminAdvparametersFeature', NULL),
(46, 1, 'Webservice status', 'Stan usługi sieciowej', 'AdminAdvparametersFeature', NULL),
(47, 1, '4 is very unguessable (guesses greater than or equal to 10^10) and provides strong protection from offline slow-hash scenario.', '4 jest bardzo trudny do odgadnięcia (zgaduje, że jest większy lub równy 10^10) i zapewnia silną ochronę przed scenariuszem powolnego mieszania w trybie offline.', 'AdminAdvparametersFeature', NULL),
(48, 1, '3 is safely unguessable (guesses lesser than 10^10). It offers moderate protection from offline slow-hash scenario.', '3 jest bezpiecznie niemożliwe do odgadnięcia (zgaduje mniej niż 10 ^ 10). Zapewnia umiarkowaną ochronę przed scenariuszem powolnego mieszania w trybie offline.', 'AdminAdvparametersFeature', NULL),
(49, 1, '2 is pretty easy to guess (guesses lesser than 10^8). It provides some protection from unthrottled online attacks.', '2 jest dość łatwe do odgadnięcia (zgaduje mniej niż 10^8). Zapewnia pewną ochronę przed niezakłóconymi atakami online.', 'AdminAdvparametersFeature', NULL),
(50, 1, '1 is still very easy to guess (guesses lesser than 10^6). An extra character on a dictionary word can score 1.', '1 jest nadal bardzo łatwe do odgadnięcia (zgaduje mniej niż 10^6). Dodatkowy znak w słowniku może otrzymać 1 punkt.', 'AdminAdvparametersFeature', NULL),
(51, 1, 'Criterions not available', 'Kryteria niedostępne', 'ModulesProductcommentsShop', NULL),
(52, 1, 'A word by itself is easy to guess', 'Samo słowo jest łatwe do odgadnięcia', 'messages', NULL),
(53, 1, 'Enrich your stats, add detailed statistics for each product of your catalog.', 'Samo słowo jest łatwe do odgadnięcia', 'ModulesStatsproductAdmin', NULL);
